ress.\nBefore any other email is sent to the account, you will have to follow the instructions in the email, to confirm that the account is actually yours.\";'),('en','messages:throttled-mailpassword','s:184:\"A password reset email has already been sent, within the last {{PLURAL:$1|hour|$1 hours}}.\nTo prevent abuse, only one password reset email will be sent per {{PLURAL:$1|hour|$1 hours}}.\";'),('en','messages:signupstart','s:0:\"\";'),('en','messages:signupend','s:0:\"\";'),('en','messages:signupend-https','s:0:\"\";'),('en','messages:mailerror','s:22:\"Error sending mail: $1\";'),('en','messages:acct_creation_throttle_hit','s:250:\"Visitors to this wiki using your IP address have created {{PLURAL:$1|1 account|$1 accounts}} in the last day, which is the maximum allowed in this time period.\nAs a result, visitors using this IP address cannot create any more accounts at the moment.\";'),('en','messages:emailauthenticated','s:45:\"Your email address was confirmed on $2 at $3.\";'),('en','messages:emailnotauthenticated','s:97:\"Your email address is not yet confirmed.\nNo email will be sent for any of the following features.\";'),('en','messages:noemailprefs','s:72:\"Specify an email address in your preferences for these features to work.\";'),('en','messages:emailconfirmlink','s:26:\"Confirm your email address\";'),('en','messages:invalidemailaddress','s:136:\"The email address cannot be accepted as it appears to have an invalid format.\nPlease enter a well-formatted address or empty that field.\";'),('en','messages:cannotchangeemail','s:55:\"Account email addresses cannot be changed on this wiki.\";'),('en','messages:emaildisabled','s:29:\"This site cannot send emails.\";'),('en','messages:emailsender','s:12:\"{{SITENAME}}\";'),('en','messages:accountcreated','s:15:\"Account created\";'),('en','messages:accountcreatedtext','s:91:\"The user account for [[{{ns:User}}:$1|$1]] ([[{{ns:User talk}}:$1|talk]]) has been created.\";'),('en','messages:createaccount-title','