URAL:$3|account is|accounts are}} associated with this email address:\n\n$2\n\n{{PLURAL:$3|This temporary password|These temporary passwords}} will expire in {{PLURAL:$5|one day|$5 days}}.\nYou should log in and choose a new password now. If someone else made this\nrequest, or if you have remembered your original password, and you no longer\nwish to change it, you may ignore this message and continue using your old\npassword.\";'),('en','messages:passwordreset-emailelement','s:36:\"Username:\n$1\n\nTemporary password:\n$2\";'),('en','messages:passwordreset-emailsent','s:37:\"A password reset email has been sent.\";'),('en','messages:passwordreset-emailsent-capture','s:59:\"A password reset email has been sent, which is shown below.\";'),('en','messages:passwordreset-emailerror-capture','s:111:\"A password reset email was generated, which is shown below, but sending it to the {{GENDER:$2|user}} failed: $1\";'),('en','messages:changeemail','s:20:\"Change email address\";'),('en','messages:changeemail-summary','s:0:\"\";'),('en','messages:changeemail-text','s:109:\"Complete this form to change your email address. You will need to enter your password to confirm this change.\";'),('en','messages:changeemail-no-info','s:51:\"You must be logged in to access this page directly.\";'),('en','messages:changeemail-oldemail','s:22:\"Current email address:\";'),('en','messages:changeemail-newemail','s:18:\"New email address:\";'),('en','messages:changeemail-none','s:6:\"(none)\";'),('en','messages:changeemail-password','s:27:\"Your {{SITENAME}} password:\";'),('en','messages:changeemail-submit','s:12:\"Change email\";'),('en','messages:changeemail-throttled','s:74:\"You have made too many login attempts.\nPlease wait $1 before trying again.\";'),('en','messages:changeemail-nochange','s:43:\"Please enter a different new email address.\";'),('en','messages:resettokens','s:12:\"Reset tokens\";'),('en','messages:resettokens-summary','s:0:\"\";'),('en','messages:resettokens-text','s:2