88:\"<strong>Your username or IP address has been blocked.</strong>\n\nThe block was made by $1.\nThe reason given is <em>$2</em>.\n\n* Start of block: $8\n* Expiry of block: $6\n* Intended blockee: $7\n\nYou can contact $1 or another [[{{MediaWiki:Grouppage-sysop}}|administrator]] to discuss the block.\nYou cannot use the \"email this user\" feature unless a valid email address is specified in your [[Special:Preferences|account preferences]] and you have not been blocked from using it.\nYour current IP address is $3, and the block ID is #$5.\nPlease include all above details in any queries you make.\";'),('en','messages:autoblockedtext','s:634:\"Your IP address has been automatically blocked because it was used by another user, who was blocked by $1.\nThe reason given is:\n\n:<em>$2</em>\n\n* Start of block: $8\n* Expiry of block: $6\n* Intended blockee: $7\n\nYou may contact $1 or one of the other [[{{MediaWiki:Grouppage-sysop}}|administrators]] to discuss the block.\n\nNote that you may not use the \"email this user\" feature unless you have a valid email address registered in your [[Special:Preferences|user preferences]] and you have not been blocked from using it.\n\nYour current IP address is $3, and the block ID is #$5.\nPlease include all above details in any queries you make.\";'),('en','messages:blockednoreason','s:15:\"no reason given\";'),('en','messages:whitelistedittext','s:24:\"Please $1 to edit pages.\";'),('en','messages:confirmedittext','s:155:\"You must confirm your email address before editing pages.\nPlease set and validate your email address through your [[Special:Preferences|user preferences]].\";'),('en','messages:nosuchsectiontitle','s:19:\"Cannot find section\";'),('en','messages:nosuchsectiontext','s:115:\"You tried to edit a section that does not exist.\nIt may have been moved or deleted while you were viewing the page.\";'),('en','messages:loginreqtitle','s:14:\"Login required\";'),('en','messages:loginreqlink','s:6:\"log in\";'),('en','messages:loginreqpagetext','s:30:\"Please $1 to view other pages.\";'),('en','messages:accmailtitle','s:13:\"Password sent\";'),('en','messages:accmailtext','s:173:\"A randomly generated password for [[User talk:$1|$1]] has been sent to $2. It can be changed on the <em>[[Special:ChangePassword|change password]]</em> page upon logging in.\";'),('en','messages:newarticle','s:5:\"(New)\";'),('en','messages:newarticletext','s:228:\"You have followed a link to a page that does not exist yet.\nTo create the page, start typing in the box below (see the [$1 help page] for more info).\nIf you are here by mistake, click your browser\'s <strong>back</strong> button.\";'),('en','messages:newarticletextanon','s:25:\"{{int:newarticletext|$1}}\";'),('en','messages:talkpagetext','s:31:\"<!-- MediaWiki:talkpagetext -->\";'),('en','messages:anontalkpagetext','s:475:\"----\n<em>This is the discussion page for an anonymous user who has not created an account yet, or who does not use it.</em>\nWe therefore have to use the numerical IP address to identify him/her.\nSuch an IP address can be shared by several users.\nIf you are an anonymous user and feel that irrelevant comments have been directed at you, please [[Special:UserLogin/signup|create an account]] or [[Special:UserLogin|log in]] to avoid future confusion with other anonymous users.\";'),('en','messages:noarticletext','s:296:\"There is currently no text in this page.\nYou can [[Special:Search/{{PAGENAME}}|search for this page title]] in other pages,\n<span class=\"plainlinks\">[{{fullurl:{{#Special:Log}}|page={{FULLPAGENAMEE}}}} search the related logs],\nor [{{fullurl:{{FULLPAGENAME}}|action=edit}} edit this page]</span>.\";'),('en','messages:noarticletext-nopermission','s:289:\"There is currently no text in this page.\nYou can [[Special:Search/{{PAGENAME}}|search for this page title]] in other pages, or <span class=\"plainlinks\">[{{fullurl:{{#Special:Log}}|page={{FULLPAGENAMEE}}}} search the related logs]</span>, but you do not have permission to create this page.\";'),('en','messages:noarticletextanon','s:21:\"{{int:noarticletext}}\";'),('en','messages:missing-revision','s:267:\"The revision #$1 of the page named \"{{FULLPAGENAME}}\" does not exist.\n\nThis is usually caused by following an outdated history link to a page that has been deleted.\nDetails can be found in the [{{fullurl:{{#Special:Log}}/delete|page={{FULLPAGENAMEE}}}} deletion log].\";'),('en','messages:userpage-userdoesnotexist','s:87:\"User account \"$1\" is not registered.\nPlease check if you want to create/edit this page.\";'),('en','messages:userpage-userdoesnotexist-view','s:36:\"User account \"$1\" is not registered.\";'),('en','messages:blocked-notice-logextract','s:91:\"This user is currently blocked.\nThe latest block log entry is provided below for reference:\";'),('en','messages:clearyourcache','s:553:\"<strong>Note:</strong> After saving, you may have to bypass your browser\'s cache to see the changes.\n* <strong>Firefox / Safari:</strong> Hold <em>Shift</em> while clicking <em>Reload</em>, or press either <em>Ctrl-F5</em> or <em>Ctrl-R</em> (<em>-R</em> on a Mac)\n* <strong>Google Chrome:</strong> Press <em>Ctrl-Shift-R</em> (<em>-Shift-R</em> on a Mac)\n* <strong>Internet Explorer:</strong> Hold <em>Ctrl</em> while clicking <em>Refresh</em>, or press <em>Ctrl-F5</em>\n* <strong>Opera:</strong> Clear the cache in <em>Tools  Preferences</em>\";'),('en','messages:usercssyoucanpreview','s:94:\"<strong>Tip:</strong> Use the \"{{int:showpreview}}\" button to test your new CSS before saving.\";'),('en','messages:userjsyoucanpreview','s:101:\"<strong>Tip:</strong> Use the \"{{int:showpreview}}\" button to test your new JavaScript before saving.\";'),('en','messages:usercsspreview','s:96:\"<strong>Remember that you are only previewing your user CSS.\nIt has not yet been saved!</strong>\";'),('en','messages:userjspreview','s:111:\"<strong>Remember that you are only testing/previewing your user JavaScript.\nIt has no