n;delete:Remove a change tag from the database, including removing the tag from all revisions, recent change entries and log entries on which it is used.\n;activate:Activate a change tag, allowing users to apply it manually.\n;deactivate:Deactivate a change tag, preventing users from applying it manually.\";'),('en','messages:apihelp-managetags-param-tag','s:277:\"Tag to create, delete, activate or deactivate. For tag creation, the tag must not exist. For tag deletion, the tag must exist. For tag activation, the tag must exist and not be in use by an extension. For tag deactivation, the tag must be currently active and manually defined.\";'),('en','messages:apihelp-managetags-param-reason','s:78:\"An optional reason for creating, deleting, activating or deactivating the tag.\";'),('en','messages:apihelp-managetags-param-ignorewarnings','s:68:\"Whether to ignore any warnings that are issued during the operation.\";'),('en','messages:apihelp-managetags-example-create','s:88:\"Create a tag named <kbd>spam</kbd> with the reason <kbd>For use in edit patrolling</kbd>\";'),('en','messages:apihelp-managetags-example-delete','s:71:\"Delete the <kbd>vandlaism</kbd> tag with the reason <kbd>Misspelt</kbd>\";'),('en','messages:apihelp-managetags-example-activate','s:90:\"Activate a tag named <kbd>spam</kbd> with the reason <kbd>For use in edit patrolling</kbd>\";'),('en','messages:apihelp-managetags-example-deactivate','s:84:\"Deactivate a tag named <kbd>spam</kbd> with the reason <kbd>No longer required</kbd>\";'),('en','messages:apihelp-move-description','s:12:\"Move a page.\";'),('en','messages:apihelp-move-param-from','s:78:\"Title of the page to rename. Cannot be used together with <var>$1fromid</var>.\";'),('en','messages:apihelp-move-param-fromid','s:78:\"Page ID of the page to rename. Cannot be used together with <var>$1from</var>.\";'),('en','messages:apihelp-move-param-to','s:28:\"Title to rename the page to.\";'),('en','messages:apihelp-move-param-reason','s:22:\"Reason for the rename.\";'),('en','messages:apihelp-move-param-movetalk','s:35:\"Rename the talk page, if it exists.\";'),('en','messages:apihelp-move-param-movesubpages','s:31:\"Rename subpages, if applicable.\";'),('en','messages:apihelp-move-param-noredirect','s:24:\"Don\'t create a redirect.\";'),('en','messages:apihelp-move-param-watch','s:62:\"Add the page and the redirect to the current user\'s watchlist.\";'),('en','messages:apihelp-move-param-unwatch','s:67:\"Remove the page and the redirect from the current user\'s watchlist.\";'),('en','messages:apihelp-move-param-watchlist','s:113:\"Unconditionally add or remove the page from the current user\'s watchlist, use preferences or do not change watch.\";'),('en','messages:apihelp-move-param-ignorewarnings','s:20:\"Ignore any warnings.\";'),('en','messages:apihelp-move-example-move','s:76:\"Move <kbd>Badtitle</kbd> to <kbd>Goodtitle</kbd> without leaving a redirect.\";'),('en','messages:apihelp-opensearch-description','s:46:\"Search the wiki using the OpenSearch protocol.\";'),('en','messages:apihelp-opensearch-param-search','s:14:\"Search string.\";'),('en','messages:apihelp-opensearch-param-limit','s:36:\"Maximum number of results to return.\";'),('en','messages:apihelp-opensearch-param-namespace','s:21:\"Namespaces to search.\";'),('en','messages:apihelp-opensearch-param-suggest','s:102:\"Do nothing if <var>[[mw:Manual:$wgEnableOpenSearchSuggest|$wgEnableOpenSearchSuggest]]</var> is false.\";'),('en','messages:apihelp-opensearch-param-redirects','s:231:\"How to handle redirects:\n;return:Return the redirect itself.\n;resolve:Return the target page. May return fewer than $1limit results.\nFor historical reasons, the default is \"return\" for $1format=json and \"resolve\" for other formats.\";'),('en','messages:apihelp-opensearch-param-format','s:25:\"The format of the output.\";'),('en','messages:apihelp-opensearch-param-warningsaserror','s:97:\"If warnings are raised with <kbd>format=json</kbd>, return an API error instead of ignoring them.\";'),('en','messages:apihelp-opensearch-example-te','s:40:\"Find pages beginning with <kbd>Te</kbd>.\";'),('en','messages:apihelp-options-description','s:224:\"Change preferences of the current user.\n\nOnly options which are registered in core or in one of installed extensions, or options with keys prefixed with <code>userjs-</code> (intended to be used by user scripts), can be set.\";'),('en','messages:apihelp-options-param-reset','s:40:\"Resets preferences to the site defaults.\";'),('en','messages:apihelp-options-param-resetkinds','s:76:\"List of types of options to reset when the <var>$1reset</var> option is set.\";'),('en','messages:apihelp-options-param-change','s:224:\"List of changes, formatted name=value (e.g. skin=vector). Value cannot contain pipe characters. If no value is given (not even an equals sign), e.g., optionname|otheroption|..., the option will be reset to its default value.\";'),('en','messages:apihelp-options-param-optionname','s:89:\"The name of the option that should be set to the value given by <var>$1optionvalue</var>.\";'),('en','messages:apihelp-options-param-optionvalue','s:91:\"The value for the option specified by <var>$1optionname</var>, can contain pipe characters.\";'),('en','messages:apihelp-options-example-reset','s:22:\"Reset all preferences.\";'),('en','messages:apihelp-options-example-change','s:60:\"Change <kbd>skin</kbd> and <kbd>hideminor</kbd> preferences.\";'),('en','messages:apihelp-options-example-complex','s:72:\"Reset all preferences, then set <kbd>skin</kbd> and <kbd>nickname</kbd>.\";'),('en','messages:apihelp-paraminfo-description','s:37:\"Obtain information about API modules.\";'),('en','messages:apihelp-paraminfo-param-modules','s:152:\"List of module names (values of the <var>action</var> and <var>format</var> parameters, or <kbd>main</kbd>). Can specify submodules with a <kbd>+</kbd>.\";'),('en','messages:apihelp-paraminfo-param-helpformat','s:23:\"Format of help strings.\";'),('en','messages:apihelp-paraminfo-param-querymodules','s:177:\"List of query module names (value of <var>prop</var>, <var>meta</var> or <var>list</var> parameter). Use <kbd>$1modules=query+foo</kbd> instead of <kbd>$1querymodules=foo</kbd>.\";'),('en','messages:apihelp-paraminfo-param-mainmodule','s:97:\"Get information about the main (top-level) module as well. Use <kbd>$1modules=main</kbd> instead.\";'),('en','messages:apihelp-paraminfo-param-pagesetmodule','s:81:\"Get information about the pageset module (providing titles= and friends) as well.\";'),('en','messages:apihelp-paraminfo-param-formatmodules','s:101:\"List of format module names (value of <var>format</var> parameter). Use <var>$1modules</var> instead.\";'),('en','messages:apihelp-paraminfo-example-1','s:269:\"Show info for <kbd>[[Special:ApiHelp/parse|action=parse]]</kbd>, <kbd>[[Special:ApiHelp/jsonfm|format=jsonfm]]</kbd>, <kbd>[[Special:ApiHelp/query+allpages|action=query&list=allpages]]</kbd>, and <kbd>[[Special:ApiHelp/query+siteinfo|action=query&meta=siteinfo]]</kbd>.\";'),('en','messages:apihelp-parse-description','s:523:\"Parses content and returns parser output.\n\nSee the various prop-modules of <kbd>[[Special:ApiHelp/query|action=query]]</kbd> to get information from the current version of a page.\n\nThere are several ways to specify the text to parse:\n# Specify a page or revision, using <var>$1page</var>, <var>$1pageid</var>, or <var>$1oldid</var>.\n# Specify content explicitly, using <var>$1text</var>, <var>$1title</var>, and <var>$1contentmodel</var>.\n# Specify only a summary to parse. <var>$1prop</var> should be given an empty value.\";'),('en','messages:apihelp-parse-param-title','s:130:\"Title of page the text belongs to. If omitted, <var>$1contentmodel</var> must be specified, and [[API]] will be used as the title.\";'),('en','messages:apihelp-parse-param-text','s:96:\"Text to parse. Use <var>$1title</var> or <var>$1contentmodel</var> to control the content model.\";'),('en','messages:apihelp-parse-param-summary','s:17:\"Summary to parse.\";'),('en','messages:apihelp-parse-param-page','s:102:\"Parse the content of this page. Cannot be used together with <var>$1text</var> and <var>$1title</var>.\";'),('en','messages:apihelp-parse-param-pageid','s:60:\"Parse the content of this page. Overrides <var>$1page</var>.\";'),('en','messages:apihelp-parse-param-redirects','s:77:\"If <var>$1page</var> or <var>$1pageid</var> is set to a redirect, resolve it.\";'),('en','messages:apihelp-parse-param-oldid','s:88:\"Parse the content of this revision. Overrides <var>$1page</var> and <var>$1pageid</var>.\";'),('en','messages:apihelp-parse-param-prop','s:35:\"Which pieces of information to get:\";'),('en','messages:apihelp-parse-paramvalue-prop-text','s:38:\"Gives the parsed text of the wikitext.\";'),('en','messages:apihelp-parse-paramvalue-prop-langlinks','s:48:\"Gives the language links in the parsed wikitext.\";'),('en','messages:apihelp-parse-paramvalue-prop-categories','s:44:\"Gives the categories in the parsed wikitext.\";'),('en','messages:apihelp-parse-paramvalue-prop-categorieshtml','s:41:\"Gives the HTML version of the categories.\";'),('en','messages:apihelp-parse-paramvalue-prop-links','s:48:\"Gives the internal links in the parsed wikitext.\";'),('en','messages:apihelp-parse-paramvalue-prop-templates','s:43:\"Gives the templates in the parsed wikitext.\";'),('en','messages:apihelp-parse-paramvalue-prop-images','s:40:\"Gives the images in the parsed wikitext.\";'),('en','messages:apihelp-parse-paramvalue-prop-externallinks','s:48:\"Gives the external links in the parsed wikitext.\";'),('en','messages:apihelp-parse-paramvalue-prop-sections','s:42:\"Gives the sections in the parsed wikitext.\";'),('en','messages:apihelp-parse-paramvalue-prop-revid','s:40:\"Adds the revision ID of the parsed page.\";'),('en','messages:apihelp-parse-paramvalue-prop-displaytitle','s:38:\"Adds the title of the parsed wikitext.\";'),('en','messages:apihelp-parse-paramvalue-prop-headitems','s:64:\"Gives items to put in the <code>&lt;head&gt;</code> of the page.\";'),('en','messages:apihelp-parse-paramvalue-prop-headhtml','s:51:\"Gives parsed <code>&lt;head&gt;</code> of the page.\";'),('en','messages:apihelp-parse-paramvalue-prop-modules','s:166:\"Gives the ResourceLoader modules used on the page. Either <kbd>jsconfigvars</kbd> or <kbd>encodedjsconfigvars</kbd> must be requested jointly with <kbd>modules</kbd>.\";'),('en','messages:apihelp-parse-paramvalue-prop-jsconfigvars','s:66:\"Gives the JavaScript configuration variables specific to the page.\";'),('en','messages:apihelp-parse-paramvalue-prop-encodedjsconfigvars','s:83:\"Gives the JavaScript configuration variables specific to the page as a JSON string.\";'),('en','messages:apihelp-parse-paramvalue-prop-indicators','s:58:\"Gives the HTML of page status indicators used on the page.\";'),('en','messages:apihelp-parse-paramvalue-prop-iwlinks','s:45:\"Gives interwiki links in the parsed wikitext.\";'),('en','messages:apihelp-parse-paramvalue-prop-wikitext','s:44:\"Gives the original wikitext that was parsed.\";'),('en','messages:apihelp-parse-paramvalue-prop-properties','s:56:\"Gives various properties defined in the parsed wikitext.\";'),('en','messages:apihelp-parse-paramvalue-prop-limitreportdata','s:103:\"Gives the limit report in a structured way. Gives no data, when <var>$1disablelimitreport</var> is set.\";'),('en','messages:apihelp-parse-paramvalue-prop-limitreporthtml','s:103:\"Gives the HTML version of the limit report. Gives no data, when <var>$1disablelimitreport</var> is set.\";'),('en','messages:apihelp-parse-paramvalue-prop-parsetree','s:79:\"The XML parse tree of revision content (requires content model <code>$1</code>)\";'),('en','messages:apihelp-parse-param-pst','s:87:\"Do a pre-save transform on the input before parsing it. Only valid when used with text.\";'),('en','messages:apihelp-parse-param-onlypst','s:165:\"Do a pre-save transform (PST) on the input, but don\'t parse it. Returns the same wikitext, after a PST has been applied. Only valid when used with <var>$1text</var>.\";'),('en','messages:apihelp-parse-param-effectivelanglinks','s:90:\"Includes language links supplied by extensions (for use with <kbd>$1prop=langlinks</kbd>).\";'),('en','messages:apihelp-parse-param-section','s:168:\"Only retrieve the content of this section number or when <kbd>new</kbd> generate a new section.\n\n<kbd>new</kbd> section is only honored when specifying <var>text</var>.\";'),('en','messages:apihelp-parse-param-sectiontitle','s:151:\"New section title when <var>section</var> is <kbd>new</kbd>.\n\nUnlike page editing, this does not fall back to <var>summary</var> when omitted or empty.\";'),('en','messages:apihelp-parse-param-disablelimitreport','s:68:\"Omit the limit report (\"NewPP limit report\") from the parser output.\";'),('en','messages:apihelp-parse-param-disablepp','s:44:\"Use <var>$1disablelimitreport</var> instead.\";'),('en','messages:apihelp-parse-param-disableeditsection','s:47:\"Omit edit section links from the parser output.\";'),('en','messages:apihelp-parse-param-disabletidy','s:57:\"Do not run HTML cleanup (e.g. tidy) on the parser output.\";'),('en','messages:apihelp-parse-param-generatexml','s:106:\"Generate XML parse tree (requires content model <code>$1</code>; replaced by <kbd>$2prop=parsetree</kbd>).\";'),('en','messages:apihelp-parse-param-preview','s:22:\"Parse in preview mode.\";'),('en','messages:apihelp-parse-param-sectionpreview','s:57:\"Parse in section preview mode (enables preview mode too).\";'),('en','messages:apihelp-parse-param-disabletoc','s:33:\"Omit table of contents in output.\";'),('en','messages:apihelp-parse-param-contentformat','s:87:\"Content serialization format used for the input text. Only valid when used with $1text.\";'),('en','messages:apihelp-parse-param-contentmodel','s:159:\"Content model of the input text. If omitted, $1title must be specified, and default will be the model of the specified title. Only valid when used with $1text.\";'),('en','messages:apihelp-parse-example-page','s:13:\"Parse a page.\";'),('en','messages:apihelp-parse-example-text','s:15:\"Parse wikitext.\";'),('en','messages:apihelp-parse-example-texttitle','s:42:\"Parse wikitext, specifying the page title.\";'),('en','messages:apihelp-parse-example-summary','s:16:\"Parse a summary.\";'),('en','messages:apihelp-patrol-description','s:26:\"Patrol a page or revision.\";'),('en','messages:apihelp-patrol-param-rcid','s:27:\"Recentchanges ID to patrol.\";'),('en','messages:apihelp-patrol-param-revid','s:22:\"Revision ID to patrol.\";'),('en','messages:apihelp-patrol-example-rcid','s:23:\"Patrol a recent change.\";'),('en','messages:apihelp-patrol-example-revid','s:18:\"Patrol a revision.\";'),('en','messages:apihelp-protect-description','s:38:\"Change the protection level of a page.\";'),('en','messages:apihelp-protect-param-title','s:72:\"Title of the page to (un)protect. Cannot be used together with $1pageid.\";'),('en','messages:apihelp-protect-param-pageid','s:68:\"ID of the page to (un)protect. Cannot be used together with $1title.\";'),('en','messages:apihelp-protect-param-protections','s:169:\"List of protection levels, formatted <kbd>action=level</kbd> (e.g. <kbd>edit=sysop</kbd>).\n\n<strong>Note:</strong> Any actions not listed will have restrictions removed.\";'),('en','messages:apihelp-protect-param-expiry','s:206:\"Expiry timestamps. If only one timestamp is set, it\'ll be used for all protections. Use <kbd>infinite</kbd>, <kbd>indefinite</kbd>, <kbd>infinity</kbd>, or <kbd>never</kbd>, for a never-expiring protection.\";'),('en','messages:apihelp-protect-param-reason','s:26:\"Reason for (un)protecting.\";'),('en','messages:apihelp-protect-param-cascade','s:160:\"Enable cascading protection (i.e. protect transcluded templates and images used in this page). Ignored if none of the given protection levels support cascading.\";'),('en','messages:apihelp-protect-param-watch','s:73:\"If set, add the page being (un)protected to the current user\'s watchlist.\";'),('en','messages:apihelp-protect-param-watchlist','s:113:\"Unconditionally add or remove the page from the current user\'s watchlist, use preferences or do not change watch.\";'),('en','messages:apihelp-protect-example-protect','s:15:\"Protect a page.\";'),('en','messages:apihelp-protect-example-unprotect','s:59:\"Unprotect a page by setting restrictions to <kbd>all</kbd>.\";'),('en','messages:apihelp-protect-example-unprotect2','s:44:\"Unprotect a page by setting no restrictions.\";'),('en','messages:apihelp-purge-description','s:92:\"Purge the cache for the given titles.\n\nRequires a POST request if the user is not logged in.\";'),('en','messages:apihelp-purge-param-forcelinkupdate','s:24:\"Update the links tables.\";'),('en','messages:apihelp-purge-param-forcerecursivelinkupdate','s:99:\"Update the links table, and update the links tables for any page that uses this page as a template.\";'),('en','messages:apihelp-purge-example-simple','s:59:\"Purge the <kbd>Main Page</kbd> and the <kbd>API</kbd> page.\";'),('en','messages:apihelp-purge-example-generator','s:47:\"Purge the first 10 pages in the main namespace.\";'),('en','messages:apihelp-query-description','s:147:\"Fetch data from and about MediaWiki.\n\nAll data modifications will first have to use query to acquire a token to prevent abuse from malicious sites.\";'),('en','messages:apihelp-query-param-prop','s:46:\"Which properties to get for the queried pages.\";'),('en','messages:apihelp-query-param-list','s:19:\"Which lists to get.\";'),('en','messages:apihelp-query-param-meta','s:22:\"Which metadata to get.\";'),('en','messages:apihelp-query-param-indexpageids','s:68:\"Include an additional pageids section listing all returned page IDs.\";'),('en','messages:apihelp-query-param-export','s:61:\"Export the current revisions of all given or generated pages.\";'),('en','messages:apihelp-query-param-exportnowrap','s:127:\"Return the export XML without wrapping it in an XML result (same format as [[Special:Export]]). Can only be used with $1export.\";'),('en','messages:apihelp-query-param-iwurl','s:62:\"Whether to get the full URL if the title is an interwiki link.\";'),('en','messages:apihelp-query-param-rawcontinue','s:61:\"Return raw <samp>query-continue</samp> data for continuation.\";'),('en','messages:apihelp-query-example-revisions','s:125:\"Fetch [[Special:ApiHelp/query+siteinfo|site info]] and [[Special:ApiHelp/query+revisions|revisions]] of <kbd>Main Page</kbd>.\";'),('en','messages:apihelp-query-example-allpages','s:56:\"Fetch revisions of pages beginning with <kbd>API/</kbd>.\";'),('en','messages:apihelp-query+allcategories-description','s:25:\"Enumerate all categories.\";'),('en','messages:apihelp-query+allcategories-param-from','s:39:\"The category to start enumerating from.\";'),('en','messages:apihelp-query+allcategories-param-to','s:36:\"The category to stop enumerating at.\";'),('en','messages:apihelp-query+allcategories-param-prefix','s:58:\"Search for all category titles that begin with this value.\";'),('en','messages:apihelp-query+allcategories-param-dir','s:21:\"Direction to sort in.\";'),('en','messages:apihelp-query+allcategories-param-min','s:55:\"Only return categories with at least this many members.\";'),('en','messages:apihelp-query+allcategories-param-max','s:54:\"Only return categories with at most this many members.\";'),('en','messages:apihelp-query+allcategories-param-limit','s:30:\"How many categories to return.\";'),('en','messages:apihelp-query+allcategories-param-prop','s:24:\"Which properties to get:\";'),('en','messages:apihelp-query+allcategories-paramvalue-prop-size','s:37:\"Adds number of pages in the category.\";'),('en','messages:apihelp-query+allcategories-paramvalue-prop-hidden','s:72:\"Tags categories that are hidden with <code>_&#95;HIDDENCAT_&#95;</code>.\";'),('en','messages:apihelp-query+allcategories-example-size','s:64:\"List categories with information on the number of pages in each.\";'),('en','messages:apihelp-query+allcategories-example-generator','s:86:\"Retrieve info about the category page itself for categories beginning <kbd>List</kbd>.\";'),('en','messages:apihelp-query+alldeletedrevisions-description','s:55:\"List all deleted revisions by a user or in a namespace.\";'),('en','messages:apihelp-query+alldeletedrevisions-paraminfo-useronly','s:40:\"May only be used with <var>$3user</var>.\";'),('en','messages:apihelp-query+alldeletedrevisions-paraminfo-nonuseronly','s:38:\"Cannot be used with <var>$3user</var>.\";'),('en','messages:apihelp-query+alldeletedrevisions-param-start','s:40:\"The timestamp to start enumerating from.\";'),('en','messages:apihelp-query+alldeletedrevisions-param-end','s:37:\"The timestamp to stop enumerating at.\";'),('en','messages:apihelp-query+alldeletedrevisions-param-from','s:28:\"Start listing at this title.\";'),('en','messages:apihelp-query+alldeletedrevisions-param-to','s:27:\"Stop listing at this title.\";'),('en','messages:apihelp-query+alldeletedrevisions-param-prefix','s:54:\"Search for all page titles that begin with this value.\";'),('en','messages:apihelp-query+alldeletedrevisions-param-tag','s:41:\"Only list revisions tagged with this tag.\";'),('en','messages:apihelp-query+alldeletedrevisions-param-user','s:33:\"Only list revisions by this user.\";'),('en','messages:apihelp-query+alldeletedrevisions-param-excludeuser','s:34:\"Don\'t list revisions by this user.\";'),('en','messages:apihelp-query+alldeletedrevisions-param-namespace','s:34:\"Only list pages in this namespace.\";'),('en','messages:apihelp-query+alldeletedrevisions-param-miser-user-namespace','s:256:\"<strong>Note:</strong> Due to [[mw:Manual:$wgMiserMode|miser mode]], using <var>$1user</var> and <var>$1namespace</var> together may result in fewer than <var>$1limit</var> results returned before continuing; in extreme cases, zero results may be returned.\";'),('en','messages:apihelp-query+alldeletedrevisions-param-generatetitles','s:73:\"When being used as a generator, generate titles rather than revision IDs.\";'),('en','messages:apihelp-query+alldeletedrevisions-example-user','s:65:\"List the last 50 deleted contributions by user <kbd>Example<kbd>.\";'),('en','messages:apihelp-query+alldeletedrevisions-example-ns-main','s:58:\"List the first 50 deleted revisions in the main namespace.\";'),('en','messages:apihelp-query+allfileusages-description','s:45:\"List all file usages, including non-existing.\";'),('en','messages:apihelp-query+allfileusages-param-from','s:48:\"The title of the file to start enumerating from.\";'),('en','messages:apihelp-query+allfileusages-param-to','s:45:\"The title of the file to stop enumerating at.\";'),('en','messages:apihelp-query+allfileusages-param-prefix','s:54:\"Search for all file titles that begin with this value.\";'),('en','messages:apihelp-query+allfileusages-param-unique','s:134:\"Only show distinct file titles. Cannot be used with $1prop=ids.\nWhen used as a generator, yields target pages instead of source pages.\";'),('en','messages:apihelp-query+allfileusages-param-prop','s:39:\"Which pieces of information to include:\";'),('en','messages:apihelp-query+allfileusages-paramvalue-prop-ids','s:68:\"Adds the page IDs of the using pages (cannot be used with $1unique).\";'),('en','messages:apihelp-query+allfileusages-paramvalue-prop-title','s:27:\"Adds the title of the file.\";'),('en','messages:apihelp-query+allfileusages-param-limit','s:31:\"How many total items to return.\";'),('en','messages:apihelp-query+allfileusages-param-dir','s:31:\"The direction in which to list.\";'),('en','messages:apihelp-query+allfileusages-example-B','s:96:\"List file titles, including missing ones, with page IDs they are from, starting at <kbd>B</kbd>.\";'),('en','messages:apihelp-query+allfileusages-example-unique','s:24:\"List unique file titles.\";'),('en','messages:apihelp-query+allfileusages-example-unique-generator','s:47:\"Gets all file titles, marking the missing ones.\";'),('en','messages:apihelp-query+allfileusages-example-generator','s:32:\"Gets pages containing the files.\";'),('en','messages:apihelp-query+allimages-description','s:34:\"Enumerate all images sequentially.\";'),('en','messages:apihelp-query+allimages-param-sort','s:20:\"Property to sort by.\";'),('en','messages:apihelp-query+allimages-param-dir','s:31:\"The direction in which to list.\";'),('en','messages:apihelp-query+allimages-param-from','s:77:\"The image title to start enumerating from. Can only be used with $1sort=name.\";'),('en','messages:apihelp-query+allimages-param-to','s:74:\"The image title to stop enumerating at. Can only be used with $1sort=name.\";'),('en','messages:apihelp-query+allimages-param-start','s:80:\"The timestamp to start enumerating from. Can only be used with $1sort=timestamp.\";'),('en','messages:apihelp-query+allimages-param-end','s:73:\"The timestamp to end enumerating. Can only be used with $1sort=timestamp.\";'),('en','messages:apihelp-query+allimages-param-prefix','s:90:\"Search for all image titles that begin with this value. Can only be used with $1sort=name.\";'),('en','messages:apihelp-query+allimages-param-minsize','s:46:\"Limit to images with at least this many bytes.\";'),('en','messages:apihelp-query+allimages-param-maxsize','s:45:\"Limit to images with at most this many bytes.\";'),('en','messages:apihelp-query+allimages-param-sha1','s:43:\"SHA1 hash of image. Overrides $1sha1base36.\";'),('en','messages:apihelp-query+allimages-param-sha1base36','s:50:\"SHA1 hash of image in base 36 (used in MediaWiki).\";'),('en','messages:apihelp-query+allimages-param-user','s:123:\"Only return files uploaded by this user. Can only be used with $1sort=timestamp. Cannot be used together with $1filterbots.\";'),('en','messages:apihelp-query+allimages-param-filterbots','s:114:\"How to filter files uploaded by bots. Can only be used with $1sort=timestamp. Cannot be used together with $1user.\";'),('en','messages:apihelp-query+allimages-param-mime','s:58:\"What MIME types to search for, e.g. <kbd>image/jpeg</kbd>.\";'),('en','messages:apihelp-query+allimages-param-limit','s:35:\"How many images in total to return.\";'),('en','messages:apihelp-query+allimages-example-B','s:57:\"Show a list of files starting at the letter <kbd>B</kbd>.\";'),('en','messages:apihelp-query+allimages-example-recent','s:72:\"Show a list of recently uploaded files, similar to [[Special:NewFiles]].\";'),('en','messages:apihelp-query+allimages-example-mimetypes','s:80:\"Show a list of files with MIME type <kbd>image/png</kbd> or <kbd>image/gif</kbd>\";'),('en','messages:apihelp-query+allimages-example-generator','s:60:\"Show info about 4 files starting at the letter <kbd>T</kbd>.\";'),('en','messages:apihelp-query+alllinks-description','s:52:\"Enumerate all links that point to a given namespace.\";'),('en','messages:apihelp-query+alllinks-param-from','s:48:\"The title of the link to start enumerating from.\";'),('en','messages:apihelp-query+alllinks-param-to','s:45:\"The title of the link to stop enumerating at.\";'),('en','messages:apihelp-query+alllinks-param-prefix','s:56:\"Search for all linked titles that begin with this value.\";'),('en','messages:apihelp-query+alllinks-param-unique','s:147:\"Only show distinct linked titles. Cannot be used with <kbd>$1prop=ids</kbd>.\nWhen used as a generator, yields target pages instead of source pages.\";'),('en','messages:apihelp-query+alllinks-param-prop','s:39:\"Which pieces of information to include:\";'),('en','messages:apihelp-query+alllinks-paramvalue-prop-ids','s:79:\"Adds the page ID of the linking page (cannot be used with <var>$1unique</var>).\";'),('en','messages:apihelp-query+alllinks-paramvalue-prop-title','s:27:\"Adds the title of the link.\";'),('en','messages:apihelp-query+alllinks-param-namespace','s:27:\"The namespace to enumerate.\";'),('en','messages:apihelp-query+alllinks-param-limit','s:31:\"How many total items to return.\";'),('en','messages:apihelp-query+alllinks-param-dir','s:31:\"The direction in which to list.\";'),('en','messages:apihelp-query+alllinks-example-B','s:98:\"List linked titles, including missing ones, with page IDs they are from, starting at <kbd>B</kbd>.\";'),('en','messages:apihelp-query+alllinks-example-unique','s:26:\"List unique linked titles.\";'),('en','messages:apihelp-query+alllinks-example-unique-generator','s:49:\"Gets all linked titles, marking the missing ones.\";'),('en','messages:apihelp-query+alllinks-example-generator','s:32:\"Gets pages containing the links.\";'),('en','messages:apihelp-query+allmessages-description','s:31:\"Return messages from this site.\";'),('en','messages:apihelp-query+allmessages-param-messages','s:68:\"Which messages to output. <kbd>*</kbd> (default) means all messages.\";'),('en','messages:apihelp-query+allmessages-param-prop','s:24:\"Which properties to get.\";'),('en','messages:apihelp-query+allmessages-param-enableparser','s:111:\"Set to enable parser, will preprocess the wikitext of message (substitute magic words, handle templates, etc.).\";'),('en','messages:apihelp-query+allmessages-param-nocontent','s:65:\"If set, do not include the content of the messages in the output.\";'),('en','messages:apihelp-query+allmessages-param-includelocal','s:241:\"Also include local messages, i.e. messages that don\'t exist in the software but do exist as a MediaWiki: page.\nThis lists all MediaWiki: pages, so it will also list those that aren\'t really messages such as [[MediaWiki:Common.js|Common.js]].\";'),('en','messages:apihelp-query+allmessages-param-args','s:41:\"Arguments to be substituted into message.\";'),('en','messages:apihelp-query+allmessages-param-filter','s:57:\"Return only messages with names that contain this string.\";'),('en','messages:apihelp-query+allmessages-param-customised','s:49:\"Return only messages in this customisation state.\";'),('en','messages:apihelp-query+allmessages-param-lang','s:33:\"Return messages in this language.\";'),('en','messages:apihelp-query+allmessages-param-from','s:41:\"Return messages starting at this message.\";'),('en','messages:apihelp-query+allmessages-param-to','s:39:\"Return messages ending at this message.\";'),('en','messages:apihelp-query+allmessages-param-title','s:77:\"Page name to use as context when parsing message (for $1enableparser option).\";'),('en','messages:apihelp-query+allmessages-param-prefix','s:33:\"Return messages with this prefix.\";'),('en','messages:apihelp-query+allmessages-example-ipb','s:44:\"Show messages starting with <kbd>ipb-</kbd>.\";'),('en','messages:apihelp-query+allmessages-example-de','s:66:\"Show messages <kbd>august</kbd> and <kbd>mainpage</kbd> in German.\";'),('en','messages:apihelp-query+allpages-description','s:54:\"Enumerate all pages sequentially in a given namespace.\";'),('en','messages:apihelp-query+allpages-param-from','s:41:\"The page title to start enumerating from.\";'),('en','messages:apihelp-query+allpages-param-to','s:38:\"The page title to stop enumerating at.\";'),('en','messages:apihelp-query+allpages-param-prefix','s:54:\"Search for all page titles that begin with this value.\";'),('en','messages:apihelp-query+allpages-param-namespace','s:27:\"The namespace to enumerate.\";'),('en','messages:apihelp-query+allpages-param-filterredir','s:20:\"Which pages to list.\";'),('en','messages:apihelp-query+allpages-param-minsize','s:45:\"Limit to pages with at least this many bytes.\";'),('en','messages:apihelp-query+allpages-param-maxsize','s:44:\"Limit to pages with at most this many bytes.\";'),('en','messages:apihelp-query+allpages-param-prtype','s:30:\"Limit to protected pages only.\";'),('en','messages:apihelp-query+allpages-param-prlevel','s:85:\"Filter protections based on protection level (must be used with $1prtype= parameter).\";'),('en','messages:apihelp-query+allpages-param-prfiltercascade','s:76:\"Filter protections based on cascadingness (ignored when $1prtype isn\'t set).\";'),('en','messages:apihelp-query+allpages-param-limit','s:31:\"How many total pages to return.\";'),('en','messages:apihelp-query+allpages-param-dir','s:31:\"The direction in which to list.\";'),('en','messages:apihelp-query+allpages-param-filterlanglinks','s:108:\"Filter based on whether a page has langlinks. Note that this may not consider langlinks added by extensions.\";'),('en','messages:apihelp-query+allpages-param-prexpiry','s:223:\"Which protection expiry to filter the page on:\n;indefinite:Get only pages with indefinite protection expiry.\n;definite:Get only pages with a definite (specific) protection expiry.\n;all:Get pages with any protections expiry.\";'),('en','messages:apihelp-query+allpages-example-B','s:57:\"Show a list of pages starting at the letter <kbd>B</kbd>.\";'),('en','messages:apihelp-query+allpages-example-generator','s:60:\"Show info about 4 pages starting at the letter <kbd>T</kbd>.\";'),('en','messages:apihelp-query+allpages-example-generator-revisions','s:70:\"Show content of first 2 non-redirect pages beginning at <kbd>Re</kbd>.\";'),('en','messages:apihelp-query+allredirects-description','s:34:\"List all redirects to a namespace.\";'),('en','messages:apihelp-query+allredirects-param-from','s:52:\"The title of the redirect to start enumerating from.\";'),('en','messages:apihelp-query+allredirects-param-to','s:49:\"The title of the redirect to stop enumerating at.\";'),('en','messages:apihelp-query+allredirects-param-prefix','s:55:\"Search for all target pages that begin with this value.\";'),('en','messages:apihelp-query+allredirects-param-unique','s:154:\"Only show distinct target pages. Cannot be used with $1prop=ids|fragment|interwiki.\nWhen used as a generator, yields target pages instead of source pages.\";'),('en','messages:apihelp-query+allredirects-param-prop','s:39:\"Which pieces of information to include:\";'),('en','messages:apihelp-query+allredirects-paramvalue-prop-ids','s:83:\"Adds the page ID of the redirecting page (cannot be used with <var>$1unique</var>).\";'),('en','messages:apihelp-query+allredirects-paramvalue-prop-title','s:31:\"Adds the title of the redirect.\";'),('en','messages:apihelp-query+allredirects-paramvalue-prop-fragment','s:86:\"Adds the fragment from the redirect, if any (cannot be used with <var>$1unique</var>).\";'),('en','messages:apihelp-query+allredirects-paramvalue-prop-interwiki','s:94:\"Adds the interwiki prefix from the redirect, if any (cannot be used with <var>$1unique</var>).\";'),('en','messages:apihelp-query+allredirects-param-namespace','s:27:\"The namespace to enumerate.\";'),('en','messages:apihelp-query+allredirects-param-limit','s:31:\"How many total items to return.\";'),('en','messages:apihelp-query+allredirects-param-dir','s:31:\"The direction in which to list.\";'),('en','messages:apihelp-query+allredirects-example-B','s:97:\"List target pages, including missing ones, with page IDs they are from, starting at <kbd>B</kbd>.\";'),('en','messages:apihelp-query+allredirects-example-unique','s:25:\"List unique target pages.\";'),('en','messages:apihelp-query+allredirects-example-unique-generator','s:48:\"Gets all target pages, marking the missing ones.\";'),('en','messages:apihelp-query+allredirects-example-generator','s:36:\"Gets pages containing the redirects.\";'),('en','messages:apihelp-query+alltransclusions-description','s:96:\"List all transclusions (pages embedded using &#123;&#123;x&#125;&#125;), including non-existing.\";'),('en','messages:apihelp-query+alltransclusions-param-from','s:56:\"The title of the transclusion to start enumerating from.\";'),('en','messages:apihelp-query+alltransclusions-param-to','s:53:\"The title of the transclusion to stop enumerating at.\";'),('en','messages:apihelp-query+alltransclusions-param-prefix','s:61:\"Search for all transcluded titles that begin with this value.\";'),('en','messages:apihelp-query+alltransclusions-param-unique','s:141:\"Only show distinct transcluded titles. Cannot be used with $1prop=ids.\nWhen used as a generator, yields target pages instead of source pages.\";'),('en','messages:apihelp-query+alltransclusions-param-prop','s:39:\"Which pieces of information to include:\";'),('en','messages:apihelp-query+alltransclusions-paramvalue-prop-ids','s:73:\"Adds the page ID of the transcluding page (cannot be used with $1unique).\";'),('en','messages:apihelp-query+alltransclusions-paramvalue-prop-title','s:35:\"Adds the title of the transclusion.\";'),('en','messages:apihelp-query+alltransclusions-param-namespace','s:27:\"The namespace to enumerate.\";'),('en','messages:apihelp-query+alltransclusions-param-limit','s:31:\"How many total items to return.\";'),('en','messages:apihelp-query+alltransclusions-param-dir','s:31:\"The direction in which to list.\";'),('en','messages:apihelp-query+alltransclusions-example-B','s:103:\"List transcluded titles, including missing ones, with page IDs they are from, starting at <kbd>B</kbd>.\";'),('en','messages:apihelp-query+alltransclusions-example-unique','s:31:\"List unique transcluded titles.\";'),('en','messages:apihelp-query+alltransclusions-example-unique-generator','s:54:\"Gets all transcluded titles, marking the missing ones.\";'),('en','messages:apihelp-query+alltransclusions-example-generator','s:40:\"Gets pages containing the transclusions.\";'),('en','messages:apihelp-query+allusers-description','s:31:\"Enumerate all registered users.\";'),('en','messages:apihelp-query+allusers-param-from','s:40:\"The user name to start enumerating from.\";'),('en','messages:apihelp-query+allusers-param-to','s:37:\"The user name to stop enumerating at.\";'),('en','messages:apihelp-query+allusers-param-prefix','s:48:\"Search for all users that begin with this value.\";'),('en','messages:apihelp-query+allusers-param-dir','s:21:\"Direction to sort in.\";'),('en','messages:apihelp-query+allusers-param-group','s:39:\"Only include users in the given groups.\";'),('en','messages:apihelp-query+allusers-param-excludegroup','s:34:\"Exclude users in the given groups.\";'),('en','messages:apihelp-query+allusers-param-rights','s:141:\"Only include users with the given rights. Does not include rights granted by implicit or auto-promoted groups like *, user, or autoconfirmed.\";'),('en','messages:apihelp-query+allusers-param-prop','s:39:\"Which pieces of information to include:\";'),('en','messages:apihelp-query+allusers-paramvalue-prop-blockinfo','s:55:\"Adds the information about a current block on the user.\";'),('en','messages:apihelp-query+allusers-paramvalue-prop-groups','s:110:\"Lists groups that the user is in. This uses more server resources and may return fewer results than the limit.\";'),('en','messages:apihelp-query+allusers-paramvalue-prop-implicitgroups','s:50:\"Lists all the groups the user is automatically in.\";'),('en','messages:apihelp-query+allusers-paramvalue-prop-rights','s:31:\"Lists rights that the user has.\";'),('en','messages:apihelp-query+allusers-paramvalue-prop-editcount','s:32:\"Adds the edit count of the user.\";'),('en','messages:apihelp-query+allusers-paramvalue-prop-registration','s:75:\"Adds the timestamp of when the user registered if available (may be blank).\";'),('en','messages:apihelp-query+allusers-param-limit','s:36:\"How many total user names to return.\";'),('en','messages:apihelp-query+allusers-param-witheditsonly','s:36:\"Only list users who have made edits.\";'),('en','messages:apihelp-query+allusers-param-activeusers','s:61:\"Only list users active in the last $1 {{PLURAL:$1|day|days}}.\";'),('en','messages:apihelp-query+allusers-example-Y','s:36:\"List users starting at <kbd>Y</kbd>.\";'),('en','messages:apihelp-query+backlinks-description','s:43:\"Find all pages that link to the given page.\";'),('en','messages:apihelp-query+backlinks-param-title','s:66:\"Title to search. Cannot be used together with <var>$1pageid</var>.\";'),('en','messages:apihelp-query+backlinks-param-pageid','s:67:\"Page ID to search. Cannot be used together with <var>$1title</var>.\";'),('en','messages:apihelp-query+backlinks-param-namespace','s:27:\"The namespace to enumerate.\";'),('en','messages:apihelp-query+backlinks-param-dir','s:31:\"The direction in which to list.\";'),('en','messages:apihelp-query+backlinks-param-filterredir','s:143:\"How to filter for redirects. If set to <kbd>nonredirects</kbd> when <var>$1redirect</var> is enabled, this is only applied to the second level.\";'),('en','messages:apihelp-query+backlinks-param-limit','s:179:\"How many total pages to return. If <var>$1redirect</var> is enabled, the limit applies to each level separately (which means up to 2 * <var>$1limit</var> results may be returned).\";'),('en','messages:apihelp-query+backlinks-param-redirect','s:106:\"If linking page is a redirect, find all pages that link to that redirect as well. Maximum limit is halved.\";'),('en','messages:apihelp-query+backlinks-example-simple','s:34:\"Show links to <kbd>Main page<kbd>.\";'),('en','messages:apihelp-query+backlinks-example-generator','s:59:\"Get information about pages linking to <kbd>Main page<kbd>.\";'),('en','messages:apihelp-query+blocks-description','s:40:\"List all blocked users and IP addresses.\";'),('en','messages:apihelp-query+blocks-param-start','s:40:\"The timestamp to start enumerating from.\";'),('en','messages:apihelp-query+blocks-param-end','s:37:\"The timestamp to stop enumerating at.\";'),('en','messages:apihelp-query+blocks-param-ids','s:37:\"List of block IDs to list (optional).\";'),('en','messages:apihelp-query+blocks-param-users','s:39:\"List of users to search for (optional).\";'),('en','messages:apihelp-query+blocks-param-ip','s:184:\"Get all blocks applying to this IP or CIDR range, including range blocks.\nCannot be used together with <var>$3users</var>. CIDR ranges broader than IPv4/$1 or IPv6/$2 are not accepted.\";'),('en','messages:apihelp-query+blocks-param-limit','s:37:\"The maximum number of blocks to list.\";'),('en','messages:apihelp-query+blocks-param-prop','s:24:\"Which properties to get:\";'),('en','messages:apihelp-query+blocks-paramvalue-prop-id','s:25:\"Adds the ID of the block.\";'),('en','messages:apihelp-query+blocks-paramvalue-prop-user','s:38:\"Adds the username of the blocked user.\";'),('en','messages:apihelp-query+blocks-paramvalue-prop-userid','s:37:\"Adds the user ID of the blocked user.\";'),('en','messages:apihelp-query+blocks-paramvalue-prop-by','s:39:\"Adds the username of the blocking user.\";'),('en','messages:apihelp-query+blocks-paramvalue-prop-byid','s:38:\"Adds the user ID of the blocking user.\";'),('en','messages:apihelp-query+blocks-paramvalue-prop-timestamp','s:47:\"Adds the timestamp of when the block was given.\";'),('en','messages:apihelp-query+blocks-paramvalue-prop-expiry','s:45:\"Adds the timestamp of when the block expires.\";'),('en','messages:apihelp-query+blocks-paramvalue-prop-reason','s:36:\"Adds the reason given for the block.\";'),('en','messages:apihelp-query+blocks-paramvalue-prop-range','s:53:\"Adds the range of IP addresses affected by the block.\";'),('en','messages:apihelp-query+blocks-paramvalue-prop-flags','s:46:\"Tags the ban with (autoblock, anononly, etc.).\";'),('en','messages:apihelp-query+blocks-param-show','s:133:\"Show only items that meet these criteria.\nFor example, to see only indefinite blocks on IP addresses, set <kbd>$1show=ip|!temp</kbd>.\";'),('en','messages:apihelp-query+blocks-example-simple','s:12:\"List blocks.\";'),('en','messages:apihelp-query+blocks-example-users','s:57:\"List blocks of users <kbd>Alice</kbd> and <kbd>Bob</kbd>.\";'),('en','messages:apihelp-query+categories-description','s:40:\"List all categories the pages belong to.\";'),('en','messages:apihelp-query+categories-param-prop','s:53:\"Which additional properties to get for each category:\";'),('en','messages:apihelp-query+categories-paramvalue-prop-sortkey','s:96:\"Adds the sortkey (hexadecimal string) and sortkey prefix (human-readable part) for the category.\";'),('en','messages:apihelp-query+categories-paramvalue-prop-timestamp','s:46:\"Adds timestamp of when the category was added.\";'),('en','messages:apihelp-query+categories-paramvalue-prop-hidden','s:72:\"Tags categories that are hidden with <code>_&#95;HIDDENCAT_&#95;</code>.\";'),('en','messages:apihelp-query+categories-param-show','s:33:\"Which kind of categories to show.\";'),('en','messages:apihelp-query+categories-param-limit','s:30:\"How many categories to return.\";'),('en','messages:apihelp-query+categories-param-categories','s:96:\"Only list these categories. Useful for checking whether a certain page is in a certain category.\";'),('en','messages:apihelp-query+categories-param-dir','s:31:\"The direction in which to list.\";'),('en','messages:apihelp-query+categories-example-simple','s:72:\"Get a list of categories the page <kbd>Albert Einstein</kbd> belongs to.\";'),('en','messages:apihelp-query+categories-example-generator','s:81:\"Get information about all categories used in the page <kbd>Albert Einstein</kbd>.\";'),('en','messages:apihelp-query+categoryinfo-description','s:47:\"Returns information about the given categories.\";'),('en','messages:apihelp-query+categoryinfo-example-simple','s:74:\"Get information about <kbd>Category:Foo</kbd> and <kbd>Category:Bar</kbd>.\";'),('en','messages:apihelp-query+categorymembers-description','s:35:\"List all pages in a given category.\";'),('en','messages:apihelp-query+categorymembers-param-title','s:142:\"Which category to enumerate (required). Must include the <kbd>{{ns:category}}:</kbd> prefix. Cannot be used together with <var>$1pageid</var>.\";'),('en','messages:apihelp-query+categorymembers-param-pageid','s:86:\"Page ID of the category to enumerate. Cannot be used together with <var>$1title</var>.\";'),('en','messages:apihelp-query+categorymembers-param-prop','s:39:\"Which pieces of information to include:\";'),('en','messages:apihelp-query+categorymembers-paramvalue-prop-ids','s:17:\"Adds the page ID.\";'),('en','messages:apihelp-query+categorymembers-paramvalue-prop-title','s:44:\"Adds the title and namespace ID of the page.\";'),('en','messages:apihelp-query+categorymembers-paramvalue-prop-sortkey','s:71:\"Adds the sortkey used for sorting in the category (hexadecimal string).\";'),('en','messages:apihelp-query+categorymembers-paramvalue-prop-sortkeyprefix','s:94:\"Adds the sortkey prefix used for sorting in the category (human-readable part of the sortkey).\";'),('en','messages:apihelp-query+categorymembers-paramvalue-prop-type','s:75:\"Adds the type that the page has been categorised as (page, subcat or file).\";'),('en','messages:apihelp-query+categorymembers-paramvalue-prop-timestamp','s:49:\"Adds the timestamp of when the page was included.\";'),('en','messages:apihelp-query+categorymembers-param-namespace','s:166:\"Only include pages in these namespaces. Note that <kbd>$1type=subcat</kbd> or <kbd>$1type=file</kbd> may be used instead of <kbd>$1namespace=14</kbd> or <kbd>6</kbd>.\";'),('en','messages:apihelp-query+categorymembers-param-type','s:91:\"Which type of category members to include. Ignored when <kbd>$1sort=timestamp</kbd> is set.\";'),('en','messages:apihelp-query+categorymembers-param-limit','s:38:\"The maximum number of pages to return.\";'),('en','messages:apihelp-query+categorymembers-param-sort','s:20:\"Property to sort by.\";'),('en','messages:apihelp-query+categorymembers-param-dir','s:27:\"In which direction to sort.\";'),('en','messages:apihelp-query+categorymembers-param-start','s:83:\"Timestamp to start listing from. Can only be used with <kbd>$1sort=timestamp</kbd>.\";'),('en','messages:apihelp-query+categorymembers-param-end','s:79:\"Timestamp to end listing at. Can only be used with <kbd>$1sort=timestamp</kbd>.\";'),('en','messages:apihelp-query+categorymembers-param-starthexsortkey','s:121:\"Sortkey to start listing from, as returned by <kbd>$1prop=sortkey</kbd>. Can only be used with <kbd>$1sort=sortkey</kbd>.\";'),('en','messages:apihelp-query+categorymembers-param-endhexsortkey','s:117:\"Sortkey to end listing at, as returned by <kbd>$1prop=sortkey</kbd>. Can only be used with <kbd>$1sort=sortkey</kbd>.\";'),('en','messages:apihelp-query+categorymembers-param-startsortkeyprefix','s:126:\"Sortkey prefix to start listing from. Can only be used with <kbd>$1sort=sortkey</kbd>. Overrides <var>$1starthexsortkey</var>.\";'),('en','messages:apihelp-query+categorymembers-param-endsortkeyprefix','s:192:\"Sortkey prefix to end listing <strong>before</strong> (not <strong>at</strong>; if this value occurs it will not be included!). Can only be used with $1sort=sortkey. Overrides $1endhexsortkey.\";'),('en','messages:apihelp-query+categorymembers-param-startsortkey','s:30:\"Use $1starthexsortkey instead.\";'),('en','messages:apihelp-query+categorymembers-param-endsortkey','s:28:\"Use $1endhexsortkey instead.\";'),('en','messages:apihelp-query+categorymembers-example-simple','s:50:\"Get first 10 pages in <kbd>Category:Physics</kbd>.\";'),('en','messages:apihelp-query+categorymembers-example-generator','s:66:\"Get page info about first 10 pages in <kbd>Category:Physics</kbd>.\";'),('en','messages:apihelp-query+contributors-description','s:89:\"Get the list of logged-in contributors and the count of anonymous contributors to a page.\";'),('en','messages:apihelp-query+contributors-param-group','s:121:\"Only include users in the given groups. Does not include implicit or auto-promoted groups like *, user, or autoconfirmed.\";'),('en','messages:apihelp-query+contributors-param-excludegroup','s:116:\"Exclude users in the given groups. Does not include implicit or auto-promoted groups like *, user, or autoconfirmed.\";'),('en','messages:apihelp-query+contributors-param-rights','s:143:\"Only include users having the given rights. Does not include rights granted by implicit or auto-promoted groups like *, user, or autoconfirmed.\";'),('en','messages:apihelp-query+contributors-param-excluderights','s:138:\"Exclude users having the given rights. Does not include rights granted by implicit or auto-promoted groups like *, user, or autoconfirmed.\";'),('en','messages:apihelp-query+contributors-param-limit','s:32:\"How many contributors to return.\";'),('en','messages:apihelp-query+contributors-example-simple','s:51:\"Show contributors to the page <kbd>Main Page</kbd>.\";'),('en','messages:apihelp-query+deletedrevisions-description','s:271:\"Get deleted revision information.\n\nMay be used in several ways:\n# Get deleted revisions for a set of pages, by setting titles or pageids. Ordered by title and timestamp.\n# Get data about a set of deleted revisions by setting their IDs with revids. Ordered by revision ID.\";'),('en','messages:apihelp-query+deletedrevisions-param-start','s:88:\"The timestamp to start enumerating from. Ignored when processing a list of revision IDs.\";'),('en','messages:apihelp-query+deletedrevisions-param-end','s:85:\"The timestamp to stop enumerating at. Ignored when processing a list of revision IDs.\";'),('en','messages:apihelp-query+deletedrevisions-param-tag','s:41:\"Only list revisions tagged with this tag.\";'),('en','messages:apihelp-query+deletedrevisions-param-user','s:33:\"Only list revisions by this user.\";'),('en','messages:apihelp-query+deletedrevisions-param-excludeuser','s:34:\"Don\'t list revisions by this user.\";'),('en','messages:apihelp-query+deletedrevisions-example-titles','s:105:\"List the deleted revisions of the pages <kbd>Main Page</kbd> and <kbd>Talk:Main Page</kbd>, with content.\";'),('en','messages:apihelp-query+deletedrevisions-example-revids','s:60:\"List the information for deleted revision <kbd>123456</kbd>.\";'),('en','messages:apihelp-query+deletedrevs-description','s:403:\"List deleted revisions.\n\nOperates in three modes:\n# List deleted revisions for the given titles, sorted by timestamp.\n# List deleted contributions for the given user, sorted by timestamp (no titles specified).\n# List all deleted revisions in the given namespace, sorted by title and timestamp (no titles specified, $1user not set).\n\nCertain parameters only apply to some modes and are ignored in others.\";'),('en','messages:apihelp-query+deletedrevs-paraminfo-modes','s:28:\"{{PLURAL:$1|Mode|Modes}}: $2\";'),('en','messages:apihelp-query+deletedrevs-param-start','s:40:\"The timestamp to start enumerating from.\";'),('en','messages:apihelp-query+deletedrevs-param-end','s:37:\"The timestamp to stop enumerating at.\";'),('en','messages:apihelp-query+deletedrevs-param-from','s:28:\"Start listing at this title.\";'),('en','messages:apihelp-query+deletedrevs-param-to','s:27:\"Stop listing at this title.\";'),('en','messages:apihelp-query+deletedrevs-param-prefix','s:54:\"Search for all page titles that begin with this value.\";'),('en','messages:apihelp-query+deletedrevs-param-unique','s:37:\"List only one revision for each page.\";'),('en','messages:apihelp-query+deletedrevs-param-tag','s:41:\"Only list revisions tagged with this tag.\";'),('en','messages:apihelp-query+deletedrevs-param-user','s:33:\"Only list revisions by this user.\";'),('en','messages:apihelp-query+deletedrevs-param-excludeuser','s:34:\"Don\'t list revisions by this user.\";'),('en','messages:apihelp-query+deletedrevs-param-namespace','s:34:\"Only list pages in this namespace.\";'),('en','messages:apihelp-query+deletedrevs-param-limit','s:40:\"The maximum amount of revisions to list.\";'),('en','messages:apihelp-query+deletedrevs-param-prop','s:628:\"Which properties to get:\n;revid:Adds the revision ID of the deleted revision.\n;parentid:Adds the revision ID of the previous revision to the page.\n;user:Adds the user who made the revision.\n;userid:Adds the ID of the user who made the revision.\n;comment:Adds the comment of the revision.\n;parsedcomment:Adds the parsed comment of the revision.\n;minor:Tags if the revision is minor.\n;len:Adds the length (bytes) of the revision.\n;sha1:Adds the SHA-1 (base 16) of the revision.\n;content:Adds the content of the revision.\n;token:<span class=\"apihelp-deprecated\">Deprecated.</span> Gives the edit token.\n;tags:Tags for the revision.\";'),('en','messages:apihelp-query+deletedrevs-example-mode1','s:119:\"List the last deleted revisions of the pages <kbd>Main Page</kbd> and <kbd>Talk:Main Page</kbd>, with content (mode 1).\";'),('en','messages:apihelp-query+deletedrevs-example-mode2','s:66:\"List the last 50 deleted contributions by <kbd>Bob</kbd> (mode 2).\";'),('en','messages:apihelp-query+deletedrevs-example-mode3-main','s:67:\"List the first 50 deleted revisions in the main namespace (mode 3).\";'),('en','messages:apihelp-query+deletedrevs-example-mode3-talk','s:70:\"List the first 50 deleted pages in the {{ns:talk}} namespace (mode 3).\";'),('en','messages:apihelp-query+disabled-description','s:36:\"This query module has been disabled.\";'),('en','messages:apihelp-query+duplicatefiles-description','s:75:\"List all files that are duplicates of the given files based on hash values.\";'),('en','messages:apihelp-query+duplicatefiles-param-limit','s:35:\"How many duplicate files to return.\";'),('en','messages:apihelp-query+duplicatefiles-param-dir','s:31:\"The direction in which to list.\";'),('en','messages:apihelp-query+duplicatefiles-param-localonly','s:44:\"Look only for files in the local repository.\";'),('en','messages:apihelp-query+duplicatefiles-example-simple','s:58:\"Look for duplicates of [[:File:Albert Einstein Head.jpg]].\";'),('en','messages:apihelp-query+duplicatefiles-example-generated','s:33:\"Look for duplicates of all files.\";'),('en','messages:apihelp-query+embeddedin-description','s:55:\"Find all pages that embed (transclude) the given title.\";'),('en','messages:apihelp-query+embeddedin-param-title','s:55:\"Title to search. Cannot be used together with $1pageid.\";'),('en','messages:apihelp-query+embeddedin-param-pageid','s:56:\"Page ID to search. Cannot be used together with $1title.\";'),('en','messages:apihelp-query+embeddedin-param-namespace','s:27:\"The namespace to enumerate.\";'),('en','messages:apihelp-query+embeddedin-param-dir','s:31:\"The direction in which to list.\";'),('en','messages:apihelp-query+embeddedin-param-filterredir','s:28:\"How to filter for redirects.\";'),('en','messages:apihelp-query+embeddedin-param-limit','s:31:\"How many total pages to return.\";'),('en','messages:apihelp-query+embeddedin-example-simple','s:49:\"Show pages transcluding <kbd>Template:Stub</kbd>.\";'),('en','messages:apihelp-query+embeddedin-example-generator','s:66:\"Get information about pages transcluding <kbd>Template:Stub</kbd>.\";'),('en','messages:apihelp-query+extlinks-description','s:64:\"Returns all external URLs (not interwikis) from the given pages.\";'),('en','messages:apihelp-query+extlinks-param-limit','s:25:\"How many links to return.\";'),('en','messages:apihelp-query+extlinks-param-protocol','s:166:\"Protocol of the URL. If empty and <var>$1query</var> is set, the protocol is <kbd>http</kbd>. Leave both this and <var>$1query</var> empty to list all external links.\";'),('en','messages:apihelp-query+extlinks-param-query','s:107:\"Search string without protocol. Useful for checking whether a certain page contains a certain external url.\";'),('en','messages:apihelp-query+extlinks-param-expandurl','s:58:\"Expand protocol-relative URLs with the canonical protocol.\";'),('en','messages:apihelp-query+extlinks-example-simple','s:52:\"Get a list of external links on <kbd>Main Page<kbd>.\";'),('en','messages:apihelp-query+exturlusage-description','s:41:\"Enumerate pages that contain a given URL.\";'),('en','messages:apihelp-query+exturlusage-param-prop','s:39:\"Which pieces of information to include:\";'),('en','messages:apihelp-query+exturlusage-paramvalue-prop-ids','s:20:\"Adds the ID of page.\";'),('en','messages:apihelp-query+exturlusage-paramvalue-prop-title','s:44:\"Adds the title and namespace ID of the page.\";'),('en','messages:apihelp-query+exturlusage-paramvalue-prop-url','s:30:\"Adds the URL used in the page.\";'),('en','messages:apihelp-query+exturlusage-param-protocol','s:166:\"Protocol of the URL. If empty and <var>$1query</var> is set, the protocol is <kbd>http</kbd>. Leave both this and <var>$1query</var> empty to list all external links.\";'),('en','messages:apihelp-query+exturlusage-param-query','s:99:\"Search string without protocol. See [[Special:LinkSearch]]. Leave empty to list all external links.\";'),('en','messages:apihelp-query+exturlusage-param-namespace','s:33:\"The page namespaces to enumerate.\";'),('en','messages:apihelp-query+exturlusage-param-limit','s:25:\"How many pages to return.\";'),('en','messages:apihelp-query+exturlusage-param-expandurl','s:58:\"Expand protocol-relative URLs with the canonical protocol.\";'),('en','messages:apihelp-query+exturlusage-example-simple','s:58:\"Show pages linking to <kbd>http://www.mediawiki.org</kbd>.\";'),('en','messages:apihelp-query+filearchive-description','s:41:\"Enumerate all deleted files sequentially.\";'),('en','messages:apihelp-query+filearchive-param-from','s:42:\"The image title to start enumerating from.\";'),('en','messages:apihelp-query+filearchive-param-to','s:39:\"The image title to stop enumerating at.\";'),('en','messages:apihelp-query+filearchive-param-prefix','s:55:\"Search for all image titles that begin with this value.\";'),('en','messages:apihelp-query+filearchive-param-limit','s:35:\"How many images to return in total.\";'),('en','messages:apihelp-query+filearchive-param-dir','s:31:\"The direction in which to list.\";'),('en','messages:apihelp-query+filearchive-param-sha1','s:43:\"SHA1 hash of image. Overrides $1sha1base36.\";'),('en','messages:apihelp-query+filearchive-param-sha1base36','s:50:\"SHA1 hash of image in base 36 (used in MediaWiki).\";'),('en','messages:apihelp-query+filearchive-param-prop','s:31:\"Which image information to get:\";'),('en','messages:apihelp-query+filearchive-paramvalue-prop-sha1','s:30:\"Adds SHA-1 hash for the image.\";'),('en','messag