instead.\";'),('en','messages:apihelp-query+info-example-simple','s:52:\"Get information about the page <kbd>Main Page</kbd>.\";'),('en','messages:apihelp-query+info-example-protection','s:75:\"Get general and protection information about the page <kbd>Main Page</kbd>.\";'),('en','messages:apihelp-query+iwbacklinks-description','s:208:\"Find all pages that link to the given interwiki link.\n\nCan be used to find all links with a prefix, or all links to a title (with a given prefix). Using neither parameter is effectively \"all interwiki links\".\";'),('en','messages:apihelp-query+iwbacklinks-param-prefix','s:25:\"Prefix for the interwiki.\";'),('en','messages:apihelp-query+iwbacklinks-param-title','s:70:\"Interwiki link to search for. Must be used with <var>$1blprefix</var>.\";'),('en','messages:apihelp-query+iwbacklinks-param-limit','s:31:\"How many total pages to return.\";'),('en','messages:apihelp-query+iwbacklinks-param-prop','s:24:\"Which properties to get:\";'),('en','messages:apihelp-query+iwbacklinks-paramvalue-prop-iwprefix','s:33:\"Adds the prefix of the interwiki.\";'),('en','messages:apihelp-query+iwbacklinks-paramvalue-prop-iwtitle','s:32:\"Adds the title of the interwiki.\";'),('en','messages:apihelp-query+iwbacklinks-param-dir','s:31:\"The direction in which to list.\";'),('en','messages:apihelp-query+iwbacklinks-example-simple','s:40:\"Get pages linking to [[wikibooks:Test]].\";'),('en','messages:apihelp-query+iwbacklinks-example-generator','s:58:\"Get information about pages linking to [[wikibooks:Test]].\";'),('en','messages:apihelp-query+iwlinks-description','s:49:\"Returns all interwiki links from the given pages.\";'),('en','messages:apihelp-query+iwlinks-param-url','s:57:\"Whether to get the full URL (cannot be used with $1prop).\";'),('en','messages:apihelp-query+iwlinks-param-prop','s:63:\"Which additional properties to get for each interlanguage link:\";'),('en','messages:apihelp-query+iwlinks-paramvalue-prop-url','s:18:\"Adds the full URL.\";'),('en','messages:apihelp-query+iwlinks-param-limit','s:35:\"How many interwiki links to return.\";'),('en','messages:apihelp-query+iwlinks-param-prefix','s:45:\"Only return interwiki links with this prefix.\";'),('en','messages:apihelp-query+iwlinks-param-title','s:68:\"Interwiki link to search for. Must be used with <var>$1prefix</var>.\";'),('en','messages:apihelp-query+iwlinks-param-dir','s:31:\"The direction in which to list.\";'),('en','messages:apihelp-query+iwlinks-example-simple','s:55:\"Get interwiki links from the page <kbd>Main Page</kbd>.\";'),('en','messages:apihelp-query+langbacklinks-description','s:284:\"Find all pages that link to the given language link.\n\nCan be used to find all links with a language code, or all links to a title (with a given language). Using neither parameter is effectively \"all language links\".\n\nNote that this may not consider language links added by extensions.\";'),('en','messages:apihelp-query+langbacklinks-param-lang','s:31:\"Language for the language link.\";'),('en','messages:apihelp-query+langbacklinks-param-title','s:54:\"Language link to search for. Must be used with $1lang.\";'),('en','messages:apihelp-query+langbacklinks-param-limit','s:31:\"How many total pages to return.\";'),('en','messages:apihelp-query+langbacklinks-param-prop','s:24:\"Which properties to get:\";'),('en','messages:apihelp-query+langbacklinks-paramvalue-prop-lllang','s:44:\"Adds the language code of the language link.\";'),('en','messages:apihelp-query+langbacklinks-paramvalue-prop-lltitle','s:36:\"Adds the title of the language link.\";'),('en','messages:apihelp-query+langbacklinks-param-dir','s:31:\"The direction in which to list.\";'),('en','messages:apihelp-query+langbacklinks-example-simple','s:34:\"Get pages linking to [[:fr:Test]].\";'),('en','messages:apihelp-query+langbacklinks-example-generator','s:52:\"Get information about pages linking to [[:fr:Test]].\";'),('en','messages:apihelp-query+langlinks-description','s:53:\"Returns all interlanguage links from the given pages.\";'),('en','messages:apihelp-query+langlinks-param-limit','s:29:\"How many langlinks to return.\";'),('en','messages:apihelp-query+langlinks-param-url','s:68:\"Whether to get the full URL (cannot be used with <var>$1prop</var>).\";'),('en','messages:apihelp-query+langlinks-param-prop','s:63:\"Which additional properties to get for each interlanguage link:\";'),('en','messages:apihelp-query+langlinks-paramvalue-prop-url','s:18:\"Adds the full URL.\";'),('en','messages:apihelp-query+langlinks-paramvalue-prop-langname','s:104:\"Adds the localised language name (best effort). Use <var>$1inlanguagecode</var> to control the language.\";'),('en','messages:apihelp-query+langlinks-paramvalue-prop-autonym','s:30:\"Adds the native language name.\";'),('en','messages:apihelp-query+langlinks-param-lang','s:51:\"Only return language links with this language code.\";'),('en','messages:apihelp-query+langlinks-param-title','s:56:\"Link to search for. Must be used with <var>$1lang</var>.\";'),('en','messages:apihelp-query+langlinks-param-dir','s:31:\"The direction in which to list.\";'),('en','messages:apihelp-query+langlinks-param-inlanguagecode','s:43:\"Language code for localised language names.\";'),('en','messages:apihelp-query+langlinks-example-simple','s:59:\"Get interlanguage links from the page <kbd>Main Page</kbd>.\";'),('en','messages:apihelp-query+links-description','s:39:\"Returns all links from the given pages.\";'),('en','messages:apihelp-query+links-param-namespace','s:36:\"Show links in these namespaces only.\";'),('en','messages:apihelp-query+links-param-limit','s:25:\"How many links to return.\";'),('en','messages:apihelp-query+links-param-titles','s:101:\"Only list links to these titles. Useful for checking whether a certain page links to a certain title.\";'),('en','messages:apihelp-query+links-param-dir','s:31:\"The direction in which to list.\";'),('en','messages:apihelp-query+links-example-simple','s:44:\"Get links from the page <kbd>Main Page</kbd>\";'),('en','messages:apihelp-query+links-example-generator','s:70:\"Get information about the link pages in the page <kbd>Main Page</kbd>.\";'),('en','messages:apihelp-query+links-example-namespaces','s:95:\"Get links from the page <kbd>Main Page</kbd> in the {{ns:user}} and {{ns:template}} namespaces.\";'),('en','messages:apihelp-query+linkshere-description','s:44:\"Find all pages that link to the given pages.\";'),('en','messages:apihelp-query+linkshere-param-prop','s:24:\"Which properties to get:\";'),('en','messages:apihelp-query+linkshere-paramvalue-prop-pageid','s:21:\"Page ID of each page.\";'),('en','messages:apihelp-query+linkshere-paramvalue-prop-title','s:19:\"Title of each page.\";'),('en','messages:apihelp-query+linkshere-paramvalue-prop-redirect','s:31:\"Flag if the page is a redirect.\";'),('en','messages:apihelp-query+linkshere-param-namespace','s:39:\"Only include pages in these namespaces.\";'),('en','messages:apihelp-query+linkshere-param-limit','s:19:\"How many to return.\";'),('en','messages:apihelp-query+linkshere-param-show','s:108:\"Show only items that meet these criteria:\n;redirect:Only show redirects.\n;!redirect:Only show non-redirects.\";'),('en','messages:apihelp-query+linkshere-example-simple','s:49:\"Get a list of pages linking to the [[Main Page]].\";'),('en','messages:apihelp-query+linkshere-example-generator','s:57:\"Get information about pages linking to the [[Main Page]].\";'),('en','messages:apihelp-query+logevents-description','s:21:\"Get events from logs.\";'),('en','messages:apihelp-query+logevents-param-prop','s:24:\"Which properties to get:\";'),('en','messages:apihelp-query+logevents-paramvalue-prop-ids','s:29:\"Adds the ID of the log event.\";'),('en','messages:apihelp-query+logevents-paramvalue-prop-title','s:45:\"Adds the title of the page for the log event.\";'),('en','messages:apihelp-query+logevents-paramvalue-prop-type','s:27:\"Adds the type of log event.\";'),('en','messages:a