logevents-param-limit','s:39:\"How many total event entries to return.\";'),('en','messages:apihelp-query+logevents-example-simple','s:23:\"List recent log events.\";'),('en','messages:apihelp-query+pagepropnames-description','s:48:\"List all page property names in use on the wiki.\";'),('en','messages:apihelp-query+pagepropnames-param-limit','s:38:\"The maximum number of names to return.\";'),('en','messages:apihelp-query+pagepropnames-example-simple','s:28:\"Get first 10 property names.\";'),('en','messages:apihelp-query+pageprops-description','s:51:\"Get various properties defined in the page content.\";'),('en','messages:apihelp-query+pageprops-param-prop','s:91:\"Only list these props. Useful for checking whether a certain page uses a certain page prop.\";'),('en','messages:apihelp-query+pageprops-example-simple','s:75:\"Get properties for the pages <kbd>Main Page</kbd> and <kbd>MediaWiki</kbd>.\";'),('en','messages:apihelp-query+pageswithprop-description','s:43:\"List all pages using a given page property.\";'),('en','messages:apihelp-query+pageswithprop-param-propname','s:39:\"Page prop for which to enumerate pages.\";'),('en','messages:apihelp-query+pageswithprop-param-prop','s:39:\"Which pieces of information to include:\";'),('en','messages:apihelp-query+pageswithprop-paramvalue-prop-ids','s:17:\"Adds the page ID.\";'),('en','messages:apihelp-query+pageswithprop-paramvalue-prop-title','s:44:\"Adds the title and namespace ID of the page.\";'),('en','messages:apihelp-query+pageswithprop-paramvalue-prop-value','s:32:\"Adds the value of the page prop.\";'),('en','messages:apihelp-query+pageswithprop-param-limit','s:38:\"The maximum number of pages to return.\";'),('en','messages:apihelp-query+pageswithprop-param-dir','s:27:\"In which direction to sort.\";'),('en','messages:apihelp-query+pageswithprop-example-simple','s:81:\"List the first 10 pages using <code>&#123;&#123;DISPLAYTITLE:&#125;&#125;</code>.\";'),('en','messages:apihelp-query+pageswithprop-example-generator','s:89:\"Get additional information about the first 10 pages using <code>_&#95;NOTOC_&#95;</code>.\";'),('en','messages:apihelp-query+prefixsearch-description','s:40:\"Perform a prefix search for page titles.\";'),('en','messages:apihelp-query+prefixsearch-param-search','s:14:\"Search string.\";'),('en','messages:apihelp-query+prefixsearch-param-namespace','s:21:\"Namespaces to search.\";'),('en','messages:apihelp-query+prefixsearch-param-limit','s:36:\"Maximum number of results to return.\";'),('en','messages:apihelp-query+prefixsearch-param-offset','s:26:\"Number of results to skip.\";'),('en','messages:apihelp-query+prefixsearch-example-simple','s:57:\"Search for page titles beginning with <kbd>meaning</kbd>.\";'),('en','messages:apihelp-query+protectedtitles-description','s:40:\"List all titles protected from creation.\";'),('en','messages:apihelp-query+protectedtitles-param-namespace','s:37:\"Only list titles in these namespaces.\";'),('en','messages:apihelp-query+protectedtitles-param-level','s:46:\"Only list titles with these protection levels.\";'),('en','messages:apihelp-query+protectedtitles-param-limit','s:31:\"How many total pages to return.\";'),('en','messages:apihelp-query+protectedtitles-param-start','s:43:\"Start listing at this protection timestamp.\";'),('en','messages:apihelp-query+protectedtitles-param-end','s:42:\"Stop listing at this protection timestamp.\";'),('en','messages:apihelp-query+protectedtitles-param-prop','s:24:\"Which properties to get:\";'),('en','messages:apihelp-query+protectedtitles-paramvalue-prop-timestamp','s:48:\"Adds the timestamp of when protection was added.\";'),('en','messages:apihelp-query+protectedtitles-paramvalue-prop-user','s:40:\"Adds the user that added the protection.\";'),('en','messages:apihelp-query+protectedtitles-paramvalue-prop-userid','s:43:\"Adds the user ID that added the protection.\";'),('en','messages:apihelp-query+protectedtitles-paramvalue-prop-comment','s:36:\"Adds the comment for the protection.\";'),('en','messages:apihelp-query+protectedtitles-paramvalue-prop-parsedcomment','s:43:\"Adds the parsed comment for the protection.\";'),('en','messages:apihelp-query+protectedtitles-paramvalue-prop-expiry','s:57:\"Adds the timestamp of when the protection will be lifted.\";'),('en','messages:apihelp-query+protectedtitles-paramvalue-prop-level','s:26:\"Adds the protection level.\";'),('en','messages:apihelp-query+protectedtitles-example-simple','s:22:\"List protected titles.\";'),('en','messages:apihelp-query+protectedtitles-example-generator','s:53:\"Find links to protected titles in the main namespace.\";'),('en','messages:apihelp-query+querypage-description','s:54:\"Get a list provided by a QueryPage-based special page.\";'),('en','messages:apihelp-query+querypage-param-page','s:59:\"The name of the special page. Note, this is case sensitive.\";'),('en','messages:apihelp-query+querypage-param-limit','s:28:\"Number of results to return.\";'),('en','messages:apihelp-query+querypage-example-ancientpages','s:45:\"Return results from [[Special:Ancientpages]].\";'),('en','messages:apihelp-query+random-description','s:326:\"Get a set of random pages.\n\nPages are listed in a fixed sequence, only the starting point is random. This means that if, for example, <samp>Main Page</samp> is the first random page in the list, <samp>List of fictional monkeys</samp> will <em>always</em> be second, <samp>List of people on stamps of Vanuatu</samp> third, etc.\";'),('en','messages:apihelp-query+random-param-namespace','s:38:\"Return pages in these namespaces only.\";'),('en','messages:apihelp-query+random-param-limit','s:45:\"Limit how many random pages will be returned.\";'),('en','messages:apihelp-query+random-param-redirect','s:47:\"Use <kbd>$1filterredir=redirects</kbd> instead.\";'),('en','messages:apihelp-query+random-param-filterredir','s:28:\"How to filter for redirects.\";'),('en','messages:apihelp-query+random-example-simple','s:48:\"Return two random pages from the main namespace.\";'),('en','messages:apihelp-query+random-example-generator','s:64:\"Return page info about two random pages from the main namespace.\";'),('en','messages:apihelp-query+recentchanges-description','s:25:\"Enumerate recent changes.\";'),('en','messages:apihelp-query+recentchanges-param-start','s:40:\"The timestamp to start enumerating from.\";'),('en','messages:apihelp-query+recentchanges-param-end','s:33:\"The timestamp to end enumerating.\";'),('en','messages:apihelp-query+recentchanges-param-namespace','s:40:\"Filter changes to only these namespaces.\";'),('en','messages:apihelp-query+recentchanges-param-user','s:31:\"Only list changes by this user.\";'),('en','messages:apihelp-query+recentchanges-param-excludeuser','s:32:\"Don\'t list changes by this user.\";'),('en','messages:apihelp-query+recentchanges-param-tag','s:39:\"Only list changes tagged with this tag.\";'),('en','messages:apihelp-query+recentchanges-param-prop','s:41:\"Include additional pieces of information:\";'),('en','messages:apihelp-query+recentchanges-paramvalue-prop-user','s:66:\"Adds the user responsible for the edit and tags if they are an IP.\";'),('en','messages:apihelp-query+recentchanges-paramvalue-prop-userid','s:42:\"Adds the user ID responsible for the edit.\";'),('en','messages:apihelp-query+recentchanges-paramvalue-prop-comment','s:30:\"Adds the comment for the edit.\";'),('en','messages:apihelp-query+recentchanges-paramvalue-prop-parsedcomment','s:37:\"Adds the parsed comment for the edit.\";'),('en','messages:apihelp-query+recentchanges-paramvalue-prop-flags','s:24:\"Adds flags for the edit.\";'),('en','messages:apihelp-query+recentchanges-paramvalue-prop-timestamp','s:27:\"Adds timestamp of the edit.\";'),('en','messages:apihelp-query+recentchanges-paramvalue-prop-title','s:32:\"Adds the page title of the edit.\";'),('en','messages:apihelp-query+recentchanges-paramvalue-prop-ids','s:68:\"Adds the page ID, recent changes ID and the new and old revision ID.\";'),('en','messages:apihelp-query+recentchanges-paramvalue-prop-sizes','s:42:\"Adds the new and old page length in bytes.\";'),('en','messages:apihelp-query+recentchanges-paramvalue-prop-redirect','s:32:\"Tags edit if page is a redirect.\";'),('en','messages:apihelp-query+recentchanges-paramvalue-prop-patrolled','s:57:\"Tags patrollable edits as being patrolled or unpatrolled.\";'),('en','messages:apihelp-query+recentchanges-paramvalue-prop-loginfo','s:60:\"Adds log information (log ID, log type, etc) to log entries.\";'),('en','messages:apihelp-query+recentchanges-paramvalue-prop-tags','s:25:\"Lists tags for the entry.\";'),('en','messages:apihelp-query+recentchanges-paramvalue-prop-sha1','s:65:\"Adds the content checksum for entries associated with a revision.\";'),('en','messages:apihelp-query+recentchanges-param-token','s:81:\"Use <kbd>[[Special:ApiHelp/query+tokens|action=query&meta=tokens]]</kbd> instead.\";'),('en','messages:apihelp-query+recentchanges-param-show','s:127:\"Show only items that meet these criteria. For example, to see only minor edits done by logged-in users, set $1show=minor|!anon.\";'),('en','messages:apihelp-query+recentchanges-param-limit','s:33:\"How many total changes to return.\";'),('en','messages:apihelp-query+recentchanges-param-type','s:31:\"Which types of changes to show.\";'),('en','messages:apihelp-query+recentchanges-param-toponly','s:48:\"Only list changes which are the latest revision.\";'),('en','messages:apihelp-query+recentchanges-example-simple','s:20:\"List recent changes.\";'),('en','messages:apihelp-query+recentchanges-example-generator','s:47:\"Get page info about recent unpatrolled changes.\";'),('en','messages:apihelp-query+redirects-description','s:41:\"Returns all redirects to the given pages.\";'),('en','messages:apihelp-query+redirects-param-prop','s:24:\"Which properties to get:\";'),('en','messages:apihelp-query+redirects-paramvalue-prop-pageid','s:25:\"Page ID of each redirect.\";'),('en','messages:apihelp-query+redirects-paramvalue-prop-title','s:23:\"Title of each redirect.\";'),('en','messages:apihelp-query+redirects-paramvalue-prop-fragment','s:34:\"Fragment of each redirect, if any.\";'),('en','messages:apihelp-query+redirects-param-namespace','s:39:\"Only include pages in these namespaces.\";'),('en','messages:apihelp-query+redirects-param-limit','s:29:\"How many redirects to return.\";'),('en','messages:apihelp-query+redirects-param-show','s:139:\"Show only items that meet these criteria:\n;fragment:Only show redirects with a fragment.\n;!fragment:Only show redirects without a fragment.\";'),('en','messages:apihelp-query+redirects-example-simple','s:45:\"Get a list of redirects to the [[Main Page]].\";'),('en','messages:apihelp-query+redirects-example-generator','s:57:\"Get information about all redirects to the [[Main Page]].\";'),('en','messages:apihelp-query+revisions-description','s:294:\"Get revision information.\n\nMay be used in several ways:\n# Get data about a set of pages (last revision), by setting titles or pageids.\n# Get revisions for one given page, by using titles or pageids with start, end, or limit.\n# Get data about a set of revisions by setting their IDs with revids.\";'),('en','messages:apihelp-query+revisions-paraminfo-singlepageonly','s:46:\"May only be used with a single page (mode #2).\";'),('en','messages:apihelp-query+revisions-param-startid','s:44:\"From which revision ID to start enumeration.\";'),('en','messages:apihelp-query+revisions-param-endid','s:46:\"Stop revision enumeration on this revision ID.\";'),('en','messages:apihelp-query+revisions-param-start','s:51:\"From which revision timestamp to start enumeration.\";'),('en','messages:apihelp-query+revisions-param-end','s:31:\"Enumerate up to this timestamp.\";'),('en','messages:apihelp-query+revisions-param-user','s:36:\"Only include revisions made by user.\";'),('en','messages:apihelp-query+revisions-param-excludeuser','s:31:\"Exclude revisions made by user.\";'),('en','messages: