ion.\";'),('en','messages:apihelp-query+revisions+base-paramvalue-prop-contentmodel','s:33:\"Content model ID of the revision.\";'),('en','messages:apihelp-query+revisions+base-paramvalue-prop-comment','s:37:\"Comment by the user for the revision.\";'),('en','messages:apihelp-query+revisions+base-paramvalue-prop-parsedcomment','s:44:\"Parsed comment by the user for the revision.\";'),('en','messages:apihelp-query+revisions+base-paramvalue-prop-content','s:21:\"Text of the revision.\";'),('en','messages:apihelp-query+revisions+base-paramvalue-prop-tags','s:22:\"Tags for the revision.\";'),('en','messages:apihelp-query+revisions+base-paramvalue-prop-parsetree','s:80:\"The XML parse tree of revision content (requires content model <code>$1</code>).\";'),('en','messages:apihelp-query+revisions+base-param-limit','s:42:\"Limit how many revisions will be returned.\";'),('en','messages:apihelp-query+revisions+base-param-expandtemplates','s:63:\"Expand templates in revision content (requires $1prop=content).\";'),('en','messages:apihelp-query+revisions+base-param-generatexml','s:112:\"Generate XML parse tree for revision content (requires $1prop=content; replaced by <kbd>$1prop=parsetree</kbd>).\";'),('en','messages:apihelp-query+revisions+base-param-parse','s:124:\"Parse revision content (requires $1prop=content). For performance reasons, if this option is used, $1limit is enforced to 1.\";'),('en','messages:apihelp-query+revisions+base-param-section','s:49:\"Only retrieve the content of this section number.\";'),('en','messages:apihelp-query+revisions+base-param-diffto','s:151:\"Revision ID to diff each revision to. Use <kbd>prev</kbd>, <kbd>next</kbd> and <kbd>cur</kbd> for the previous, next and current revision respectively.\";'),('en','messages:apihelp-query+revisions+base-param-difftotext','s:187:\"Text to diff each revision to. Only diffs a limited number of revisions. Overrides <var>$1diffto</var>. If <var>$1section</var> is set, only that section will be diffed aga