api-help-permissions-granted-to','s:28:\"{{PLURAL:$1|Granted to}}: $2\";'),('en','messages:api-help-right-apihighlimits','s:135:\"Use higher limits in API queries (slow queries: $1; fast queries: $2). The limits for slow queries also apply to multivalue parameters.\";'),('en','messages:api-credits-header','s:7:\"Credits\";'),('en','messages:api-credits','s:370:\"API developers:\n* Yuri Astrakhan (creator, lead developer Sep 2006Sep 2007)\n* Roan Kattouw (lead developer Sep 20072009)\n* Victor Vasiliev\n* Bryan Tong Minh\n* Sam Reed\n* Brad Jorsch (lead developer 2013present)\n\nPlease send your comments, suggestions and questions to mediawiki-api@lists.wikimedia.org\nor file a bug report at https://phabricator.wikimedia.org/.\";'),('en','messages:ooui-outline-control-move-down','s:14:\"Move item down\";'),('en','messages:ooui-outline-control-move-up','s:12:\"Move item up\";'),('en','messages:ooui-outline-control-remove','s:11:\"Remove item\";'),('en','messages:ooui-toolbar-more','s:4:\"More\";'),('en','messages:ooui-toolgroup-expand','s:4:\"More\";'),('en','messages:ooui-toolgroup-collapse','s:5:\"Fewer\";'),('en','messages:ooui-dialog-message-accept','s:2:\"OK\";'),('en','messages:ooui-dialog-message-reject','s:6:\"Cancel\";'),('en','messages:ooui-dialog-process-error','s:20:\"Something went wrong\";'),('en','messages:ooui-dialog-process-dismiss','s:7:\"Dismiss\";'),('en','messages:ooui-dialog-process-retry','s:9:\"Try again\";'),('en','messages:ooui-dialog-process-continue','s:8:\"Continue\";'),('en','messages:ooui-selectfile-button-select','s:13:\"Select a file\";'),('en','messages:ooui-selectfile-not-supported','s:31:\"File selection is not supported\";'),('en','messages:ooui-selectfile-placeholder','s:19:\"No file is selected\";'),('en','messages:ooui-selectfile-dragdrop-placeholder','s:14:\"Drop file here\";'),('en','messages:cologneblue.css','s:64:\"/* CSS placed here will affect users of the Cologne Blue skin */\";'),('en','messages:cologneblue.js','s:78:\"/