d <citation>{{CURRENTTIME}}, {{CURRENTMONTHNAME}} {{CURRENTDAY}}, {{CURRENTYEAR}}</citation> from {{canonicalurl:{{FULLPAGENAME}}|oldid={{REVISIONID}}}}.\n\n=== [[The MLA style manual|MLA style]] ===\n\"{{FULLPAGENAME}}.\" \'\'{{SITENAME}}, {{int:sitesubtitle}}\'\'. {{CURRENTDAY}} {{CURRENTMONTHABBREV}} {{CURRENTYEAR}}, {{CURRENTTIME}} UTC. <citation>{{CURRENTDAY}} {{CURRENTMONTHABBREV}} {{CURRENTYEAR}}, {{CURRENTTIME}}</citation> &lt;{{canonicalurl:{{FULLPAGENAME}}|oldid={{REVISIONID}}}}&gt;.\n\n=== [[MHRA Style Guide|MHRA style]] ===\n{{SITENAME}} contributors, \'{{FULLPAGENAME}}\', \'\'{{SITENAME}}, {{int:sitesubtitle}},\'\' {{CURRENTDAY}} {{CURRENTMONTHNAME}} {{CURRENTYEAR}}, {{CURRENTTIME}} UTC, &lt;{{canonicalurl:{{FULLPAGENAME}}|oldid={{REVISIONID}}}}&gt; [accessed <citation>{{CURRENTDAY}} {{CURRENTMONTHNAME}} {{CURRENTYEAR}}</citation>]\n\n=== [[The Chicago Manual of Style|Chicago style]] ===\n{{SITENAME}} contributors, \"{{FULLPAGENAME}},\" \'\'{{SITENAME}}, {{int:sitesubtitle}},\'\' {{canonicalurl:{{FULLPAGENAME}}|oldid={{REVISIONID}}}} (accessed <citation>{{CURRENTMONTHNAME}} {{CURRENTDAY}}, {{CURRENTYEAR}}</citation>).\n\n=== [[Council of Science Editors|CBE/CSE style]] ===\n{{SITENAME}} contributors. {{FULLPAGENAME}} [Internet]. {{SITENAME}}, {{int:sitesubtitle}}; {{CURRENTYEAR}} {{CURRENTMONTHABBREV}} {{CURRENTDAY}}, {{CURRENTTIME}} UTC [cited <citation>{{CURRENTYEAR}} {{CURRENTMONTHABBREV}} {{CURRENTDAY}}</citation>]. Available from:\n{{canonicalurl:{{FULLPAGENAME}}|oldid={{REVISIONID}}}}.\n\n=== [[Bluebook|Bluebook style]] ===\n{{FULLPAGENAME}}, {{canonicalurl:{{FULLPAGENAME}}|oldid={{REVISIONID}}}} (last visited <citation>{{CURRENTMONTHNAME}} {{CURRENTDAY}}, {{CURRENTYEAR}}</citation>).\n\n=== [[BibTeX]] entry ===\n\n  @misc{ wiki:xxx,\n    author = \"{{SITENAME}}\",\n    title = \"{{FULLPAGENAME}} --- {{SITENAME}}{,} {{int:sitesubtitle}}\",\n    year = \"{{CURRENTYEAR}}\",\n    url = \"{{canonicalurl:{{FULLPAGENAME}}|oldid={{REVISIONID}}}}\",\n    note = \"[Online; accessed <citation>{{CURRENTDAY}}-{{CURRENTMONTHNAME}}-{{CURRENTYEAR}}</citation>]\"\n  }\n\nWhen using the [[LaTeX]] package url (<code>\\usepackage{url}</code> somewhere in the preamble) which tends to give much more nicely formatted web addresses, the following may be preferred:\n\n  @misc{ wiki:xxx,\n    author = \"{{SITENAME}}\",\n    title = \"{{FULLPAGENAME}} --- {{SITENAME}}{,} {{int:sitesubtitle}}\",\n    year = \"{{CURRENTYEAR}}\",\n    url = \"\'\'\'\\url{\'\'\'{{canonicalurl:{{FULLPAGENAME}}|oldid={{REVISIONID}}}}\'\'\'}\'\'\'\",\n    note = \"[Online; accessed <citation>{{CURRENTDAY}}-{{CURRENTMONTHNAME}}-{{CURRENTYEAR}}</citation>]\"\n  }\n\n\n</div> <!--closing div for \"plainlinks\"-->\";'),('en','messages:captcha-edit','s:122:\"To edit this page, please solve the simple sum below and enter the answer in the box ([[Special:Captcha/help|more info]]):\";'),('en','messages:captcha-desc','s:73:\"Provides CAPTCHA techniques to protect against spam and password-guessing\";'),('en','messages:captcha-label','s:7:\"CAPTCHA\";'),('en','messages:captcha-addurl','s:227:\"Your edit includes new external links.\nTo protect the wiki against automated spam, we kindly ask you to solve the simple sum below and enter the answer in the box in order to save your edit ([[Special:Captcha/help|more info]]):\";'),('en','messages:captcha-badlogin','s:174:\"To protect the wiki against automated password cracking, we kindly ask you to solve the simple sum below and enter the answer in the box ([[Special:Captcha/help|more info]]):\";'),('en','messages:captcha-createaccount','s:173:\"To protect the wiki against automated account creation, we kindly ask you to solve the simple sum below and enter the answer in the box ([[Special:Captcha/help|more info]]):\";'),('en','messages:captcha-createaccount-fail','s:29:\"Incorrect or missing CAPTCHA.\";'),('en','messages:captcha-create','s:123:\"To create the page, please solve the simple sum below and enter the answer in the box ([[Special:Captcha/help|more info]]):\";'),('en','messages:captcha-sendemail','s:165:\"To protect the wiki against automated spamming, we kindly ask you to solve the simple sum below and enter the answer in the box ([[Special:Captcha/help|more info]]):\";'),('en','messages:captcha-sendemail-fail','s:29:\"Incorrect or missing CAPTCHA.\";'),('en','messages:captcha-disabledinapi','s:74:\"This action requires a CAPTCHA, so it cannot be performed through the API.\";'),('en','messages:captchahelp-title','s:12:\"CAPTCHA help\";'),('en','messages:captchahelp-cookies-needed','s:71:\"You will need to have cookies enabled in your browser for this to work.\";'),('en','messages:captchahelp-text','s:923:\"Web sites that accept postings from the public, like this wiki, are often abused by spammers who use automated tools to post their links to many sites.\nWhile these spam links can be removed, they are a significant nuisance.\n\nSometimes, especially when adding new web links to a page, the wiki may show you an image of colored or distorted text and ask you to type the words shown.\nSince this is a task that\'s hard to automate, it will allow most real humans to make their posts while stopping most spammers and other robotic attackers.\n\nUnfortunately this may inconvenience users with limited vision or using text-based or speech-based browsers.\nAt the moment we do not have an audio alternative available.\nPlease contact the [[Special:ListAdmins|site administrators]] for assistance if this is unexpectedly preventing you from making legitimate actions.\n\nHit the \"back\" button in your browser to return to the page editor.\";'),('en','messages:captcha-addurl-whitelist','s:285:\" #<!-- leave this line exactly as it is --> <pre>\n# Syntax is as follows:\n#   * Everything from a \"#\" character to the end of the line is a comment\n#   * Every non-blank line is a regex fragment which will only match hosts inside URLs\n #</pre> <!-- leave this line exactly as it is -->\";'),('en','messages:right-skipcaptcha','s:75:\"Perform CAPTCHA-triggering actions without having to go through the CAPTCHA\";'),('en','messages:gadgets-desc','s:139:\"Lets users select custom [[Special:Gadgets|CSS and JavaScript gadgets]] in their [[Special:Preferences#mw-prefsection-gadgets|preferences]]\";'),('en','messages:prefs-gadgets','s:7:\"Gadgets\";'),('en','messages:gadgets-prefstext','s:535:\"Below is a list of special gadgets you can enable for your account.\nThese gadgets are mostly based on JavaScript, so JavaScript has to be enabled in your browser for them to work.\nNote that these gadgets will have no effect on this preferences page.\n\nAlso note that these special gadgets are not part of the MediaWiki software, and are usually developed and maintained by users on your local wiki.\nLocal administrators can edit the [[MediaWiki:Gadgets-definition|definitions]] and [[Special:Gadgets|descriptions]] of available gadgets.\";'),('en','messages:gadgets','s:7:\"Gadgets\";'),('en','messages:gadgets-definition','s:0:\"\";'),('en','messages:gadgets-title','s:7:\"Gadgets\";'),('en','messages:gadgets-pagetext','s:300:\"Below is a list of special gadgets users can enable on their [[Special:Preferences#mw-prefsection-gadgets|preferences page]], as defined by the [[MediaWiki:Gadgets-definition|definitions]].\nThis overview provides easy access to the system message pages that define each gadget\'s description and code.\";'),('en','messages:gadgets-uses','s:4:\"Uses\";'),('en','messages:gadgets-required-rights','s:54:\"Requires the following {{PLURAL:$2|right|rights}}:\n\n$1\";'),('en','messages:gadgets-required-skins','s:59:\"Available on the {{PLURAL:$2|$1 skin|following skins: $1}}.\";'),('en','messages:gadgets-default','s:32:\"Enabled for everyone by default.\";'),('en','messages:gadgets-legacy','s:140:\"Gadget is not loaded. Please migrate to ResourceLoader. ([https://www.mediawiki.org/wiki/ResourceLoader/Migration_guide_(users) Learn more])\";'),('en','messages:gadgets-export','s:6:\"Export\";'),('en','messages:gadgets-export-title','s:13:\"Gadget export\";'),('en','messages:gadgets-not-found','s:22:\"Gadget \"$1\" not found.\";'),('en','messages:gadgets-export-text','s:382:\"To export the $1 gadget, click on \"{{int:gadgets-export-download}}\" button, save the downloaded file,\ngo to Special:Import on destination wiki and upload it. Then add the following to MediaWiki:Gadgets-definition page:\n<pre>$2</pre>\nYou must have appropriate permissions on destination wiki (including the right to edit system messages) and import from file uploads must be enabled.\";'),('en','messages:gadgets-export-download','s:8:\"Download\";'),('en','messages:apihelp-query+gadgetcategories-description','s:36:\"Returns a list of gadget categories.\";'),('en','messages:apihelp-query+gadgetcategories-param-prop','s:133:\"What gadget category information to get:\n;name:Internal category name.\n;title:Category title.\n;members:Number of gadgets in category.\";'),('en','messages:apihelp-query+gadgetcategories-param-names','s:32:\"Names of categories to retrieve.\";'),('en','messages:apihelp-query+gadgetcategories-example-1','s:40:\"Get a list of existing gadget categories\";'),('en','messages:apihelp-query+gadgetcategories-example-2','s:58:\"Get all information about categories named \"foo\" and \"bar\"\";'),('en','messages:apihelp-query+gadgets-description','s:44:\"Returns a list of gadgets used on this wiki.\";'),('en','messages:apihelp-query+gadgets-param-prop','s:175:\"What gadget information to get:\n;id:Internal gadget ID.\n;metadata:The gadget metadata.\n;desc:Gadget description transformed into HTML (can be slow, use only if really needed).\";'),('en','messages:apihelp-query+gadgets-param-categories','s:41:\"Gadgets from what categories to retrieve.\";'),('en','messages:apihelp-query+gadgets-param-ids','s:27:\"IDs of gadgets to retrieve.\";'),('en','messages:apihelp-query+gadgets-param-allowedonly','s:42:\"List only gadgets allowed to current user.\";'),('en','messages:apihelp-query+gadgets-param-enabledonly','s:42:\"List only gadgets enabled by current user.\";'),('en','messages:apihelp-query+gadgets-example-1','s:51:\"Get a list of gadgets along with their descriptions\";'),('en','messages:apihelp-query+gadgets-example-2','s:50:\"Get a list of gadgets with all possible properties\";'),('en','messages:apihelp-query+gadgets-example-3','s:49:\"Get a list of gadgets belonging to category \"foo\"\";'),('en','messages:apihelp-query+gadgets-example-4','s:45:\"Get information about gadgets \"foo\" and \"bar\"\";'),('en','messages:apihelp-query+gadgets-example-5','s:45:\"Get a list of gadgets enabled by current user\";'),('en','messages:right-gadgets-edit','s:36:\"Edit gadget JavaScript and CSS pages\";'),('en','messages:action-gadgets-edit','s:39:\"edit this gadget JavaScript or CSS page\";'),('en','messages:right-gadgets-definition-edit','s:23:\"Edit gadget definitions\";'),('en','messages:action-gadgets-definition-edit','s:27:\"edit this gadget definition\";'),('en','messages:imagemap_desc','s:79:\"Allows client-side clickable image maps using <code>&lt;imagemap&gt;</code> tag\";'),('en','messages:imagemap_no_image','s:47:\"Error: Must specify an image in the first line.\";'),('en','messages:imagemap_invalid_image','s:40:\"Error: Image is invalid or non-existent.\";'),('en','messages:imagemap_bad_image','s:41:\"Error: Image is blacklisted on this page.\";'),('en','messages:imagemap_no_link','s:53:\"Error: No valid link was found at the end of line $1.\";'),('en','messages:imagemap_invalid_title','s:40:\"Error: Invalid title in link at line $1.\";'),('en','messages:imagemap_missing_coord','s:51:\"Error: Not enough coordinates for shape at line $1.\";'),('en','messages:imagemap_unrecognised_shape','s:154:\"Error: Unrecognized shape at line $1, each line must start with one of: <code>default</code>, <code>rect</code>, <code>circle</code> or <code>poly</code>.\";'),('en','messages:imagemap_invalid_coord','s:55:\"Error: Invalid coordinate at line $1, must be a number.\";'),('en','messages:imagemap_invalid_desc','s:67:\"Error: Invalid desc specification, must be one of: <code>$1</code>.\";'),('en','messages:imagemap_description','s:16:\"About this image\";'),('en','messages:imagemap_desc_types','s:52:\"top-right, bottom-right, bottom-left, top-left, none\";'),('en','messages:imagemap_poly_odd','s:59:\"Error: Found poly with odd number of coordinates on line $1\";'),('en','messages:inputbox-desc','s:40:\"Allow inclusion of predefined HTML forms\";'),('en','messages:inputbox-error-no-type','s:55:\"You have not specified the type of input box to create.\";'),('en','messages:inputbox-error-bad-type','s:106:\"Input box type \"$1\" not recognized.\nPlease specify \"create\", \"comment\", \"search\", \"search2\" or \"fulltext\".\";'),('en','messages:inputbox-tryexact','s:15:\"Try exact match\";'),('en','messages:inputbox-searchfulltext','s:16:\"Search full text\";'),('en','messages:inputbox-createarticle','s:11:\"Create page\";'),('en','messages:inputbox-movearticle','s:9:\"Move page\";'),('en','messages:inputbox-postcomment','s:11:\"New section\";'),('en','messages:inputbox-postcommenttitle','s:11:\"New section\";'),('en','messages:inputbox-ns-main','s:4:\"Main\";'),('en','messages:interwiki','s:28:\"View and edit interwiki data\";'),('en','messages:interwiki-title-norights','s:19:\"View interwiki data\";'),('en','messages:interwiki-desc','s:78:\"Adds a [[Special:Interwiki|special page]] to view and edit the interwiki table\";'),('en','messages:interwiki_intro','s:252:\"This is an overview of the interwiki table, which defines the prefix shortcuts used to quickly link to different wikis and other external sites. For recommended use, please see [//www.mediawiki.org/wiki/Extension:Interwiki the manual on MediaWiki.org].\";'),('en','messages:interwiki-legend-label','s:6:\"Legend\";'),('en','messages:interwiki-legend','s:574:\"{| class=\"wikitable intro mw-interwikitable mw-interwiki-legend mw-collapsible mw-collapsed\"\n!colspan=3|{{int:interwiki-legend-label}}\n|-\n!{{int:interwiki_prefix}}\n|colspan=2|{{int:interwiki_prefix_intro}}\n|-\n!{{int:interwiki_url}}\n|colspan=2|{{int:interwiki_url_intro}}\n|-\n!rowspan=2|{{int:interwiki_local}}\n!{{int:interwiki_1}}\n|{{int:interwiki_local_1_intro}}\n|-\n!{{int:interwiki_0}}\n|{{int:interwiki_local_0_intro}}\n|-\n!rowspan=2|{{int:interwiki_trans}}\n!{{int:interwiki_1}}\n|{{int:interwiki_trans_1_intro}}\n|-\n!{{int:interwiki_0}}\n|{{int:interwiki_trans_0_intro}}\n|-\n|}\";'),('en','messages:interwiki_prefix','s:6:\"Prefix\";'),('en','messages:interwiki-prefix-label','s:7:\"Prefix:\";'),('en','messages:interwiki_prefix_intro','s:99:\"Interwiki prefix to be used in <code>[<nowiki />[prefix:<em>pagename</em>]]</code> wikitext syntax.\";'),('en','messages:interwiki_url','s:3:\"URL\";'),('en','messages:interwiki-url-label','s:4:\"URL:\";'),('en','messages:interwiki_url_intro','s:135:\"Template for URLs. The placeholder $1 will be replaced by the <em>pagename</em> in <code>[<nowiki />[prefix:<em>pagename</em>]]</code>.\";'),('en','messages:interwiki_local','s:7:\"Forward\";'),('en','messages:interwiki-local-label','s:8:\"Forward:\";'),('en','messages:interwiki_local_0_intro','s:127:\"External HTTP requests to the local wiki using this interwiki prefix in the URL will result in a \"{{int:badtitle}}\" error page.\";'),('en','messages:interwiki_local_1_intro','s:164:\"External HTTP requests to the local wiki using this interwiki prefix will be redirected to the target URL of the interwiki (i.e. treated like links to local pages).\";'),('en','messages:interwiki_trans','s:10:\"Transclude\";'),('en','messages:interwiki-trans-label','s:11:\"Transclude:\";'),('en','messages:interwiki_trans_1_intro','s:267:\"If wikitext syntax <code>{<nowiki />{prefix:<em>pagename</em>}}</code> is used, allow template/page transclusion from the foreign wiki if interwiki transclusions are enabled in general ([//www.mediawiki.org/wiki/