','messages:watchthis','s:22:\"Diese Seite beobachten\";'),('de','messages:savearticle','s:15:\"Seite speichern\";'),('de','messages:preview','s:8:\"Vorschau\";'),('de','messages:showpreview','s:15:\"Vorschau zeigen\";'),('de','messages:showdiff','s:18:\"nderungen zeigen\";'),('de','messages:blankarticle','s:155:\"<strong>Warnung:</strong> Die Seite, die du erstellst, ist leer.\nWenn du erneut auf {{int:savearticle}} klickst, wird die Seite ohne Inhalt erstellt.\";'),('de','messages:anoneditwarning','s:327:\"<strong>Warnung:</strong> Du bist nicht angemeldet. Deine IP-Adresse wird ffentlich sichtbar, falls du Bearbeitungen durchfhrst. Sofern du dich <strong>[$1 anmeldest]</strong> oder <strong>[$2 ein Benutzerkonto erstellst]</strong>, werden deine Bearbeitungen zusammen mit anderen Beitrgen deinem Benutzernamen zugeordnet.\";'),('de','messages:anonpreviewwarning','s:107:\"\'\'Du bist nicht angemeldet. Beim Speichern wird deine IP-Adresse in der Versionsgeschichte aufgezeichnet.\'\'\";'),('de','messages:missingsummary','s:164:\"\'\'\'Hinweis:\'\'\' Du hast keine Zusammenfassung angegeben. Wenn du erneut auf {{int:savearticle}} klickst, wird deine nderung ohne Zusammenfassung bernommen.\";'),('de','messages:selfredirect','s:261:\"<strong>Warnung:</strong> Du leitest auf diese Seite selbst weiter.\nDu hast vermutlich das falsche Weiterleitungsziel angegeben oder du bearbeitest die falsche Seite.\nWenn du erneut auf {{int:savearticle}} klickst, wird die Weiterleitung dennoch erstellt.\";'),('de','messages:missingcommenttext','s:36:\"Bitte gib unten einen Kommentar ein.\";'),('de','messages:missingcommentheader','s:168:\"\'\'\'Achtung:\'\'\' Du hast kein Betreff/berschrift eingegeben. Wenn du erneut auf {{int:savearticle}} klickst, wird deine Bearbeitung ohne berschrift gespeichert.\";'),('de','messages:summary-preview','s:35:\"Vorschau der Zusammenfassungszeile:\";'),('de','messages:subject-preview','s:35:\"Vorschau der Zusammenfassungszeile:\";'),('de','messages:previewerrortext','s:86:\"Beim Versuch, eine Vorschau deiner nderungen anzuzeigen, ist ein Fehler aufgetreten.\";'),('de','messages:blockedtitle','s:21:\"Benutzer ist gesperrt\";'),('de','messages:blockedtext','s:721:\"\'\'\'Dein Benutzername oder deine IP-Adresse wurde gesperrt.\'\'\'\n\nDie Sperrung wurde vom Administrator $1 durchgefhrt.\nAls Grund wurde \'\'$2\'\' angegeben.\n\n* Beginn der Sperre: $8\n* Ende der Sperre: $6\n* Sperre betrifft: $7\n\nDu kannst $1 oder einen der anderen [[{{MediaWiki:Grouppage-sysop}}|Administratoren]] kontaktieren, um ber die Sperre zu diskutieren.\nDu kannst die E-Mail an diesen Benutzer-Funktion nicht nutzen, solange keine gltige E-Mail-Adresse in deinen [[Special:Preferences|Benutzerkonto-Einstellungen]] eingetragen ist oder diese Funktion fr dich gesperrt wurde.\nDeine aktuelle IP-Adresse ist $3 und die Sperrkennung lautet $5.\nBitte fge alle Informationen jeder Anfrage hinzu, die du stellst.\";'),('de','messages:autoblockedtext','s:722:\"Deine IP-Adresse wurde automatisch gesperrt, da sie von einem anderen Benutzer genutzt wurde, der von $1 gesperrt wurde.\nAls Grund wurde angegeben:\n\n:\'\'$2\'\'\n\n* Beginn der Sperre: $8\n* Ende der Sperre: $6\n* Sperre betrifft: $7\n\nDu kannst $1 oder einen der anderen [[{{MediaWiki:Grouppage-sysop}}|Administratoren]] kontaktieren, um ber die Sperre zu diskutieren.\n\nDu kannst die E-Mail an diesen Benutzer-Funktion nicht nutzen, solange keine gltige E-Mail-Adresse in deinen [[Special:Preferences|Benutzerkonto-Einstellungen]] eingetragen ist oder diese Funktion fr dich gesperrt wurde.\n\nDeine aktuelle IP-Adresse ist $3, und die Sperr-ID ist $5.\nBitte fge alle Informationen jeder Anfrage hinzu, die du stellst.\";'),('de','messages:blockednoreason','s:27:\"keine Begrndung angegeben\";'),('de','messages:whitelistedittext','s:50:\"Du musst dich $1, um Seiten bearbeiten zu knnen.\";'),('de','messages:confirmedittext','s:180:\"Du musst deine E-Mail-Adresse erst besttigen, bevor du Bearbeitungen durchfhren kannst. Bitte ergnze und besttige deine E-Mail in den [[Special:Preferences|Einstellungen]].\";'),('de','messages:nosuchsectiontitle','s:24:\"Abschnitt nicht gefunden\";'),('de','messages:nosuchsectiontext','s:154:\"Du hast versucht, einen Abschnitt zu bearbeiten, der nicht existiert.\nVermutlich wurde er verschoben oder gelscht, nachdem du die Seite aufgerufen hast.\";'),('de','messages:loginreqtitle','s:22:\"Anmeldung erforderlich\";'),('de','messages:loginreqlink','s:8:\"anmelden\";'),('de','messages:loginreqpagetext','s:45:\"Du musst dich $1, um Seiten lesen zu knnen.\";'),('de','messages:accmailtitle','s:25:\"Passwort wurde verschickt\";'),('de','messages:accmailtext','s:188:\"Ein zufllig generiertes Passwort fr [[User talk:$1|$1]] wurde an $2 versandt. Es kann auf der Seite \'\'[[Special:ChangePassword|Passwort ndern]]\'\' nach der Anmeldung gendert werden.\";'),('de','messages:newarticle','s:5:\"(Neu)\";'),('de','messages:newarticletext','s:302:\"Du bist einem Link zu einer Seite gefolgt, die nicht vorhanden ist.\nUm diese Seite anzulegen, trage deinen Text in das untenstehende Bearbeitungsfeld ein (weitere Informationen auf der [$1 Hilfeseite]).\nSofern du flschlicherweise hier bist, klicke auf die Schaltflche \'\'\'Zurck\'\'\' deines Browsers.\";'),('de','messages:anontalkpagetext','s:583:\"----\'\'Diese Seite dient dazu, einem nicht angemeldeten Benutzer Nachrichten zu hinterlassen. Es wird seine IP-Adresse zur Identifizierung verwendet. IP-Adressen knnen von mehreren Benutzern gemeinsam verwendet werden. Wenn du mit den Kommentaren auf dieser Seite nichts anfangen kannst, richten sie sich vermutlich an einen frheren Inhaber deiner IP-Adresse und du kannst sie ignorieren. Du kannst dir auch ein [[Special:UserLogin/signup|Benutzerkonto erstellen]] oder dich [[Special:UserLogin|anmelden]], um knftig Verwechslungen mit anderen anonymen Benutzern zu vermeiden.\'\'\";'),('de','messages:noarticletext','s:349:\"Diese Seite enthlt momentan noch keinen Text.\nDu kannst sie <span class=\"plainlinks\">[{{fullurl:{{FULLPAGENAME}}|action=edit}} bearbeiten]</span>,\nihren Titel auf anderen Seiten [[Special:Search/{{PAGENAME}}|suchen]]\noder die zugehrigen <span class=\"plainlinks\">[{{fullurl:{{#special:Log}}|page={{FULLPAGENAMEE}}}} Logbcher betrachten]</span>.\";'),('de','messages:noarticletext-nopermission','s:323:\"Diese Seite enthlt momentan noch keinen Text und du bist auch nicht dazu berechtigt, diese Seite zu erstellen.\nDu kannst ihren Titel auf anderen Seiten [[Special:Search/{{PAGENAME}}|suchen]] oder die zugehrigen <span class=\"plainlinks\">[{{fullurl:{{#special:Log}}|page={{FULLPAGENAMEE}}}} Logbcher betrachten].</span>\";'),('de','messages:missing-revision','s:328:\"Die Version $1 der Seite namens {{FULLPAGENAME}} ist nicht vorhanden.\n\nDieser Fehler wird normalerweise von einem veralteten Link zur Versionsgeschichte einer Seite verursacht, die zwischenzeitlich gelscht wurde.\nEinzelheiten sind im [{{fullurl:{{#Special:Log}}/delete|page={{FULLPAGENAMEE}}}} Lsch-Logbuch] einsehbar.\";'),('de','messages:userpage-userdoesnotexist','s:134:\"Das Benutzerkonto <nowiki>$1</nowiki> ist nicht vorhanden. Bitte prfe, ob du diese Seite wirklich erstellen/bearbeiten willst.\";'),('de','messages:userpage-userdoesnotexist-view','s:47:\"Das Benutzerkonto $1 ist nicht vorhanden.\";'),('de','messages:blocked-notice-logextract','s:142:\"{{GENDER:$1|Dieser Benutzer|Diese Benutzerin}} ist zurzeit gesperrt.\nZur Information folgt ein aktueller Auszug aus dem Benutzersperr-Logbuch:\";'),('de','messages:clearyourcache','s:594:\"\'\'\'Hinweis:\'\'\' Leere nach dem Speichern den Browser-Cache, um die nderungen sehen zu knnen.\n* \'\'\'Firefox/Safari:\'\'\' \'\'Umschalttaste\'\' drcken und gleichzeitig \'\'Aktualisieren\'\' anklicken oder entweder \'\'Strg+F5\'\' oder \'\'Strg+R\'\' (\'\'+R\'\' auf dem Mac) drcken\n* \'\'\'Google Chrome:\'\'\' \'\'Umschalttaste+Strg+R\'\' (\'\'+Umschalttaste+R\'\' auf dem Mac) drcken\n* \'\'\'Internet Explorer:\'\'\' \'\'Strg+F5\'\' drcken oder \'\'Strg\'\' drcken und gleichzeitig \'\'Aktualisieren\'\' anklicken\n* \'\'\'Opera:\'\'\' \'\'Extras  Internetspuren lschen   Individuelle Auswahl  Den kompletten Cache lschen\'\'\";'),('de','messages:usercssyoucanpreview','s:104:\"\'\'\'Tipp:\'\'\' Benutze den {{int:showpreview}}-Button, um dein neues CSS vor dem Speichern zu testen.\";'),('de','messages:userjsyoucanpreview','s:111:\"\'\'\'Tipp:\'\'\' Benutze den {{int:showpreview}}-Button, um dein neues JavaScript vor dem Speichern zu testen.\";'),('de','messages:usercsspreview','s:112:\"\'\'\'Beachte, dass du nur eine Vorschau deines Benutzer-CSS betrachtest.\'\'\'\n\'\'\'Es wurde noch nicht gespeichert!\'\'\'\";'),('de','messages:userjspreview','s:120:\"\'\'\'Beachte, dass du nur eine Vorschau deines Benutzer-JavaScripts betrachtest.\'\'\'\n\'\'\'Es wurde noch nicht gespeichert!\'\'\'\";'),('de','messages:sitecsspreview','s:103:\"\'\'\'Beachte, dass du nur eine Vorschau dieses CSS betrachtest.\'\'\'\n\'\'\'Es wurde noch nicht gespeichert!\'\'\'\";'),('de','messages:sitejspreview','s:110:\"\'\'\'Beachte, dass du nur eine Vorschau dieses JavaScript betrachtest.\'\'\'\n\'\'\'Es wurde noch nicht gespeichert!\'\'\'\";'),('de','messages:userinvalidcssjstitle','s:274:\"\'\'\'Achtung:\'\'\' Die Benutzeroberflche $1 existiert nicht. Bedenke, dass benutzerspezifische .css- und .js-Seiten mit einem Kleinbuchstaben anfangen mssen, also beispielsweise \'\'{{ns:user}}:Mustermann/vector.css\'\' an Stelle von \'\'{{ns:user}}:Mustermann/Vector.css\'\'.\";'),('de','messages:updated','s:11:\"(Gendert)\";'),('de','messages:note','s:14:\"\'\'\'Hinweis:\'\'\'\";'),('de','messages:previewnote','s:73:\"\'\'\'Dies ist nur eine Vorschau.\'\'\'\nDie Seite wurde noch nicht gespeichert!\";'),('de','messages:continue-editing','s:26:\"Zum Bearbeitungsfeld gehen\";'),('de','messages:previewconflict','s:114:\"Diese Vorschau gibt den Inhalt des oberen Textfeldes wieder. So wird die Seite aussehen, wenn du jetzt speicherst.\";'),('de','messages:session_fail_preview','s:305:\"\'\'\'Deine Bearbeitung konnte nicht gespeichert werden, da Sitzungsdaten verloren gegangen sind.\nBitte versuche es erneut, indem du unter der folgenden Textvorschau nochmals auf Seite speichern klickst.\nSollte das Problem bestehen bleiben, [[Special:UserLogout|melde dich ab]] und danach wieder an.\'\'\'\";'),('de','messages:session_fail_preview_html','s:450:\"\'\'\'Deine Bearbeitung konnte nicht gespeichert werden, da Sitzungsdaten verloren gegangen sind.\'\'\'\n\n\'\'Da in {{SITENAME}} das Speichern von reinem HTML aktiviert ist, wurde die Vorschau ausgeblendet, um JavaScript-Attacken vorzubeugen.\'\'\n\n\'\'\'Bitte versuche es erneut, indem du unter der folgenden Textvorschau nochmals auf Seite speichern klickst.\nSollte das Problem bestehen bleiben, [[Special:UserLogout|melde dich ab]] und danach wieder an.\'\'\'\";'),('de','messages:token_suffix_mismatch','s:260:\"\'\'\'Deine Bearbeitung wurde zurckgewiesen, da dein Browser Zeichen im Bearbeiten-Token verstmmelt hat.\nEine Speicherung kann den Seiteninhalt zerstren. Dies geschieht bisweilen durch die Benutzung eines anonymen Proxy-Dienstes, der fehlerhaft arbeitet.\'\'\'\";'),('de','messages:edit_form_incomplete','s:164:\"\'\'\'Der Inhalt des Bearbeitungsformulars hat den Server nicht vollstndig erreicht. Bitte prfe deine Bearbeitungen auf Vollstndigkeit und versuche es erneut.\'\'\'\";'),('de','messages:editing','s:23:\"Bearbeiten von $1\";'),('de','messages:creating','s:22:\"Erstellen von $1\";'),('de','messages:editingsection','s:35:\"Bearbeiten von $1 (Abschnitt)\";'),('de','messages:editingcomment','s:41:\"Bearbeiten von $1 (Neuer Abschnitt)\";'),('de','messages:editconflict','s:24:\"Bearbeitungskonflikt: $1\";'),('de','messages:explainconflict','s:371:\"Jemand anders hat diese Seite gendert, nachdem du angefangen hast, sie zu bearbeiten.\nDas obere Textfeld enthlt den aktuellen Bearbeitungsstand der Seite.\nDas untere Textf