e Umbenennung rckgngig machen kannst, sofern du einen Fehler gemacht hast. Du kannst hingegen keine existierende Seite berschreiben.\n\n\'\'\'Warnung!\'\'\'\nDie Verschiebung kann weitreichende und unerwartete Folgen fr hufig besuchte Seiten haben.\nDu solltest daher die Konsequenzen verstanden haben, bevor du jetzt fortfhrst.\";'),('de','messages:movepagetext-noredirectfixer','s:944:\"Mit untenstehendem Formular kannst du eine Seite umbenennen, indem du sie mitsamt allen Versionen auf einen neuen Titel verschiebst.\nDer alte Titel wird danach zum neuen weiterleiten.\nStelle sicher, dass du im Anschluss alle [[Special:DoubleRedirects|doppelten]] oder [[Special:BrokenRedirects|defekten Weiterleitungen]] berprfst.\nDu bist dafr verantwortlich, dass Links weiterhin auf das korrekte Ziel verweisen.\n\nDie Seite wird \'\'\'nicht\'\'\' verschoben, sofern es bereits eine Seite mit dem vorgesehenen Titel gibt, es sei denn, diese ist eine Weiterleitung ohne Versionsgeschichte.\nDies bedeutet, dass du die Umbenennung rckgngig machen kannst, sofern du einen Fehler gemacht hast. Du kannst hingegen keine existierende Seite berschreiben.\n\n\'\'\'Warnung!\'\'\'\nDie Verschiebung kann weitreichende und unerwartete Folgen fr hufig besuchte Seiten haben.\nDu solltest daher die Konsequenzen verstanden haben, bevor du jetzt fortfhrst.\";'),('de','messages:movepagetalktext','s:418:\"Die dazugehrige Diskussionsseite wird, sofern vorhanden, mitverschoben, \'\'\'es sei denn:\'\'\'\n*Es existiert bereits eine Diskussionsseite mit diesem Namen, oder\n*du whlst die unten stehende Option ab.\n\nIn diesen Fllen musst du, falls gewnscht, den Inhalt der Seite von Hand verschieben oder zusammenfhren.\n\nBitte den \'\'\'neuen\'\'\' Titel unter \'\'\'Ziel\'\'\' eintragen, darunter die Umbenennung bitte \'\'\'begrnden.\'\'\'\";'),('de','messages:movearticle','s:18:\"Seite verschieben:\";'),('de','messages:moveuserpage-warning','s:172:\"\'\'\'Warnung:\'\'\' Du bist dabei, eine Benutzerseite zu versch