ert, dass du deine E-Mail-Adresse besttigst (authentifizieren), bevor du die erweiterten E-Mail-Funktionen benutzen kannst. Klicke bitte auf die unten stehende, mit Besttigungscode zuschicken beschriftete Schaltflche, damit eine automatisch erstellte E-Mail an die angegebene Adresse geschickt wird. Diese E-Mail enthlt eine Web-Adresse mit einem Besttigungscode. Indem du diese Webseite in deinem Webbrowser ffnest, besttigst du, dass die angegebene E-Mail-Adresse korrekt und gltig ist.\";'),('de','messages:confirmemail_pending','s:212:\"Es wurde dir bereits ein Besttigungscode per E-Mail zugeschickt.\nWenn du dein Benutzerkonto erst vor kurzem erstellt hast, warte bitte noch ein paar Minuten auf die E-Mail, bevor du einen neuen Code anforderst.\";'),('de','messages:confirmemail_send','s:28:\"Besttigungscode zuschicken\";'),('de','messages:confirmemail_sent','s:42:\"Die Besttigungs-E-Mail wurde verschickt.\";'),('de','messages:confirmemail_oncreate','s:198:\"Ein Besttigungs-Code wurde an deine E-Mail-Adresse gesandt. Dieser Code wird fr die Anmeldung nicht bentigt, jedoch wird er zur Aktivierung der E-Mail-Funktionen innerhalb des Wikis gebraucht.\";'),('de','messages:confirmemail_sendfailed','s:159:\"{{SITENAME}} konnte die Besttigungs-E-Mail nicht an dich versenden.\nBitte prfe die E-Mail-Adresse auf ungltige Zeichen.\n\nRckmeldung des Mailservers: $1\";'),('de','messages:confirmemail_invalid','s:138:\"Ungltiger Besttigungscode. Mglicherweise ist der Besttigungszeitraum verstrichen. Versuche bitte, die Besttigung zu wiederholen.\";'),('de','messages:confirmemail_needlogin','s:57:\"Du musst dich $1, um deine E-Mail-Adresse zu besttigen.\";'),('de','messages:confirmemail_success','s:103:\"Deine E-Mail-Adresse wurde erfolgreich besttigt. Du kannst dich jetzt [[Special:UserLogin|anmelden]].\";'),('de','messages:confirmemail_loggedin','s:50:\"Deine E-Mail-Adresse wurde erfolgreich besttigt.\";'),('de','messages:confirmemail_subject','s:46:\"[{{SITENAME}}] Besttigung der E-Mail-Adresse\";'),('de','messages:confirmemail_body','s:534:\"Hallo,\n\njemand mit der IP-Adresse $1, wahrscheinlich du selbst, hat das Benutzerkonto $2 bei {{SITENAME}} registriert.\n\nUm die E-Mail-Funktionen von {{SITENAME}} (wieder) zu aktivieren und um zu besttigen,\ndass dieses Benutzerkonto wirklich zu deiner E-Mail-Adresse und damit zu dir gehrt, ffne bitte folgenden Link in deinem Browser:\n\n$3\n\nWenn du das genannte Benutzerkonto *nicht* registriert hast, folge diesem Link, um den Besttigungsprozess abzubrechen:\n\n$5\n\nDieser Besttigungscode ist gltig bis zum $6, $7 Uhr.\";'),('de','messages:confirmemail_body_changed','s:470:\"Jemand mit der IP-Adresse $1, wahrscheinlich du selbst,\nhat die E-Mail-Adresse des Benutzerkontos $2 zu dieser Adresse bei {{SITENAME}} gendert.\n\nUm zu besttigen, dass dieses Benutzerkonto wirklich dir gehrt,\nund um die E-Mail-Features bei {{SITENAME}} zu reaktivieren, ffne diesen Link in deinem Browser:\n\n$3\n\nFalls das Konto *nicht* dir gehrt, folge diesem Link,\num die E-Mail-Besttigung abzubrechen:\n\n$5\n\nDieser Besttigungscode ist gltig bis $4.\";'),('de','messages:confirmemail_body_set','s:528:\"Jemand mit der IP-Adresse $1, wahrscheinlich du selbst,\nhat die E-Mail-Adresse des Benutzerkontos $2 auf {{SITENAME}} zu dieser E-Mail-Adresse abgendert.\n\nUm zu besttigen, dass dieses Benutzerkonto wirklich zu dir gehrt\nund um die E-Mail-Funktionen auf {{SITENAME}} zu aktivieren, ffne bitte den folgenden Link in deinem Browser:\n\n$3\n\nFalls das Konto *nicht* zu dir gehrt, bitte den nachfolgenden Link ffnen,\num die Besttigung der E-Mail-Adresse abzubrechen:\n\n$5\n\nDieser Besttigungscode ist gltig bis $4.\";'),('de','messages:confirmemail_invalidated','s:48:\"Die E-Mail-Adressbesttigung wurde abgebrochen.\";'),('de','messages:invalidateemail','s:35:\"E-Mail-Adressbesttigung abbrechen\";'),('de','messages:scarytranscludedisabled','s:38:\"[Interwiki-Einbindung ist deaktiviert]\";'),('de','messages:scarytranscludefailed','s:44:\"[Vorlageneinbindung fr $1 ist gescheitert]\";'),('de','messages:scarytranscludefailed-httpstatus','s:48:\"[Vorlagenabruf fehlgeschlagen fr $1: HTTP  $2]\";'),('de','messages:scarytranscludetoolong','s:17:\"[URL ist zu lang]\";'),('de','messages:deletedwhileediting','s:262:\"Achtung: Diese Seite wurde gelscht, nachdem du angefangen hast, sie zu bearbeiten!\nIm [{{fullurl:{{#special:Log}}|type=delete&page={{FULLPAGENAMEE}}}} Lsch-Logbuch] findest du den Grund fr die Lschung. Wenn du die Seite speicherst, wird sie neu angelegt.\";'),('de','messages:confirmrecreate','s:231:\"Benutzer [[User:$1|$1]] ([[User talk:$1|Diskussion]]) hat diese Seite gelscht, nachdem du angefangen hast, sie zu bearbeiten. Die Begrndung lautete:\n:\'\'$2\'\'\nBitte besttige, dass du diese Seite wirklich neu erstellen mchten.\";'),('de','messages:confirmrecreate-noreason','s:200:\"Benutzer [[User:$1|$1 ]] ([[User talk:$1|Diskussion]]) hat diese Seite gelscht, nachdem du mit der Bearbeitung begonnen hast. Bitte besttige, dass du die Seite wirklich erneut erstellen mchtest.\";'),('de','messages:recreate','s:13:\"Neu erstellen\";'),('de','messages:confirm_purge_button','s:2:\"OK\";'),('de','messages:confirm-purge-top','s:42:\"Diese Seite aus dem Server-Cache lschen?\";'),('de','messages:confirm-purge-bottom','s:75:\"Leert den Cache einer Seite und erzwingt die Anzeige der aktuellen Version.\";'),('de','messages:confirm-watch-button','s:2:\"OK\";'),('de','messages:confirm-watch-top','s:60:\"Diese Seite zur persnlichen Beobachtungsliste hinzufgen?\";'),('de','messages:confirm-unwatch-button','s:2:\"OK\";'),('de','messages:confirm-unwatch-top','s:62:\"Diese Seite von der persnlichen Beobachtungsliste entfernen?\";'),('de','messages:ellipsis','s:3:\"\";'),('de','messages:percent','s:9:\"$1&#160;%\";'),('de','messages:quotation-marks','s:8:\"$1\";'),('de','messages:imgmultipageprev','s:19:\" vorherige Seite\";'),('de','messages:imgmultipagenext','s:18:\"nchste Seite \";'),('de','messages:imgmu