messages:pagelang-use-default','s:25:\"Standardsprache verwenden\";'),('de','messages:pagelang-select-lang','s:18:\"Sprache auswhlen\";'),('de','messages:right-pagelang','s:21:\"Seitensprache ndern\";'),('de','messages:action-pagelang','s:28:\"die Seitensprache zu ndern\";'),('de','messages:log-name-pagelang','s:26:\"Sprachennderungs-Logbuch\";'),('de','messages:log-description-pagelang','s:55:\"Dies ist ein Logbuch mit nderungen an Seitensprachen.\";'),('de','messages:logentry-pagelang-pagelang','s:67:\"$1 {{GENDER:$2|nderte}} die Seitensprache fr $3 von $4 nach $5.\";'),('de','messages:default-skin-not-found','s:2170:\"Hoppla! Die mit <code>$wgDefaultSkin</code> als <code>$1</code>&nbsp;fr dein Wiki definierte Standardbenutzeroberflche ist nicht verfgbar.\n\n{{PLURAL:$4|Die folgende Benutzeroberflche scheint|Die folgenden Benutzeroberflchen scheinen}} vorhanden zu sein:\n\n$2\n\nSiehe hierzu das [https://www.mediawiki.org/wiki/Manual:Skin_configuration/de Benutzerhandbuch zur Konfiguration von Benutzeroberflchen].\n\n; Sofern du MediaWiki gerade installiert hast\n: Du hast MediaWiki vermutlich mit Hilfe von Git oder den Quellcode direkt anhand einer anderen Methode installiert. Das aktuelle Problem war deshalb zu erwarten. Installiere zumindest eine im [https://www.mediawiki.org/wiki/Category:All_skins Verzeichnis der Benutzeroberflchen] enthaltene Benutzeroberflche indem du:\n:* [https://www.mediawiki.org/wiki/Download_from_Git#Using_Git_to_download_MediaWiki_skins Git zum Herunterladen von Benutzeroberflchen verwendest].\n:* die Dateiverffentlichungen einzelner Benutzeroberflchen aus [https://www.mediawiki.org/wiki/Special:SkinDistributor MediaWiki.org] herunterldst und in das Verzeichnis <code dir=\"ltr\">skins/</code> deiner MediaWiki-Installation kopierst,\n:* die [https://www.mediawiki.org/wiki/Download/de Dateiverffentlichung von MediaWiki] herunterldst, die verschiedene Benutzeroberflchen sowie Erweiterungen enthlt. Du kannst das dort enthaltene Verzeichnis <code>skins/</code> Verzeichnis nutzen und in das Verzeichnis <code dir=\"ltr\">skins/</code> deiner MediaWiki-Installation kopieren.\n\n; Sofern du MediaWiki gerade aktualisiert hast\n: Bei MediaWiki 1.24 und neueren Versionen werden die installierten Benutzeroberflchen nicht mehr automatisch aktiviert (siehe das [https://www.mediawiki.org/wiki/Manual:Skin_autodiscovery Benutzerhandbuch]). Du kannst die {{PLURAL:$5|folgende Zeile|folgenden Zeilen}} in die Datei <code>LocalSettings.php</code> einfgen, um {{PLURAL:$5|die installierte Benutzeroberflche|alle installierten Benutzeroberflchen}} zu aktivieren:\n\n<pre dir=\"ltr\">$3</pre>\n\n; Falls du gerade die Datei <code>LocalSettings.php</code> gendert hast\n: berprfe die Namen der Benutzeroberflchen auf Tippfehler.\";'),('de','messages:default-skin-not-found-no-skins','s:1564:\"Hoppla! Die mit <code>$wgDefaultSkin</code> als <code>$1</code>&nbsp;fr dein Wiki definierte Standardbenutzeroberflche ist nicht verfgbar.\n\nDu hast keine Benutzeroberflche installiert.\n\n; Sofern du MediaWiki gerade installiert oder aktualisiert hast\n: Du hast MediaWiki vermutlich mit Hilfe von Git oder den Quellcode direkt anhand einer anderen Methode installiert. Das aktuelle Problem war deshalb zu erwarten, da MediaWiki 1.24 und neuere Versionen keine Benutzeroberflchen im Hauptrepositorium enthalten. Installiere zumindest eine im [https://www.mediawiki.org/wiki/Category:All_skins Verzeichnis der Benutzeroberflchen] enthaltene Benutzeroberflche indem du:\n:* [https://www.mediawiki.org/wiki/Download_from_Git#Using_Git_to_download_MediaWiki_skins Git zum Herunterladen von Benutzeroberflchen verwendest].\n:* die Dateiverffentlichungen einzelner Benutzeroberflchen aus [https://www.mediawiki.org/wiki/Special:SkinDistributor MediaWiki.org] herunterldst und in das Verzeichnis <code dir=\"ltr\">skins/</code> deiner MediaWiki-Installation kopierst,\n:* die [https://www.mediawiki.org/wiki/Download/de Dateiverffentlichung von MediaWiki] herunterldst, die verschiedene Benutzeroberflchen sowie Erweiterungen enthlt. Du kannst das dort enthaltene Verzeichnis <code>skins/</code> Verzeichnis nutzen und in das Verzeichnis <code dir=\"ltr\">skins/</code> deiner MediaWiki-Installation kopieren.\n: Siehe hierzu das [https://www.mediawiki.org/wiki/Manual:Skin_configuration/de Benutzerhandbuch zur Konfiguration von Benutzeroberflchen].\";'),('de','messages:default-skin-not-found-row-enabled','s:34:\"* <code>$1</code> / $2 (aktiviert)\";'),('de','messages:default-skin-not-found-row-disabled','s:42:\"* <code>$1</code> / $2 (\'\'\'deaktiviert\'\'\')\";'),('de','messages:mediastatistics','s:17:\"Medienstatistiken\";'),('de','messages:mediastatistics-summary','s:155:\"Statistiken ber hochgeladene Dateitypen. Dies beinhaltet nur die aktuellste Version einer Datei. Alte oder gelschte Dateiversionen sind ausgeschlossen.\";'),('de','messages:mediastatistics-nfiles','s:9:\"$1 ($2 %)\";'),('de','messages:mediastatistics-nbytes','s:42:\"{{PLURAL:$1|Ein Byte|$1 Bytes}} ($2; $3 %)\";'),('de','messages:mediastatistics-table-mimetype','s:8:\"MIME-Typ\";'),('de','messages:mediastatistics-table-extensions','s:23:\"Mgliche Erweiterungen\";'),('de','messages:mediastatistics-table-count','s:18:\"Anzahl der Dateien\";'),('de','messages:mediastatistics-table-totalbytes','s:13:\"Gesamtgre\";'),('de','messages:mediastatistics-header-unknown','s:9:\"Unbekannt\";'),('de','messages:mediastatistics-header-bitmap','s:13:\"Bitmap-Bilder\";'),('de','messages:mediastatistics-header-drawing','s:26:\"Zeichnungen (Vektorbilder)\";'),('de','messages:mediastatistics-header-audio','s:5:\"Audio\";'),('de','messages:mediastatistics-header-video','s:6:\"Videos\";'),('de','messages:mediastatistics-header-multimedia','s:10:\"Rich Media\";'),('de','messages:mediastatistics-header-office','s:6:\"Office\";'),('de','messages:mediastatistics-header-text','s:4:\"Text\";'),('de','messages:mediastatistics-header-executable','s:20:\"Ausfhrbare Dateien\";'),('de','messa