, um ber Aktualisierungen informiert zu werden.\n\n<strong>Fehlerhafte Anfragen:</strong> Wenn fehlerhafte Anfragen an die API gesendet werden, wird ein HTTP-Header mit dem Schlssel MediaWiki-API-Error gesendet. Der Wert des Headers und der Fehlercode werden auf den gleichen Wert gesetzt. Fr weitere Informationen siehe [[mw:API:Errors_and_warnings|API: Fehler und Warnungen]].\";'),('de','messages:apihelp-main-param-action','s:22:\"Auszufhrende Aktion.\";'),('de','messages:apihelp-main-param-format','s:19:\"Format der Ausgabe.\";'),('de','messages:apihelp-main-param-maxlag','s:538:\"maxlag kann verwendet werden, wenn MediaWiki auf einem datenbankreplizierten Cluster installiert ist. Um weitere Replikationsrckstnde zu verhindern, lsst dieser Parameter den Client warten, bis der Replikationsrckstand kleiner als der angegebene Wert (in Sekunden) ist. Bei einem grerem Rckstand wird der Fehlercode <samp>maxlag</samp> zurckgegeben mit einer Nachricht wie <samp>Waiting for $host: $lag seconds lagged</samp>.<br />Siehe [[mw:Manual:Maxlag_parameter|Handbuch: Maxlag parameter]] fr weitere Informationen.\";'),('de','messages:apihelp-main-param-smaxage','s:119:\"Den <code>s-maxage</code>-HTTP-Cache-Control-Header auf diese Anzahl Sekunden festlegen. Fehler werden niemals gecacht.\";'),('de','messages:apihelp-main-param-maxage','s:118:\"Den <code>max-age</code>-HTTP-Cache-Control-Header auf diese Anzahl Sekunden festlegen. Fehler werden niemals gecacht.\";'),('de','messages:apihelp-main-param-assert','s:129:\"Sicherstellen, dass der Benutzer eingeloggt ist, wenn auf <kbd>user</kbd> gesetzt, oder Bot ist, wenn auf <kbd>bot</kbd> gesetzt.\";'),('de','messages:apihelp-main-param-requestid','s:114:\"Der angegebene Wert wird mit in die Antwort aufgenommen und kann zur Unterscheidung von Anfragen verwendet werden.\";'),('de','messages:apihelp-main-param-servedby','s:47:\"Namen des bearbeitenden Hosts mit zurckgeben.\";'),('de','messages:apihelp-main-param-curtimestamp','s:39:\"Aktuellen Zeitstempel mit zurckgeben.\";'),('de','messages:apihelp-main-param-origin','s:735:\"Beim Zugriff auf die API mittels Cross-Domain-AJAX-Anfrage (CORS) ist dieser Parameter auf die veranlassende Domain zu setzen. Er muss in jedem Pre-Flight-Request angegeben werden und deshalb ein Teil der Anfrage-URI sein (nicht des POST-Bodys). Er muss genau einer der Angaben im <code>Origin</code>-Header entsprechen, d.&nbsp;h. er muss auf etwas wie <kbd>https://de.wikipedia.org</kbd> oder <kbd>https://meta.wikimedia.org</kbd> gesetzt werden. Falls dieser Parameter nicht mit dem <code>Origin</code>-Header bereinstimmt, wird eine 403-Antwort zurckgegeben. Falls dieser Parameter dem <code>Origin</code>-Header entspricht und die Domain auf der Whitelist ist, wird ein <code>Access-Control-Allow-Origin</code>-Header gesetzt.\";'),('de','messages:apihelp-main-param-uselang','s:355:\"Zu verwendende Sprache fr Nachrichtenbersetzungen. Eine Liste der Codes kann von <kbd>[[Special:ApiHelp/query+siteinfo|action=query&meta=siteinfo]]</kbd> mit <kbd>siprop=languages</kbd> abgerufen werden. Gib <kbd>user</kbd> zum Verwenden der aktuellen Benutzerspracheinstellung oder <kbd>content</kbd> an, um die Inhaltssprache des Wikis zu verwenden.\";'),('de','messages:apihelp-block-description','s:23:\"Einen Benutzer sperren.\";'),('de','messages:apihelp-block-param-user','s:67:\"Benutzername, IP-Adresse oder IP-Bereich, der gesperrt werden soll.\";'),('de','messages:apihelp-block-param-expiry','s:255:\"Sperrdauer. Kann relativ (z.&nbsp;B. <kbd>5 months</kbd> oder <kbd>2 weeks</kbd>) oder absolut (z.&nbsp;B. <kbd>2014-09-18T12:34:56Z</kbd>) sein. Wenn auf <kbd>infinite</kbd>, <kbd>indefinite</kbd> oder <kbd>never</kbd> gesetzt, ist die Sperre unbegrenzt.\";'),('de','messages:apihelp-block-param-reason','s:17:\"Sperrbegrndung.\";'),('de','messages:apihelp-block-param-anononly','s:91:\"Nur anonyme Benutzer sperren (z.&nbsp;B. anonyme Bearbeitungen fr diese IP deaktivieren).\";'),('de','messages:apihelp-block-param-nocreate','s:36:\"Benutzerkontenerstellung verhindern.\";'),('de','messages:apihelp-block-param-autoblock','s:122:\"Die zuletzt verwendete IP-Adresse automatisch sperren und alle darauffolgenden IP-Adressen, die versuchen sich anzumelden.\";'),('de','messages:apihelp-block-param-noemail','s:105:\"Benutzer davon abhalten, E-Mails auf dem Wiki zu versenden (erfordert das <code>blockemail</code>-Recht).\";'),('de','messages:apihelp-block-param-hidename','s:90:\"Den Benutzernamen im Sperr-Logbuch verstecken (erfordert das <code>hideuser</code>-Recht).\";'),('de','messages:apihelp-block-param-allowusertalk','s:150:\"Dem Benutzer erlauben, seine eigene Diskussionsseite zu bearbeiten (abhngig von <var>[[mw:Manual:$wgBlockAllowsUTEdit|$wgBlockAllowsUTEdit]]</var>).\";'),('de','messages:apihelp-block-param-reblock','s:78:\"Falls der Benutzer bereits gesperrt ist, die vorhandene Sperre berschreiben.\";'),('de','messages:apihelp-block-param-watchuser','s:77:\"Benutzer- und Diskussionsseiten des Benutzers oder der IP-Adresse beobachten.\";'),('de','messages:apihelp-block-example-ip-simple','s:104:\"IP <kbd>192.0.2.5</kbd> fr drei Tage mit der Begrndung First strike (erste Verwarnung) sperren\";'),('de','messages:apihelp-block-example-user-complex','s:169:\"Benutzer <kbd>Vandal</kbd> unbeschrnkt sperren mit der Begrndung Vandalism (Vandalismus), Erstellung neuer Benutzerkonten sowie Versand von E-Mails verhindern.\";'),('de','messages:apihelp-checktoken-description','s:127:\"berprft die Gltigkeit eines ber <kbd>[[Special:ApiHelp/query+tokens|action=query&meta=tokens]]</kbd> erhaltenen Tokens.\";'),('de','messages:apihelp-checktoken-param-type','s:41:\"Typ des Tokens, das getestet werden soll.\";'),('de','messages:apihelp-checktoken-param-token','s:32:\"Token, das getestet werden soll.\";'),('de','messages:apihelp-checktoken-param-maxtokenage','s:47:\"Maximal erlaubtes Alter des Tokens in Sekunden.\";'),('de','messages:apihelp-checktoken-example-simple','s:55:\"berprft die Gltigkeit des <kbd>csrf</kbd>-Tokens.\";'),('de','messages:apihelp-clearhasmsg-description','s:96:\"Lschen des <code>hasmsg</code>-Flags (hat Nachrichten-Flag) fr den aktuellen Benutzer.\";'),('de','messages:apihelp-clearhasmsg-example-1','s:62:\"<code>hasmsg</code>-Flags fr den aktuellen Benutzer lschen\";'),('de','messages:apihelp-compare-description','s:161:\"Abrufen des Unterschieds zwischen zwei Seiten.\n\nDu musst eine Versionsnummer, einen Seitentitel oder eine Seitennummer fr from als auch to angeben.\";'),('de','messages:apihelp-compare-param-fromtitle','s:31:\"Erster zu vergleichender Titel.\";'),('de','messages:apihelp-compare-param-fromid','s:36:\"Erste zu vergleichende Seitennummer.\";'),('de','messages:apihelp-compare-param-fromrev','s:31:\"Erste zu vergleichende Version.\";'),('de','messages:apihelp-compare-param-totitle','s:32:\"Zweiter zu vergleichender Titel.\";'),('de','messages:apihelp-compare-param-toid','s:37:\"Zweite zu vergleichende Seitennummer.\";'),('de','messages:apihelp-compare-param-torev','s:32:\"Zweite zu vergleichende Version.\";'),('de','messages:apihelp-compare-example-1','s:44:\"Unterschied zwischen Version 1 und 2 abrufen\";'),('de','messages:apihelp-createaccount-description','s:37:\"Erstellen eines neuen Benutzerkontos.\";'),('de','messages:apihelp-createaccount-param-name','s:13:\"Benutzername.\";'),('de','messages:apihelp-createaccount-param-password','s:72:\"Passwort (wird ignoriert, wenn <var>$1mailpassword</var> angegeben ist).\";'),('de','messages:apihelp-createaccount-param-domain','s:53:\"Domain fr die externe Authentifizierung (optional).\";'),('de','messages:apihelp-createaccount-param-token','s:68:\"Der in der ersten Anfrage erhaltene Benutzerkontenerstellungs-Token.\";'),('de','messages:apihelp-createaccount-param-email','s:40:\"E-Mail-Adresse des Benutzers (optional).\";'),('de','messages:apihelp-createaccount-param-realname','s:34:\"Realname des Benutzers (optional).\";'),('de','messages:apihelp-createaccount-p