;</code>: Der Parameter name ist ungltig oder zu lang.\";'),('de','messages:cite_error_ref_no_input','s:111:\"Ungltige Verwendung von <code>&lt;ref&gt;</code>: Der Parameter ref ohne Namen muss einen Inhalt haben.\";'),('de','messages:cite_error_references_invalid_parameters','s:163:\"Ungltige Verwendung von <code>&lt;references&gt;</code>: Es sind keine Parameter mglich. Verwende ausschlielich <code><nowiki><references /></nowiki></code>.\";'),('de','messages:cite_error_references_invalid_parameters_group','s:206:\"Ungltige Verwendung von <code>&lt;references&gt;</code>: Nur der Parameter group ist mglich. Verwende entweder <code>&lt;references /&gt;</code> oder <code>&lt;references group=\"\" /&gt;</code>.\";'),('de','messages:cite_error_references_no_backlink_label','s:275:\"Eine Referenz der Form <code>&lt;ref name=\"\" /&gt;</code> wird fter benutzt als Buchstaben vorhanden sind. Ein Administrator muss die Systemnachricht <nowiki>[[MediaWiki:Cite references link many format backlink labels]]</nowiki> um weitere Buchstaben/Zeichen ergnzen.\";'),('de','messages:cite_error_no_link_label_group','s:190:\"Fr die Gruppe $1 sind keine benutzerdefinierten Linkbezeichnungen mehr verfgbar.\nEin Administrator muss weitere mit der Systemnachricht <nowiki>[[MediaWiki:$2]]</nowiki> festlegen.\";'),('de','messages:cite_error_references_no_text','s:130:\"Es ist ein ungltiger <code>&lt;ref&gt;</code>-Tag vorhanden: Fr die Referenz namens <code>$1</code> wurde kein Text angegeben.\";'),('de','messages:cite_error_included_ref','s:92:\"Fr ein <code>&lt;ref&gt;</code>-Tag fehlt ein schlieendes <code>&lt;/ref&gt;</code>-Tag.\";'),('de','messages:cite_error_group_refs_without_references','s:220:\"Es sind <code>&lt;ref&gt;</code>-Tags fr die Gruppe $1 vorhanden, jedoch wurde kein dazugehriges <code>&lt;references group=\"$1\" /&gt;</code>-Tag gefunden oder ein schlieendes <code>&lt;/ref&gt;</code> fehlt.\";'),('de','messages:cite_error_references_group_mismatch','s:113:\"Das <code>&lt;ref&gt;</code>-Tag in <code>&lt;references&gt;</code> enthlt das kollidierende Attribut $1.\";'),('de','messages:cite_error_references_missing_group','s:161:\"Das in <code>&lt;references&gt;</code> definierte <code>&lt;ref&gt;</code>-Tag hat das Gruppenattribut $1, das nicht im vorausgehenden Text verwendet wird.\";'),('de','messages:cite_error_references_missing_key','s:146:\"Das in <code>&lt;references&gt;</code> definierte <code>&lt;ref&gt;</code>-Tag mit dem Namen $1 wird im vorausgehenden Text nicht verwendet.\";'),('de','messages:cite_error_references_no_key','s:103:\"Das in <code>&lt;references&gt;</code> definierte <code>&lt;ref&gt;</code>-Tag hat kein Namensattribut.\";'),('de','messages:cite_error_empty_references_define','s:126:\"Das in <code>&lt;references&gt;</code> definierte <code>&lt;ref&gt;</code>-Tag mit dem Namen $1 weist keinen Inhalt auf.\";'),('de','messages:cite_references_link_accessibility_label','s:12:\"Hochspringen\";'),('de','messages:cite_references_link_many_accessibility_label','s:18:\"Hochspringen nach:\";'),('de','messages:citethispage','s:11:\"Zitierhilfe\";'),('de','messages:citethispage-desc','s:125:\"Erweitert das Wiki um eine [[Special:CiteThisPage|Spezialseite]] als Zitierhilfe sowie einen Link darauf im Bereich Werkzeuge\";'),('de','messages:citethispage-link','s:14:\"Seite zitieren\";'),('de','messages:tooltip-citethispage','s:45:\"Hinweise, wie diese Seite zitiert werden kann\";'),('de','messages:citethispage-change-submit','s:8:\"zitieren\";'),('de','messages:citethispage-change-target','s:6:\"Seite:\";'),('de','messages:citethispage-content','s:3505:\"__NOTOC__\n<div class=\"mw-specialCiteThisPage-bibliographic\">\n\n== Bibliografische Angaben fr {{FULLPAGENAME}} ==\n\n* Seitentitel: {{FULLPAGENAME}}\n* Autor(en): {{SITENAME}}-Bearbeiter\n* Herausgeber: \'\'{{SITENAME}}, {{int:sitesubtitle}}\'\'.\n* Zeitpunkt der letzten Bearbeitung: {{CURRENTDAY}}. {{CURRENTMONTHNAME}} {{CURRENTYEAR}}, {{CURRENTTIME}} UTC\n* Datum des Abrufs: <citation>{{CURRENTDAY}}. {{CURRENTMONTHNAME}} {{CURRENTYEAR}}, {{CURRENTTIME}} UTC</citation>\n* Permanente URL: {{canonicalurl:{{FULLPAGENAME}}|oldid={{REVISIONID}}}}\n* Versionskennung: {{REVISIONID}}\n\n</div>\n<div class=\"plainlinks mw-specialCiteThisPage-styles\">\n\n== Zitatstile fr {{FULLPAGENAME}} ==\n\n=== [[APA style|APA-Stil]] ===\n{{FULLPAGENAME}}. ({{CURRENTDAY}}. {{CURRENTMONTHNAME}} {{CURRENTYEAR}}). \'\'{{SITENAME}}, {{int:sitesubtitle}}\'\'. Abgerufen am <citation>{{CURRENTDAY}}. {{CURRENTMONTHNAME}} {{CURRENTYEAR}}, {{CURRENTTIME}}</citation> von {{canonicalurl:{{FULLPAGENAME}}|oldid={{REVISIONID}}}}.\n\n=== [[The MLA style manual|MLA-Stil]] ===\n\"{{FULLPAGENAME}}.\" \'\'{{SITENAME}}, {{int:sitesubtitle}}\'\'. {{CURRENTDAY}}. {{CURRENTMONTHABBREV}} {{CURRENTYEAR}}, {{CURRENTTIME}} UTC. <citation>{{CURRENTDAY}}. {{CURRENTMONTHABBREV}} {{CURRENTYEAR}}, {{CURRENTTIME}}</citation> &lt;{{canonicalurl:{{FULLPAGENAME}}|oldid={{REVISIONID}}}}&gt;.\n\n=== [[MHRA Style Guide|MHRA-Stil]] ===\n{{SITENAME}}-Bearbeiter, \'{{FULLPAGENAME}}\', \'\'{{SITENAME}}, {{int:sitesubtitle}},\'\' {{CURRENTDAY}}. {{CURRENTMONTHNAME}} {{CURRENTYEAR}}, {{CURRENTTIME}} UTC, &lt;{{canonicalurl:{{FULLPAGENAME}}|oldid={{REVISIONID}}}}&gt; [abgerufen am <citation>{{CURRENTDAY}}. {{CURRENTMONTHNAME}} {{CURRENTYEAR}}</citation>]\n\n=== [[The Chicago Manual of Style|Chicago-Stil]] ===\n{{SITENAME}}-Bearbeiter, \"{{FULLPAGENAME}},\" \'\'{{SITENAME}}, {{int:sitesubtitle}},\'\' {{canonicalurl:{{FULLPAGENAME}}|oldid={{REVISIONID}}}} (abgerufen am <citation>{{CURRENTDAY}}. {{CURRENTMONTHNAME}} {{CURRENTYEAR}}</citation>).\n\n=== [[Council of Science Editors|CBE/CSE-Stil]] ===\n{{SITENAME}}-Bearbeiter. {{FULLPAGENAME}} [Internet]. {{SITENAME}}, {{int:sitesubtitle}}; {{CURRENTDAY}}. {{CURRENTMONTHABBREV}} {{CURRENTYEAR}}, {{CURRENTTIME}} UTC [zitiert am <citation>{{CURRENTDAY}}. {{CURRENTMONTHABBREV}} {{CURRENTYEAR}}</citation>]. Verfgbar unter:\n{{canonicalurl:{{FULLPAGENAME}}|oldid={{REVISIONID}}}}.\n\n=== [[Bluebook|Bluebook-Stil]] ===\n{{FULLPAGENAME}}, {{canonicalurl:{{FULLPAGENAME}}|oldid={{REVISIONID}}}} (abgerufen am <citation>{{CURRENTDAY}}. {{CURRENTMONTHNAME}} {{CURRENTYEAR}}</citation>).\n\n=== [[BibTeX]]-Eintrag ===\n\n  @misc{ wiki:xxx,\n    author = \"{{SITENAME}}\",\n    title = \"{{FULLPAGENAME}} --- {{SITENAME}}{,} {{int:sitesubtitle}}\",\n    year = \"{{CURRENTYEAR}}\",\n    url = \"{{canonicalurl:{{FULLPAGENAME}}|oldid={{REVISIONID}}}}\",\n    note = \"[Online; abgerufen am <citation>{{CURRENTDAY}}. {{CURRENTMONTHNAME}} {{CURRENTYEAR}}</citation>]\"\n  }\n\nBei Benutzung der [[LaTeX]]-Moduls url (<code>\\usepackage{url}</code> im Bereich der Einleitung), welches eine schner formatierte Internetadresse ausgibt, kann die folgende Ausgabe genommen werden:\n\n  @misc{ wiki:xxx,\n    author = \"{{SITENAME}}\",\n    title = \"{{FULLPAGENAME}} --- {{SITENAME}}{,} {{int:sitesubtitle}}\",\n    year = \"{{CURRENTYEAR}}\",\n    url = \"\'\'\'\\url{\'\'\'{{canonicalurl:{{FULLPAGENAME}}|oldid={{REVISIONID}}}}\'\'\'}\'\'\'\",\n    note = \"[Online; abgerufen am <citation>{{CURRENTDAY}}. {{CURRENTMONTHNAME}} {{CURRENTYEAR}}</citation>]\"\n  }\n\n\n</div> <!--closing div for \"plainlinks\"-->\";'),('de','messages:captcha-edit','s:157:\"Zur Bearbeitung der Seite lse die nachfolgende Rechenaufgabe und trage das Ergebnis in das Feld unten ein [[Special:Captcha/help|(Fragen oder Probleme?)]].\";'),('de','messages:captcha-desc','s:95:\"Ermglicht verschiedene CAPTCHA-Techniken zum Schutz vor Spam und dem Erraten von Passwrtern\";'),('de','messages:captcha-label','s:7:\"CAPTCHA\";'),('de','messages:captcha-addurl','s:305:\"Deine Bearbeitung enthlt neue externe Links.\nUm das Wiki vor automatisiertem Spam zu schtzen, bitten wir dich die untenstehende einfache Rechenaufgabe zu lsen und deine Antwort in das Feld einzugeben, damit deine Bearbeitung gespeichert werden kann ([[Special:Captcha/help|mehr Informationen ]]):\";'),('de','messages:captcha-badlogin','s:244:\"Um das Wiki vor der automatisierten Kompromittierung der Benutzerkonten zu schtzen, bitten wir dich die untenstehende einfache Rechenaufgabe zu lsen und deine Antwort in das Feld einzugeben ([[Special:Captcha/help|mehr Informationen ]]):\";'),('de','messages:captcha-createaccount','s:238:\"Um das Wiki vor der automatisierten Erstellung von Benutzerkonten zu schtzen, bitten wir dich die untenstehende einfache Rechenaufgabe zu lsen und deine Antwort in das Feld einzugeben ([[Special:Captcha/help|mehr Informationen ]]):\";'),('de','messages:captcha-createaccount-fail','s:32:\"Falsches oder fehlendes CAPTCHA.\";'),('de','messages:captcha-create','s:156:\"Zur Erstellung der Seite lse die nachfolgende Rechenaufgabe und trage das Ergebnis in das Feld unten ein [[Special:Captcha/help|(Fragen oder Probleme?)]].\";'),('de','messages:captcha-sendemail','s:209:\"Um das Wiki vor automatisiertem Spam zu schtzen, bitten wir dich die untenstehende einfache Rechenaufgabe zu lsen und deine Antwort in das Feld einzugeben ([[Special:Captcha/help|mehr Informationen ]]):\";'),('de','messages:captcha-sendemail-fail','s:32:\"Falsches oder fehlendes CAPTCHA.\";'),('de','messages:captcha-disabledinapi','s:84:\"Diese Aktion bentigt ein CAPTCHA. Sie kann nicht ber die API ausgefhrt werden.\";'),('de','messages:captchahelp-title','s:13:\"CAPTCHA-Hilfe\";'),('de','messages:captchahelp-cookies-needed','s:68:\"\'\'\'Wichtiger Hinweis:\'\'\' Es mssen Cookies im Browser erlaubt sein.\";'),('de','messages:captchahelp-text','s:1176:\"Internetangebote, die fr Beitrge von praktisch jedem offen sind  so wie dieses Wiki  werden oft von Spammern missbraucht, die ihre Links automatisch auf vielen Webseiten platzieren. Diese Spam-Links knnen wieder entfernt werden, sie sind aber ein erhebliches rgernis.\n\nIn manchen Fllen, insbesondere beim Hinzufgen von neuen Weblinks zu einer Seite, kann es vorkommen, dass dieses Wiki ein Bild mit einem farbigen und verzerrten Text anzeigt und dazu auffordert, die angezeigten Wrter einzutippen.\nDa eine solche Aufgabe nur schwer automatisch erledigt werden kann, werden dadurch die meisten Spammer, die mit automatischen Werkzeugen arbeiten, gestoppt, wogegen menschliche Benutzer ihren Beitrag absenden knnen.\n\nLeider kann dies zu Schwierigkeiten fr Personen fhren, die ber eine eingeschrnkte Sehfhigkeit verfgen oder text- oder sprachbasierte Browser verwenden. Aktuell sind keine Audio-CAPTCHAs verfgbar.\n\nBitte kontaktiere einen [[Special:ListAdmins|Administrator]] fr weitere Hilfe, wenn dies es unmglich macht, erwnschte Bearbeitungen vorzunehmen.\n\nDer Zurck-Knopf des Browsers fhrt zurck zum Bearbeitungsfenster.\";'),('de','messages:captcha-addurl-whitelist','s:308:\" #<!-- Diese Zeile darf nicht verndert werden! --> <pre>\n#  Syntax:\n#   * Alles von einem #-Zeichen bis zum Ende der Zeile ist ein Kommentar\n#   * Jede nicht-leere Zeile ist ein Regex-Fragment, das gegenber den Hostnamen einer URL geprft wird\n #</pre> <!-- Diese Zeile darf nicht verndert werden! -->\";'),('de','messages:right-skipcaptcha','s:33:\"berspringen der CAPTCHA-Eingabe\";'),('de','messages:gadgets-desc','s:188:\"Ermglicht es Benutzern, in ihren [[Special:Preferences#mw-prefsection-gadgets|persnlichen Einstellungen]] vordefinierte [[Special:Gadgets|CSS- und JavaScript-Helferlein]] zu aktivieren\";'),('de','messages:prefs-gadgets','s:10:\"Helferlein\";'),('de','messages:gadgets-prefstext','s:664:\"Dies ist eine Liste spezieller Helferlein, die jeder Benutzer aktivieren kann.\nDie Helferlein basieren zumeist auf JavaScript. Daher muss JavaScript im Browser aktiviert sein, damit sie funktionieren knnen.\nSie funktionieren allerdings nicht auf dieser Spezialseite mit den persnlichen Einstellungen.\n\nAuerdem ist zu beachten, dass diese Helferlein im Allgemeinen nicht Teil von MediaWiki sind, sondern meist von Benutzern lokaler Wikis entwickelt und gewartet werden.\nLokale Administratoren knnen die verfgbaren Helferlein bearbeiten. Dafr stehen die [[MediaWiki:Gadgets-definition|Definitionen]] und [[Special:Gadgets|Beschreibungen]] zur Verfgung.\";'),('de','messages:gadgets','s:10:\"Helferlein\";'),('de','messages:gadgets-title','s:10:\"Helferlein\";'),('de','messages:gadgets-pagetext','s:355:\"Liste besonderer, in [[MediaWiki:Gadgets-definition]] festgelegter Helferlein, die fr jeden Benutzer in seinen [[Special:Preferences#mw-prefsection-gadgets|persnlichen Einstellungen]] verfgbar sind.\nDiese bersicht bietet direkten Zugang zu den MediaWiki-Systemnachrichten, welche die Beschreibung sowie den Programmcode jedes Helferlein enthalten.\";'),('de','messages:gadgets-uses','s:7:\"Benutzt\";'),('de','messages:gadgets-required-rights','s:79:\"Erfordert die {{PLURAL:$2|folgende Berechtigung|folgenden Berechtigungen}}:\n\n$1\";'),('de','messages:gadgets-required-skins','s:102:\"Verfgbar bei {{PLURAL:$2|der folgenden Benutzeroberflche|den folgenden Benutzeroberflchen}}: $1.\";'),('de','messages:gadgets-default','s:36:\"Fr alle standardmig aktiviert.\";'),('de','messages:gadgets-legacy','s:169:\"Das Helferlein ist nicht geladen. Bitte stelle auf den ResourceLoader um. ([https://www.mediawiki.org/wiki/ResourceLoader/Migration_guide_(users) Weitere Informationen])\";'),('de','messages:gadgets-export','s:11:\"Exportieren\";'),('de','messages:gadgets-export-title','s:21:\"Export der Helferlein\";'),('de','messages:gadgets-not-found','s:41:\"Helferlein $1 wurde nicht gefunden.\";'),('de','messages:gadgets-export-text','s:581:\"Um das Helferlein $1 zu exportieren, klicke auf die Schaltflche {{int:gadgets-export-download}} und speichere die heruntergeladene Datei. Gehe sodann zur Spezialseite Spezial:Import auf dem fr den Import vorgesehenen Wiki und lade die Datei hoch. Fge danach den folgenden Text zur Seite MediaWiki:Gadgets-definition hinzu:\n<pre>$2</pre>\nDu musst ber die notwendigen Berechtigungen auf dem fr den Import vorgesehenen Wiki verfgen (einschlielich der Berechtigung, MediaWiki-Systemnachrichten zu bearbei