f nicht verndert werden! -->\";'),('de','messages:spam-whitelist','s:494:\" #<!-- Diese Zeile darf nicht verndert werden! --> <pre>\n# Externe URLs, die in dieser Liste enthalten sind, blockieren das Speichern einer Seite nicht, \n# auch wenn sie in der lokalen oder ggf. globalen Blockierliste enthalten sind.\n#\n# Syntax:\n#   * Alles ab dem #-Zeichen bis zum Ende der Zeile ist ein Kommentar\n#   * Jede nicht-leere Zeile ist ein regulrer Ausdruck, der gegen die Host-Namen in den URLs geprft wird.\n\n #</pre> <!-- Diese Zeile darf nicht verndert werden! -->\";'),('de','messages:email-blacklist','s:677:\" #<!-- Diese Zeile darf nicht verndert werden! --> <pre>\n# E-Mail-Adressen, die in dieser Liste enthalten sind, werden bei der Registrierung sowie beim Senden von E-Mail-Nachrichten blockiert.\n# Diese Liste hat nur Auswirkungen auf dieses Wiki. Siehe gegebenenfalls auch die globale Blockierliste.\n# Siehe auch https://www.mediawiki.org/wiki/Extension:SpamBlacklist fr weiterfhrende Informationen.\n#\n# Syntax wie folgt:\n# * Alles ab dem #-Zeichen bis zum Ende der Zeile ist ein Kommentar.\n# * Jede nicht-leere Zeile ist ein regulrer Ausdruck, der mit dem Hostnamen der E-Mail-Adressen abgeglichen wird.\n\n #</pre> <!-- Diese Zeile darf nicht verndert werden! -->\";'),('de','messages:email-whitelist','s:335:\" #<!-- Diese Zeile darf nicht verndert werden! --> <pre>\n# E-Mail-Adressen, die sich in dieser Liste befinden, blockieren die Registrierung sowie\n# das Senden von E-Mail-Nachrichten *nicht*, auch wenn sie in der \n# lokalen oder ggf. globalen Blockierliste enthalten sind.\n#\n #</pre> <!-- Diese Zeile darf nicht verndert werden! -->\";'),('de','messages:spam-blacklisted-email','s:26:\"Blockierte E-Mail-Adressen\";'),('de','messages:spam-blacklisted-email-text','s:101:\"Deine E-Mail-Adresse ist derzeit fr das Senden von E-Mail-Nachrichten an andere Benutzer blockiert.\";'),('de','messages:spam-blacklisted-email-signup','s:110:\"Die angegebene E-Mail-Adresse ist 