es','s:64:\"Page properties defined by expanded magic words in the wikitext.\";'),('de','messages:apihelp-expandtemplates-paramvalue-prop-volatile','s:82:\"Whether the output is volatile and should not be reused elsewhere within the page.\";'),('de','messages:apihelp-expandtemplates-paramvalue-prop-ttl','s:72:\"The maximum time after which caches of the result should be invalidated.\";'),('de','messages:apihelp-expandtemplates-paramvalue-prop-modules','s:203:\"Any ResourceLoader modules that parser functions have requested be added to the output. Either <kbd>jsconfigvars</kbd> or <kbd>encodedjsconfigvars</kbd> must be requested jointly with <kbd>modules</kbd>.\";'),('de','messages:apihelp-expandtemplates-paramvalue-prop-jsconfigvars','s:66:\"Gives the JavaScript configuration variables specific to the page.\";'),('de','messages:apihelp-expandtemplates-paramvalue-prop-encodedjsconfigvars','s:83:\"Gives the JavaScript configuration variables specific to the page as a JSON string.\";'),('de','messages:apihelp-managetags-param-operation','s:379:\"Which operation to perform:\n;create:Create a new change tag for manual use.\n;delete:Remove a change tag from the database, including removing the tag from all revisions, recent change entries and log entries on which it is used.\n;activate:Activate a change tag, allowing users to apply it manually.\n;deactivate:Deactivate a change tag, preventing users from applying it manually.\";'),('de','messages:apihelp-managetags-param-tag','s:277:\"Tag to create, delete, activate or deactivate. For tag creation, the tag must not exist. For tag deletion, the tag must exist. For tag activation, the tag must exist and not be in use by an extension. For tag deactivation, the tag must be currently active and manually defined.\";'),('de','messages:apihelp-opensearch-param-redirects','s:231:\"How to handle redirects:\n;return:Return the redirect itself.\n;resolve:Return the target page. May return fewer than $1limit results.\nFor historical reasons, the default is \"return\" for $1format=json and \"resolve\" for other formats.\";'),('de','messages:apihelp-opensearch-param-warningsaserror','s:97:\"If warnings are raised with <kbd>format=json</kbd>, return an API error instead of ignoring them.\";'),('de','messages:apihelp-options-description','s:224:\"Change preferences of the current user.\n\nOnly options which are registered in core or in one of installed extensions, or options with keys prefixed with <code>userjs-</code> (intended to be used by user scripts), can be set.\";'),('de','messages:apihelp-options-param-resetkinds','s:76:\"List of types of options to reset when the <var>$1reset</var> option is set.\";'),('de','messages:apihelp-options-param-change','s:224:\"List of changes, formatted name=value (e.g. skin=vector). Value cannot contain pipe characters. If no value is given (not even an equals sign), e.g., optionname|otheroption|..., the option will be reset to its default value.\";'),('de','messages:apihelp-options-param-optionname','s:89:\"The name of the option that should be set to the value given by <var>$1optionvalue</var>.\";'),('de','messages:apihelp-options-param-optionvalue','s:91:\"The value for the option specified by <var>$1optionname</var>, can contain pipe characters.\";'),('de','messages:apihelp-paraminfo-param-modules','s:152:\"List of module names (values of the <var>action</var> and <var>format</var> parameters, or <kbd>main</kbd>). Can specify submodules with a <kbd>+</kbd>.\";'),('de','messages:apihelp-paraminfo-param-querymodules','s:177:\"List of query module names (value of <var>prop</var>, <var>meta</var> or <var>list</var> parameter). Use <kbd>$1modules=query+foo</kbd> instead of <kbd>$1querymodules=foo</kbd>.\";'),('de','messages:apihelp-paraminfo-param-mainmodule','s:97:\"Get information about the main (top-level) module as well. Use <kbd>$1modules=main</kbd> instead.\";'),('de','messages:apihelp-paraminfo-param-pagesetmodule','s:81:\"Get information about the pageset module (providing titles= and friends) as well.\";'),('de','messages:apihelp-paraminfo-param-formatmodules','s:101:\"List of format module names (value of <var>format</var> parameter). Use <var>$1modules</var> instead.\";'),('de','messages:apihelp-paraminfo-example-1','s:269:\"Show info for <kbd>[[Special:ApiHelp/parse|action=parse]]</kbd>, <kbd>[[Special:ApiHelp/jsonfm|format=jsonfm]]</kbd>, <kbd>[[Special:ApiHelp/query+allpages|action=query&list=allpages]]</kbd>, and <kbd>[[Special:ApiHelp/query+siteinfo|action=query&meta=siteinfo]]</kbd>.\";'),('de','messages:apihelp-parse-description','s:523:\"Parses content and returns parser output.\n\nSee the various prop-modules of <kbd>[[Special:ApiHelp/query|action=query]]</kbd> to get information from the current version of a page.\n\nThere are several ways to specify the text to parse:\n# Specify a page or revision, using <var>$1page</var>, <var>$1pageid</var>, or <var>$1oldid</var>.\n# Specify content explicitly, using <var>$1text</var>, <var>$1title</var>, and <var>$1contentmodel</var>.\n# Specify only a summary to parse. <var>$1prop</var> should be given an empty value.\";'),('de','messages:apihelp-parse-param-title','s:130:\"Title of page the text belongs to. If omitted, <var>$1contentmodel</var> must be specified, and [[API]] will be used as the title.\";'),('de','messages:apihelp-parse-param-text','s:96:\"Text to parse. Use <var>$1title</var> or <var>$1contentmodel</var> to control the content model.\";'),('de','messages:apihelp-parse-param-page','s:102:\"Parse the content of this page. Cannot be used together with <var>$1text</var> and <var>$1title</var>.\";'),('de','messages:apihelp-parse-param-pageid','s:60:\"Parse the content of this page. Overrides <var>$1page</var>.\";'),('de','messages:apihelp-parse-param-redirects','s:77:\"If <var>$1page</var> or <var>$1pageid</var> is set to a redirect, resolve it.\";'),('de','messages:apihelp-parse-param-oldid','s:88:\"Parse the content of this revision. Overrides <var>$1page</var> and <var>$1pageid</var>.\";'),('de','messages:apihelp-parse-param-prop','s:35:\"Which pieces of information to get:\";'),('de','messages:apihelp-parse-paramvalue-prop-text','s:38:\"Gives the parsed text of the wikitext.\";'),('de','messages:apihelp-parse-paramvalue-prop-sections','s:42:\"Gives the sections in the parsed wikitext.\";'),('de','messages:apihelp-parse-paramvalue-prop-headitems','s:64:\"Gives items to put in the <code>&lt;head&gt;</code> of the page.\";'),('de','messages:apihelp-parse-paramvalue-prop-headhtml','s:51:\"Gives parsed <code>&lt;head&gt;</code> of the page.\";'),('de','messages:apihelp-parse-paramvalue-prop-modules','s:166:\"Gives the ResourceLoader modules used on the page. Either <kbd>jsconfigvars</kbd> or <kbd>encodedjsconfigvars</kbd> must be requested jointly with <kbd>modules</kbd>.\";'),('de','messages:apihelp-parse-paramvalue-prop-jsconfigvars','s:66:\"Gives the JavaScript configuration variables specific to the page.\";'),('de','messages:apihelp-parse-paramvalue-prop-encodedjsconfigvars','s:83:\"Gives the JavaScript configuration variables specific to the page as a JSON string.\";'),('de','messages:apihelp-parse-paramvalue-prop-indicators','s:58:\"Gives the HTML of page status indicators used on the page.\";'),('de','messages:apihelp-parse-paramvalue-prop-iwlinks','s:45:\"Gives interwiki links in the parsed wikitext.\";'),('de','messages:apihelp-parse-paramvalue-prop-wikitext','s:44:\"Gives the original wikitext that was parsed.\";'),('de','messages:apihelp-parse-paramvalue-prop-properties','s:56:\"Gives various properties defined in the parsed wikitext.\";'),('de','messages:apihelp-parse-paramvalue-prop-limitreportdata','s:103:\"Gives the limit report in a structured way. Gives no data, when <var>$1disablelimitreport</var> is set.\";'),('de','messages:apihelp-parse-paramvalue-prop-limitreporthtml','s:103:\"Gives the HTML version of the limit report. Gives no data, when <var>$1disablelimitreport</var> is set.\";'),('de','messages:apihelp-parse-paramvalue-prop-parsetree','s:79:\"The XML parse tree of revision content (requires content model <code>$1</code>)\";'),('de','messages:apihelp-parse-param-pst','s:87:\"Do a pre-save transform on the input before parsing it. Only valid when used with text.\";'),('de','messages:apihelp-parse-param-onlypst','s:165:\"Do a pre-save transform (PST) on the input, but don\'t parse it. Returns the same wikitext, after a PST has been applied. Only valid when used with <var>$1text</var>.\";'),('de','messages:apihelp-parse-param-effectivelanglinks','s:90:\"Includes language links supplied by extensions (for use with <kbd>$1prop=langlinks</kbd>).\";'),('de','messages:apihelp-parse-param-disablelimitreport','s:68:\"Omit the limit report (\"NewPP limit report\") from the parser output.\";'),('de','messages:apihelp-parse-param-disablepp','s:44:\"Use <var>$1disablelimitreport</var> instead.\";'),('de','messages:apihelp-parse-param-disabletidy','s:57:\"Do not run HTML cleanup (e.g. tidy) on the parser output.\";'),('de','messages:apihelp-parse-param-generatexml','s:106:\"Generate XML parse tree (requires content model <code>$1</code>; replaced by <kbd>$2prop=parsetree</kbd>).\";'),('de','messages:apihelp-parse-param-sectionpreview','s:57:\"Parse in section preview mode (enables preview mode too).\";'),('de','messages:apihelp-parse-param-contentformat','s:87:\"Content serialization format used for the input text. Only valid when used with $1text.\";'),('de','messages:apihelp-parse-param-contentmodel','s:159:\"Content model of the input text. If omitted, $1title must be specified, and default will be the model of the specified title. Only valid when used with $1text.\";'),('de','messages:apihelp-query+alldeletedrevisions-param-miser-user-namespace','s:256:\"<strong>Note:</strong> Due to [[mw:Manual:$wgMiserMode|miser mode]], using <var>$1user</var> and <var>$1namespace</var> together may result in fewer than <var>$1limit</var> results returned before continuing; in extreme cases, zero results may be returned.\";'),('de','messages:apihelp-query+alldeletedrevisions-param-generatetitles','s:73:\"When being used as a generator, generate titles rather than revision IDs.\";'),('de','messages:apihelp-query+alldeletedrevisions-example-user','s:65:\"List the last 50 deleted contributions by user <kbd>Example<kbd>.\";'),('de','messages:apihelp-query+alldeletedrevisions-example-ns-main','s:58:\"List the first 50 deleted revisions in the main namespace.\";'),('de','messages:apihelp-query+allfileusages-description','s:45:\"List all file usages, including non-existing.\";'),('de','messages:apihelp-query+allfileusages-param-prefix','s:54:\"Search for all file titles that begin with this value.\";'),('de','messages:apihelp-query+allfileusages-param-unique','s:134:\"Only show distinct file titles. Cannot be used with $1prop=ids.\nWhen used as a generator, yields target pages instead of source pages.\";'),('de','messages:apihelp-query+allfileusages-paramvalue-prop-ids','s:68:\"Adds the page IDs of the using pages (cannot be used with $1unique).\";'),('de','messages:apihelp-query+allfileusages-example-B','s:96:\"List file titles, including missing ones, with page IDs they are from, starting at <kbd>B</kbd>.\";'),('de','messages:apihelp-query+allimages-param-from','s:77:\"The image title to start enumerating from. Can only be used with $1sort=name.\";'),('de','messages:apihelp-query+allimages-param-to','s:74:\"The image title to stop enumerating at. Can only be used with $1sort=name.\";'),('de','messages:apihelp-query+allimages-param-start','s:80:\"The timestamp to start enumerating from. Can only be used with $1sort=timestamp.\";'),('de','messages:apihelp-query+allimages-param-end','s:73:\"The timestamp to end enumerating. Can only be used with $1sort=timestamp.\";'),('de','messages:apihelp-query+allimages-param-prefix','s:90:\"Search for all image titles that begin with this value. Can only be used with $1sort=name.\";'),('de','messages:apihelp-query+allimages-param-minsize','s:46:\"Limit to images with at least this many bytes.\";'),('de','messages:apihelp-query+allimages-param-maxsize','s:45:\"Limit to images with at most this many bytes.\";'),('de','messages:apihelp-query+allimages-param-user','s:123:\"Only return files uploaded by this user. Can only be used with $1sort=timestamp. Cannot be used together with $1filterbots.\";'),('de','messages:apihelp-query+allimages-param-filterbots','s:114:\"How to filter files uploaded by bots. Can only be used with $1sort=timestamp. Cannot be used together with $1user.\";'),('de','messages:apihelp-query+allimages-param-mime','s:58:\"What MIME types to search for, e.g. <kbd>image/jpeg</kbd>.\";'),('de','messages:apihelp-query+allimages-example-B','s:57:\"Show a list of files starting at the letter <kbd>B</kbd>.\";'),('de','messages:apihelp-query+allimages-example-mimetypes','s:80:\"Show a list of files with MIME type <kbd>image/png</kbd> or <kbd>image/gif</kbd>\";'),('de','messages:apihelp-query+allimages-example-generator','s:60:\"Show info about 4 files starting at the letter <kbd>T</kbd>.\";'),('de','messages:apihelp-query+alllinks-description','s:52:\"Enumerate all links that point to a given namespace.\";'),('de','messages:apihelp-query+alllinks-param-from','s:48:\"The title of the link to start enumerating from.\";'),('de','messages:apihelp-query+alllinks-param-to','s:45:\"The title of the link to stop enumerating at.\";'),('de','messages:apihelp-query+alllinks-param-prefix','s:56:\"Search for all linked titles that begin with this value.\";'),('de','messages:apihelp-query+alllinks-param-unique','s:147:\"Only show distinct linked titles. Cannot be used with <kbd>$1prop=ids</kbd>.\nWhen used as a generator, yields target pages instead of source pages.\";'),('de','messages:apihelp-query+alllinks-param-prop','s:39:\"Which pieces of information to include:\";'),('de','messages:apihelp-query+alllinks-paramvalue-prop-ids','s:79:\"Adds the page ID of the linking page (cannot be used with <var>$1unique</var>).\";'),('de','messages:apihelp-query+alllinks-paramvalue-prop-title','s:27:\"Adds the title of the link.\";'),('de','messages:apihelp-query+alllinks-param-namespace','s:27:\"The namespace to enumerate.\";'),('de','messages:apihelp-query+alllinks-param-limit','s:31:\"How many total items to return.\";'),('de','messages:apihelp-query+alllinks-param-dir','s:31:\"The direction in which to list.\";'),('de','messages:apihelp-query+alllinks-example-B','s:98:\"List linked titles, including missing ones, with page IDs they are from, starting at <kbd>B</kbd>.\";'),('de','messages:apihelp-query+alllinks-example-unique-generator','s:49:\"Gets all linked titles, marking the missing ones.\";'),('de','messages:apihelp-query+alllinks-example-generator','s:32:\"Gets pages containing the links.\";'),('de','messages:apihelp-query+allmessages-description','s:31:\"Return messages from this site.\";'),('de','messages:apihelp-query+allmessages-param-messages','s:68:\"Which messages to output. <kbd>*</kbd> (default) means all messages.\";'),('de','messages:apihelp-query+allmessages-param-prop','s:24:\"Which properties to get.\";'),('de','messages:apihelp-query+allmessages-param-enableparser','s:111:\"Set to enable parser, will preprocess the wikitext of message (substitute magic words, handle templates, etc.).\";'),('de','messages:apihelp-query+allmessages-param-nocontent','s:65:\"If set, do not include the content of the messages in the output.\";'),('de','messages:apihelp-query+allmessages-param-includelocal','s:241:\"Also include local messages, i.e. messages that don\'t exist in the software but do exist as a MediaWiki: page.\nThis lists all MediaWiki: pages, so it will also list those that aren\'t really messages such as [[MediaWiki:Common.js|Common.js]].\";'),('de','messages:apihelp-query+allmessages-param-args','s:41:\"Arguments to be substituted into message.\";'),('de','messages:apihelp-query+allmessages-param-filter','s:57:\"Return only messages with names that contain this string.\";'),('de','messages:apihelp-query+allmessages-param-customised','s:49:\"Return only messages in this customisation state.\";'),('de','messages:apihelp-query+allmessages-param-lang','s:33:\"Return messages in this language.\";'),('de','messages:apihelp-query+allmessages-param-from','s:41:\"Return messages starting at this message.\";'),('de','messages:apihelp-query+allmessages-param-to','s:39:\"Return messages ending at this message.\";'),('de','messages:apihelp-query+allmessages-param-title','s:77:\"Page name to use as context when parsing message (for $1enableparser option).\";'),('de','messages:apihelp-query+allmessages-param-prefix','s:33:\"Return messages with this prefix.\";'),('de','messages:apihelp-query+allmessages-example-ipb','s:44:\"Show messages starting with <kbd>ipb-</kbd>.\";'),('de','messages:apihelp-query+allmessages-example-de','s:66:\"Show messages <kbd>august</kbd> and <kbd>mainpage</kbd> in German.\";'),('de','messages:apihelp-query+alltransclusions-description','s:96:\"List all transclusions (pages embedded using &#123;&#123;x&#125;&#125;), including non-existing.\";'),('de','messages:apihelp-query+alltransclusions-param-from','s:56:\"The title of the transclusion to start enumerating from.\";'),('de','messages:apihelp-query+alltransclusions-param-to','s:53:\"The title of the transclusion to stop enumerating at.\";'),('de','messages:apihelp-query+alltransclusions-param-prefix','s:61:\"Search for all transcluded titles that begin with this value.\";'),('de','messages:apihelp-query+alltransclusions-param-unique','s:141:\"Only show distinct transcluded titles. Cannot be used with $1prop=ids.\nWhen used as a generator, yields target pages instead of source pages.\";'),('de','messages:apihelp-query+alltransclusions-param-prop','s:39:\"Which pieces of information to include:\";'),('de','messages:apihelp-query+alltransclusions-paramvalue-prop-ids','s:73:\"Adds the page ID of the transcluding page (cannot be used with $1unique).\";'),('de','messages:apihelp-query+alltransclusions-paramvalue-prop-title','s:35:\"Adds the title of the transclusion.\";'),('de','messages:apihelp-query+alltransclusions-param-limit','s:31:\"How many total items to return.\";'),('de','messages:apihelp-query+alltransclusions-param-dir','s:31:\"The direction in which to list.\";'),('de','messages:apihelp-query+alltransclusions-example-B','s:103:\"List transcluded titles, including missing ones, with page IDs they are from, starting at <kbd>B</kbd>.\";'),('de','messages:apihelp-query+alltransclusions-example-unique-generator','s:54:\"Gets all transcluded titles, marking the missing ones.\";'),('de','messages:apihelp-query+alltransclusions-example-generator','s:40:\"Gets pages containing the transclusions.\";'),('de','messages:apihelp-query+allusers-description','s:31:\"Enumerate all registered users.\";'),('de','messages:apihelp-query+allusers-param-from','s:40:\"The user name to start enumerating from.\";'),('de','messages:apihelp-query+allusers-param-to','s:37:\"The user name to stop enumerating at.\";'),('de','messages:apihelp-query+allusers-param-prefix','s:48:\"Search for all users that begin with this value.\";'),('de','messages:apihelp-query+allusers-param-dir','s:21:\"Direction to sort in.\";'),('de','messages:apihelp-query+allusers-param-group','s:39:\"Only include users in the given groups.\";'),('de','messages:apihelp-query+allusers-param-excludegroup','s:34:\"Exclude users in the given groups.\";'),('de','messages:apihelp-query+allusers-param-rights','s:141:\"Only include users with the given rights. Does not include rights granted by implicit or auto-promoted groups like *, user, or autoconfirmed.\";'),('de','messages:apihelp-query+allusers-param-prop','s:39:\"Which pieces of information to include:\";'),('de','messages:apihelp-query+allusers-paramvalue-prop-blockinfo','s:55:\"Adds the information about a current block on the user.\";'),('de','messages:apihelp-query+allusers-paramvalue-prop-groups','s:110:\"Lists groups that the user is in. This uses more server resources and may return fewer results than the limit.\";'),('de','messages:apihelp-query+allusers-paramvalue-prop-implicitgroups','s:50:\"Lists all the groups the user is automatically in.\";'),('de','messages:apihelp-query+allusers-paramvalue-prop-rights','s:31:\"Lists rights that the user has.\";'),('de','messages:apihelp-query+allusers-paramvalue-prop-editcount','s:32:\"Adds the edit count of the user.\";'),('de','messages:apihelp-query+allusers-paramvalue-prop-registration','s:75:\"Adds the timestamp of when the user registered if available (may be blank).\";'),('de','messages:apihelp-query+allusers-param-witheditsonly','s:36:\"Only list users who have made edits.\";'),('de','messages:apihelp-query+allusers-param-activeusers','s:61:\"Only list users active in the last $1 {{PLURAL:$1|day|days}}.\";'),('de','messages:apihelp-query+backlinks-param-title','s:66:\"Title to search. Cannot be used together with <var>$1pageid</var>.\";'),('de','messages:apihelp-query+backlinks-param-pageid','s:67:\"Page ID to search. Cannot be used together with <var>$1title</var>.\";'),('de','messages:apihelp-query+backlinks-param-namespace','s:27:\"The namespace to enumerate.\";'),('de','messages:apihelp-query+backlinks-param-dir','s:31:\"The direction in which to list.\";'),('de','messages:apihelp-query+backlinks-param-filterredir','s:143:\"How to filter for redirects. If set to <kbd>nonredirects</kbd> when <var>$1redirect</var> is enabled, this is only applied to the second level.\";'),('de','messages:apihelp-query+backlinks-param-limit','s:179:\"How many total pages to return. If <var>$1redirect</var> is enabled, the limit applies to each level separately (which means up to 2 * <var>$1limit</var> results may be returned).\";'),('de','messages:apihelp-query+backlinks-param-redirect','s:106:\"If linking page is a redirect, find all pages that link to that redirect as well. Maximum limit is halved