essages:apihelp-query+categoryinfo-description','s:47:\"Returns information about the given categories.\";'),('de','messages:apihelp-query+categoryinfo-example-simple','s:74:\"Get information about <kbd>Category:Foo</kbd> and <kbd>Category:Bar</kbd>.\";'),('de','messages:apihelp-query+categorymembers-description','s:35:\"List all pages in a given category.\";'),('de','messages:apihelp-query+categorymembers-param-title','s:142:\"Which category to enumerate (required). Must include the <kbd>{{ns:category}}:</kbd> prefix. Cannot be used together with <var>$1pageid</var>.\";'),('de','messages:apihelp-query+categorymembers-param-pageid','s:86:\"Page ID of the category to enumerate. Cannot be used together with <var>$1title</var>.\";'),('de','messages:apihelp-query+categorymembers-param-prop','s:39:\"Which pieces of information to include:\";'),('de','messages:apihelp-query+categorymembers-paramvalue-prop-ids','s:17:\"Adds the page ID.\";'),('de','messages:apihelp-query+categorymembers-paramvalue-prop-title','s:44:\"Adds the title and namespace ID of the page.\";'),('de','messages:apihelp-query+categorymembers-paramvalue-prop-sortkey','s:71:\"Adds the sortkey used for sorting in the category (hexadecimal string).\";'),('de','messages:apihelp-query+categorymembers-paramvalue-prop-sortkeyprefix','s:94:\"Adds the sortkey prefix used for sorting in the category (human-readable part of the sortkey).\";'),('de','messages:apihelp-query+categorymembers-paramvalue-prop-type','s:75:\"Adds the type that the page has been categorised as (page, subcat or file).\";'),('de','messages:apihelp-query+categorymembers-paramvalue-prop-timestamp','s:49:\"Adds the timestamp of when the page was included.\";'),('de','messages:apihelp-query+categorymembers-param-namespace','s:166:\"Only include pages in these namespaces. Note that <kbd>$1type=subcat</kbd> or <kbd>$1type=file</kbd> may be used instead of <kbd>$1namespace=14</kbd> or <kbd>6</kbd>.\";'),('de','messages:apihelp-query+categorymembers-param-type','s:91:\"Which type of category members to include. Ignored when <kbd>$1sort=timestamp</kbd> is set.\";'),('de','messages:apihelp-query+categorymembers-param-limit','s:38:\"The maximum number of pages to return.\";'),('de','messages:apihelp-query+categorymembers-param-sort','s:20:\"Property to sort by.\";'),('de','messages:apihelp-query+categorymembers-param-dir','s:27:\"In which direction to sort.\";'),('de','messages:apihelp-query+categorymembers-param-start','s:83:\"Timestamp to start listing from. Can only be used with <kbd>$1sort=timestamp</kbd>.\";'),('de','messages:apihelp-query+categorymembers-param-end','s:79:\"Timestamp to end listing at. Can only be used with <kbd>$1sort=timestamp</kbd>.\";'),('de','messages:apihelp-query+categorymembers-param-starthexsortkey','s:121:\"Sortkey to start listing from, as returned by <kbd>$1prop=sortkey</kbd>. Can only be used with <kbd>$1sort=sortkey</kbd>.\";'),('de','messages:apihelp-query+categorymembers-param-endhexsortkey','s:117:\"Sortkey to end listing at, as returned by <kbd>$1prop=sortkey</kbd>. Can only be used with <kbd>$1sort=sortkey</kbd>.\";'),('de','messages:apihelp-query+categorymembers-param-startsortkeyprefix','s:126:\"Sortkey prefix to start listing from. Can only be used with <kbd>$1sort=sortkey</kbd>. Overrides <var>$1starthexsortkey</var>.\";'),('de','messages:apihelp-query+categorymembers-param-endsortkeyprefix','s:192:\"Sortkey prefix to end listing <strong>before</strong> (not <strong>at</strong>; if this value occurs it will not be included!). Can only be used with $1sort=sortkey. Overrides $1endhexsortkey.\";'),('de','messages:apihelp-query+categorymembers-example-simple','s:50:\"Get first 10 pages in <kbd>Category:Physics</kbd>.\";'),('de','messages:apihelp-query+categorymembers-example-generator','s:66:\"Get page info about first 10 pages in <kbd>Category:Physics</kbd>.\";'),('de','messages:apihelp-query+contributors-description','s:89:\"Get the list of logged-in contributors and the 