eturns <samp>$2</samp> if more).\";'),('de','messages:apihelp-query+userinfo-example-data','s:50:\"Get additional information about the current user.\";'),('de','messages:apihelp-query+users-param-prop','s:39:\"Which pieces of information to include:\";'),('de','messages:apihelp-query+users-paramvalue-prop-blockinfo','s:58:\"Tags if the user is blocked, by whom, and for what reason.\";'),('de','messages:apihelp-query+users-paramvalue-prop-groups','s:42:\"Lists all the groups each user belongs to.\";'),('de','messages:apihelp-query+users-paramvalue-prop-implicitgroups','s:57:\"Lists all the groups a user is automatically a member of.\";'),('de','messages:apihelp-query+users-paramvalue-prop-rights','s:35:\"Lists all the rights each user has.\";'),('de','messages:apihelp-query+users-paramvalue-prop-editcount','s:27:\"Adds the user\'s edit count.\";'),('de','messages:apihelp-query+users-paramvalue-prop-registration','s:39:\"Adds the user\'s registration timestamp.\";'),('de','messages:apihelp-query+users-paramvalue-prop-emailable','s:78:\"Tags if the user can and wants to receive email through [[Special:Emailuser]].\";'),('de','messages:apihelp-query+users-paramvalue-prop-gender','s:68:\"Tags the gender of the user. Returns \"male\", \"female\", or \"unknown\".\";'),('de','messages:apihelp-query+users-param-users','s:42:\"A list of users to obtain information for.\";'),('de','messages:apihelp-query+users-param-token','s:81:\"Use <kbd>[[Special:ApiHelp/query+tokens|action=query&meta=tokens]]</kbd> instead.\";'),('de','messages:apihelp-query+users-example-simple','s:47:\"Return information for user <kbd>Example</kbd>.\";'),('de','messages:apihelp-query+watchlist-description','s:60:\"Get recent changes to pages in the current user\'s watchlist.\";'),('de','messages:apihelp-query+watchlist-param-allrev','s:67:\"Include multiple revisions of the same page within given timeframe.\";'),('de','messages:apihelp-query+watchlist-param-start','s:40:\"The timestamp to start enumerating from.\";'),('de','messages:apihelp-query+watchlist-param-end','s:33:\"The timestamp to end enumerating.\";'),('de','messages:apihelp-query+watchlist-param-namespace','s:44:\"Filter changes to only the given namespaces.\";'),('de','messages:apihelp-query+watchlist-param-user','s:31:\"Only list changes by this user.\";'),('de','messages:apihelp-query+watchlist-param-excludeuser','s:32:\"Don\'t list changes by this user.\";'),('de','messages:apihelp-query+watchlist-param-limit','s:45:\"How many total results to return per request.\";'),('de','messages:apihelp-query+watchlist-param-prop','s:35:\"Which additional properties to get:\";'),('de','messages:apihelp-query+watchlist-paramvalue-prop-ids','s:31:\"Adds revision IDs and page IDs.\";'),('de','messages:apihelp-query+watchlist-paramvalue-prop-title','s:23:\"Adds title of the page.\";'),('de','messages:apihelp-query+watchlist-paramvalue-prop-flags','s:24:\"Adds flags for the edit.\";'),('de','messages:apihelp-query+watchlist-paramvalue-prop-user','s:32:\"Adds the user who made the edit.\";'),('de','messages:apihelp-query+watchlist-paramvalue-prop-userid','s:38:\"Adds user ID of whoever made the edit.\";'),('de','messages:apihelp-query+watchlist-paramvalue-prop-comment','s:25:\"Adds comment of the edit.\";'),('de','messages:apihelp-query+watchlist-paramvalue-prop-parsedcomment','s:32:\"Adds parsed comment of the edit.\";'),('de','messages:apihelp-query+watchlist-paramvalue-prop-timestamp','s:27:\"Adds timestamp of the edit.\";'),('de','messages:apihelp-query+watchlist-paramvalue-prop-patrol','s:30:\"Tags edits that are patrolled.\";'),('de','messages:apihelp-query+watchlist-paramvalue-prop-sizes','s:41:\"Adds the old and new lengths of the page.\";'),('de','messages:apihelp-query+watchlist-paramvalue-prop-notificationtimestamp','s:65:\"Adds timestamp of when the user was last notified about the edit.\";'),('de','messages:apihelp-query+watchlist-paramvalue-prop-loginfo','s:39:\"Adds log information where appropriate.\";'),('de','messages:apihelp-query+watchlist-param-show','s:127:\"Show only items that meet these criteria. For example, to see only minor edits done by logged-in users, set $1show=minor|!anon.\";'),('de','messages:apihelp-query+watchlist-param-type','s:124:\"Which types of changes to show:\n;edit:Regular page edits.\n;external:External changes.\n;new:Page creations.\n;log:Log entries.\";'),('de','messages:apihelp-query+watchlist-param-owner','s:63:\"Used along with $1token to access a different user\'s watchlist.\";'),('de','messages:apihelp-query+watchlist-param-token','s:148:\"A security token (available in the user\'s [[Special:Preferences#mw-prefsection-watchlist|preferences]]) to allow access to another user\'s watchlist.\";'),('de','messages:apihelp-query+watchlist-example-simple','s:81:\"List the top revision for recently changed pages on the current user\'s watchlist.\";'),('de','messages:apihelp-query+watchlist-example-props','s:111:\"Fetch additional information about the top revision for recently changed pages on the current user\'s watchlist.\";'),('de','messages:apihelp-query+watchlist-example-allrev','s:84:\"Fetch information about all recent changes to pages on the current user\'s watchlist.\";'),('de','messages:apihelp-query+watchlist-example-generator','s:75:\"Fetch page info for recently changed pages on the current user\'s watchlist.\";'),('de','messages:apihelp-query+watchlist-example-generator-rev','s:80:\"Fetch revision info for recent changes to pages on the current user\'s watchlist.\";'),('de','messages:apihelp-query+watchlist-example-wlowner','s:93:\"List the top revision for recently changed pages on the watchlist of user <kbd>Example</kbd>.\";'),('de','messages:apihelp-query+watchlistraw-description','s:46:\"Get all pages on the current user\'s watchlist.\";'),('de','messages:apihelp-query+watchlistraw-param-namespace','s:40:\"Only list pages in the given namespaces.\";'),('de','messages:apihelp-query+watchlistraw-param-limit','s:45:\"How many total results to return per request.\";'),('de','messages:apihelp-query+watchlistraw-param-prop','s:35:\"Which additional properties to get:\";'),('de','messages:apihelp-query+watchlistraw-paramvalue-prop-changed','s:65:\"Adds timestamp of when the user was last notified about the edit.\";'),('de','messages:apihelp-query+watchlistraw-param-show','s:41:\"Only list items that meet these criteria.\";'),('de','messages:apihelp-query+watchlistraw-param-owner','s:63:\"Used along with $1token to access a different user\'s watchlist.\";'),('de','messages:apihelp-query+watchlistraw-param-token','s:148:\"A security token (available in the user\'s [[Special:Preferences#mw-prefsection-watchlist|preferences]]) to allow access to another user\'s watchlist.\";'),('de','messages:apihelp-query+watchlistraw-param-fromtitle','s:56:\"Title (with namespace prefix) to begin enumerating from.\";'),('de','messages:apihelp-query+watchlistraw-param-totitle','s:53:\"Title (with namespace prefix) to stop enumerating at.\";'),('de','messages:apihelp-query+watchlistraw-example-simple','s:43:\"List pages on the current user\'s watchlist.\";'),('de','messages:apihelp-query+watchlistraw-example-generator','s:58:\"Fetch page info for pages on the current user\'s watchlist.\";'),('de','messages:apihelp-revisiondelete-description','s:30:\"Delete and undelete revisions.\";'),('de','messages:apihelp-revisiondelete-param-type','s:42:\"Type of revision deletion being performed.\";'),('de','messages:apihelp-revisiondelete-param-target','s:63:\"Page title for the revision deletion, if required for the type.\";'),('de','messages:apihelp-revisiondelete-param-ids','s:44:\"Identifiers for the revisions to be deleted.\";'),('de','messages:apihelp-revisiondelete-param-hide','s:31:\"What to hide for each revision.\";'),('de','messages:apihelp-revisiondelete-param-show','s:33:\"What to unhide for each revision.\";'),('de','messages:apihelp-revisiondelete-param-suppress','s:63:\"Whether to suppress data from administrators as well as others.\";'),('de','messages:apihelp-revisiondelete-param-reason','s:38:\"Reason for the deletion or undeletion.\";'),('de','messages:apihelp-revisiondelete-example-revision','s:76:\"Hide content for revision <kbd>12345</kbd> on the page <kbd>Main Page</kbd>.\";'),('de','messages:apihelp-revisiondelete-example-log','s:85:\"Hide all data on log entry <kbd>67890</kbd> with the reason <kbd>BLP violation</kbd>.\";'),('de','messages:apihelp-rollback-description','s:129:\"Undo the last edit to the page.\n\nIf the last user who edited the page made multiple edits in a row, they will all be rolled back.\";'),('de','messages:apihelp-rollback-param-title','s:81:\"Title of the page to roll back. Cannot be used together with <var>$1pageid</var>.\";'),('de','messages:apihelp-rollback-param-pageid','s:82:\"Page ID of the page to roll back. Cannot be used together with <var>$1title</var>.\";'),('de','messages:apihelp-rollback-param-user','s:51:\"Name of the user whose edits are to be rolled back.\";'),('de','messages:apihelp-rollback-param-summary','s:60:\"Custom edit summary. If empty, default summary will be used.\";'),('de','messages:apihelp-rollback-param-markbot','s:52:\"Mark the reverted edits and the revert as bot edits.\";'),('de','messages:apihelp-rollback-param-watchlist','s:113:\"Unconditionally add or remove the page from the current user\'s watchlist, use preferences or do not change watch.\";'),('de','messages:apihelp-rollback-example-simple','s:81:\"Roll back the last edits to page <kbd>Main Page</kbd> by user <kbd>Example</kbd>.\";'),('de','messages:apihelp-rollback-example-summary','s:180:\"Roll back the last edits to page <kbd>Main Page</kbd> by IP user <kbd>192.0.2.5</kbd> with summary <kbd>Reverting vandalism</kbd>, and mark those edits and the revert as bot edits.\";'),('de','messages:apihelp-setnotificationtimestamp-description','s:222:\"Update the notification timestamp for watched pages.\n\nThis affects the highlighting of changed pages in the watchlist and history, and the sending of email when the \"{{int:tog-enotifwatchlistpages}}\" preference is enabled.\";'),('de','messages:apihelp-setnotificationtimestamp-param-timestamp','s:53:\"Timestamp to which to set the notification timestamp.\";'),('de','messages:apihelp-setnotificationtimestamp-param-torevid','s:62:\"Revision to set the notification timestamp to (one page only).\";'),('de','messages:apihelp-setnotificationtimestamp-param-newerthanrevid','s:70:\"Revision to set the notification timestamp newer than (one page only).\";'),('de','messages:apihelp-setnotificationtimestamp-example-all','s:55:\"Reset the notification status for the entire watchlist.\";'),('de','messages:apihelp-setnotificationtimestamp-example-page','s:55:\"Reset the notification status for <kbd>Main page</kbd>.\";'),('de','messages:apihelp-setnotificationtimestamp-example-pagetimestamp','s:103:\"Set the notification timestamp for <kbd>Main page</kbd> so all edits since 1 January 2012 are unviewed.\";'),('de','messages:apihelp-setnotificationtimestamp-example-allpages','s:80:\"Reset the notification status for pages in the <kbd>{{ns:user}}</kbd> namespace.\";'),('de','messages:apihelp-stashedit-description','s:134:\"Prepare an edit in shared cache.\n\nThis is intended to be used via AJAX from the edit form to improve the performance of the page save.\";'),('de','messages:apihelp-stashedit-param-title','s:31:\"Title of the page being edited.\";'),('de','messages:apihelp-stashedit-param-section','s:83:\"Section number. <kbd>0</kbd> for the top section, <kbd>new</kbd> for a new section.\";'),('de','messages:apihelp-stashedit-param-sectiontitle','s:28:\"The title for a new section.\";'),('de','messages:apihelp-stashedit-param-text','s:13:\"Page content.\";'),('de','messages:apihelp-stashedit-param-contentmodel','s:33:\"Content model of the new content.\";'),('de','messages:apihelp-stashedit-param-contentformat','s:53:\"Content serialization format used for the input text.\";'),('de','messages:apihelp-stashedit-param-baserevid','s:33:\"Revision ID of the base revision.\";'),('de','messages:apihelp-tag-description','s:67:\"Add or remove change tags from individual revisions or log entries.\";'),('de','messages:apihelp-tag-param-rcid','s:67:\"One or more recent changes IDs from which to add or remove the tag.\";'),('de','messages:apihelp-tag-param-revid','s:61:\"One or more revision IDs from which to add or remove the tag.\";'),('de','messages:apihelp-tag-param-logid','s:62:\"One or more log entry IDs from which to add or remove the tag.\";'),('de','messages:apihelp-tag-param-add','s:53:\"Tags to add. Only manually defined tags can be added.\";'),('de','messages:apihelp-tag-param-remove','s:98:\"Tags to remove. Only tags that are either manually defined or completely undefined can be removed.\";'),('de','messages:apihelp-tag-example-rev','s:79:\"Add the <kbd>vandalism</kbd> tag to revision ID 123 without specifying a reason\";'),('de','messages:apihelp-tag-example-log','s:95:\"Remove the <kbd>spam</kbd> tag from log entry ID 123 with the reason <kbd>Wrongly applied</kbd>\";'),('de','messages:apihelp-tokens-description','s:136:\"Get tokens for data-modifying actions.\n\nThis module is deprecated in favor of [[Special:ApiHelp/query+tokens|action=query&meta=tokens]].\";'),('de','messages:apihelp-tokens-param-type','s:26:\"Types of token to request.\";'),('de','messages:apihelp-tokens-example-edit','s:37:\"Retrieve an edit token (the default).\";'),('de','messages:apihelp-tokens-example-emailmove','s:41:\"Retrieve an email token and a move token.\";'),('de','messages:apihelp-unblock-param-id','s:117:\"ID of the block to unblock (obtained through <kbd>list=blocks</kbd>). Cannot be used together with <var>$1user</var>.\";'),('de','messages:apihelp-unblock-param-user','s:90:\"Username, IP address or IP range to unblock. Cannot be used together with <var>$1id</var>.\";'),('de','messages:apihelp-unblock-example-user','s:61:\"Unblock user <kbd>Bob</kbd> with reason <kbd>Sorry Bob</kbd>.\";'),('de','messages:apihelp-undelete-description','s:281:\"Restore revisions of a deleted page.\n\nA list of deleted revisions (including timestamps) can be retrieved through [[Special:ApiHelp/query+deletedrevs|list=deletedrevs]], and a list of deleted file IDs can be retrieved through [[Special:ApiHelp/query+filearchive|list=filearchive]].\";'),('de','messages:apihelp-undelete-param-title','s:29:\"Title of the page to restore.\";'),('de','messages:apihelp-undelete-param-timestamps','s:129:\"Timestamps of the revisions to restore. If both <var>$1timestamps</var> and <var>$1fileids</var> are empty, all will be restored.\";'),('de','messages:apihelp-undelete-param-fileids','s:127:\"IDs of the file revisions to restore. If both <var>$1timestamps</var> and <var>$1fileids</var> are empty, all will be restored.\";'),('de','messages:apihelp-undelete-param-watchlist','s:113:\"Unconditionally add or remove the page from the current user\'s watchlist, use preferences or do not change watch.\";'),('de','messages:apihelp-undelete-example-page','s:35:\"Undelete page <kbd>Main Page</kbd>.\";'),('de','messages:apihelp-undelete-example-revisions','s:52:\"Undelete two revisions of page <kbd>Main Page</kbd>.\";'),('de','messages:apihelp-upload-description','s:601:\"Upload a file, or get the status of pending uploads.\n\nSeveral methods are available:\n* Upload file contents directly, using the <var>$1file</var> parameter.\n* Upload the file in pieces, using the <var>$1filesize</var>, <var>$1chunk</var>, and <var>$1offset</var> parameters.\n* Have the MediaWiki server fetch a file from a URL, using the <var>$1url</var> parameter.\n* Complete an earlier upload that failed due to warnings, using the <var>$1filekey</var> parameter.\nNote that the HTTP POST must be done as a file upload (i.e. using <code>multipart/form-data</code>) when sending the <var>$1file</var>.\";'),('de','messages:apihelp-upload-param-comment','s:103:\"Upload comment. Also used as the initial page text for new files if <var>$1text</var> is not specified.\";'),('de','messages:apihelp-upload-param-text','s:32:\"Initial page text for new files.\";'),('de','messages:apihelp-upload-param-watchlist','s:113:\"Unconditionally add or remove the page from the current user\'s watchlist, use preferences or do not change watch.\";'),('de','messages:apihelp-upload-param-ignorewarnings','s:20:\"Ignore any warnings.\";'),('de','messages:apihelp-upload-param-filekey','s:67:\"Key that identifies a previous upload that was stashed temporarily.\";'),('de','messages:apihelp-upload-param-sessionkey','s:57:\"Same as $1filekey, maintained for backward compatibility.\";'),('de','messages:apihelp-upload-param-stash','s:90:\"If set, the server will stash the file temporarily instead of adding it to the repository.\";'),('de','messages:apihelp-upload-param-filesize','s:26:\"Filesize of entire upload.\";'),('de','messages:apihelp-upload-param-offset','s:25:\"Offset of chunk in bytes.\";'),('de','messages:apihelp-upload-param-chunk','s:15:\"Chunk contents.\";'),('de','messages:apihelp-upload-param-async','s:66:\"Make potentially large file operations asynchronous when possible.\";'),('de','messages:apihelp-upload-param-asyncdownload','s:33:\"Make fetching a URL asynchronous.\";'),('de','messages:apihelp-upload-param-leavemessage','s:76:\"If asyncdownload is used, leave a message on the user talk page if finished.\";'),('de','messages:apihelp-upload-param-statuskey','s:58:\"Fetch the upload status for this file key (upload by URL).\";'),('de','messages:apihelp-upload-param-checkstatus','s:52:\"Only fetch the upload status for the given file key.\";'),('de','messages:apihelp-upload-example-filekey','s:47:\"Complete an upload that failed due to warnings.\";'),('de','messages:apihelp-userrights-description','s:33:\"Change a user\'s group membership.\";'),('de','messages:apihelp-userrights-param-add','s:29:\"Add the user to these groups.\";'),('de','messages:apihelp-userrights-param-remove','s:34:\"Remove the user from these groups.\";'),('de','messages:apihelp-userrights-param-reason','s:22:\"Reason for the change.\";'),('de','messages:apihelp-userrights-example-user','s:118:\"Add user <kbd>FooBot</kbd> to group <kbd>bot</kbd>, and remove from groups <kbd>sysop</kbd> and <kbd>bureaucrat</kbd>.\";'),('de','messages:apihelp-userrights-example-userid','s:127:\"Add the user with ID <kbd>123</kbd> to group <kbd>bot</kbd>, and remove from groups <kbd>sysop</kbd> and <kbd>bureaucrat</kbd>.\";'),('de','messages:apihelp-watch-description','s:54:\"Add or remove pages from the current user\'s watchlist.\";'),('de','messages:apihelp-watch-param-title','s:55:\"The page to (un)watch. Use <var>$1titles</var> instead.\";'),('de','messages:apihelp-watch-param-unwatch','s:54:\"If set the page will be unwatched rather than watched.\";'),('de','messages:apihelp-watch-example-unwatch','s:38:\"Unwatch the page <kbd>Main Page</kbd>.\";'),('de','messages:apihelp-watch-example-generator','s:48:\"Watch the first few pages in the main namespace.\";'),('de','messages:apihelp-json-param-ascii','s:126:\"If specified, encodes all non-ASCII using hexadecimal escape sequences. Default when <var>formatversion</var> is <kbd>1</kbd>.\";'),('de','messages:apihelp-json-param-formatversion','s:251:\"Output formatting:\n;1:Backwards-compatible format (XML-style booleans, <samp>*</samp> keys for content nodes, etc.).\n;2:Experimental modern format. Details may change!\n;latest:Use the latest format (currently <kbd>2</kbd>), may change without warning.\";'),('de','messages:apihelp-php-param-formatversion','s:251:\"Output formatting:\n;1:Backwards-compatible format (XML-style booleans, <samp>*</samp> keys for content nodes, etc.).\n;2:Experimental modern format. Details may change!\n;latest:Use the latest format (currently <kbd>2</kbd>), may change without warning.\";'),('de','messages:api-format-prettyprint-header-only-html','s:200:\"This is an HTML representation intended for debugging, and is unsuitable for application use.\n\nSee the [[mw:API|complete documentation]], or the [[Special:ApiHelp/main|API help]] for more information.\";'),('de','messages:api-pageset-param-generator','s:166:\"Get the list of pages to work on by executing the specified query module.\n\n<strong>Note:</strong> Generator parameter names must be prefixed with a \"g\", see examples.\";'),('de','messages:api-pageset-param-redirects-generator','s:151:\"Automatically resolve redirects in <var>$1titles</var>, <var>$1pageids</var>, and <var>$1revids</var>, and in pages returned by <var>$1generator</var>.\";'),('de','messages:api-pageset-param-redirects-nogenerator','s:102:\"Automatically resolve redirects in <var>$1titles</var>, <var>$1pageids</var>, and <var>$1revids</var>.\";'),('de','messages:api-pageset-param-converttitles','s:171:\"Convert titles to other variants if necessary. Only works if the wiki\'s content language supports variant conversion. Languages that support variant conversion include $1.\";'),('de','messages:api-help-fallback-description','s:2:\"$1\";'),('de','messages:api-help-fallback-parameter','s:2:\"$1\";'),('de','messages:api-help-fallback-example','s:2:\"$1\";'),('de','messages:api-help-flags','s:0:\"\";'),('de','messages:api-help-help-urls','s:0:\"\";'),('de','messages:api-help-datatypes','s:1817:\"Some parameter types in API requests need further explanation:\n;boolean\n:Boolean parameters work like HTML checkboxes: if the parameter is specified, regardless of value, it is considered true. For a false value, omit the parameter entirely.\n;timestamp\n:Timestamps may be specified in several formats. ISO 8601 date and time is recommended. All times are in UTC, any included timezone is ignored.\n:* ISO 8601 date and time, <kbd><var>2001</var>-<var>01</var>-<var>15</var>T<var>14</var>:<var>56</var>:<var>00</var>Z</kbd> (punctuation and <kbd>Z</kbd> are optional)\n:* ISO 8601 date and time with (ignored) fractional seconds, <kbd><var>2001</var>-<var>01</var>-<var>15</var>T<var>14</var>:<var>56</var>:<var>00</var>.<var>00001</var>Z</kbd> (dashes, colons, and <kbd>Z</kbd> are optional)\n:* MediaWiki format, <kbd><var>2001</var><var>01</var><var>15</var><var>14</var><var>56</var><var>00</var></kbd>\n:* Generic numeric format, <kbd><var>2001</var>-<var>01</var>-<var>15</var> <var>14</var>:<var>56</var>:<var>00</var></kbd> (optional timezone of <kbd>GMT</kbd>, <kbd>+<var>##</var></kbd>, or <kbd>-<var>##</var></kbd> is ignored)\n:* EXIF format, <kbd><var>2001</var>:<var>01</var>:<var>15</var> <var>14</var>:<var>56</var>:<var>00</var></kbd>\n:*RFC 2822 format (timezone may be omitted), <kbd><var>Mon</var>, <var>15</var> <var>Jan</var> <var>2001</var> <var>14</var>:<var>56</var>:<var>00</var></kbd>\n:* RFC 850 format (timezone may be omitted), <kbd><var>Monday</var>, <var>15</var>-<var>Jan</var>-<var>2001</var> <var>14</var>:<var>56</var>:<var>00</var></kbd>\n:* C ctime format, <kbd><var>Mon</var> <var>Jan</var> <var>15</var> <var>14</var>:<var>56</var>:<var>00</var> <var>2001</var></kbd>\n:* Seconds since 1970-01-01T00:00:00Z as a 1 to 13 digit integer (excluding <kbd>0</kbd>)\n:* The string <kbd>now</kbd>\";'),('de','messages:api-help-param-type-limit','s:31:\"Type: integer or <kbd>max</kbd>\";'),('de','messages:api-help-param-type-integer','s:48:\"Type: {{PLURAL:$1|1=integer|2=list of integers}}\";'),('de','messages:api-help-param-type-boolean','s:63:\"Type: boolean ([[Special:ApiHelp/main#main/datatypes|details]])\";'),('de','messages:api-help-param-type-password','s:0:\"\";'),('de','messages:api-help-param-type-timestamp','s:110:\"Type: {{PLURAL:$1|1=timestamp|2=list of timestamps}} ([[Special:ApiHelp/main#main/datatypes|allowed formats]])\";'),('de','messages:api-help-param-type-user','s:52:\"Type: {{PLURAL:$1|1=user name|2=list of user names}}\";'),('de','messages:api-help-param-token-webui','s:65:\"For compatibility, the token used in the web UI is also accepted.\";'),('de','messages:api-help-para