INSERT INTO `text` VALUES (1,'<strong>MediaWiki has been successfully installed.</strong>\n\nConsult the [//meta.wikimedia.org/wiki/Help:Contents User\'s Guide] for information on using the wiki software.\n\n== Getting started ==\n* [//www.mediawiki.org/wiki/Special:MyLanguage/Manual:Configuration_settings Configuration settings list]\n* [//www.mediawiki.org/wiki/Special:MyLanguage/Manual:FAQ MediaWiki FAQ]\n* [https://lists.wikimedia.org/mailman/listinfo/mediawiki-announce MediaWiki release mailing list]\n* [//www.mediawiki.org/wiki/Special:MyLanguage/Localisation#Translation_resources Localise MediaWiki for your language]','utf-8'),(2,'<strong>MediaWiki has been successfully installed.</strong>\n\nConsult the [//meta.wikimedia.org/wiki/Help:Contents User\'s Guide] for information on using the wiki software.\n\n== Getting started ==\n* [//www.mediawiki.org/wiki/Special:MyLanguage/Manual:Configuration_settings Configuration settings list]\n* [//www.mediawiki.org/wiki/Special:MyLanguage/Manual:FAQ MediaWiki FAQ]\n* [https://lists.wikimedia.org/mailman/listinfo/mediawiki-announce MediaWiki release mailing list]\n* [//www.mediawiki.org/wiki/Special:MyLanguage/Localisation#Translation_resources Localise MediaWiki for your language]\n\n[[Village:Amateur_Radio page 2016]]\n\n[[Village:Amateur_Radio page 2014]]','utf-8'),(3,'{{Village\n|Description=Ham radio at its finest.\n|Contact=M0TZO\n|Activities=Demonstrations of Amateur Radio communication and possibly some contesting.\n|Location=51.21250,-0.60941\n|Name=mateur (Ham) Radio enthusiasts\n|Picture=Radiotowerhi.png\n}}\n==Amateur Radio==\nQuoting from Wikipedia [https://en.wikipedia.org/wiki/Amateur_radio Amateur Radio page] \'\'\"Amateur radio (also called \"ham\" radio) describes the use of radio frequency spectra for purposes of non-commercial exchange of messages, wireless experimentation, self-training, private recreation and emergency communication\".\'\'\n\nDuring EMF 2016 will shall be showcasing Amateur Radio on Bands from 3.5 MHz (80m) to 430MHz (70cm) and maybe higher. We\'ll also have a local frequency on either 144MHz (2m) &/or 430MHz (70cm) FM.\n\nFor reference, the EMF site in Guildford is at Gridsquare: IO91QF. WAB Square: SU94\n\nUnique Hackerspace passport stamp available on site. Please ask for Paul M0TZO for the stamp in your passport.\n\n===Special Event Callsigns===\nAmateur Radio Village will be operating a special event station: \'\'\'GB4EMF\'\'\'<br />\nAnother team will be the special event station: \'\'\'GB8EMF\'\'\'\n\n===Local Comms===\n145.425 / 433.425 simplex NFM \'\'(If in use by other Amateurs then please try 145.450 / 433.450)\'\'\n\n==Amateur Radio chat on IRC/Telegram/Facebook==\nWe\'re using [http://en.wikipedia.org/wiki/IRC IRC] and [https://telegram.org/ Telegram] to organise the Amateur Radio Village, & you can find us on [https://kiwiirc.com/client/irc.freenode.net/emfhams <tt>#emfhams</tt>] on Freenode or our [https://telegram.me/joinchat/A3glvAZ5xf_T9RkCfuDeOA Telegram Group]. The IRC channel and Telegram group are linked, so you can use either.\n\n* IRC Network - <tt>chat.freenode.net</tt> on port 6667 (non-SSL) or 6697 (SSL, recommended)<br />\n* Channel - #emfhams<br />\n* Username - Callsign or other username<br />\n* Web Based Link to #emfhams - [http://webchat.freenode.net?channels=emfhams Webbased #emfhams channel]\n* Connect through Tor (Instructions can be found [http://freenode.net/irc_servers.shtml#tor here])\n* [https://telegram.me/emfhams Join our Telegram Group] (iPhone, Android Apps & Web Based)\n\nThere is also a Facebook group with pictures, videos and other bits:\n\n* [https://www.facebook.com/groups/316141732057436/ Facebook: EMF Hams]\n\n===Chat Members===\n{| class=\"wikitable sortable\"\n! style=\"text-align:left;\"| Callsign*\n! IRC Name\n! First Name\n! Role\n! Ticket\n! Notes\n|-\n| data-sort-value=\"M6LPI\"| M6LPI\n| M6LPI\n| Neil\n| &nbsp;\n| No\n| &nbsp;\n|-\n| data-sort-value=\"M0RVM\"| MRVM\n| tgreer\n| Thomas\n| &nbsp;\n| &nbsp;\n| &nbsp;\n|-\n| data-sort-value=\"M0WPG\"| M0WPG\n| paul-M0WPG\n| data-sort-value=\"Paul\"| Paul (another)\n| &nbsp;\n| Yes\n| Bringing Gazebo & SCAM12 mast\n|-\n| 2M0STB\n| irl\n| Iain\n| &nbsp;\n| No\n| &nbsp;\n|-\n| 5Q5R\n| mihtjel\n| Rune\n| &nbsp;\n| &nbsp;\n| &nbsp;\n|-\n| [https://www.qrz.com/lookup/M0NGY MNGY]\n| Filbert\n| Jon\n| &nbsp;\n| Yes\n| &nbsp;\n|-\n| M0RYS\n| kraptv\n| Ryan\n| &nbsp;\n| &nbsp;\n| &nbsp;\n|-\n| MM3ZRZ\n| hibby/Rde\n| Dave\n| Buckfast Warrior\n| data-sort-value=\"Yes\"| Aye\n| Manages Scottish Consulate, will have 5.4m mast in consulate\n|-\n| data-sort-value=\"M0TZO\"| [http://www.m0tzo.co.uk MTZO]\n| data-sort-value=\"M0TZO\"| MTZO\n| Paul\n| Ham Village Lead\n| Yes\n| Bringing APRS kit, 2014 EMF Badge network, Handheld Radios and Cards Against Humanity (big set)\n|-\n| data-sort-value=\"M0SPN\"| M0SPN\n| M0SPN\n| Steve\n| &nbsp;\n| Yes\n| &nbsp;\n|-\n| data-sort-value=\"DB1SQU\"| DB1SQU\n| SQUelcher\n| Kai\n| &nbsp;\n| &nbsp;\n| &nbsp;\n|-\n| data-sort-value=\"M0NIT\"| M0NIT\n| M0NIT\n| Jan\n| &nbsp;\n| &nbsp;\n| &nbsp;\n|-\n| data-sort-value=\"M0PLL\"| M0PLL\n| plett\n| Paul (yet another one!)\n| &nbsp;\n| Yes\n| &nbsp;\n|-\n| data-sort-value=\"M0DLX\"| M0DLX\n| Dominic\n| Dominic\n| &nbsp;\n| Yes\n| Bringing IC-706, 2m/70cms beams, may enter contests\n|-\n| data-sort-value=\"HB9EGM\"| HB9EGM\n| hb9egm\n| Matthias\n| &nbsp;\n| &nbsp;\n| Doing DAB things\n|-\n| data-sort-value=\"M0NIT\"| M0NIT\n| jasiek\n| Jan\n| &nbsp;\n| &nbsp;\n| &nbsp;\n|-\n| data-sort-value=\"2E0TPS\"| 2E0TPS\n| MatStace\n| Mat\n| &nbsp;\n| Yes\n| Bringing couple of DMR handies (MD-380 and MD-390), arrow antenna and vx-8r for ISS APRS, and a pair of ft-817s to attempt to do something amsat based.\n|-\n| data-sort-value=\"G6VZM\"| G6VZM\n| g6vzm\n| JJ\n| Token old bloke with G- call to balance the inclusivity statistics.\n| Yes\n| Could bring FT-1000MP if shack is dry and secure, definitely FT-897D, 10m lightweight guyed mast, 2+70 yagis if required, <s>organising (but not actual transporting) 50m RG213 from LHS and</s> antenna cable believed to be 15-20m of RG-213.\n|-\n| data-sort-value=\"M6KVA\"| M6KVA\n| pe5er\n| Peter\n| Village First Aider\n| Yes\n| Bringing Kenwood TM-241E, Realtek SDRs, selection of DIY 2m antennas\n|-\n| data-sort-value=\"MM0MRU\"| MM0MRU\n| WSPR\n| Calum\n| &nbsp;\n| Yes\n| &nbsp;\n|-\n| data-sort-value=\"M1PFS\"| M1PFS\n| M1PFS\n| Pete\n| &nbsp;\n| Yes\n| SDR stuff and Raspberry Pi\n|-\n| data-sort-value=\"M1DHL\"| M1DHL\n| murb\n| bill\n| &nbsp;\n| Yes\n| &nbsp;\n|-\n| data-sort-value=\"G0VQH\"| G0VQH\n| jennyb\n| Jenny\n| &nbsp;\n| Yes\n| Campervan + Large Tarheel. KX3+Pole+wire+gaffer tape for something creative;\n|-\n| data-sort-value=\"IV3BSI\"| IV3BSI\n| g5pw\n| Alja\n| &nbsp;\n| Yes\n| &nbsp;\n|-\n| data-sort-value=\"PD5KNR\"| PD5KNR\n| Knorrie\n| Hans\n| Learning stuff\n| Yes\n| &nbsp;\n|-\n| data-sort-value=\"ON4PHP\"| ON4PHP\n| trouble\n| Philip\n| &nbsp;\n| Yes\n| &nbsp;\n|-\n| data-sort-value=\"MM0TKE\"| MM0TKE\n| tkerby\n| Tim\n| &nbsp;\n| Yes\n| Bringing an APRS iGate and a Yaesu VX-8\n-\n\n|}\n<nowiki />* If you have a Callsign\n\n==Local Repeaters==\n\'\'List being updated\'\'\n{| class=\"wikitable sortable\"\n! style=\"text-align:left;\"| Repeater!!Output!!Recieve!!CTCSS/DMR!!Distance!!Notes\n|-\n| GB3GF ||433.3000||434.9000||88.5Hz||1.9 miles||FM voice\n|-\n| GB7GF ||439.6875||430.6875||3||1.9 miles||DMR\n|-\n| GB3HV ||3408.000||1248.000||&nbsp;||8.2 miles||ATV\n|-\n| GB3FX ||50.8100||51.3100||82.5Hz||8.7 miles||FM voice\n|-\n| GB3FN ||433.3750||434.9750||82.5Hz||8.7 miles||FM voice\n|-\n| GB3FM ||1297.0500||1291.0500||100.0Hz||8.7 miles||FM voice\n|-\n| GB3BN ||433.0000||434.6000||118.8Hz||14.7 miles||FM voice, Echolink ID 1938\n|-\n| GB7EP ||439.4000||430.4000||3||17.7 miles||DMR\n|-\n| GB3SN ||145.7250||145.1250||71.9Hz||19.5 miles||FM voice\n|-\n| GB7ID ||430.9750||438.5750||3||20.8 miles||DMR\n|}\n\n==ISS Passes==\nThere are quite a few ISS passes of which at least six are at high angle during hacker-friendly times:\n\n{| class=\"wikitable sortable\"\n! style=\"text-align:left;\"| Date!!Start!!Alt!!Az!!Highest!!Alt!!Az!!End!!Alt!!Az!!Pass type\n|-\n| 05 Aug\n| 19:30:38\n| 10\n| SW\n| 19:33:50\n| 51\n| SSE\n| 19:37:01\n| 10\n| E\n| daylight \n|-\n| 05 Aug\n| 21:06:56\n| 10\n| W\n| 21:10:12\n| 81\n| N\n| 21:13:28\n| 10\n| E\n| daylight \n|-\n| 05 Aug\n| 22:43:24\n| 10\n| W\n| 22:46:39\n| 69\n| SSW\n| 22:49:54\n| 10\n| ESE\n| visible \n|-\n| 06 Aug\n| 00:20:13\n| 10\n| W\n| 00:22:43\n| 20\n| SW\n| 00:25:12\n| 10\n| SSE\n| visible \n|-\n| 06 Aug\n| 18:37:56\n| 10\n| SW\n| 18:40:57\n| 35\n| SSE\n| 18:43:58\n| 10\n| E\n| daylight \n|-\n| 06 Aug\n| 20:13:57\n| 10\n| W \n| 0:17:13\n| 89\n| N\n| 20:20:30\n| 10\n| E\n| daylight \n|-\n| 06 Aug\n| 21:50:26\n| 10\n| W\n| 21:53:42\n| 87\n| SSW\n| 21:56:58\n| 10\n| ESE\n| visible \n|-\n| 06 Aug\n| 23:27:00\n| 10\n| W\n| 23:29:55\n| 30\n| SSW\n| 23:32:50\n| 10\n| SSE\n| visible \n|-\n| 07 Aug\n| 17:45:28\n| 10\n| SSW\n| 17:48:09\n| 23\n| SE\n| 17:50:49\n| 10\n| E\n| daylight \n|-\n| 07 Aug\n| 19:20:59\n| 10\n| WSW\n| 19:24:15\n| 76\n| SSE\n| 19:27:31\n| 10\n| E\n| daylight \n|-\n| 07 Aug\n| 20:57:27\n| 10\n| W\n| 21:00:43\n| 83\n| N\n| 21:03:59\n| 10\n| E\n| daylight \n|-\n| 07 Aug\n| 22:33:55\n| 10\n| W\n| 22:37:04\n| 45\n| SSW\n| 22:40:12\n| 10\n| SE\n| visible \n|}\n\n==Contests==\nThere are a [http://www.rsgbcc.org/cgi-bin/readcal.pl couple of contests] on during EMF which we might want to put together a station for:\n\nAlso here nearer the time will be contest over the EMF Camp weekend [http://www.hornucopia.com/contestcal/weeklycont.php Hornucopia.com 8 Day Contest Calendar]\n\n==Tasks/Organisation==\nSome tasks may already be complete - if so please add owner/completion date.  Otherwise feel free to take ownership.\n{| class=\"wikitable sortable\"\n! style=\"text-align:left;\"| Task*\n! Owner\n! Date Complete\n! Notes\n|-\n| Contact RSGB News\n| M0DLX\n| 24/07/16\n| Sent item for special event stations\n|-\n| Contact RADCOM\n| \n| &nbsp;\n| Press release?  \'\'\'Print deadline missed.\'\'\'\n|-\n| Contact GB2RS\n| M0DLX\n| 24/07/16\n| Sent item for special event stations\n|-\n| emfcamp\n| M0DLX\n| &nbsp;\n| Press release (Facebook/Twitter)?\n|-\n| Contact RSGB\n| M0SPN\n| 06/07/16\n| Requested promo paterial\n|-\n| Contact Yaesu\n| M0SPN\n| 06/07/16\n| Requested promo items & equipment loans\n|-\n| Contact Icom\n| M0SPN\n| 06/07/16\n| Requested promo items & equipment loans\n|-\n| Contact Kenwood\n| M0SPN\n| 06/07/16\n| Requested promo items & equipment loans\n|-\n| Contact Moonraker\n| M0SPN\n| 06/07/16\n| Requested antenna loans (for satellite)\n|-\n| Furniture\n| \n| &nbsp;\n| Organise loan/hire of tables & chairs\n|-\n| Equipment\n| \n| &nbsp;\n| Contact attendees and compile definitive radio/antenna/mast list\n|-\n| Event Write Up\n| \n| &nbsp;\n| Something to post on Social Media after event\n|-\n| Photos\n| \n| &nbsp;\n| Maybe have a Shared DropBox or space somewhere\n|-\n|}\n\n==Station Planning==\nInitial plan made from comments/equipment above.  Please keep updated with offers/changes.\n\nBear in mind that this is an initial framework based on the offers of equipment received and the constraints of the site as best we can determine from Google/OS etc. It\'s quite likely to change on the day so please don\'t be surprised if you\'ve offered equipment to do one thing but we suggest it\'s better for something else.  If you have particular plans please raise it in the IRC channel.\n\n===HF Station===\n{| class=\"wikitable sortable\"\n! style=\"text-align:left;\"| Function*\n! Item\n! Owner\n! Notes\n|-\n| Transceiver\n| Yaesu FT-1000 or FT-897\n| G6VZM\n| (May swap G6VZM\'s FT-897 with M0PSN\'s FT-847 if appropriate) (M0PLL also has an FT-450D if that\'s useful)\n|-\n| PSU\n| n/a\n| n/a\n| integral in both of above\n|-\n| Antenna\n| doublet\n| M0SPN\n| will probably need a balun\n|-\n| Antenna 2\n| Mosley Mini-33-aw\n| M0WPG\n| 5 band (20-10m), \n|-\n| Mast\n| SCAM-12\n| M0WPG\n| \n|-\n| Feeder\n| Twin/Ladder Line\n| JJ/plett/M0SPN and others\n| 20m length (can be trimmed) - M0SPN\n|-\n| Other\n| Logging computer? Data interface?\n| \n| \n|-\n| Antenna analyser\n| MFJ 259\n| M0NGY\n| \n|-\n| Antenna tuner\n| LDG Z-11ProII\n| M0DLX\n| (won\'t be needed with those transceivers but useful to have around)\n|}\n\n===VHF/UHF Station===\n{| class=\"wikitable sortable\"\n! style=\"text-align:left;\"| Function*\n! Item\n! Owner\n! Notes\n|-\n| Transceiver\n| Icom 706 MK1Ig\n| M0DLX\n| HF to 70cm\n|-\n| PSU\n| ?\n| M0DLX\n| To power IC-706\n|-\n| Antenna\n| 2/70 Beams\n| M0DLX\n| \n|-\n| Mast\n| 10m lightweight telescopic\n| G6VZM\n| \n|-\n| Feeder\n| PL259 or N-type (M0DLX has adapter for the former)\n| G6VZM can potentially get some\n| How long do we need?\n|-\n| Other\n| Logging computer? Data interface?\n| \n| \n|}\n\n===Satellite (and ISS?) Station===\n{| class=\"wikitable sortable\"\n! style=\"text-align:left;\"| Function*\n! Item\n! Owner\n! Notes\n|-\n| Transceiver\n| Yaesu FT-847\n| M0SPN\n| [Or swapped with G6VZM\'s FT-897]\n|-\n| PSU\n| 20A SMPS\n| M0SPN\n| \n|-\n| Antenna\n| 2 & 70 ZL Specials on G-5500 Az/El rotator\n| M0SPN \n| \n|-\n| Mast\n| 4(?) metre mast on tripod stand\n| M0SPN\n| \n|-\n| Feeder\n| COAX\n| M0SPN\n| 2x 15m Aircell-5\n|}\n\n===Local Comms===\nFor comms around the site, maybe a crossband repeater if handhelds can\'t reach from one side of the site to the other.\n{| class=\"wikitable sortable\"\n! style=\"text-align:left;\"| Function*\n! Item\n! Owner\n! Notes\n|-\n| Transceiver\n| FT8900\n| M0PLL\n| (or maybe TM-V71, or maybe both)\n|-\n| PSU\n| 20A SMPS\n| M0PLL\n| \n|-\n| Antenna\n| X-50 co-linear clone\n| M0PLL\n| N-type\n|-\n| Mast\n| 5.4m clansman mast\n| MM0MRU\n|\n|-\n| Feeder\n| 10m RG213\n| M0PLL\n| with N-types on both ends\n|}\n\n===Misc===\n{| class=\"wikitable sortable\"\n! style=\"text-align:left;\"| Item*\n! Owner\n! Notes\n|-\n| Gazebo\n| M0WPG\n| 4.5M * 3M, has sides, tie downs.\n|-\n| Power Distribution\n| M0WPG\n| 25M 16A Hookup Cable, 16A 3 way splitter, 2 * 16A -> 10 UK Mains power strips\n|-\n| Rotator\n| ?\n| ?\n|-\n| Table and stools\n| M0PLL\n| [http://www.decathlon.co.uk/camping-table-with-4-seats-4-6-people-green-id_8303444.html One of these]. 1.2m x 0.6m table with 4 folding stools\n|-\n| 4x chairs\n| M0DLX\n| Two camping chairs, two folding wooden chairs\n|-\n| Camping lantern\n| M0DLX\n| Small, rechargeable\n|}\n\n===Needed===\n{| class=\"wikitable sortable\"\n! style=\"text-align:left;\"| Item*\n! Owner\n! Notes\n|-\n| Assorted coax and connectors\n| \n| ...and a 50w soldering iron (50w minimum)\n|-\n| More tables and chairs\n| \n| \n|-\n| Laptops\n| \n| \n|-\n| Display screens\n| \n| To display contacts, satellites etc (just an idea)\n|-\n| Fixed displays\n| \n| Some way to display printed material\n|-\n| Lighting\n| \n| For night!\n|-\n|-\n| Beer fridge\n| M0PLL\n| I will bring an electric coolbox to use as a beer chiller if people bring drinks they want cooling\n|-\n| Coffee machine\n| \n| Bean-to-cup\n|-\n| Moon-onna-stick\n| \n| Is anyone reading this? [I want a pony]\n|-\n| Mains cables\n| everyone!\n| You \'\'\'always\'\'\' need more 4-way bars than you have\n|}\n\n==Useful Links==\n[https://sites.google.com/site/gw6itj/bandplan GW6ITJ UK Band Plans]\n[http://www.arrl.org/graphical-frequency-allocations USA Band Plans]\n\n[[Category:Schedule]] <!-- added by [[User:Ms7821]] so we can potentially put the contests in the schedule -->','utf-8'),(4,'{{Village\n|Name=Amateur Radio\n|Picture=Radiotowerhi.png\n|Description=ham radio at its finest.\n|Contact=Paul\n|Activities=Radio... durr\n|Location=51.967000, -0.793989\n}}\n\nMoved from [[radio]]\n\n\'\'\'We have a [https://lists.emfcamp.org/listinfo/hamradio mailing list] - please subscribe!\n\'\'\'\n\n==Things to during EMF==\n===Radio Village Workshops/Talks===\nWe plan on running some small talks/workshops on a fairly informal basis, these will include: \n* Introduction to software defined radio - Dominic\n* Something TBD - Paul\n* Amateur Radio: The Original Nerd Hobby - Ryan Sayre (2E0RYS / KG7NMC)\n* <span style=\"color: red;\">YOUR_TALK_HERE</span>\n\n===Contests===\nDuring EMF the following contests will be running\n\nhttp://www.hornucopia.com/contestcal/contestdetails.php?ref=99\n\nhttp://www.hornucopia.com/contestcal/contestdetails.php?ref=98\n\nhttp://www.hornucopia.com/contestcal/contestdetails.php?ref=101\n\n===Special Event Station===\nPaul (M0OKE) has applied for an NoV for a special call sign for a special event station, \'\'\'[[GB2EMF]]\'\'\'.  \n\nThis has been granted.\n\nColin (G8TMV) has organised RSGB posters and info leaflets.\n\n===Talk In===\n\nTalk in will be happening on 2m on Friday and will possibly continue intermittently throughout the weekend.  Operator(s) required.  This will take place on 145.550 MHz.\n\n===Modes & Bands===\n\nSteve M0SPN intends to run voice on HF.  VHF/UHF dependent on availability of masts and beams.\n\nIain MM6MVQ will have an SSTV receiving station operating during EMF on 70cm that will upload recieved images to the Internet. For details on this, see the [[Villages:57North#SSTV_Receiving_Station|57North village]] page.\n\n==Local Stuff==\n\n===Clubs===\n* Milton Keynes ARS (MKARS) are literally just up the road from the campsite - http://www.mkars.org.uk/ \n\n===Repeaters===\nIt would be very cool to have a dedicated on-site repeater just for EMF.  The practicality wouldn\'t be too difficult -- M0RND can provide a 2m/70cm colinear (which might be able to be hosted on the main EMF mast), and there\'s no shortage of radios which can do cross-band repeat, or something could be lashed up with two Baofeng UV-B5 radios and a diplexer.\n\nThe awkward part would be getting an NoV for the repeater, and getting it in time for EMF.\n\n* Voice - GB3VA http://ukrepeater.net/my_repeater.php?id=997\n\n* Digital - http://www.ukrepeater.net/repeaters/maps/gb7bp.jpg \n\n* Digital - http://www.ukrepeater.net/my_repeater.php?id=180\n\n==Tasks/Status==\n\n{| class=\"wikitable\"\n! Task \n! Owner(s) \n! Notes\n|-\n| Village/Station || tgreer?/Everyone! || Organisation of tent, power, network\n|-\n| Radios || (tbc) || Supply of HF/VHF/UHF gear<sup>1</sup>\n|-\n| Mast(s) || (tbc) || Supply of masts, rotator?<sup>2</sup> * Tgreer has 12m push up mast on his landrover * Hopefully LHS\'s trailer mast will be ready for then. [https://wiki.london.hackspace.org.uk/view/Project:Mast_Trailer]\n|-\n| Operators || See below || People volunteering to rotate operation/manning of station\n|-\n| Special Event Call || Paul M0OKE || [[GB2EMF]] granted by Ofcom\n|- \n| QSL Cards || Steve M0SPN || Assistance required <sup>3</sup>\n|- \n| GB2RS News || Paul || Emailed, probably a bit late for ticket sales though\n|-\n| Southgate ARC || ? (no owner) || Already up there!\n|-\n| TX Factor || Steve M0SPN || Initial contact made (to be passed to jontyw if successful)\n|-\n| Promo Material || Steve M0SPN || Initial contact made with RSGB, Kenwood, Yaseu, Icom, Moonraker, ML&S<sup>4</sup?\n|}\n<sup>1</sup> Steve M0SPN has TS450S & PSU available\n\n<sup>2</sup> Cillian (possible V/UHF yagis), tgreer (possible landrover/mast) \n\n<sup>3</sup> http://www.centreprint.co.uk/qsl_cards2.htm can deliver in 1-2 weeks,  50 for 250 cards\n\n<sup>4</sup> Leaflets/posters received from Icom, RSGB.\n\n==Equipment==\n{| class=\"wikitable\"\n! style=\"text-align:left;\"| Item\n! Amount\n! Status\n|-\n|Army tent thing\n|1\n|17\'6 http://www.rddusa.com/product/gp-small-tent-176-x-176/\n|-\n|Gazebo\n|1\n|3x3m with sides - Arrived from Ebay\n|-\n|Table\n|1\n|Rental booked\n|-\n|Chairs\n|6\n|Rental booked\n|-\n|Radio\n|1\n|TS450S (TCMSLP/M0SPN)\n|-\n|PSU\n|1\n|25A SMPSU (TCMSLP/M0SPN)\n|-\n|Antenna\n|1\n|V/UHF Colinear (TCMSLP/M0SPN)\n|-\n|Other radios etc...\n| \n| \n|-\n|}\n\n==People==\nA list of people who may or may not be going and may or may not be interested in doing things related to amateur radio.\n\n===Manual list===\n* David M0TNR `Cillian\' (is going, can bring some radio goodies, but doesn\'t want to dedicate all weekend to it)\n* Adam M0RND\n* Colin G8TMV\n* Paul M0OKE\n* Jon M0JSN\n* Gavan 2E0UND (Underhand on IRC)\n* Steve M0SPN (TCMSLP on #emfcamp)\n* Kai DB1SQU (SQUelcher on IRC)\n* Kimball 2E1FWL (drrk on IRC)\n* Relocker PA1BYL\n* Paul M0TZO - bringing D-STAR equipment\n* Blake KC9CHL\n* Alan MW6ZEC\n* Kraptv 2E0RYS (KG7NMC)\n* Iain MM6MVQ\n* Paul 2E0PGW\n* Bill M1DHL (murb on IRC)\n* Mark (no valid callsign atm because Ofcom have double-issued it)\n* Paul 2E1AWG\n\n===Villagers===\n{{inhabitant}}\n\n==Amateur Radio chat on IRC==\nIRC Network - chat.freenode.net<br />\nChannel - #emfhams<br />\nUsername - Callsign or other username<br />\nWeb Based Link - http://webchat.freenode.net/?channels=emfhams\n\n===Chat Members===\n{| class=\"wikitable\"\n! style=\"text-align:left;\"| Callsign*\n! IRC Name\n! First Name\n|-\n| 5Q5R\n| mihtjel\n| Rune\n|-\n| MM3ZRZ\n| hibby\n| Dave\n|-\n| MM6MVQ\n| irl\n| Iain\n|-\n|MTZO\n|MTZO\n|Paul\n|}\n<nowiki />* If you have a Callsign\n\n==Amateur Radio Village Feedback==\n\n===What Went Well===\n* The tent was friendly and there were a lot of interested people dropping in and exchanging knowledge. [[User:Irl|Irl]] ([[User talk:Irl|talk]]) 19:26, 5 September 2014 (UTC)\n\n===What Didn\'t===\n* No one sent any SSTV to my recieving station. That probably could have been planned a lot better. [[User:Irl|Irl]] ([[User talk:Irl|talk]]) 19:26, 5 September 2014 (UTC)\n\n===Ideas for 2016===\n* Get the whole camp mapped out using APRS. i.e. where the villages are, etc.\n** Get all the Hams on site with portable APRS setup\n** We\'re looking at a cheap [http://foxdelta.com/products/foxtrak1.htm FOXTRAK :: APRS Tracker] setup\n* Throw some packets at the ISS / other amateur satellite things\n* Foundation/intermediate practical workshops\n* EME?\n* Computer Logging (maybe adding to CloudLog online logbook see [here http://logbook.m3php.com/2e0sql/])\n* Website/Blog','utf-8'),(5,'== <strong>Welcome to the EMF Hams Wiki Site</strong> ==\n\n[[Village:Amateur_Radio page 2016]]\n\n[[Village:Amateur_Radio page 2014]]\n\n----\n\n<strong>MediaWiki has been successfully installed.</strong>\n\nConsult the [//meta.wikimedia.org/wiki/Help:Contents User\'s Guide] for information on using the wiki software.\n\n== Getting started ==\n* [//www.mediawiki.org/wiki/Special:MyLanguage/Manual:Configuration_settings Configuration settings list]\n* [//www.mediawiki.org/wiki/Special:MyLanguage/Manual:FAQ MediaWiki FAQ]\n* [https://lists.wikimedia.org/mailman/listinfo/mediawiki-announce MediaWiki release mailing list]\n* [//www.mediawiki.org/wiki/Special:MyLanguage/Localisation#Translation_resources Localise MediaWiki for your language]','utf-8'),(6,'== <strong>Welcome to the EMF Hams Wiki Site</strong> ==\n\nSorry for the current page having little information, but this is a new site and will be adding information soon.\n\n[[Village:Amateur_Radio page 2016]]\n\n[[Village:Amateur_Radio page 2014]]\n\n----\n\n<!-- Hidden Text\n<strong>MediaWiki has been successfully installed.</strong>\n\nConsult the [//meta.wikimedia.org/wiki/Help:Contents User\'s Guide] for information on using the wiki software.\n\n== Getting started ==\n* [//www.mediawiki.org/wiki/Special:MyLanguage/Manual:Configuration_settings Configuration settings list]\n* [//www.mediawiki.org/wiki/Special:MyLanguage/Manual:FAQ MediaWiki FAQ]\n* [https://lists.wikimedia.org/mailman/listinfo/mediawiki-announce MediaWiki release mailing list]\n* [//www.mediawiki.org/wiki/Special:MyLanguage/Localisation#Translation_resources Localise MediaWiki for your language]\n-->','utf-8'),(7,'{{MainPageIntro}}<!-- Template:MainPageIntro -->\n<div style=\"padding-bottom: .3em; margin: 0 .5em .5em\">{{Main Page banner}}</div>\n\n{| cellspacing=\"3\" \n|- valign=\"top\" \n|width=\"50%\" class=\"MainPageBG\" style=\"border: 4px solid #B0C8E3; 