to use. Anyone can edit the page, meaning that anyone can contribute.<br>You can learn more about this and how to do basic formatting here at [http://wiki.emfhams.org/Help:Contents EMF HamsWiki Help]. You can play around in the [[Sand Box]].</center>','utf-8'),(14,'=== <center>Help with using this Wiki</center> ===\n\n<center>Wiki\'s are by their nature meant to be easy for anyone to use. Anyone can edit the page, meaning that anyone can contribute.<br>You can learn more about this and how to do basic formatting here at [http://wiki.emfhams.org/index.php/Help:Contents EMF HamsWiki Help]. You can play around in the [[Sand Box]].</center>','utf-8'),(15,'== <strong>Welcome to the EMF Hams Wiki Site</strong> ==\n\n<center>We are currently working on at least [[Special:Statistics|{{NUMBEROFPAGES}}]] articles. Please feel free to register and start editing.</center><br>','utf-8'),(16,'=== What is EMF Camp? ===\n\nIt\'s a Biannual event for hackers, makers and geeky people to get together started in 2012. In 2016 some of the things you could do at the event included the following (in no particular order):- Blacksmithing, Maths, Ring Making, Karaoke, become a True Scotsman, Amateur Radio, Be on bridge if star trek ship, play 3D life sized Guitar hero, retro arcade & console games, internet controlled lighting of a rabbit, order a drink over the internet and watch a robot make it, Dungeons and dragons, cards against humanity, sumo robot competition, fire ping pong, 3D printing, Laser cutting, use a BBC micro to Tweet, be in a tent with Mains electricity, WiFi or Cabled internet, smoke machines, Laser tag, tuck shop, hackerspace passports and stamps, hackable badges, use a BBS, soldering,','utf-8'),(17,'Sorry for the current page having little information, but this is a new site and will be adding information soon','utf-8'),(18,'=== What is EMF Camp? ===\n\nIt\'s a Biannual event for hackers, makers and geeky people to get together started in 2012. In 2016 some of the things 