ecome a True Scotsman, Amateur Radio, Be on bridge if star trek ship, play 3D life sized Guitar hero, retro arcade & console games, internet controlled lighting of a rabbit, order a drink over the internet and watch a robot make it, Dungeons and dragons, cards against humanity, sumo robot competition, fire ping pong, 3D printing, Laser cutting, use a BBC micro to Tweet, be in a tent with Mains electricity, WiFi or Cabled internet, smoke machines, Laser tag, tuck shop, hackerspace passports and stamps, hackable badges, use a BBS, soldering, BBQ, use a fire pit, play laser tag, lock picking','utf-8'),(22,'=== What is EMF Camp? ===\n\nIt\'s a Biannual event for hackers, makers and geeky people to get together started in 2012. In 2016 some of the things you could do at the event included the following (in no particular order):- have Mains electricity, WiFi or Cabled internet to your tent, use Amateur Radio, become a True Scotsman, be on bridge of Star Trek ship, get a hackable conference badge, play retro arcade & console games, blacksmithing, maths, ring making, Karaoke, play 3D life sized Guitar hero, internet controlled lighting of a rabbit, order a drink over the internet and watch a robot make it, play Dungeons and dragons or cards against humanity, watch sumo robot competition & fire ping pong, 3D printing, Laser cutting, use a BBC micro to Tweet, smoke machines, Laser tag, tuck shop, hackerspace passports and stamps, use a BBS, soldering, BBQ, use a fire pit, play laser tag, ethical lock picking','utf-8'),(23,'[[EMF Ham Attendees]]\n\n[http://log.emfhams.org/ GB4EMF Log Book]\n\nPages from main EMF Camp site for EMF Hams\n\n[[Village:Amateur_Radio page 2016]]\n\n[[Village:Amateur_Radio page 2014]]','utf-8'),(24,'===Chat Members===\n{| class=\"wikitable sortable\"\n! style=\"text-align:left;\"| Callsign*\n! IRC Name\n! First Name\n! EMF Camp 2012\n! EMF (Wave) 2013\n! EMF Camp 2014\n! EMF Camp 2016\n|-\n| data-sort-value=\"M6LPI\"| M6LPI\n| M6LPI\n| Neil\n| &nbsp;