ro to Tweet, smoke machines, Laser tag, tuck shop, hackerspace passports and stamps, use a BBS, soldering, BBQ, use a fire pit, play laser tag, ethical lock picking\n\n==Hacker / Maker Camping Events==\n\n[[Calendar]]','utf-8'),(34,'===2016===\n==August==\nEMF camp \n==September==\n===2017===','utf-8'),(35,'===2016===\n==August==\nEMF camp\n[http://endsummercamp.org End Summer Camp, Italy] 31 Aug to 4 Sept\n\n==September==\n===2017===','utf-8'),(36,'===2016===\n==August==\n[http://emfcamp.org EMF camp, UK] 5th Aug to 7th Aug\n[http://endsummercamp.org End Summer Camp, Italy] 31 Aug to 4 Sept\n\n==September==\n===2017===','utf-8'),(37,'===2016===\n==August==\n[http://emfcamp.org EMF camp, UK] 5th Aug to 7th Aug<br />\n[http://endsummercamp.org End Summer Camp, Italy] 31 Aug to 4 Sept<br />\n\n==September==\n===2017===','utf-8'),(38,'===2016===\n==August==\n[http://emfcamp.org EMF camp, UK] 5th Aug to 7th Aug<br />\n[http://endsummercamp.org End Summer Camp, Italy] 31 Aug to 4 Sept<br />\n\n==September==\n==October==\n==November==\n==December==\n\n===2017===\n\n==January==\n==February==\n==March==\n==April==\n==May==\n==June==\n==July==\n==August==\n==September==\n==October==\n==November==\n==December==\n\n===2018===','utf-8'),(39,'==2016==\n===August===\n[http://emfcamp.org EMF camp, UK] 5th Aug to 7th Aug<br />\n[http://endsummercamp.org End Summer Camp, Italy] 31 Aug to 4 Sept<br />\n\n===September===\n===October===\n===November===\n===December===\n\n==2017==\n\n===January===\n===February===\n===March===\n===April===\n===May===\n===June===\n===July===\n===August===\n===September===\n===October===\n===November===\n===December===\n\n==2018==','utf-8'),(40,'==2012==\n===August===\n[http://emfcamp.org EMF camp, UK]<br />\n\n==2014==\n===August===\n[http://emfcamp.org EMF camp, UK]<br />\n\n==2016==\n===August===\n[http://emfcamp.org EMF camp, UK] 5th Aug to 7th Aug<br />\n[http://endsummercamp.org End Summer Camp, Italy] 31 Aug to 4 Sept<br />\n\n===September===\n===October===\n===November===\n===December===\n\n==2017==\n\n===January===\n===February===\n===March===\n===April===\n===May===\n===June===\n===July===\n===August===\n===September===\n===October===\n===November===\n===December===\n\n==2018==','utf-8'),(41,'==What is EMF Camp?==\n\nIt\'s a Biannual event for hackers, makers and geeky people to get together started in 2012. In 2016 some of the things you could do at the event included the following (in no particular order):- have Mains electricity, WiFi or Cabled internet to your tent, use Amateur Radio, become a True Scotsman, be on bridge of Star Trek ship, get a hackable conference badge, play retro arcade & console games, blacksmithing, maths, ring making, Karaoke, play 3D life sized Guitar hero, internet controlled lighting of a rabbit, order a drink over the internet and watch a robot make it, play Dungeons and dragons or cards against humanity, watch sumo robot competition & fire ping pong, 3D printing, Laser cutting, use a BBC micro to Tweet, smoke machines, Laser tag, tuck shop, hackerspace passports and stamps, use a BBS, soldering, BBQ, use a fire pit, play laser tag, ethical lock picking\n\n==Hacker / Maker Camping Events==\n\n[[Calendar]]','utf-8'),(42,'==What is EMF Camp?==\n\nIt\'s a Biannual (\'\'every 2 years\'\') event for hackers, makers and geeky people to get together started in 2012.\n\nIn 2016 some of the things you could do at the event included the following (in no particular order):-<br />have Mains electricity, WiFi or Cabled internet to your tent, use Amateur Radio, become a True Scotsman, be on bridge of Star Trek ship, get a hackable conference badge, play retro arcade & console games, blacksmithing, maths, ring making, Karaoke, play 3D life sized Guitar hero, internet controlled lighting of a rabbit, order a drink over the internet and watch a robot make it, play Dungeons and dragons or cards against humanity, watch sumo robot competition & fire ping pong, 3D printing, Laser cutting, use a BBC micro to Tweet, smoke machines, Laser tag, tuck shop, hackerspace passports and stamps, use a BBS, soldering, BBQ, use a fire pit, play laser tag, ethical lock picking\n\n==Hacker / Maker Camping Events==\n\n[[Calendar]]','utf-8'),(43,'==Amateur Radio chat on IRC/Telegram/Facebook==\nWe\'re using [http://en.wikipedia.org/wiki/IRC IRC] and [https://telegram.org/ Telegram] to organise the Amateur Radio Village, & you can find us on [https://kiwiirc.com/client/irc.freenode.net/emfhams <tt>#emfhams</tt>] on Freenode or our [https://telegram.me/joinchat/A3glvAZ5xf_T9RkCfuDeOA Telegram Group]. The IRC channel and Telegram group are linked, so you can use either.\n\n* IRC Network - <tt>chat.freenode.net</tt> on port 6667 (non-SSL) or 6697 (SSL, recommended)<br />\n* Channel - <tt>#emfhams</tt><br />\n* Username - Callsign or other username<br />\n* Web Based Link to <tt>#emfhams</tt> - [http://webchat.freenode.net?channels=emfhams Webbased #emfhams channel]\n* Connect through Tor (Instructions can be found [http://freenode.net/irc_servers.shtml#tor here])\n* [https://telegram.me/emfhams Join our Telegram Group] (iPhone, Android Apps & Web Based)\n\nThere is also a Facebook group with pictures, videos and other bits:\n\n* [https://www.facebook.com/groups/316141732057436/ Facebook: EMF Hams]\n\n==Attendess & Logbook==\n\n[[EMF Ham Attendees]]\n\n[http://log.emfhams.org/ GB4EMF Log Book]\n\n==Pages from main EMF Camp wiki for EMF Hams==\n\n[[Village:Amateur_Radio page 2016]]\n\n[[Village:Amateur_Radio page 2014]]','utf-8'),(44,'==Chat with us==\n===IRC / Telegram===\nWe\'re using [http://en.wikipedia.org/wiki/IRC IRC] and [https://telegram.org/ Telegram] to organise the Amateur Radio Village, & you can find us on [https://kiwiirc.com/client/irc.freenode.net/emfhams <tt>#emfhams</tt>] on Freenode or our [https://telegram.me/joinchat/A3glvAZ5xf_T9RkCfuDeOA Telegram Group]. The IRC channel and Telegram group are linked, so you can use either.\n\n* IRC Network - <tt>chat.freenode.net</tt> on port 6667 (non-SSL) or 6697 (SSL, recommended)<br />\n* Channel - <tt>#emfhams</tt><br />\n* Username - Callsign or other username<br />\n* Web Based Link to <tt>#emfhams</tt> - [http://webchat.freenode.net?channels=emfhams Webbased #emfhams channel]\n* Connect through Tor (Instructions can be found [http://freenode.net/irc_servers.shtml#tor here])\n* [https://telegram.me/emfhams Join our Telegram Group] (iPhone, Android Apps & Web Based)\n\n===Facebook===\nWe have a Facebook group with pictures, videos and other bits:\n\n* [https://www.facebook.com/groups/316141732057436/ Facebook: EMF Hams]\n\n===Attendess & Logbook===\n\n[[EMF Ham Attendees]]\n\n[http://log.emfhams.org/ GB4EMF Log Book]\n\n===Pages from main EMF Camp wiki for EMF Hams===\n\n[[Village:Amateur_Radio page 2016]]\n\n[[Village:Amateur_Radio page 2014]]','utf-8'),(45,'==What is EMF Camp?==\n\nIt\'s a Biannual (\'\'every 2 years\'\') event for hackers, makers and geeky people to get together started in 2012.\n\nIn 2016 some of the things you could do at the event included the following (in no particular order):-<br />have Mains electricity, WiFi or Cabled internet to your tent, use Amateur Radio, become a True Scotsman, be on bridge of Star Trek ship, get a hackable conference badge, play retro arcade & console games, blacksmithing, maths, ring making, Karaoke, play 3D life sized Guitar hero, internet controlled lighting of a rabbit, order a drink over the internet and watch a robot make it, play Dungeons and dragons or cards against humanity, watch sumo robot competition & fire ping pong, 3D printing, Laser cutting, use a BBC micro to Tweet, smoke machines, Laser tag, tuck shop, hackerspace passports and stamps, use a BBS, soldering, BBQ, use a fire pit, play laser tag, ethical lock picking\n\n==Hacker / Maker Camping Events==\n\n[[Calendar]]\n\n==2018 Planning==','utf-8'),(46,'==What is EMF Camp?==\n\nIt\'s a Biannual (\'\'every 2 years\'\') event for hackers, makers and geeky people to get together started in 2012.\n\nIn 2016 some of the things you could do at the event included the following (in no particular order):-<br />have Mains electricity, WiFi or Cabled internet to your tent, use Amateur Radio, become a True Scotsman, be on bridge of Star Trek ship, get a hackable conference badge, play retro arcade & console games, blacksmithing, maths, ring making, Karaoke, play 3D life sized Guitar hero, internet controlled lighting of a rabbit, order a drink over the internet and watch a robot make it, play Dungeons and dragons or cards against humanity, watch sumo robot competition & fire ping pong, 3D printing, Laser cutting, use a BBC micro to Tweet, smoke machines, Laser tag, tuck shop, hackerspace passports and stamps, use a BBS, soldering, BBQ, use a fire pit, play laser tag, ethical lock picking\n\n==Hacker / Maker Camping Events==\n\n[[Calendar]]\n\n==2018 Planning==\n\n[[Gateway Project]] \'\'(Name may change)\'\'','utf-8'),(47,'Project to Link Radios to the Internet at EMF Camp\n\nGateway Project name may change \n\n__TOC__\n\n==Comparison Table==\nComparison of possible Internet Linking Software.Note:- WORK IN PROGRESS\n{| class=\"wikitable sortable\" border=\"1\"\n|-\n! Name\n! Opensource \n! Hams Only\n! Notes\n|-\n| Echolink|| No || Y || Etc, Etc\n\n|}\n\n== [http://www.echolink.org/ Echolink] ==\n\nBeen around for many years, but looks dated now. \n\n===Pros===\n* Only for Registered Hams\n\n===Cons===\n* Closed Source','utf-8'),(48,'Project to Link Radios to the Internet at EMF Camp\n\nGateway Project name may change \n\n__TOC__\n\n==Comparison Table==\nComparison of possible Internet Linking Software.Note:- WORK IN PROGRESS\n{| class=\"wikitable sortable\" border=\"1\"\n|-\n! Name\n! Opensource \n! Hams Only\n! Notes\n|-\n| Echolink|| No || Y || Etc, Etc\n|-\n| Zello || ? || No || Etc, Etc\n|}\n\n== [http://www.echolink.org/ Echolink] ==\n\nBeen around for many years, but looks dated now. \n\n===Pros===\n* Only for Registered Hams\n\