o || Y || Etc, Etc\n|-\n| Telegram|| Partly || No || Even on Windows Phones\n|-\n| Zello || ? || No || Etc,\n|}\n\nOthers to look into at some points, Discord (gaming chat platform), XMPP / Jabber, Mumble, Teamspeak, Ventrillo.\n\n== [http://www.echolink.org/ Echolink] ==\n\nBeen around for many years, but looks dated now. \n\n===Pros===\n* Only for Registered Hams\n\n===Cons===\n* Closed Source\n\n== [https://allstarlink.org/ AllStarLink] ==\n\nA RoIP based network aimed at repeaters and gateways. \n\n===Pros===\n* Only for Registered Hams\n* Uses SIP protocol and open source modules. \n* Flexible\n\n===Cons===\n* Less widely known than other offerings\n* No native smartphone clients \n\n== [http://discordapp.com Discord (gaming chat platform)] ==\n===Pros===\n* Pro\n\n===Cons===\n* Con\n\n== [https://wiki.mumble.info/wiki/Main_Page Mumble] ==\n===Pros===\n* Pro\n\n===Cons===\n* Con\n\n\n== [https://www.teamspeak.com/en/teamspeak3 Teamspeak] ==\n===Pros===\n* Pro\n\n===Cons===\n* Con\n\n\n== [https://telegram.org/ Telegram] ==\n===Pros===\n* Pro\n\n===Cons===\n* Con\n\n\n== [http://www.ventrilo.com/ Ventrillo] ==\n===Pros===\n* Pro\n\n===Cons===\n* Con\n\n\n== [https://xmpp.org/ XMPP / Jabber] ==\n===Pros===\n* Pro\n\n===Cons===\n* Con\n\n\n== [https://zello.com/ Zello] ==\n===Pros===\n* Available\n* Up-to-date\n* Easy to use\n\n===Cons===\n* Reported high latency makes QSOs difficult\n* AFAIK They don\'t provide any bridging methods on their free tier, you have to rely on an always on device hooked up to a radio, using VOX.','utf-8'),(56,'This project aims to operate simplex gateways at EMF Camp 2018 so other radio amateurs around the globe can speak to people at the event. I propose we host two such gateways, one for Analogue and one for DMR.\n\nGateway Project name may change \n\n__TOC__\n\n==Internet Linking Protocol Comparisons==\n\nComparison of possible Internet Linking Software.Note:- WORK IN PROGRESS\n{| class=\"wikitable sortable\" border=\"1\"\n|-\n! Name\n! Opensource \n! Hams Only\n! Notes\n|-\n| Echolink|| No || Y || Etc, Etc\n|-\n| Telegram|| Partly || No || Even on Windows Phones\n|-\n| Zello || ? || No || Etc,\n|}\n\nOthers to look into at some points, Discord (gaming chat platform), XMPP / Jabber, Mumble, Teamspeak, Ventrillo.\n\nClick expand to view in more detail\n\n<div class=\"mw-collapsible mw-collapsed\" id=\"comparisons\">\n\n=== [http://www.echolink.org/ Echolink] ===\n\nBeen around for many years, but looks dated now. \n\n====Pros====\n* Only for Registered Hams\n\n====Cons====\n* Closed Source\n\n=== [https://allstarlink.org/ AllStarLink] ===\n\nA RoIP based network aimed at repeaters and gateways. \n\n====Pros====\n* Only for Registered Hams\n* Uses SIP protocol and open source modules. \n* Flexible\n\n====Cons====\n* Less widely known than other offerings\n* No native smartphone clients \n\n=== [http://discordapp.com Discord (gaming chat platform)] ===\n====Pros====\n* Pro\n\n====Cons====\n* Con\n\n=== [https://wiki.mumble.info/wiki/Main_Page Mumble] ===\n==== Pros ====\n* Pro\n\n====Cons====\n* Con\n\n\n=== [https://www.teamspeak.com/en/teamspeak3 Teamspeak] ===\n====Pros====\n* Pro\n\n====Cons====\n* Con\n\n\n=== [https://telegram.org/ Telegram] ===\n====Pros====\n* Pro\n\n====Cons====\n* Con\n\n\n=== [http://www.ventrilo.com/ Ventrillo] ===\n====Pros====\n* Pro\n\n====Cons====\n* Con\n\n\n=== [https://xmpp.org/ XMPP / Jabber] ===\n====Pros====\n* Pro\n\n====Cons====\n* Con\n\n\n=== [https://zello.com/ Zello] ===\n====Pros====\n* Available\n* Up-to-date\n* Easy to use\n\n====Cons====\n* Reported high latency makes QSOs difficult\n* AFAIK They don\'t provide any bridging methods on their free tier, you have to rely on an always on device hooked up to a radio, using VOX.\n</div>\n\n\n----','utf-8'),(57,'==Chat with us==\n===IRC / Telegram===\nWe\'re using [http://en.wikipedia.org/wiki/IRC IRC] and [https://telegram.org/ Telegram] to organise the Amateur Radio Village, & you can find us on [https://kiwiirc.com/client/irc.freenode.net/emfhams <tt>#emfhams</tt>] on Freenode or our [https://telegram.me/joinchat/A3glvAZ5xf_T9RkCfuDeOA Telegram Group]. The IRC channel and Telegram group are linked, so you can use either.\n\n* IRC Network - <tt>chat.freenode.net</tt> on port 6667 (non-SSL) or 6697 (SSL, recommended)<br />\n* Channel - <tt>#emfhams</tt><br />\n* Username - Callsign or other username<br />\n* Web Based Link to <tt>#emfhams</tt> - [http://webchat.freenode.net?channels=emfhams Webbased #emfhams channel]\n* Connect through Tor (Instructions can be found [http://freenode.net/irc_servers.shtml#tor here])\n* [https://telegram.me/emfhams Join our Telegram Group] (iPhone, Android Apps & Web Based)\n\n===Facebook===\nWe have a Facebook group with pictures, videos and other bits:\n\n* [https://www.facebook.com/groups/316141732057436/ Facebook: EMF Hams]\n\n===Attendess & Logbook===\n\n[[EMF Ham Attendees]]\n\n[http://log.emfhams.org/ GB4EMF Log Book]\n\n===Pages from main EMF Camp wiki for EMF Hams===\n\n[[Village:Amateur_Radio page 2018]]\n\n[[Village:Amateur_Radio page 2016]]\n\n[[Village:Amateur_Radio page 2014]]','utf-8'),(58,'{{Village\n|Description=Ham radio at its finest.\n|Contact=M0TZO\n|Activities=Demonstrations of Amateur Radio communication and possibly some contesting.\n|Location=51.21250,-0.60941\n|Name=mateur (Ham) Radio enthusiasts\n|Picture=Radiotowerhi.png\n}}\n==Amateur Radio==\nQuoting from Wikipedia [https://en.wikipedia.org/wiki/Amateur_radio Amateur Radio page] \'\'\"Amateur radio (also called \"ham\" radio) describes the use of radio frequency spectra for purposes of non-commercial exchange of messages, wireless experimentation, self-training, private recreation and emergency communication\".\'\'\n\nDuring EMF 2016 will shall be showcasing Amateur Radio on Bands from 3.5 MHz (80m) to 430MHz (70cm) and maybe higher. We\'ll also have a local frequency on either 144MHz (2m) &/or 430MHz (70cm) FM.\n\nFor reference, the EMF site in Guildford is at Gridsquare: IO91QF. WAB Square: SU94\n\nUnique Hackerspace passport stamp available on site. Please ask for Paul M0TZO for the stamp in your passport.\n\n===Special Event Callsigns===\nAmateur Radio Village will be operating a special event station: \'\'\'GB4EMF\'\'\'<br />\nAnother team will be the special event station: \'\'\'GB8EMF\'\'\'\n\n===Local Comms===\n145.425 / 433.425 simplex NFM \'\'(If in use by other Amateurs then please try 145.450 / 433.450)\'\'\n\n==Amateur Radio chat on IRC/Telegram/Facebook==\nWe\'re using [http://en.wikipedia.org/wiki/IRC IRC] and [https://telegram.org/ Telegram] to organise the Amateur Radio Village, & you can find us on [https://kiwiirc.com/client/irc.freenode.net/emfhams <tt>#emfhams</tt>] on Freenode or our [https://telegram.me/joinchat/A3glvAZ5xf_T9RkCfuDeOA Telegram Group]. The IRC channel and Telegram group are linked, so you can use either.\n\n* IRC Network - <tt>chat.freenode.net</tt> on port 6667 (non-SSL) or 6697 (SSL, recommended)<br />\n* Channel - #emfhams<br />\n* Username - Callsign or other username<br />\n* Web Based Link to #emfhams - [http://webchat.freenode.net?channels=emfhams Webbased #emfhams channel]\n* Connect through Tor (Instructions can be found [http://freenode.net/irc_servers.shtml#tor here])\n* [https://telegram.me/emfhams Join our Telegram Group] (iPhone, Android Apps & Web Based)\n\nThere is also a Facebook group with pictures, videos and other bits:\n\n* [https://www.facebook.com/groups/316141732057436/ Facebook: EMF Hams]\n\n===Chat Members===\n{| class=\"wikitable sortable\"\n! style=\"text-align:left;\"| Callsign*\n! IRC Name\n! First Name\n! Role\n! Ticket\n! Notes\n|-\n| data-sort-value=\"M6LPI\"| M6LPI\n| M6LPI\n| Neil\n| &nbsp;\n| No\n| &nbsp;\n|-\n| data-sort-value=\"M0RVM\"| MRVM\n| tgreer\n| Thomas\n| &nbsp;\n| &nbsp;\n| &nbsp;\n|-\n| data-sort-value=\"M0WPG\"| M0WPG\n| paul-M0WPG\n| data-sort-value=\"Paul\"| Paul (another)\n| &nbsp;\n| Yes\n| Bringing Gazebo & SCAM12 mast\n|-