name may change \n\n__TOC__\n\n==Internet Linking Protocol Comparisons==\n\nComparison of possible Internet Linking Software.Note:- WORK IN PROGRESS\n{| class=\"wikitable sortable\" border=\"1\"\n|-\n! Name\n! Opensource \n! Hams Only\n! Notes\n|-\n| Echolink|| No || Y || Etc, Etc\n|-\n| Telegram|| Partly || No || Even on Windows Phones\n|-\n| Zello || ? || No || Etc,\n|}\n\nOthers to look into at some points, Discord (gaming chat platform), XMPP / Jabber, Mumble, Teamspeak, Ventrillo.\n\nClick expand to view in more detail\n\n<div class=\"mw-collapsible mw-collapsed\" id=\"comparisons\">\n\n=== [http://www.echolink.org/ Echolink] ===\n\nBeen around for many years, but looks dated now. \n\n====Pros====\n* Only for Registered Hams\n\n====Cons====\n* Closed Source\n\n=== [https://allstarlink.org/ AllStarLink] ===\n\nA RoIP based network aimed at repeaters and gateways. \n\n====Pros====\n* Only for Registered Hams\n* Uses SIP protocol and open source modules. \n* Flexible\n\n====Cons====\n* Less widely known than other offerings\n* No native smartphone clients \n\n=== [http://discordapp.com Discord (gaming chat platform)] ===\n====Pros====\n* Pro\n\n====Cons====\n* Con\n\n=== [https://wiki.mumble.info/wiki/Main_Page Mumble] ===\n==== Pros ====\n* Pro\n\n====Cons====\n* Con\n\n\n=== [https://www.teamspeak.com/en/teamspeak3 Teamspeak] ===\n====Pros====\n* Low Latency\n\n====Cons====\n* Pay for Apps iPhone/iPad & Android\n\n=== [https://telegram.org/ Telegram] ===\n====Pros====\n* Pro\n\n====Cons====\n* Con\n\n\n=== [http://www.ventrilo.com/ Ventrillo] ===\n====Pros====\n* Pro\n\n====Cons====\n* Con\n\n\n=== [https://xmpp.org/ XMPP / Jabber] ===\n====Pros====\n* Pro\n\n====Cons====\n* Con\n\n\n=== [https://zello.com/ Zello] ===\n====Pros====\n* Available\n* Up-to-date\n* Easy to use\n\n====Cons====\n* Reported high latency makes QSOs difficult\n* AFAIK They don\'t provide any bridging methods on their free tier, you have to rely on an always on device hooked up to a radio, using VOX.\n</div>\n\n\n----','utf-8'),(77,'This project aims to operate simplex gateways at EMF Camp 2018 so other radio amateurs around the globe can speak to people at the event. I propose we host two such gateways, one for Analogue and one for DMR.\n\nGateway Project name may change \n\n__TOC__\n\n==Internet Linking Protocol Comparisons==\n\nComparison of possible Internet Linking Software.Note:- WORK IN PROGRESS\n{| class=\"wikitable sortable\" border=\"1\"\n|-\n! Name\n! Opensource \n! Hams Only\n! Notes\n|-\n| Echolink|| No || Y || Etc, Etc\n|-\n| Telegram|| Partly || No || Even on Windows Phones\n|-\n| Zello || ? || No || Etc,\n|}\n\nOthers to look into at some points, Discord (gaming chat platform), XMPP / Jabber, Mumble, Teamspeak, Ventrillo.\n\nClick expand to view in more detail\n\n<div class=\"mw-collapsible mw-collapsed\" id=\"comparisons\">\n\n=== [http://www.echolink.org/ Echolink] ===\n\nBeen around for many years, but looks dated now. \n\n====Pros====\n* Only for Registered Hams\n\n====Cons====\n* Closed Source\n\n=== [https://allstarlink.org/ AllStarLink] ===\n\nA RoIP based network aimed at repeaters and gateways. \n\n====Pros====\n* Only for Registered Hams\n* Uses SIP protocol and open source modules. \n* Flexible\n\n====Cons====\n* Less widely known than other offerings\n* No native smartphone clients \n\n=== [http://discordapp.com Discord (gaming chat platform)] ===\n====Pros====\n* Free\n* Low Latency\n* Channels\n* Can Admin ourselves\n* servers are hosted by Discord\n* paid options don\'t affect main features\n* free iPhone/iPad & Android apps\n\n====Cons====\n* Con\n\n=== [https://wiki.mumble.info/wiki/Main_Page Mumble] ===\n==== Pros ====\n* Pro\n\n====Cons====\n* Con\n\n\n=== [https://www.teamspeak.com/en/teamspeak3 Teamspeak] ===\n====Pros====\n* Low Latency\n\n====Cons====\n* Pay for Apps iPhone/iPad & Android\n\n=== [https://telegram.org/ Telegram] ===\n====Pros====\n* Pro\n\n====Cons====\n* Con\n\n\n=== [http://www.ventrilo.com/ Ventrillo] ===\n====Pros====\n* Pro\n\n====Cons====\n* Con\n\n\n=== [https://xmpp.org/ XMPP / Jabber] ===\n====Pros====\n* Pro\n\n====Cons====\n* Con\n\n\n=== [https://zello.com/ Zello] ===\n====Pros====\n* Available\n* Up-to-date\n* Easy to use\n\n====Cons====\n* Reported high latency makes QSOs difficult\n* AFAIK They don\'t provide any bridging methods on their free tier, you have to rely on an always on device hooked up to a radio, using VOX.\n</div>\n\n\n----','utf-8'),(78,'This project aims to operate simplex gateways at EMF Camp 2018 so other radio amateurs around the globe can speak to people at the event. I propose we host two such gateways, one for Analogue and one for DMR.\n\nGateway Project name may change \n\n__TOC__\n\n==Internet Linking Protocol Comparisons==\n\nComparison of possible Internet Linking Software.Note:- WORK IN PROGRESS\n{| class=\"wikitable sortable\" border=\"1\"\n|-\n! Name\n! Opensource \n! Hams Only\n! Notes\n|-\n| Echolink|| No || Y || Etc, Etc\n|-\n| Telegram|| Partly || No || Even on Windows Phones\n|-\n| Zello || ? || No || Etc,\n|}\n\nOthers to look into at some points, Discord (gaming chat platform), XMPP / Jabber, Mumble, Teamspeak, Ventrillo.\n\nClick expand to view in more detail\n\n<div class=\"mw-collapsible mw-collapsed\" id=\"comparisons\">\n\n=== [http://www.echolink.org/ Echolink] ===\n\nBeen around for many years, but looks dated now. \n\n====Pros====\n* Only for Registered Hams\n\n====Cons====\n* Closed Source\n\n=== [https://allstarlink.org/ AllStarLink] ===\n\nA RoIP based network aimed at repeaters and gateways. \n\n====Pros====\n* Only for Registered Hams\n* Uses SIP protocol and open source modules. \n* Flexible\n\n====Cons====\n* Less widely known than other offerings\n* No native smartphone clients \n\n=== [http://discordapp.com Discord (gaming chat platform)] ===\n====Pros====\n* Free\n* Low Latency\n* Channels\n* Can Admin ourselves\n* servers are hosted by Discord\n* paid options don\'t affect main features\n* free iPhone/iPad & Android apps\n\n====Cons====\n* Con\n\n=== [https://wiki.mumble.info/wiki/Main_Page Mumble] ===\n==== Pros ====\n* Pro\n\n====Cons====\n* Con\n\n\n=== [https://www.teamspeak.com/en/teamspeak3 Teamspeak] ===\n====Pros====\n* Low Latency\n\n====Cons====\n* Pay for Apps iPhone/iPad & Android\n\n=== [https://telegram.org/ Telegram] ===\n====Pros====\n* Pro\n\n====Cons====\n* Con\n\n\n=== [http://www.ventrilo.com/ Ventrillo] ===\n====Pros====\n* Pro\n\n====Cons====\n* Con\n\n\n=== [https://xmpp.org/ XMPP / Jabber] ===\n====Pros====\n* Pro\n\n====Cons====\n* Con\n\n\n=== [https://zello.com/ Zello] ===\n====Pros====\n* Available\n* Up-to-date\n* Easy to use\n* Password protected channels\n\n====Cons====\n* Reported high latency makes QSOs difficult\n* AFAIK They don\'t provide any bridging methods on their free tier, you have to rely on an always on device hooked up to a radio, using VOX.\n</div>\n\n\n----','utf-8'),(79,'==What is EMF Camp?==\n\nIt\'s a Biannual (\'\'every 2 years\'\') event for hackers, makers and geeky people to get together started in 2012.\n\nIn 2016 some of the things you could do at the event included the following (in no particular order):-<br />have Mains electricity, WiFi or Cabled internet to your tent, use Amateur Radio, become a True Scotsman, be on bridge of Star Trek ship, get a hackable conference badge, play retro arcade & console games, blacksmithing, maths, ring making, Karaoke, play 3D life sized Guitar hero, internet controlled lighting of a rabbit, order a drink over the internet and watch a robot make it, play Dungeons and dragons or cards against humanity, watch sumo robot competition & fire ping pong, 3D printing, Laser cutting, use a BBC micro to Tweet, smoke machines, Laser tag, tuck shop, hackerspace passports and stamps, use a BBS, soldering, BBQ, use a fire pit, play laser tag, ethical lock picking\n\n==Hacker / Maker Camping Events==\n\n[[Calendar]]\n\n==2018 Planning==\n\n[[Gateway Project]] \'\'(Name may change)\'\'\n\n==For Sale==\nMember is selling the following on eBay. \n\nComplete SCAM 12 Mast setup with Legs, Accessories and Trailer [https://www.ebay.co.uk/itm/183083664303 eBay Link]','utf-8'),(80,'In 2016 some of the things you could do at the event included the following (in no particular order):-\nhave Mains electricity, WiFi or Cabled internet to your tent, use Amateur Radio, become a True Scotsman, be on bridge of Star Trek ship, get a hackable conference badge, play retro arcade & console games, blacksmithing, maths, ring making, Karaoke, play 3D life sized Guitar hero, internet controlled lighting of a rabbit, order a drink over the internet and watch a robot make it, play Dungeons and dragons or cards against humanity, watch sumo robot competition & fire ping pong, 3D printing, Laser cutting, use a BBC micro to Tweet, smoke machines, Laser tag, tuck shop, hackerspace passports and stamps, use a BBS, soldering, BBQ, use a fire pit, play laser tag, ethical lock picking','utf-8'),(81,'==2018 Plans==\n\n[[Calendar]]\n\n==2018 Planning==\n\n[[Gateway Project]] \'\'(Name may change)\'\'\n\n==For Sale==\nMember is selling the following on eBay. \n\nComplete SCAM 12 Mast setup with Legs, Accessories and Trailer [https://www.ebay.co.uk/itm/183083664303 eBay Link]','utf-8'),(82,'==What is EMF Camp?==\n\nIt\'s a Biannual (\'\'every 2 years\'\') event for hackers, makers and geeky people to get together started in 2012.\n\nIn 2016 some of the things you could do at the event included the following (in no particular order):-<br />have Mains electricity, WiFi or Cabled internet to your tent, use Amateur Radio, become a True Scotsman, be on bridge of Star Trek ship, get a hackable conference badge, play retro arcade & console games, blacksmithing, maths, ring making, Karaoke, play 3D life sized Guitar hero, internet controlled lighting of a rabbit, order a drink over the internet and watch a robot make it, play Dungeons and dragons or cards against humanity, watch sumo robot competition & fire ping pong, 3D printing, Laser cutting, use a BBC micro to Tweet, smoke machines, Laser tag, tuck shop, hackerspace passports and stamps, use a BBS, soldering, BBQ, use a fire pit, play laser tag, ethical lock picking','utf-8'),(83,'\'\'\'What is EMF Camp?\'\'\' It\'s a Biannual (\'\'every 2 years\'\') event for hackers, makers and geeky people to get together started in 2012.\n\nIn 2016 some of the things you could do at the event included the following (in no particular order):-<br />have Mains electricity, WiFi or Cabled internet to your tent, use Amateur Radio, become a True Scotsman, be on bridge of Star Trek ship, get a hackable conference badge, play retro arcade & console games, blacksmithing, maths, ring making, Karaoke, play 3D life sized Guitar hero, internet controlled lighting of a rabbit, order a drink over the internet and watch a robot make it, play Dungeons and dragons or cards against humanity, watch sumo robot competition & fire ping pong, 3D printing, Laser cutting, use a BBC micro to Tweet, smoke machines, Laser tag, tuck shop, hackerspace passports and stamps, use a BBS, soldering, BBQ, use a fire pit, play laser tag, ethical lock picking','utf-8'),(84,'==Chat with us==\n===IRC / Telegram===\nWe\'re using [http://en.wikipedia.org/wiki/IRC IRC] and [https://telegram.org/ Telegram] to organise the Amateur Radio Village, & you can find us on [https://kiwiirc.com/client/irc.freenode.net/emfhams <tt>#emfhams</tt>] on Freenode or our [https://telegram.me/joinchat/A3glvAZ5xf_T9RkCfuDeOA Telegram Group]. The IRC channel and Telegram group are linked, so you can use either.\n\n* IRC Network - <tt>chat.freenode.net</tt> on port 6667 (non-SSL) or 6697 (SSL, recommended)<br />\n* Channel - <tt>#emfhams</tt><br />\n* Username - Callsign or other username<br />\n* Web Based Link to <tt>#emfhams</tt> - [http://webchat.freenode.net?channels=emfhams Webbased #emfhams channel]\n* Connect through Tor (Instructions can be found [http: