bsp;\n| &nbsp;\n| &nbsp;\n| TBC\n|-\n| data-sort-value=\"ON4PHP\"| ON4PHP\n| trouble\n| Philip\n| &nbsp;\n| &nbsp;\n| &nbsp;\n| &nbsp;\n| TBC\n|-\n| data-sort-value=\"PD5KNR\"| PD5KNR\n| Knorrie\n| Hans\n| &nbsp;\n| &nbsp;\n| &nbsp;\n| &nbsp;\n| TBC\n|-\n| data-sort-value=\"M0MTT\"| [https://www.qrz.com/lookup/M0MTT M0MTT]\n| M0MTT\n| Mark\n| &nbsp;\n| &nbsp;\n| &nbsp;\n| &nbsp;\n| TBC\n|-\n|}','utf-8'),(93,'We intend to have an Analogue FM and DMR \'Gateway\' on site. These will be bridged together, allowing analogue and DMR users to communicate. The gateways will also be linked to various RF and RoIP based networks, allowing amateurs around the world to connect the onsite gateways and chat with attendees.\n\nThe system is already live and accepting connections from the various networks, so attendees can get to know each other and start planning for EMF 2018. Please note, the system is still being tested, so there may be the occasional blip.\n\nFor more information visit the [http://hub.emfhams.org EMF Hub Webpage]\n\n==Connecting the EMF Hub Remotely==\n\n===Currently Supported===\n\nYou can connect to the EMF Hub using several methods listed below. If you\'d like to connect via a different method, please let us know.\n\nNote: Whilst we are in the testing phase, connection methods are subject to change!\n\n====Echolink====\n\nEcholink is a well established Radio over IP (RoIP) system for linking RF repeaters and gateways to the Echolink software applications, available on most operating systems.\n\nTo connect via Echolink, connect to Node 2E0SIP-L (986046)\n\n====AllStar====\n\nAllStar is another RoIP system based on open source software, making it more flexible and \'hackable\' compared to Echolink. The primary controller runs on AllStar.\n\nTo connect to the AllStar hub, connect to Node 47920.\n\n====DMR (Brandmeister)====\n\nDMR is a popular digital mode, and Brandmeister provide a global network that encourages cross linking and experimentation.\n\nTo connect via DMR, key up on TG 2773 via the Brandmiester Network.\n\nMany thanks to Brandmeister Ireland for facilitating this connection.\n\n====International Radio Network (IRN)====\n\nIRN is another RoIP network based on the TeamSpeak application availble for most operating systems. Whilst IRN has no native RF support, its often linked to RF systems.\n\nTo connect via IRN, join the \'EMF Hub\' room\n\n====SIP====\n\nIf you\'d like to connect via SIP, let us know and we will setup the connection.\n\n===Potentially Supported===\n\n====Fusion (YSF)====\n\nYSF is a reflector system for MMDVM powered repeaters and hotspots. Creating a reflector is trivial and there\'s no costs involved, but so far there\'s no demand. If you want a YSF reflector, let me know and I will get it added.\n\n====Fusion (Wires X)====\n\nWires X is the proprietary network provided by Yaesu for Fusion radios. Due to its closed nature, the only way to bridge from the Hub to Wires X is via FM into a Yaesu rig with Fusion support. If you\'re desperate to use Wires X and would like to host the link, please get in touch.\n\n====D-Star====\n\nAdding D-Star support will require approximately 200-300 in additional hardware in order to transcode the codecs involved. If you want to purchase and host the required hardware, please get in touch.\n\n====Other====\n\nIf there\'s another mode or service you\'d like supported, please get in touch.','utf-8'),(94,'We intend to have an Analogue FM and DMR \'Gateway\' on site. These will be bridged together, allowing analogue and DMR users to communicate. The gateways will also be linked to various RF and RoIP based networks, allowing amateurs around the world to connect the onsite gateways and chat with attendees.\n\nThe system is already live and accepting connections from the various networks, so attendees can get to know each other and start planning for EMF 2018. Please note, the system is still being tested, so there may be the occasional blip.\n\nFor more information visit the [http://hub.emfhams.org EMF Hub Webpage]\n\n==Connecting the EMF Hub Remotely==\n\n===Currently Supported===\n\nYou can connect to the EMF Hub using several methods listed below. If you\'d like to connect via a different method, please let us know.\n\nNote: Whilst we are in the testing phase, connection methods are subject to change!\n\n====Echolink====\n\nEcholink is a well established Radio over IP (RoIP) system for linking RF repeaters and gateways to the Echolink software applications, available on most operating systems.\n\nTo connect via Echolink, connect to Node 2E0SIP-L (986046)\n\n====AllStar====\n\nAllStar is another RoIP system based on open source software, making it more flexible and \'hackable\' compared to Echolink. The primary controller runs on AllStar.\n\nTo connect to the AllStar hub, connect to Node 47920.\n\n====DMR (Brandmeister)====\n\nDMR is a popular digital mode, and Brandmeister provide a global network that encourages cross linking and experimentation.\n\nTo connect via DMR, key up on TG 2773 via the Brandmiester Network.\n\nMany thanks to Brandmeister Ireland for facilitating this connection.\n\n====International Radio Network (IRN)====\n\nIRN is another RoIP network based on the TeamSpeak application availble for most operating systems. Whilst IRN has no native RF support, its often linked to RF systems.\n\nTo connect via IRN, join the \'EMF Hub\' room\n\n====Online (Receive Only)====\n\nYou can listen to the EMF Hub online [http://emfhub.blogspot.co.uk/p/listen-to-emf-hub.html Here]. It\'s currently Rx only.\n\n====SIP====\n\nIf you\'d like to connect via SIP, let us know and we will setup the connection.\n\n===Potentially Supported===\n\n====Fusion (YSF)====\n\nYSF is a reflector system for MMDVM powered repeaters and hotspots. Creating a reflector is trivial and there\'s no costs involved, but so far there\'s no demand. If you want a YSF reflector, let me know and I will get it added.\n\n====Fusion (Wires X)====\n\nWires X is the proprietary network provided by Yaesu for Fusion radios. Due to its closed nature, the only way to bridge from the Hub to Wires X is via FM into a Yaesu rig with Fusion support. If you\'re desperate to use Wires X and would like to host the link, please get in touch.\n\n====D-Star====\n\nAdding D-Star support will require approximately 200-300 in additional hardware in order to transcode the codecs involved. If you want to purchase and host the required hardware, please get in touch.\n\n====Other====\n\nIf there\'s another mode or service you\'d like supported, please get in touch.','utf-8'),(95,'==Chat with us==\n===IRC / Telegram===\nWe\'re using [http://en.wikipedia.org/wiki/IRC IRC] and [https://telegram.org/ Telegram] to organise the Amateur Radio Village, & you can find us on [https://kiwiirc.com/client/irc.freenode.net/emfhams <tt>#emfhams</tt>] on Freenode or our [https://telegram.me/joinchat/A3glvAZ5xf_T9RkCfuDeOA Telegram Group]. The IRC channel and Telegram group are linked, so you can use either.\n\n* IRC Network - <tt>chat.freenode.net</tt> on port 6667 (non-SSL) or 6697 (SSL, recommended)<br />\n** Channel - <tt>#emfhams</tt><br />\n** Username - Callsign or other username<br />\n** Web Based Link to <tt>#emfhams</tt> - [http://webchat.freenode.net?channels=emfhams Webbased #emfhams channel]\n** Connect through Tor (Instructions can be found [http://freenode.net/irc_servers.shtml#tor here])\n* [https://telegram.me/emfhams Join our Telegram Group] (iPhone, Android Apps & Web Based)\n===Digital Radio===\n* DMR, EchoLink, AllStar, IRN radio via our new [[EMF_Hub_-_Amateur_Radio_%27Bridge%27|EMF Hub]]\n\n===Social Media===\nWe have a Facebook group with pictures, videos and other bits:\n\n* [https://www.facebook.com/groups/316141732057436/ Facebook: EMF Hams]\n\n===Attendess & Logbook===\n\n[[EMF Ham Attendees]]\n\n[http://log.emfhams.org/ GB4EMF Log Book 2016]\n\n===Pages from main EMF Camp wiki for EMF Hams===\n\n[[Village:Amateur_Radio page 2018]]\n\n[[Village:Amateur_Radio page 2016]]\n\n[[Village:Amateur_Radio page 2014]]','utf-8'),(96,'We intend to have an Analogue FM and DMR \'Gateway\' on site. These will be bridged together, allowing analogue and DMR users to communicate. The gateways will also be linked to various RF and RoIP based networks, allowing amateurs around the world to connect the onsite gateways and chat with attendees.\n\nThe system is already live and accepting connections from the various networks, so attendees can get to know each other and start planning for EMF 2018. Please note, the system is still being tested, so there may be the occasional blip.\n\nFor more information visit the [http://hub.emfhams.org EMF Hub Webpage]\n\n==Connecting the EMF Hub Remotely==\n\n===Currently Supported===\n\nYou can connect to the EMF Hub using several methods listed below. If you\'d like to connect via a different method, please let us know.\n\nNote: Whilst we are in the testing phase, connection methods are subject to change!\n\n====Echolink====\n\nEcholink is a well established Radio over IP (RoIP) system for linking RF repeaters and gateways to the Echolink software applications, available on most operating systems.\n\nTo connect via Echolink, connect to Node 2E0SIP-L (986046)\n\n====AllStar====\n\nAllStar is another RoIP system based on open source software, making it more flexible and \'hackable\' compared to Echolink. The primary controller runs on AllStar.\n\nTo connect to the AllStar hub, connect to Node 47920.\n\n====DMR (Brandmeister)====\n\nDMR is a popular digital mode, and Brandmeister provide a global network that encourages cross linking and experimentation.\n\nTo connect via DMR, key up on TG 27273 via the Brandmiester Network.\n\nMany thanks to Brandmeister Ireland for facilitating this connection.\n\n====International Radio Network (IRN)====\n\nIRN is another RoIP network based on the TeamSpeak application availble for most operating systems. Whilst IRN has no native RF support, its often linked to RF systems.\n\nTo connect via IRN, join the \'EMF Hub\' room\n\n====Online (Receive Only)====\n\nYou can listen to the EMF Hub online [http://emfhub.blogspot.co.uk/p/listen-to-emf-hub.html Here]. It\'s currently Rx only.\n\n====SIP====\n\nIf you\'d like to connect via SIP, let us know and we will setup the connection.\n\n===Potentially Supported===\n\n====Fusion (YSF)====\n\nYSF is a reflector system for MMDVM powered repeaters and hotspots. Creating a reflector is trivial and there\'s no costs involved, but so far there\'s no demand. If you want a YSF reflector, let me know and I will get it added.\n\n====Fusion (Wires X)====\n\nWires X is the proprietary network provided by Yaesu for Fusion radios. Due to its closed nature, the only way to bridge from the Hub to Wires X is via FM into a Yaesu rig with Fusion support. If you\'re desperate to use Wires X and would like to host the link, please get in touch.\n\n====D-Star====\n\nAdding D-Star support will require approximately 200-300 in additional hardware in order to transcode the codecs involved. If you want to purchase and host the required hardware, please get in touch.\n\n====Other====\n\nIf there\'s another mode or service you\'d like supported, please get in touch.','utf-8'),(97,'We intend to have an Analogue FM and DMR \'Gateway\' on site. These will be bridged together, allowing analogue and DMR users to communicate. The gateways will also be linked to various RF and RoIP based networks, allowing amateurs around the world to connect the onsite gateways and chat with attendees.\n\nThe system is already live and accepting connections from the various networks, so attendees can get to know each other and start planning for EMF 2018. Please note, the system is still being tested, so there may be the occasional blip.\n\nFor more information visit the [http://hub.emfhams.org EMF Hub Webpage]\n\n==Connecting to the EMF Hub Remotely==\n\n===Currently Supported===\n\nYou can connect to the EMF Hu