n|-\n| data-sort-value=\"PD5KNR\"| PD5KNR\n| Knorrie\n| Hans\n| Learning stuff\n| No\n| &nbsp;\n|-\n| data-sort-value=\"ON4PHP\"| ON4PHP\n| trouble\n| Philip\n| &nbsp;\n| No\n| &nbsp;\n|-\n| data-sort-value=\"MM0TKE\"| MM0TKE\n| tkerby\n| Tim\n| &nbsp;\n| No\n| Bringing an APRS iGate and a Yaesu VX-8\n|-\n| data-sort-value=\"2E0SIP\"| 2ESIP\n| marrold\n| Matthew\n| &nbsp;\n| No\n| FM + DMR Gateway, possibly a cheapo 20W 2&70 Mobile Radio? (12/07/2018)\n|-\n\n|}\n<nowiki />* If you have a Callsign\n\n==Local Repeaters==\n\'\'List needs updating for new location\'\'\n{| class=\"wikitable sortable\"\n! style=\"text-align:left;\"| Repeater!!Output!!Recieve!!CTCSS/DMR!!Distance!!Notes\n|-\n| &nbsp;||&nbsp;||&nbsp;||&nbsp;||&nbsp;||&nbsp;\n|-\n| &nbsp;||&nbsp;||&nbsp;||&nbsp;||&nbsp;||&nbsp;\n|}\n\n==ISS Passes==\nList needs updating for New location and times. \n\nThere are quite a few ISS passes of which at least six are at high angle during hacker-friendly times:\n\n{| class=\"wikitable sortable\"\n! style=\"text-align:left;\"| Date!!Start!!Alt!!Az!!Highest!!Alt!!Az!!End!!Alt!!Az!!Pass type\n|-\n| &nbsp;\n| &nbsp;\n| &nbsp;\n| &nbsp;\n| &nbsp;\n| &nbsp;\n| &nbsp;\n| &nbsp;\n| &nbsp;\n| &nbsp;\n| &nbsp; \n|-\n| &nbsp;\n| &nbsp;\n| &nbsp;\n| &nbsp;\n| &nbsp;\n| &nbsp;\n| &nbsp;\n| &nbsp;\n| &nbsp;\n| &nbsp;\n| &nbsp;\n\n|}\n\n==Contests==\nThere are a [http://www.rsgbcc.org/cgi-bin/readcal.pl couple of contests] on during EMF which we might want to put together a station for:\n\nAlso here nearer the time will be contest over the EMF Camp weekend [http://www.hornucopia.com/contestcal/weeklycont.php Hornucopia.com 8 Day Contest Calendar]\n\n==Tasks/Organisation==\nSome tasks may already be complete - if so please add owner/completion date.  Otherwise feel free to take ownership.\n{| class=\"wikitable sortable\"\n! style=\"text-align:left;\"| Task*\n! Owner\n! Date Complete\n! Notes\n|-\n| Contact RSGB News\n| &nbsp;\n| &nbsp;\n| Sent item for special event stations\n|-\n| Contact RADCOM\n| &nbsp;\n| &nbsp;\n| Press release?\n|-\n| Contact GB2RS||&nbsp;||&nbsp;||Sent item for special event stations\n|-\n| emfcamp\n| &nbsp;\n| &nbsp;\n| Press release (Facebook/Twitter)?\n|-\n| Contact RSGB\n| &nbsp;\n| &nbsp;\n| Requested promo paterial\n|-\n| Contact Yaesu\n| &nbsp;\n| &nbsp;\n| Requested promo items & equipment loans\n|-\n| Contact Icom\n| &nbsp;\n| &nbsp;\n| Requested promo items & equipment loans\n|-\n| Contact Kenwood\n| &nbsp;\n| &nbsp;\n| Requested promo items & equipment loans\n|-\n| Contact Moonraker\n| &nbsp;\n| &nbsp;\n| Requested antenna loans (for satellite)\n|-\n| Furniture\n| &nbsp;\n| &nbsp;\n| Organise loan/hire of tables & chairs\n|-\n| Equipment\n| &nbsp;\n| &nbsp;\n| Contact attendees and compile definitive radio/antenna/mast list\n|-\n| Event Write Up\n| &nbsp;\n| &nbsp;\n| Something to post on Social Media after event\n|-\n| Photos\n| &nbsp;\n| &nbsp;\n| Maybe have a Shared DropBox or space somewhere\n|-\n|}\n\n==Station Planning==\nInitial plan made from comments/equipment above.  Please keep updated with offers/changes.\n\nBear in mind that this is an initial framework based on the offers of equipment received and the constraints of the site as best we can determine from Google/OS etc. It\'s quite likely to change on the day so please don\'t be surprised if you\'ve offered equipment to do one thing but we suggest it\'s better for something else.  If you have particular plans please raise it in the IRC channel.\n\n===HF Station===\n{| class=\"wikitable sortable\"\n! style=\"text-align:left;\"| Function*\n! Item\n! Owner\n! Notes\n|-\n| Transceiver\n| \n| \n| \n|-\n| PSU\n| \n| \n| \n|-\n| Antenna\n| \n| \n| \n|-\n| Antenna 2\n| \n| \n| \n|-\n| Mast\n| \n| \n| \n|-\n| Feeder\n| \n| \n| \n|-\n| Other\n| \n| \n| \n|-\n| Antenna analyser\n| \n| \n| \n|-\n| Antenna tuner\n| \n| \n| \n|}\n\n===VHF/UHF Station===\n{| class=\"wikitable sortable\"\n! style=\"text-align:left;\"| Function*\n! Item\n! Owner\n! Notes\n|-\n| Transceiver\n| \n| \n| \n|-\n| PSU\n| \n|\n| \n|-\n| Antenna\n| \n| \n| \n|-\n| Mast\n| \n| \n| \n|-\n| Feeder\n| \n| \n| \n|-\n| Other\n| \n| \n| \n|}\n\n===DMR and Analogue Gateway===\n{| class=\"wikitable sortable\"\n! style=\"text-align:left;\"| Function*\n! Item\n! Owner\n! Notes\n|-\n| Transceiver\n| Tait 8105 UHF\n| 2E0SIP\n| 2x\n|-\n| PSU\n| Sharam 23A Switching PSU\n| 2E0SIP\n| \n|-\n| Antenna\n| Diamond X30\n| 2E0SIP\n| \n|-\n| Mast\n| \n| \n| \n|-\n| Feeder\n| RG8X patch leads + UltraFlex7 feeder to antenna\n| 2E0SIP\n| \n|}\n\n===Local Comms===\nFor comms around the site, maybe a crossband repeater if handhelds can\'t reach from one side of the site to the other.\n\nWill this be required this year? (MM0MRU 12/07/2018)\n{| class=\"wikitable sortable\"\n! style=\"text-align:left;\"| Function*\n! Item\n! Owner\n! Notes\n|-\n| Transceiver\n| \n| \n| \n|-\n| PSU\n| \n| \n| \n|-\n| Antenna\n| \n| \n| \n|-\n| Mast\n| \n| \n|\n|-\n| Feeder\n| \n| \n| \n|}\n\n===Misc/Shelter===\n{| class=\"wikitable sortable\"\n! style=\"text-align:left;\"| Item*\n! Owner\n! Notes\n|-\n| Gazebo\n| EMF Camp\n| Rented from EMF\n|-\n| Power Distribution\n| \n| \n|-\n| Rotator\n| ?\n| ?\n|-\n| Table and stools\n| EMF Camp\n| Rented from EMF\n|-\n| ?x chairs\n| EMF Camp\n| Rented from EMF\n|-\n| Ligthing\n| EMF Camp\n| Believed to be part of the tent?\n|}\n\n===Needed===\n{| class=\"wikitable sortable\"\n! style=\"text-align:left;\"| Item*\n! Owner\n! Notes\n|-\n| \n| \n|-\n| Mains cables\n| everyone!\n| You \'\'\'always\'\'\' need more 4-way bars than you have\n|}\n\n==Useful Links==\n[https://sites.google.com/site/gw6itj/bandplan GW6ITJ UK Band Plans]\n[http://www.arrl.org/graphical-frequency-allocations USA Band Plans]\n\n[[Category:Schedule]] <!-- added by [[User:Ms7821]] so we can potentially put the contests in the schedule -->','utf-8'),(1535,'I\'m Jerold (24) from Issy-Les-Moulineaux, France. <br>I\'m learning Chinese literature at a local high school and I\'m just about to graduate.<br>I have a part time job in a university.<br><br>Feel free to visit my page [http://www.youtube.com/watch?v=nXe9FkcsZ94 ENO Hammock]','utf-8'),(1536,'Outdoors :: Camping Trips to Remember and What to Know About Them   <br><br>As you are probably aware right now, there are several choices available with regards to investing in a hammock. In fact, lots of people miss what number of different fibers, styles, etc. you\'ll find. When it comes to a rope hammock you might have two fibers to choose from - one is polyester as well as the other is cotton. There are some other blends available, but cotton and polyester will be the two hottest, and also the most commonly found. It\'s hard to produce the proper choice because they all have its very own advantages, and disadvantages. Here are a few considerations that might help. <br><br>The first, and possibly the best solution, is to apply a hammock stand.?? Since the Mexican, Central American, and South American style hammocks that are best fitting for indoor use don\'t fit well within the standard hammock stand you need to use a stand like the Vario Stand, that is adjustable in length and height, and may accommodate these hammocks.?? <br><br>Unfortunately, every year, lots of people wander off in the wilderness while camping. Irregardless of the time of the season and region, it\'s hard to discover their whereabouts. As might be expected, if you do wander away, it is very important to be sure that you\'ll be able to prepare foods safely, as well as make sure that your h2o is clean. In many cases, having a reliable heating way is the only way to accomplish both goals. While fuels utilized in backpacking stoves won\'t go on for significant amounts of time, no less than they\'ll supply you with a chance to start learning how to reap the benefits of other resources. <br><br><br>Fundraisers can be quite a wonderful means of earning  [http://www.youtube.com/watch?v=nXe9FkcsZ94 ENO Hammock] money for camp, particularly if \'re going which has a group. If everyone pitches in, it could be easy to boost the money. Your group leader may currently have ideas about how to raise money for summer camp. These ideas can sometimes include organizing a bake sale, car wash, or even a group garage sale. <br><br>A Leatherman makes both lists of cool camping gadgets because using a multi-tool is essential in numerous situations. But since size aren\'t such an important consideration for the car-camper, the Leatherman Super Tool 300 is listed here rather than the Skeletool CX. The 300 gives you more tools having a straight edge knife, a serrated knife, needle nose and regular pliers, wire cutters, screwdrivers in numerous sizes, a wood/metal file, a saw, and both a bottle which enable it to opener. It even has and awl having a thread loop. You have so many options that you may want to break something across the campsite just to demonstrate to your friends you could correct it with this particular thing. Amazon.com has it with a bargain for around $56.','utf-8'),(1537,'#EMF Hams Conference Call (23/07/2018)\n\n==Details==\n\n\n\'\'\'Date / Time:\'\'\' 23/07/2018 20:00 BST<br />\n\'\'\'Number:\'\'\' 44 (0) 3308081871<br />\n\'\'\'Pin:\'\'\' [Redacted]<br />\nOther dial-in numbers available on request. If you would like to join but cant for whatever reason, let us know so we can see if we can accommodate you.<br />\n\n==Agenda==\n\n#Introductions\n#Should we create a mailing list? If yes, which service should we use?\n#Should we create a static web page? \n#Logo Feedback discussion\n#Reminder to update wiki pages with who is going / what they are taking\n#Other business\n#Feedback on conference call, should we do it again, when? \n\n==Attendees==\n\n*Matthew (2ESIP) - Chair\n*Calum (MMMRU)\n*Peter (MSWN)\n*Paul (MPLL)\n*Paul (MTZO) - Monitoring Text doc\n\n==Outcome of Call==\n\n#\'\'\'Introductions\'\'\'<br />People introduced themselves\n#\'\'\'Should we create a mailing list? If yes, which service should we use?\'\'\'<br />Lets give groups.io a try for Organisation and updates stuff, but not general high volume How do I program my Baofeng type noise\n#\'\'\'Should we create a static web page?\'\'\'<br />Lets update the Wiki page as a landing page\'\n#\'\'\'Logo Feedback discussion\'\'\'<br />People liked 3 and 9, with people leaning towards 3 for its simplicity. We will put it up for discussion on IRC and take a final vote on Friday Deadline (27/07/2018)\n#\'\'\'Reminder to update wiki pages with who is going / what they are taking\'\'\'<br />People were reminded\n#\'\'\'Other business\'\'\'\n#* MMMRU discussed forming a \"Ham Hamlet\" or cluster of villages, alongside HAB and AMSAT\n#* MMMRU also advised that whilst everyone is welcome, the area could be a little loud at night\n#* Logging was discussed, and we will use Cloud Log. MMMRU will speak to people already using it and see if we can get another instance setup.\n#* MMMRU announced the GB2EMF Callsign \n#* MSWN will submit an article to RADCOM\n#* MPLL can bring a Yaesu 450D and a mag loop if required - but warned the mag loop can be frustrating for new users\n#* MPLL also discussed a call sign for the APRS iGate. MMMRU will ask the ETCC if we have time to apply for an NoV\n#* MMMRU / 2ESIP discussed bringing programming leads to setup radios on-site\n#\'\'\'Feedback on conference call, should we do it again, when?\'\'\'<br/>The conference call and \"Net\" style format worked well. We should do it again a couple of weeks before the event.\n\n==Full Minutes==\n\n===Introductions===\n\n\'\'\'[ Redacted ]\'\'\'\n\n===Should we create a mailing list? If yes, which service should we use?===\n\n\'\'\'Matthew (2ESIP):\'\'\' Theres radio amateurs going to EMF this year that have no idea we exist. The only way they can find out we do exist is on the EMF Camp wiki, which not everyone will not automatically do, so its about promoting awareness for 2020 and also IRC and Telegram are great but not well suited for longer running conversations. If someone goes away for a week and come back and theyve missed something its pretty much gone. Lets start with mailing lists - there appears to be mixed opinions on this. I quite like low traffic mailing lists, they work better than forums for this kind of purpose because you can get an email when someone posts.\"\n\n\'\'\'Paul (MTZO):\'\'\' NO (He doesnt like the volume of traffic he recieves from them)\n\n\'\'\'Calum (MMMRU):\'\'\' Not too much of an issue to have a low volume mailing list backed up by say IRC where we can bounce ideas off each other and general chit chat rather than on the mailing list. I know a lot of hackerspaces have their own low volume mailing list. You can have emails as they come in, or daily digest. That would help if people are concerned about receiving large amounts of email. I think that would be the way to go just because as you say we get a permanent record of things and it allows people who aren\'t interested in Telegram or ICE to be still in the chat if they so desire\n\n\'\'\'Peter (MSWN):\'\'\' Not too bothered either way, but if I get too many emails that will be irritating, but if we keep it updates, specific questions - I dont have a problem with that, I think its fine\n\n\'\'\'Paul (MPLL):\'\'\' If we need a permanent record for asynchronous communications and the choice is a mailing list or a forum, I would always go for a mailing list. Having messages pushed to me is important, I wont check a website daily for new posts. Something like a sub-reddit or Facebook - something that pushes messages to me would be my preferred route, and the lowest common denominator for that is an email mailing list\"\n\n\'\'\'Matthew (2ESIP):\'\'\' My vision I guess it wouldnt be somewhere where you ask for help with an antenna because theres 1000 of places you can ask that question. It would solely be for organisation, updates and perhaps some more casual chit chat threads - hopefully it shouldnt be 10000 threads a day of  how do I program my baofeng, its not aimed for that kind of traffic. It sounds like theres some mixed feelings but it sounds like its worth trialling, but if people say its not working we can try something else were not forced to use anything we dont want to. Has anyone got any ideas on what theyd want to use? Yahoo Groups is this traditional one used for amateur radio but its not very good...\n\n\'\'\'Peter (MSWN):\'\'\' We use groups.io for a few things and thats a decent replacement for Yahoo Groups\n\n\'\'\'Matthew (2ESIP):\'\'\' Yeah, thats the new one that more amateur radio groups are moving to or wished they moved to, they have a free tier which is adequate, the only limitation is file uploads but I dont think that will a huge issue. Does anyone else have any suggestions? - There is Google Groups but again its not amazing. A lot of people use it so theyre familiar with it, but its not great\"\n\n\'\'\'Paul (MPLL):\'\'\' Im on several google groups mailing lists, these days its a faff to get emails out of them, they really want people to do it web based or integrate it with gmail. Groups.IO is top of the list, followed by hosting our own mailman, and then Google Groups and Yahoo firmly at the bottom.\"\n\n\'\'\'Matthew (2ESIP):\'\'\' Ok, in that case I think we can give groups.io a try, unless anyone has any major objections?\"\n\n\'\'\'[Silence]\'\'\'\n\n\'\'\'Matthew (2ESIP):\'\'\'  Ok Motion carried! Has anyone got anything else theyd like to add before we move onto the next topic?\n\n\'\'\'[Silence]\'\'\'\n\n\'\'\'Outcome: Lets give groups.io a try for Organisation and updates stuff, but not general high volume How do I program my Baofeng type noise\'\'\'\n\n===Should we create a static web page?===\n\n\'\'\'Matthew (2ESIP):\'\'\' Should we create a static web page, at the moment we have the wiki which has some information but its quite busy, but if youre in the field and youve just spoken to a radio ham theres no obvious click here for more info for more info or to join the mailing list etc.  Im not suggesting a fully fledged web page, more just a static page that directs them to IRC / Telegram / Mailing List and how they can join the discussion, what are peoples thoughts, should we build our own bespoke website, or use something like blogger and use their servers, or does anyone have any thoughts?\n\n\'\'\'Paul (MTZO):\'\'\' Yes\n\n\'\'\'Calum (MMMRU):\'\'\' Having somewhere with an easily repeatable URL so people who are interested in getting into the idea of the hobby at EMF - we currently use emfhams.org, Im not sure what the main page on that goes to, Ill give it a try now. That goes to the wiki, we could put a static page there that says this is what we are. There is the thing on wiki about it, but something on there that says this is us, this is we are etc and how to get into the hobby, how to find your local club, and something like that. It can be as complicated as we want it to be. If its hosted on the same domain as the Wiki that would be easiest, if its simple and kept relatively date free parse, that would help I think. Its difficult to point someone to a long web address thats specific to the event theyre at - that does distract from it if its not easy to remember or type into a phone in a field  as you say\n\n\'\'\'Peter (MSWN):\'\'\' I agree with you, there\'s no point setting up anything complicated if we can setup a simple landing page at emfhams.org with a photo of the antenna that was there last year and a couple of links to the mailing list and wiki, we can leave it at that\n\n\'\'\'Paul (MPLL):\'\'\' Yeah I agree, we should have a simple page for people to reach us on, it should be on emfhams.org as the main page, but I feel we could use the Wiki page which is reachable at emfhams.org - it already has contact details for IRC and Telegram, as well as details of the hub and facebook page. My opinion would be to improve the front page of the wiki rather than build an external static site that directs to the wiki.\n\n\'\'\'Matthew (2ESIP):\'\'\' Yeah, I think thats reasonable, from my perspective I want to do the minimum amount possible, if someone wants to step forward and say Hey Im a web designer, Im going to create a huge website in PHP and its going to be great theyre welcome to do it, but for me its about creating the easiest simplest thing to get the information out there without having to spend too much time on it, so slimming down the front page, losing the older stuff works for me, unless anyone has any objections or suggestions?\n\n\'\'\'[Positive Sounds]\'\'\'\n\n\'\'\'Calum (MMMRU):\'\'\' That sounds reasonable, we just need to work out how to update the wiki page to make it look a little more appealing. Im not entirely au fait with that kind of thing, if I cant hit it with a spanner its not much use to me, but its best to leave that to someone else. If anyone wants a hand creating content or creating more information Im more than happy to help.\n\n\'\'\'Matthew (2ESIP):\'\'\' Is it you thats hosting the Wiki at the moment Paul?\n\n\'\'\'Paul (MPLL):\'\'\' No, its another Paul thats on Telegram, I said I would take over the hosting, but Ive been slow about taking it over. Its still on my todo list but Ive not been chased in a while so its fallen towards the bottom Im afraid, but I totally can host it.\n\n\'\'\'Matthew (2ESIP):\'\'\' Ok that wasnt me chasing, I just thought you were hosting it. Are you looking after the DNS or am I completely confused? \n\n\'\'\'Paul (MPLL):\'\'\' No, thats also not me, Im au fait with DNS - Im a sysadmin, I can host all these things but Im currently not involved in the slightest\n\n\'\'\'Matthew (2ESIP):\'\'\' No worries, weve got too many Pauls, everyone in radio is called Paul or John I think\n\nPaul (MPLL) : If it helps, the wiki is hosted I think by Paul that came 2 years ago with the trailer mast but I dont think hes coming this year\n\n\'\'\'Matthew (2ESIP):\'\'\' Unfortunately not - Im not super desperate to move the hosting but I think he was looking to close it down or shift it, I dont think he wanted to look after anymore which is perfectly reasonable. Hosting isnt a huge issue, you can host stuff anywhere these days its not a problem. Does anyone else want to add to that before we move onto the next topic?\n\n\'\'\'[ Silence ]\'\'\'\n\n\'\'\'Outcome: Lets update the Wiki page as a landing page\'\'\'\n\n===Logo Feedback discussion===\n\nDraft logos shown here - https://imgur.com/a/bdZ9UYf\n\n\'\'\'Matthew (2ESIP):\'\'\' The next thing is the logo, Ive stuck a link in Telegram which has the various options. I will start with my thoughts. In no particular order, I quite like #3 which was yours Peter because its simple, you can draw it with 6 strokes of a pen if you like, Id probably change the EMF Hams font to something a bit blockier but\n\n\'\'\'[ Matthew left the call ]\'\'\'\n\'\'\'[ Banter ensues ]\'\'\'\n\n\'\'\'Matthew (2ESIP):\'\'\' Im back sorry, I got kicked out my own conference call. Im not too sure where I got cut off, were you guys talking about something else or am I okay to start again? \n\n\'\'\'[ Positive sounds ]\'\'\' \n\n\'\'\'Matthew (2ESIP):\'\'\' I like Peters design, which is #3 its simple, you can print it on a circle just the logo - Id probably go for a blockier text but its not a big deal. Obviously I also like the one I suggested which is #9 but it\'s a bit more complicated, more difficult to draw. I also quite like M0TZOs #1 but it would be nice to incorporate the EMF logo, but with what weve got on the table today Id go with #9 or #3.\n\n\'\'\'Callum (MMMRU):\'\'\' I like all of them, but I agree with you when you say #3 because its simple and its easy to get things like stamps and stickers, theyre easy enough to do in a simple image like that - a stamp especially if were stamping passports and things, its useful to have something that is simple. I agree with having a blockier text, again for stamps and things, but not necessary. Its simple and easy and it doesnt suggest we do anything with Wifi which will be a big thing on a site, and its just a simple easy logo really, so I would go with #3, and that would be more preference or something like #8 which is that with an antenna, but it would be best to stick with less detail for stamps etc.\n\n\'\'\'Peter (MSWN):\'\'\' Im biased, If Im going to brutally honest Im not a great fan of the traditional amateur radio club logos AKA 9 and 10. I cant decide between 3 and 8 out of f my own. I like it simple but I worry that its not amateur radio-y enough and it looks like any sort of RF - Im not entirely sure about that. But then I like it simple. You can do it with and without the text, its not a badge its just a logo so it will look fine. As for the text Ill draw it in inkscape as a vector graphic and Ill look through the fonts to see if theres anything nice we can choose. Thats about it really but I am biased but we will have to make a decision. Im leaning towards #3 over #8\n\n\'\'\'Paul (MPLL):\'\'\' I have no graphic ability whatsoever, so take my opinions with a truck of salt. I like the ones that incorporate the tilde EMF logo itself, #3-10 as we are EMF Hams so we should have the EMF logo in there somewhere. Did we check if it was CC licensed so we can remix it into our own?\n\n\'\'\'Peter (MSWN):\'\'\' Not really, but lots of other people have\n\n\'\'\'Paul (MPLL):\'\'\' In that case theyre probably cool with it. Looking through the list, I also like #3 for simplicity but if I had to pick one I think Id go for #9, because it  combines the EMF logo and the traditional radio logo which is what we are. I might make the tilde logo blue in the centre of #9 if were going for a coloured logo, but thats my view.\n\n\'\'\'Matthew (2ESIP):\'\'\' Has anyone else got anything they want to add? I dont think well make a decision today as theres too many people involved and its not fair to make a decision but it sounds like most people are leaning towards #3 but well put to the group. We should probably put a deadline, I dont know if anyone objects but EMF is in a month, if were going to get stuff printed we need to really need to make a move on that, so Id say we should make a decision by Friday of this week unless anyone has any suggestions or concerns?\n\n\'\'\'Peter (MSWN):\'\'\' I will make another draft of my #3 and #8\n\n\'\'\'Calum (MMMRU):\'\'\' I agree, if were going to make stuff up we need to get things done. Im made a note to ask Russ about the status of the logo to make sure theyre happy with us to incorporate the logo, I dont think they will object but its better to just ask \n\n\'\'\'Matthew (2ESIP):\'\'\' Cheers Calum, I dont think there will be any objections either, I asked about using the phrase EMF Hub and they said yes as long as youre not claiming to be part of the organisation and make it clear your a village or whatever but if you could check that ensures everyones happy. \n\nWell chuck that onto IRC later and try and get a decision by Friday.\n\n\'\'\'Outcome: People liked 3 and 9, with people leaning towards 3 for its simplicity. We will put it up for discussion on IRC and take a final vote on Friday (27/07/2018) Deadline\'\'\'\n\n===Reminder to update wiki pages with who is going / what they are taking===\n\n\'\'\'Matthew (2ESIP):\'\'\' If youve not already updated the wiki with if youre going and what youre taking that would be helpful, and also remind anyone else that you know they should also update it as well - it helps to track who is there and what equipment theyre taking either.\n\nOutcome: No objections \n\n===Other business===\n\n\'\'\'Calum (MMMRU):\'\'\' Following on from the point about updating the Wiki, I will clear the attendees list to allow everyone to update with appropriate call signs etc. Ive noticed the attendees list was copied from last EMF, and there are people there that didnt come and have different call signs, so I will clear it so we can start afresh. \n\nIve been talking with some of the radio villages, and theres the High Altitude ballooning group and amsat. I believe the plan is to put most of the ham thing in campsite F which is the highest point on site F. I will have a word with AMSAT and HAB and speak to them about theyd like it laid out. My biggest concern is being too close and wiping them out during a satellite pass which obviously we dont want to do. I will have a word with them and see what they want to do.\n\nI expect well have a large number of people attending including potentially Scot Con in that area as well. There could be a good number of us arranged into a small hamlet or cluster of villages, so we should do some organisation of whats required. \n\nFor equipment I believe Paul youre offering your 450D and Magloop, I would bring my equipment but Im flying out shortly after EMF to the US to get married, so I won\'t be back in Aberdeen for sometime after, and the groups that are bringing my equipment down wil not be able to offload so I dont want them to give too much to do otherwise I would have bought my equipment with.\n\nIf we have an idea of what we need to setup, what we have and what we need then we can get something organised, if theres anything else let me know, I have information on things. \n\nDo we want a logging setup on a computer, or do we prefer paper, do we have any opinions on that?\n\n\'\'\'Peter (MSWN):\'\'\' We used Cloud Log last time and it worked quite well.\n\n\'\'\'Calum (MMMRU):\'\'\' If everyone is happy with that, we will setup a cloud log instance with this years logging on it. If anyone does object we can sort out paper which is another possibility. If anyone wants anything else let me know.\n\nI think most things are in place, Ive got the NoV for the SES call sign GB2EMF, we have a DMR number and I think were mostly on track now. Its fine weve got the DMR system thanks to Matthew, the only thing that we need to thing about soon is things like press releases to the RSGB for Radcom, GB2RS etc. I believe the deadline for RADCOM is the 25th which is a matter of days away so we should get something together and get it into them if want anything in the press. If anyone wants to help or has experience please help facilitate that, and if anyone wants to do any of it let me know, it shouldnt be a problem\n\n\'\'\'Peter (MSWN):\'\'\' I could potentially do Radcom, without wishing to sound arrogant Im the YOTA 2018 Team Leader, if we shove that into an email or Radcom write up its likely to get published because they want all the publicity they can for YOTA, just remind me when the deadline is. \n\nWe also need to decide what things we need to buy, branding things. Theres been talk about a flag, badges, stickers - something we need to talk about but probably for another time\n\n\'\'\'Calum (MMMRU):\'\'\' Peter you know your stuff, it would be good to have a YOTA presence, you know how the RSGB system works so Im more than happy for that to be you, Im an engineer by trade, people skills arent my speciality, you have my email if you need a hand with anything or any information let me know\n\n\'\'\'Peter (MSWN):\'\'\' Sure\n\n\'\'\'Matthew (2ESIP):\'\'\' Peter, if youve got contacts within Radcom and the RSGB and have experience publishing articles I think it makes sense for you to be involved, not necessarily write it all if Calum wants to have some input but drive that and get it in Radcom I think that would be appreciated by everyone\n\n\'\'\'Paul (MPLL):\'\'\' I also have no experience writing press releases so if someone else has experience doing it, Im more than happy for that to happen . I like the naming scheme of a Ham Hamlet if we get all the radio villages together. Yes I do have a 450D and a mag loop. I would say the mag loop isnt the perfect antenna, if you havent used a magloop before it can be frustrating tuning across the band and retune every few KHz to make it match. Im happy to bring it, but we have a better antenna or other kit Im also happy not to bring it.\n\nRegarding the GB2EMF Call, I intend to bring an APRS digipeater / iGate, would there be any feasibiliy to use the GB2EMF or would that have to go under my own call, assuming Ive left it too late to get an NoV for it\n\n\'\'\'Calum (MMMRU):\'\'\' I can speak to Steve who is the controller for that thing, we recently applied for the Digital and Analoge Gateways. If you have all the information I can speak to Steve and see if we have time to get an offical call sign for the igate but as you say its getting quite short, its 6 weeks or something away so timing can be tight but I can ask the question.\n\n\'\'\'Matthew (2ESIP):\'\'\' I think its worth a go, M0SKF at London Hackspace recently applied for a Packet NoV, and because its on 2 metres and amateurs the primary holder it was granted within 2 days and it was super quick and pain free, so theres probably time to do it properly, but failing that we can come up with something between us\n\n\'\'\'Paul (MPLL):\'\'\' If my tent is next to the radio tent, Im happy to consider that attended operation if necessary but it would be nice to run under an official call, but if we can talk to RSGB and ETCC.. I dont know the procedure to get an NoV but Im happy to bring the equipment and make it run, but Ive not done the paper work side of it\n\n\'\'\'Calum (MMMRU):\'\'\'  I will investigate that, Steve knows were doing this on a temporary basis in a field and hes been excepetionally helpful so I will drop him an email. The gateways are attended and on site, so it shouldnt be a problem. I will see what I can do.\n\nIf you can bring your 450D for now that would be useful, do they have an inbuilt tuner?\n\n\'\'\'Paul (MPLL):\'\'\' Yes, but only up to 3:1 after which it gets a bit sketchy\n\n\'\'\'Calum (MMMRU):\'\'\' Hibby has offer his 949E external, manual tuner. I can arrange for a 5.4M Clansman mast which we could attach say an end fed wire which should give us a reasonable amount of length to play with if you think that will be a better antenna?\n\n\'\'\'Paul (MPLL):\'\'\' Probably yes, if we have an end fed and manual tuner that can drag it down enough to something that the built in tuner can manager, or just use the external tuner, that sounds like a better option\n\n\'\'\'Calum (MMMRU):\'\'\' I have two Clansman masts available, theyre 2 fibreglass poles, 5.4 metres. I can arrange to bring them. Ill be getting to site around 11-12. Id like to put up the mast before people are arriving so theyre up and theres no one near it whilst were doing it.\n\nThe only thing Ill say on location for the Ham Hamlet theres potential to be noise. We had an issue 2 years ago where..\n\nId rather avoid that. People are welcome to camp next to us, we welcome anyone but if you see someone setting up it might be worth letting them know there might be noise after the official cut off, there might be voices and laughter if were staying up drinking. Theyre welcome to join us but it might be worth letting them know if they are looking for the quiet camping next to us might not be best\n\n\'\'\'Paul (MPLL):\'\'\' As well as the AF noise there was also some RF noise from the Dutch and Scots, is there a plan to revisit that?\n\n\'\'\'Calum (MMMRU):\'\'\' I believe that might come but I might have to speak to the Scots. There was talk about moving that away from us to stop RF issues but I havent confirmed that. We might need to build some filtering for them I will add a low pass filter to the list. Were in a temporary field full of generators and hackey projects so there will be some noise I think, we just need to deal with\n\n\'\'\'Paul (MPLL):\'\'\' WEll be supplied by switch mode power supplies and homebrew, unshielded electronics, but were there to have fun, not run a serious contest station in the lowest noise conditions possible\n\n\'\'\'Calum (MMMRU):\'\'\' Yes, well we will have a pile of handhelds anyway - label your handhelds because everyone has a Baofeng! If anyone wants anything programmed let me know and we can sort something out\n\n\'\'\'Matthew (2ESIP):\'\'\' Im probably going to offer to add the EMF hub to anyones radio that hasnt got it on - I probably only have facilities to program TYTs and a couple of other DMR radios, no Motorola stuff. But I imagine the whole world has an MD380 so it shouldnt be a massive issue. I will try and bring an old laptop so we can add a freq frequencies if required\n\n\'\'\'Calum (MMMRU):\'\'\' Ill bring my programming leads with me for various units, if anyone needs anything programing let me know \n\n===Feedback on conference call, should we do it again, when? ===\n\n\'\'\'Matthew (2ESIP):\'\'\' The only thing Ive got left is feedback on the conference call format, I know some people said its a bit formal, I agrees but sometimes to get stuff done you need a more formal format rather than discuss stuff on IRC, so if anyone has any feedback on if it worked, if theyd rather do something else, anyone?\n\n\'\'\'Peter (MSWN):\'\'\' More reliable than Skype, so its good\n\n\'\'\'Calum (MMMRU):\'\'\' I think it works quite well, especially with the Net style format, so we we know whos next. It makes it easier to gather your thoughts and be ready to go. Im quite happy with it, now is a good time, Monday night because it doesnt seem like theres much on for many people. Im happy enough with it \n\n\'\'\'Matthew (2ESIP):\'\'\' Cool, I dont think it needs to be a weekly thing, the next one will probably be a 2  weeks before the camp and thats all we need unless something urgent comes up. So well run with this format for now. Has anyone else got anything else they want to add before we wrap it up?\n\n\'\'\'[ No ]\'\'\'\n\n\'\'Meeting adjourned\'\'','utf-8'),(1538,'==Details==\n\n\n\'\'\'Date / Time:\'\'\' 23/07/2018 20:00 BST<br />\n\'\'\'Number:\'\'\' 44 (0) 3308081871<br />\n\'\'\'Pin:\'\'\' [Redacted]<br />\nOther dial-in numbers available on request. If you would like to join but cant for whatever reason, let us know so we can see if we can accommodate you.<br />\n\n==Agenda==\n\n#Introductions\n#Should we create a mailing list? If yes, which service should we use?\n#Should we create a static web page? \n#Logo Feedback discussion\n#Reminder to update wiki pages with who is going / what they are taking\n#Other business\n#Feedback on conference call, should we do it again, when? \n\n==Attendees==\n\n*Matthew (2ESIP) - Chair\n*Calum (MMMRU)\n*Peter (MSWN)\n*Paul (MPLL)\n*Paul (MTZO) - Monitoring Text doc\n\n==Outcome of Call==\n\n#\'\'\'Introductions\'\'\'<br />People introduced themselves\n#\'\'\'Should we create a mailing list? If yes, which service should we use?\'\'\'<br />Lets give groups.io a try for Organisation and updates stuff, but not general high volume How do I program my Baofeng type noise\n#\'\'\'Should we create a static web page?\'\'\'<br />Lets update the Wiki page as a landing page\'\n#\'\'\'Logo Feedback discussion\'\'\'<br />People liked 3 and 9, with people leaning towards 3 for its simplicity. We will put it up for discussion on IRC and take a final vote on Friday Deadline (27/07/2018)\n#\'\'\'Reminder to update wiki pages with who is going / what they are taking\'\'\'<br />People were reminded\n#\'\'\'Other business\'\'\'\n#* MMMRU discussed forming a \"Ham Hamlet\" or cluster of villages, alongside HAB and AMSAT\n#* MMMRU also advised that whilst everyone is welcome, the area could be a little loud at night\n#* Logging was discussed, and we will use Cloud Log. MMMRU will speak to people already using it and see if we can get another instance setup.\n#* MMMRU announced the GB2EMF Callsign \n#* MSWN will submit an article to RADCOM\n#* MPLL can bring a Yaesu 450D and a mag loop if required - but warned the mag loop can be frustrating for new users\n#* MPLL also discussed a call sign for the APRS iGate. MMMRU will ask the ETCC if we have time to apply for an NoV\n#* MMMRU / 2ESIP discussed bringing programming leads to setup radios on-site\n#\'\'\'Feedback on conference call, should we do it again, when?\'\'\'<br/>The conference call and \"Net\" style format worked well. We should do it again a couple of weeks before the event.\n\n==Full Minutes==\n\n===Introductions===\n\n\'\'\'[ Redacted ]\'\'\'\n\n===Should we create a mailing list? If yes, which service should we use?===\n\n\'\'\'Matthew (2ESIP):\'\'\' Theres radio amateurs going to EMF this year that have no idea we exist. The only way they can find out we do exist is on the EMF Camp wiki, which not everyone will not automatically do, so its about promoting awareness for 2020 and also IRC and Telegram are great but not well suited for longer running conversations. If someone goes away for a week and come back and theyve missed something its pretty much gone. Lets start with mailing lists - there appears to be mixed opinions on this. I quite like low traffic mailing lists, they work better than forums for this kind of purpose because you can get an email when someone posts.\"\n\n\'\'\'Paul (MTZO):\'\'\' NO (He doesnt like the volume of traffic he recieves from them)\n\n\'\'\'Calum (MMMRU):\'\'\' Not too much of an issue to have a low volume mailing list backed up by say IRC where we can bounce ideas off each other and general chit chat rather than on the mailing list. I know a lot of hackerspaces have their own low volume mailing list. You can have emails as they come in, or daily digest. That would help if people are concerned about receiving large amounts of email. I think that would be the way to go just because as you say we get a permanent record of things and it allows people who aren\'t interested in Telegram or ICE to be still in the chat if they so desire\n\n\'\'\'Peter (MSWN):\'\'\' Not too bothered either way, but if I get too many emails that will be irritating, but if we keep it updates, specific questions - I dont have a problem with that, I think its fine\n\n\'\'\'Paul (MPLL):\'\'\' If we need a permanent record for asynchronous communications and the choice is a mailing list or a forum, I would always go for a mailing list. Having messages pushed to me is important, I wont check a website daily for new posts. Something like a sub-reddit or Facebook - something that pushes messages to me would be my preferred route, and the lowest common denominator for that is an email mailing list\"\n\n\'\'\'Matthew (2ESIP):\'\'\' My vision I guess it wouldnt be somewhere where you ask for help with an antenna because theres 1000 of places you can ask that question. It would solely be for organisation, updates and perhaps some more casual chit chat threads - hopefully it shouldnt be 10000 threads a day of  how do I program my baofeng, its not aimed for that kind of traffic. It sounds like theres some mixed feelings but it sounds like its worth trialling, but if people say its not working we can try something else were not forced to use anything we dont want to. Has anyone got any ideas on what theyd want to use? Yahoo Groups is this traditional one used for amateur radio but its not very good...\n\n\'\'\'Peter (MSWN):\'\'\' We use groups.io for a few things and thats a decent replacement for Yahoo Groups\n\n\'\'\'Matthew (2ESIP):\'\'\' Yeah, thats the new one that more amateur radio groups are moving to or wished they moved to, they have a free tier which is adequate, the only limitation is file uploads but I dont think that will a huge issue. Does anyone else have any suggestions? - There is Google Groups but again its not amazing. A lot of people use it so theyre familiar with it, but its not great\"\n\n\'\'\'Paul (MPLL):\'\'\' Im on several google groups mailing lists, these days its a faff to get emails out of them, they really want people to do it web based or integrate it with gmail. Groups.IO is top of the list, followed by hosting our own mailman, and then Google Groups and Yahoo firmly at the bottom.\"\n\n\'\'\'Matthew (2ESIP):\'\'\' Ok, in that case I think we can give groups.io a try, unless anyone has any major objections?\"\n\n\'\'\'[Silence]\'\'\'\n\n\'\'\'Matthew (2ESIP):\'\'\'  Ok Motion carried! Has anyone got anything else theyd like to add before we move onto the next topic?\n\n\'\'\'[Silence]\'\'\'\n\n\'\'\'Outcome: Lets give groups.io a try for Organisation and updates stuff, but not general high volume How do I program my Baofeng type noise\'\'\'\n\n===Should we create a static web page?===\n\n\'\'\'Matthew (2ESIP):\'\'\' Should we create a static web page, at the moment we have the wiki which has some information but its quite busy, but if youre in the field and youve just spoken to a radio ham theres no obvious click here for more info for more info or to join the mailing list etc.  Im not suggesting a fully fledged web page, more just a static page that directs them to IRC / Telegram / Mailing List and how they can join the discussion, what are peoples thoughts, should we build our own bespoke website, or use something like blogger and use their servers, or does anyone have any thoughts?\n\n\'\'\'Paul (MTZO):\'\'\' Yes\n\n\'\'\'Calum (MMMRU):\'\'\' Having somewhere with an easily repeatable URL so people who are interested in getting into the idea of the hobby at EMF - we currently use emfhams.org, Im not sure what the main page on that goes to, Ill give it a try now. That goes to the wiki, we could put a static page there that says this is what we are. There is the thing on wiki about it, but something on there that says this is us, this is we are etc and how to get into the hobby, how to find your local club, and something like that. It can be as complicated as we want it to be. If its hosted on the same domain as the Wiki that would be easiest, if its simple and kept relatively date free parse, that would help I think. Its difficult to point someone to a long web address thats specific to the event theyre at - that does distract from it if its not easy to remember or type into a phone in a field  as you say\n\n\'\'\'Peter (MSWN):\'\'\' I agree with you, there\'s no point setting up anything complicated if we can setup a simple landing page at emfhams.org with a photo of the antenna that was there last year and a couple of links to the mailing list and wiki, we can leave it at that\n\n\'\'\'Paul (MPLL):\'\'\' Yeah I agree, we should have a simple page for people to reach us on, it should be on emfhams.org as the main page, but I feel we could use the Wiki page which is reachable at emfhams.org - it already has contact details for IRC and Telegram, as well as details of the hub and facebook page. My opinion would be to improve the front page of the wiki rather than build an external static site that directs to the wiki.\n\n\'\'\'Matthew (2ESIP):\'\'\' Yeah, I think thats reasonable, from my perspective I want to do the minimum amount possible, if someone wants to step forward and say Hey Im a web designer, Im going to create a huge website in PHP and its going to be great theyre welcome to do it, but for me its about creating the easiest simplest thing to get the information out there without having to spend too much time on it, so slimming down the front page, losing the older stuff works for me, unless anyone has any objections or suggestions?\n\n\'\'\'[Positive Sounds]\'\'\'\n\n\'\'\'Calum (MMMRU):\'\'\' That sounds reasonable, we just need to work out how to update the wiki page to make it look a little more appealing. Im not entirely au fait with that kind of thing, if I cant hit it with a spanner its not much use to me, but its best to leave that to someone else. If anyone wants a hand creating content or creating more information Im more than happy to help.\n\n\'\'\'Matthew (2ESIP):\'\'\' Is it you thats hosting the Wiki at the moment Paul?\n\n\'\'\'Paul (MPLL):\'\'\' No, its another Paul thats on Telegram, I said I would take over the hosting, but Ive been slow about taking it over. Its still on my todo list but Ive not been chased in a while so its fallen towards the bottom Im afraid, but I totally can host it.\n\n\'\'\'Matthew (2ESIP):\'\'\' Ok that wasnt me chasing, I just thought you were hosting it. Are you looking after the DNS or am I completely confused? \n\n\'\'\'Paul (MPLL):\'\'\' No, thats also not me, Im au fait with DNS - Im a sysadmin, I can host all these things but Im currently not involved in the slightest\n\n\'\'\'Matthew (2ESIP):\'\'\' No worries, weve got too many Pauls, everyone in radio is called Paul or John I think\n\nPaul (MPLL) : If it helps, the wiki is hosted I think by Paul that came 2 years ago with the trailer mast but I dont think hes coming this year\n\n\'\'\'Matthew (2ESIP):\'\'\' Unfortunately not - Im not super desperate to move the hosting but I think he was looking to close it down or shift it, I dont think he wanted to look after anymore which is perfectly reasonable. Hosting isnt a huge issue, you can host stuff anywhere these days its not a problem. Does anyone else want to add to that before we move onto the next topic?\n\n\'\'\'[ Silence ]\'\'\'\n\n\'\'\'Outcome: Lets update the Wiki page as a landing page\'\'\'\n\n===Logo Feedback discussion===\n\nDraft logos shown here - https://imgur.com/a/bdZ9UYf\n\n\'\'\'Matthew (2ESIP):\'\'\' The next thing is the logo, Ive stuck a link in Telegram which has the various options. I will start with my thoughts. In no particular order, I quite like #3 which was yours Peter because its simple, you can draw it with 6 strokes of a pen if you like, Id probably change the EMF Hams font to something a bit blockier but\n\n\'\'\'[ Matthew left the call ]\'\'\'\n\'\'\'[ Banter ensues ]\'\'\'\n\n\'\'\'Matthew (2ESIP):\'\'\' Im back sorry, I got kicked out my own conference call. Im not too sure where I got cut off, were you guys talking about something else or am I okay to start again? \n\n\'\'\'[ Positive sounds ]\'\'\' \n\n\'\'\'Matthew (2ESIP):\'\'\' I like Peters design, which is #3 its simple, you can print it on a circle just the logo - Id probably go for a blockier text but its not a big deal. Obviously I also like the one I suggested which is #9 but it\'s a bit more complicated, more difficult to draw. I also quite like M0TZOs #1 but it would be nice to incorporate the EMF logo, but with what weve got on the table today Id go with #9 or #3.\n\n\'\'\'Callum (MMMRU):\'\'\' I like all of them, but I agree with you when you say #3 because its simple and its easy to get things like stamps and stickers, theyre easy enough to do in a simple image like that - a stamp especially if were stamping passports and things, its useful to have something that is simple. I agree with having a blockier text, again for stamps and things, but not necessary. Its simple and easy and it doesnt suggest we do anything with Wifi which will be a big thing on a site, and its just a simple easy logo really, so I would go with #3, and that would be more preference or something like #8 which is that with an antenna, but it would be best to stick with less detail for stamps etc.\n\n\'\'\'Peter (MSWN):\'\'\' Im biased, If Im going to brutally honest Im not a great fan of the traditional amateur radio club logos AKA 9 and 10. I cant decide between 3 and 8 out of f my own. I like it simple but I worry that its not amateur radio-y enough and it looks like any sort of RF - Im not entirely sure about that. But then I like it simple. You can do it with and without the text, its not a badge its just a logo so it will look fine. As for the text Ill draw it in inkscape as a vector graphic and Ill look through the fonts to see if theres anything nice we can choose. Thats about it really but I am biased but we will have to make a decision. Im leaning towards #3 over #8\n\n\'\'\'Paul (MPLL):\'\'\' I have no graphic ability whatsoever, so take my opinions with a truck of salt. I like the ones that incorporate the tilde EMF logo itself, #3-10 as we are EMF Hams so we should have the EMF logo in there somewhere. Did we check if it was CC licensed so we can remix it into our own?\n\n\'\'\'Peter (MSWN):\'\'\' Not really, but lots of other people have\n\n\'\'\'Paul (MPLL):\'\'\' In that case theyre probably cool with it. Looking through the list, I also like #3 for simplicity but if I had to pick one I think Id go for #9, because it  combines the EMF logo and the traditional radio logo which is what we are. I might make the tilde logo blue in the centre of #9 if were going for a coloured logo, but thats my view.\n\n\'\'\'Matthew (2ESIP):\'\'\' Has anyone else got anything they want to add? I dont think well make a decision today as theres too many people involved and its not fair to make a decision but it sounds like most people are leaning towards #3 but well put to the group. We should probably put a deadline, I dont know if anyone objects but EMF is in a month, if were going to get stuff printed we need to really need to make a move on that, so Id say we should make a decision by Friday of this week unless anyone has any suggestions or concerns?\n\n\'\'\'Peter (MSWN):\'\'\' I will make another draft of my #3 and #8\n\n\'\'\'Calum (MMMRU):\'\'\' I agree, if were going to make stuff up we need to get things done. Im made a note to ask Russ about the status of the logo to make sure theyre happy with us to incorporate the logo, I dont think they will object but its better to just ask \n\n\'\'\'Matthew (2ESIP):\'\'\' Cheers Calum, I dont think there will be any objections either, I asked about using the phrase EMF Hub and they said yes as long as youre not claiming to be part of the organisation and make it clear your a village or whatever but if you could check that ensures everyones happy. \n\nWell chuck that onto IRC later and try and get a decision by Friday.\n\n\'\'\'Outcome: People liked 3 and 9, with people leaning towards 3 for its simplicity. We will put it up for discussion on IRC and take a final vote on Friday (27/07/2018) Deadline\'\'\'\n\n===Reminder to update wiki pages with who is going / what they are taking===\n\n\'\'\'Matthew (2ESIP):\'\'\' If youve not already updated the wiki with if youre going and what youre taking that would be helpful, and also remind anyone else that you know they should also update it as well - it helps to track who is there and what equipment theyre taking either.\n\nOutcome: No objections \n\n===Other business===\n\n\'\'\'Calum (MMMRU):\'\'\' Following on from the point about updating the Wiki, I will clear the attendees list to allow everyone to update with appropriate call signs etc. Ive noticed the attendees list was copied from last EMF, and there are people there that didnt come and have different call signs, so I will clear it so we can start afresh. \n\nIve been talking with some of the radio villages, and theres the High Altitude ballooning group and amsat. I believe the plan is to put most of the ham thing in campsite F which is the highest point on site F. I will have a word with AMSAT and HAB and speak to them about theyd like it laid out. My biggest concern is being too close and wiping them out during a satellite pass which obviously we dont want to do. I will have a word with them and see what they want to do.\n\nI expect well have a large number of people attending including potentially Scot Con in that area as well. There could be a good number of us arranged into a small hamlet or cluster of villages, so we should do some organisation of whats required. \n\nFor equipment I believe Paul youre offering your 450D and Magloop, I would bring my equipment but Im flying out shortly after EMF to the US to get married, so I won\'t be back in Aberdeen for sometime after, and the groups that are bringing my equipment down wil not be able to offload so I dont want them to give too much to do otherwise I would have bought my equipment with.\n\nIf we have an idea of what we need to setup, what we have and what we need then we can get something organised, if theres anything else let me know, I have information on things. \n\nDo we want a logging setup on a computer, or do we prefer paper, do we have any opinions on that?\n\n\'\'\'Peter (MSWN):\'\'\' We used Cloud Log last time and it worked quite well.\n\n\'\'\'Calum (MMMRU):\'\'\' If everyone is happy with that, we will setup a cloud log instance with this years logging on it. If anyone does object we can sort out paper which is another possibility. If anyone wants anything else let me know.\n\nI think most things are in place, Ive got the NoV for the SES call sign GB2EMF, we have a DMR number and I think were mostly on track now. Its fine weve got the DMR system thanks to Matthew, the only thing that we need to thing about soon is things like press releases to the RSGB for Radcom, GB2RS etc. I believe the deadline for RADCOM is the 25th which is a matter of days away so we should get something together and get it into them if want anything in the press. If anyone wants to help or has experience please help facilitate that, and if anyone wants to do any of it let me know, it shouldnt be a problem\n\n\'\'\'Peter (MSWN):\'\'\' I could potentially do Radcom, without wishing to sound arrogant Im the YOTA 2018 Team Leader, if we shove that into an email or Radcom write up its likely to get published because they want all the publicity they can for YOTA, just remind me when the deadline is. \n\nWe also need to decide what things we need to buy, branding things. Theres been talk about a flag, badges, stickers - something we need to talk about but probably for another time\n\n\'\'\'Calum (MMMRU):\'\'\' Peter you know your stuff, it would be good to have a YOTA presence, you know how the RSGB system works so Im more than happy for that to be you, Im an engineer by trade, people skills arent my speciality, you have my email if you need a hand with anything or any information let me know\n\n\'\'\'Peter (MSWN):\'\'\' Sure\n\n\'\'\'Matthew (2ESIP):\'\'\' Peter, if youve got contacts within Radcom and the RSGB and have experience publishing articles I think it makes sense for you to be involved, not necessarily write it all if Calum wants to have some input but drive that and get it in Radcom I think that would be appreciated by everyone\n\n\'\'\'Paul (MPLL):\'\'\' I also have no experience writing press releases so if someone else has experience doing it, Im more than happy for that to happen . I like the naming scheme of a Ham Hamlet if we get all the radio villages together. Yes I do have a 450D and a mag loop. I would say the mag loop isnt the perfect antenna, if you havent used a magloop before it can be frustrating tuning across the band and retune every few KHz to make it match. Im happy to bring it, but we have a better antenna or other kit Im also happy not to bring it.\n\nRegarding the GB2EMF Call, I intend to bring an APRS digipeater / iGate, would there be any feasibiliy to use the GB2EMF or would that have to go under my own call, assuming Ive left it too late to get an NoV for it\n\n\'\'\'Calum (MMMRU):\'\'\' I can speak to Steve who is the controller for that thing, we recently applied for the Digital and Analoge Gateways. If you have all the information I can speak to Steve and see if we have time to get an offical call sign for the igate but as you say its getting quite short, its 6 weeks or something away so timing can be tight but I can ask the question.\n\n\'\'\'Matthew (2ESIP):\'\'\' I think its worth a go, M0SKF at London Hackspace recently applied for a Packet NoV, and because its on 2 metres and amateurs the primary holder it was granted within 2 days and it was super quick and pain free, so theres probably time to do it properly, but failing that we can come up with something between us\n\n\'\'\'Paul (MPLL):\'\'\' If my tent is next to the radio tent, Im happy to consider that attended operation if necessary but it would be nice to run under an official call, but if we can talk to RSGB and ETCC.. I dont know the procedure to get an NoV but Im happy to bring the equipment and make it run, but Ive not done the paper work side of it\n\n\'\'\'Calum (MMMRU):\'\'\'  I will investigate that, Steve knows were doing this on a temporary basis in a field and hes been excepetionally helpful so I will drop him an email. The gateways are attended and on site, so it shouldnt be a problem. I will see what I can do.\n\nIf you can bring your 450D for now that would be useful, do they have an inbuilt tuner?\n\n\'\'\'Paul (MPLL):\'\'\' Yes, but only up to 3:1 after which it gets a bit sketchy\n\n\'\'\'Calum (MMMRU):\'\'\' Hibby has offer his 949E external, manual tuner. I can arrange for a 5.4M Clansman mast which we could attach say an end fed wire which should give us a reasonable amount of length to play with if you think that will be a better antenna?\n\n\'\'\'Paul (MPLL):\'\'\' Probably yes, if we have an end fed and manual tuner that can drag it down enough to something that the built in tuner can manager, or just use the external tuner, that sounds like a better option\n\n\'\'\'Calum (MMMRU):\'\'\' I have two Clansman masts available, theyre 2 fibreglass poles, 5.4 metres. I can arrange to bring them. Ill be getting to site around 11-12. Id like to put up the mast before people are arriving so theyre up and theres no one near it whilst were doing it.\n\nThe only thing Ill say on location for the Ham Hamlet theres potential to be noise. We had an issue 2 years ago where..\n\nId rather avoid that. People are welcome to camp next to us, we welcome anyone but if you see someone setting up it might be worth letting them know there might be noise after the official cut off, there might be voices and laughter if were staying up drinking. Theyre welcome to join us but it might be worth letting them know if they are looking for the quiet camping next to us might not be best\n\n\'\'\'Paul (MPLL):\'\'\' As well as the AF noise there was also some RF noise from the Dutch and Scots, is there a plan to revisit that?\n\n\'\'\'Calum (MMMRU):\'\'\' I believe that might come but I might have to speak to the Scots. There was talk about moving that away from us to stop RF issues but I havent confirmed that. We might need to build some filtering for them I will add a low pass filter to the list. Were in a temporary field full of generators and hackey projects so there will be some noise I think, we just need to deal with\n\n\'\'\'Paul (MPLL):\'\'\' WEll be supplied by switch mode power supplies and homebrew, unshielded electronics, but were there to have fun, not run a serious contest station in the lowest noise conditions possible\n\n\'\'\'Calum (MMMRU):\'\'\' Yes, well we will have a pile of handhelds anyway - label your handhelds because everyone has a Baofeng! If anyone wants anything programmed let me know and we can sort something out\n\n\'\'\'Matthew (2ESIP):\'\'\' Im probably going to offer to add the EMF hub to anyones radio that hasnt got it on - I probably only have facilities to program TYTs and a couple of other DMR radios, no Motorola stuff. But I imagine the whole world has an MD380 so it shouldnt be a massive issue. I will try and bring an old laptop so we can add a freq frequencies if required\n\n\'\'\'Calum (MMMRU):\'\'\' Ill bring my programming leads with me for various units, if anyone needs anything programing let me know \n\n===Feedback on conference call, should we do it again, when? ===\n\n\'\'\'Matthew (2ESIP):\'\'\' The only thing Ive got left is feedback on the conference call format, I know some people said its a bit formal, I agrees but sometimes to get stuff done you need a more formal format rather than discuss stuff on IRC, so if anyone has any feedback on if it worked, if theyd rather do something else, anyone?\n\n\'\'\'Peter (MSWN):\'\'\' More reliable than Skype, so its good\n\n\'\'\'Calum (MMMRU):\'\'\' I think it works quite well, especially with the Net style format, so we we know whos next. It makes it easier to gather your thoughts and be ready to go. Im quite happy with it, now is a good time, Monday night because it doesnt seem like theres much on for many people. Im happy enough with it \n\n\'\'\'Matthew (2ESIP):\'\'\' Cool, I dont think it needs to be a weekly thing, the next one will probably be a 2  weeks before the camp and thats all we need unless something urgent comes up. So well run with this format for now. Has anyone else got anything else they want to add before we wrap it up?\n\n\'\'\'[ No ]\'\'\'\n\n\'\'Meeting adjourned\'\'','utf-8'),(1539,'We occasionally have meetings to organise ourselves. You can view the agendas, outcomes and minutes below- \n\n===Conference Calls===\n\n*[http://wiki.emfhams.org/index.php/EMF_Hams_Conference_Call_(23/07/2018) 23/07/2018]','utf-8'),(1540,'Callsign currently M0XPX\n\nSpends too much time on random nonsense and not enough on ham radio stuff.','utf-8'),(1541,'{{Village\n|Description=Ham radio at its finest.\n|Contact=M0TZO\n|Activities=Demonstrations of Amateur Radio communication and possibly some contesting.\n|Location=51.21250,-0.60941\n|Name=mateur (Ham) Radio enthusiasts\n|Picture=Radiotowerhi.png\n}}\n==Amateur Radio==\nQuoting from Wikipedia [https://en.wikipedia.org/wiki/Amateur_radio Amateur Radio page] \'\'\"Amateur radio (also called \"ham\" radio) describes the use of radio frequency spectra for purposes of non-commercial exchange of messages, wireless experimentation, self-training, private recreation and emergency communication\".\'\'\n\nDuring EMF 2018 will shall be showcasing Amateur Radio on Bands from 3.5 MHz (80m) to 430MHz (70cm) and maybe higher. We\'ll also have a local frequency on either 144MHz (2m) &/or 430MHz (70cm) FM.\n\nFor reference, the EMF site in Eastnor is at Gridsquare: IO82ta. WAB Square: SO73\n\nUnique Hackerspace passport stamp available on site. Please ask for Paul M0TZO for the stamp in your passport.\n\n===Special Event Callsigns===\nAmateur Radio Village will be operating a special event station: \'\'\'GB2EMF\'\'\'<br />\nNoV Holder is MM0MRU\n\n===Local Comms===\n145.425 / 433.425 simplex NFM \'\'(If in use by other Amateurs then please try 145.450 / 433.450)\'\'\n\n==Amateur Radio chat on IRC/Telegram/Facebook==\nWe\'re using [http://en.wikipedia.org/wiki/IRC IRC] and [https://telegram.org/ Telegram] to organise the Amateur Radio Village, & you can find us on [https://kiwiirc.com/client/irc.freenode.net/emfhams <tt>#emfhams</tt>] on Freenode or our [https://telegram.me/joinchat/A3glvAZ5xf_T9RkCfuDeOA Telegram Group]. The IRC channel and Telegram group are linked, so you can use either.\n\n* IRC Network - <tt>chat.freenode.net</tt> on port 6667 (non-SSL) or 6697 (SSL, recommended)<br />\n* Channel - #emfhams<br />\n* Username - Callsign or other username<br />\n* Web Based Link to #emfhams - [http://webchat.freenode.net?channels=emfhams Webbased #emfhams channel]\n* Connect through Tor (Instructions can be found [http://freenode.net/irc_servers.shtml#tor here])\n* [https://telegram.me/emfhams Join our Telegram Group] (iPhone, Android Apps & Web Based)\n\nThere is also a Facebook group with pictures, videos and other bits:\n\n* [https://www.facebook.com/groups/316141732057436/ Facebook: EMF Hams]\n\n===Chat Members===\n{| class=\"wikitable sortable\"\n! style=\"text-align:left;\"| Callsign*\n! IRC Name\n! First Name\n! Role\n! Ticket\n! Notes\n|-\n| data-sort-value=\"M6LPI\"| M6LPI\n| M6LPI\n| Neil\n| &nbsp;\n| No\n| &nbsp;\n|-\n| data-sort-value=\"M0RVM\"| MRVM\n| tgreer\n| Thomas\n| &nbsp;\n| &nbsp;\n| &nbsp;\n|-\n| data-sort-value=\"M0WPG\"| M0WPG\n| paul-M0WPG\n| data-sort-value=\"Paul\"| Paul (another)\n| &nbsp;\n| No\n| Bringing Gazebo & SCAM12 mast\n|-\n| 2M0STB\n| irl\n| Iain\n| &nbsp;\n| No\n| &nbsp;\n|-\n| 5Q5R\n| mihtjel\n| Rune\n| &nbsp;\n| &nbsp;\n| &nbsp;\n|-\n| [https://www.qrz.com/lookup/M0NGY MNGY]\n| Filbert\n| Jon\n| &nbsp;\n| No\n| &nbsp;\n|-\n| M0RYS\n| kraptv\n| Ryan\n| &nbsp;\n| &nbsp;\n| &nbsp;\n|-\n| MM3ZRZ\n| hibby/Rde\n| Dave\n| Buckfast Warrior\n| data-sort-value=\"No\"| Nah\n| Manages Scottish Consulate, will have 5.4m mast in consulate\n|-\n| data-sort-value=\"M0TZO\"| [http://www.m0tzo.co.uk MTZO]\n| data-sort-value=\"M0TZO\"| MTZO\n| Paul\n| Ham Village Lead\n| Yes\n| Bringing some Radios and Cards Against Humanity (big set)\n|-\n| data-sort-value=\"M0SPN\"| M0SPN\n| M0SPN\n| Steve\n| &nbsp;\n| No\n| &nbsp;\n|-\n| data-sort-value=\"DB1SQU\"| DB1SQU\n| SQUelcher\n| Kai\n| &nbsp;\n| &nbsp;\n| &nbsp;\n|-\n| data-sort-value=\"M0NIT\"| M0NIT\n| M0NIT\n| Jan\n| &nbsp;\n| &nbsp;\n| &nbsp;\n|-\n| data-sort-value=\"M0PLL\"| M0PLL\n| plett\n| Paul (yet another one!)\n| &nbsp;\n| No\n| &nbsp;\n|-\n| data-sort-value=\"M0DLX\"| M0DLX\n| Dominic\n| Dominic\n| &nbsp;\n| No\n| Bringing IC-706, 2m/70cms beams, may enter contests\n|-\n| data-sort-value=\"HB9EGM\"| HB9EGM\n| hb9egm\n| Matthias\n| &nbsp;\n| &nbsp;\n| Doing DAB things\n|-\n| data-sort-value=\"M0NIT\"| M0NIT\n| jasiek\n| Jan\n| &nbsp;\n| &nbsp;\n| &nbsp;\n|-\n| data-sort-value=\"M0XPX\"| M0XPX\n| MatStace\n| Mat\n| &nbsp;\n| Yes\n|  \n|-\n| data-sort-value=\"G6VZM\"| G6VZM\n| g6vzm\n| JJ\n| Token old bloke with G- call to balance the inclusivity statistics.\n| No\n| Could bring FT-1000MP if shack is dry and secure, definitely FT-897D, 10m lightweight guyed mast, 2+70 yagis if required, <s>organising (but not actual transporting) 50m RG213 from LHS and</s> antenna cable believed to be 15-20m of RG-213.\n|-\n| data-sort-value=\"M6KVA\"| M6KVA\n| pe5er\n| Peter\n| Village First Aider\n| No\n| Bringing Kenwood TM-241E, Realtek SDRs, selection of DIY 2m antennas\n|-\n| data-sort-value=\"MM0MRU\"| MM0MRU\n| WSPR\n| Calum\n| Village Idiot\n| Yes\n| NoV Holder for GB2EMF\n|-\n| data-sort-value=\"M1PFS\"| M1PFS\n| M1PFS\n| Pete\n| &nbsp;\n| No\n| SDR stuff and Raspberry Pi\n|-\n| data-sort-value=\"M1DHL\"| M1DHL\n| murb\n| bill\n| &nbsp;\n| No\n| &nbsp;\n|-\n| data-sort-value=\"G0VQH\"| G0VQH\n| jennyb\n| Jenny\n| &nbsp;\n| No\n| Campervan + Large Tarheel. KX3+Pole+wire+gaffer tape for something creative;\n|-\n| data-sort-value=\"IV3BSI\"| IV3BSI\n| g5pw\n| Alja\n| &nbsp;\n| No\n| &nbsp;\n|-\n| data-sort-value=\"PD5KNR\"| PD5KNR\n| Knorrie\n| Hans\n| Learning stuff\n| No\n| &nbsp;\n|-\n| data-sort-value=\"ON4PHP\"| ON4PHP\n| trouble\n| Philip\n| &nbsp;\n| No\n| &nbsp;\n|-\n| data-sort-value=\"MM0TKE\"| MM0TKE\n| tkerby\n| Tim\n| &nbsp;\n| No\n| Bringing an APRS iGate and a Yaesu VX-8\n|-\n| data-sort-value=\"2E0SIP\"| 2ESIP\n| marrold\n| Matthew\n| &nbsp;\n| No\n| FM + DMR Gateway, possibly a cheapo 20W 2&70 Mobile Radio? (12/07/2018)\n|-\n\n|}\n<nowiki />* If you have a Callsign\n\n==Local Repeaters==\n\'\'List needs updating for new location\'\'\n{| class=\"wikitable sortable\"\n! style=\"text-align:left;\"| Repeater!!Output!!Recieve!!CTCSS/DMR!!Distance!!Notes\n|-\n| &nbsp;||&nbsp;||&nbsp;||&nbsp;||&nbsp;||&nbsp;\n|-\n| &nbsp;||&nbsp;||&nbsp;||&nbsp;||&nbsp;||&nbsp;\n|}\n\n==ISS Passes==\nList needs updating for New location and times. \n\nThere are quite a few ISS passes of which at least six are at high angle during hacker-friendly times:\n\n{| class=\"wikitable sortable\"\n! style=\"text-align:left;\"| Date!!Start!!Alt!!Az!!Highest!!Alt!!Az!!End!!Alt!!Az!!Pass type\n|-\n| &nbsp;\n| &nbsp;\n| &nbsp;\n| &nbsp;\n| &nbsp;\n| &nbsp;\n| &nbsp;\n| &nbsp;\n| &nbsp;\n| &nbsp;\n| &nbsp; \n|-\n| &nbsp;\n| &nbsp;\n| &nbsp;\n| &nbsp;\n| &nbsp;\n| &nbsp;\n| &nbsp;\n| &nbsp;\n| &nbsp;\n| &nbsp;\n| &nbsp;\n\n|}\n\n==Contests==\nThere are a [http://www.rsgbcc.org/cgi-bin/readcal.pl couple of contests] on during EMF which we might want to put together a station for:\n\nAlso here nearer the time will be contest over the EMF Camp weekend [http://www.hornucopia.com/contestcal/weeklycont.php Hornucopia.com 8 Day Contest Calendar]\n\n==Tasks/Organisation==\nSome tasks may already be complete - if so please add owner/completion date.  Otherwise feel free to take ownership.\n{| class=\"wikitable sortable\"\n! style=\"text-align:left;\"| Task*\n! Owner\n! Date Complete\n! Notes\n|-\n| Contact RSGB News\n| &nbsp;\n| &nbsp;\n| Sent item for special event stations\n|-\n| Contact RADCOM\n| &nbsp;\n| &nbsp;\n| Press release?\n|-\n| Contact GB2RS||&nbsp;||&nbsp;||Sent item for special event stations\n|-\n| emfcamp\n| &nbsp;\n| &nbsp;\n| Press release (Facebook/Twitter)?\n|-\n| Contact RSGB\n| &nbsp;\n| &nbsp;\n| Requested promo paterial\n|-\n| Contact Yaesu\n| &nbsp;\n| &nbsp;\n| Requested promo items & equipment loans\n|-\n| Contact Icom\n| &nbsp;\n| &nbsp;\n| Requested promo items & equipment loans\n|-\n| Contact Kenwood\n| &nbsp;\n| &nbsp;\n| Requested promo items & equipment loans\n|-\n| Contact Moonraker\n| &nbsp;\n| &nbsp;\n| Requested antenna loans (for satellite)\n|-\n| Furniture\n| &nbsp;\n| &nbsp;\n| Organise loan/hire of tables & chairs\n|-\n| Equipment\n| &nbsp;\n| &nbsp;\n| Contact attendees and compile definitive radio/antenna/mast list\n|-\n| Event Write Up\n| &nbsp;\n| &nbsp;\n| Something to post on Social Media after event\n|-\n| Photos\n| &nbsp;\n| &nbsp;\n| Maybe have a Shared DropBox or space somewhere\n|-\n|}\n\n==Station Planning==\nInitial plan made from comments/equipment above.  Please keep updated with offers/changes.\n\nBear in mind that this is an initial framework based on the offers of equipment received and the constraints of the site as best we can determine from Google/OS etc. It\'s quite likely to change on the day so please don\'t be surprised if you\'ve offered equipment to do one thing but we suggest it\'s better for something else.  If you have particular plans please raise it in the IRC channel.\n\n===HF Station===\n{| class=\"wikitable sortable\"\n! style=\"text-align:left;\"| Function*\n! Item\n! Owner\n! Notes\n|-\n| Transceiver\n| \n| \n| \n|-\n| PSU\n| \n| \n| \n|-\n| Antenna\n| \n| \n| \n|-\n| Antenna 2\n| \n| \n| \n|-\n| Mast\n| \n| \n| \n|-\n| Feeder\n| \n| \n| \n|-\n| Other\n| \n| \n| \n|-\n| Antenna analyser\n| \n| \n| \n|-\n| Antenna tuner\n| \n| \n| \n|}\n\n===VHF/UHF Station===\n{| class=\"wikitable sortable\"\n! style=\"text-align:left;\"| Function*\n! Item\n! Owner\n! Notes\n|-\n| Transceiver\n| \n| \n| \n|-\n| PSU\n| \n|\n| \n|-\n| Antenna\n| \n| \n| \n|-\n| Mast\n| \n| \n| \n|-\n| Feeder\n| \n| \n| \n|-\n| Other\n| \n| \n| \n|}\n\n===DMR and Analogue Gateway===\n{| class=\"wikitable sortable\"\n! style=\"text-align:left;\"| Function*\n! Item\n! Owner\n! Notes\n|-\n| Transceiver\n| Tait 8105 UHF\n| 2E0SIP\n| 2x\n|-\n| PSU\n| Sharam 23A Switching PSU\n| 2E0SIP\n| \n|-\n| Antenna\n| Diamond X30\n| 2E0SIP\n| \n|-\n| Mast\n| \n| \n| \n|-\n| Feeder\n| RG8X patch leads + UltraFlex7 feeder to antenna\n| 2E0SIP\n| \n|}\n\n===Local Comms===\nFor comms around the site, maybe a crossband repeater if handhelds can\'t reach from one side of the site to the other.\n\nWill this be required this year? (MM0MRU 12/07/2018)\n{| class=\"wikitable sortable\"\n! style=\"text-align:left;\"| Function*\n! Item\n! Owner\n! Notes\n|-\n| Transceiver\n| \n| \n| \n|-\n| PSU\n| \n| \n| \n|-\n| Antenna\n| \n| \n| \n|-\n| Mast\n| \n| \n|\n|-\n| Feeder\n| \n| \n| \n|}\n\n===Misc/Shelter===\n{| class=\"wikitable sortable\"\n! style=\"text-align:left;\"| Item*\n! Owner\n! Notes\n|-\n| Gazebo\n| EMF Camp\n| Rented from EMF\n|-\n| Power Distribution\n| \n| \n|-\n| Rotator\n| ?\n| ?\n|-\n| Table and stools\n| EMF Camp\n| Rented from EMF\n|-\n| ?x chairs\n| EMF Camp\n| Rented from EMF\n|-\n| Ligthing\n| EMF Camp\n| Believed to be part of the tent?\n|}\n\n===Needed===\n{| class=\"wikitable sortable\"\n! style=\"text-align:left;\"| Item*\n! Owner\n! Notes\n|-\n| \n| \n|-\n| Mains cables\n| everyone!\n| You \'\'\'always\'\'\' need more 4-way bars than you have\n|}\n\n==Useful Links==\n[https://sites.google.com/site/gw6itj/bandplan GW6ITJ UK Band Plans]\n[http://www.arrl.org/graphical-frequency-allocations USA Band Plans]\n\n[[Category:Schedule]] <!-- added by [[User:Ms7821]] so we can potentially put the contests in the schedule -->','utf-8'),(1542,'=== Introduction ===\n\nA Codeplug is the programming file containing that is uploaded to a radio to configure various channels, contacts, receive lists, scan lists and zones.\n\n===Format===\n\nWhilst the actual Code Plug format varies between manufacturers and models, they usually have the same basic structure. \n\n====Contacts====\n\nContacts are \'\'who\'\' you want to call. They could be a private call which will call another radio directly, or a talk group which will broadcast audio to anyone else monitoring that talk group.\n\nGenerally a Contact has only two important settings, the ID, i.e the number assigned to the Radio/User or the Talk Group, and they Type - whether its a Private or Group Call\n\nOne contact can usually be assigned to any channels and scan lists.\n\n====Receive Group====\n\nA receive group is a group of contacts that you wish to receive audio from, so one \"channel\" can listen to several talk groups simultaneously.\n\n====Channels====\n\nChannels are where you configure the frequencies, colour codes, time slots etc  for the individual repeater/gateway or simplex contact.\n\nYou then assign a contact to the channel, so when you key up the radio will transmit to that contact, and likewise the radio will output any traffic received from that contact\n\nYou can also assign a receive group, so your radio will output any traffic received from a group of contacts when received on the same frequency / colour code / Time Slot combination as the channel. \n\nYou can also assign a scan list, this is a list of channels that your radio will scan through, changing frequency when required. These can usually be a mix of Analog and DMR channels.\n\n====Scan Lists====\n\nScan lists are made up of groups of channels. The channels do not need to have anything in common, they can be a mix of frequencies, modes, colour codes etc.\n\nScan lists are then assigned to a channel so a user can scan through multiple contacts if desired. \n\nNote: Scan Lists are slower than Receive Groups as the radio is changing Frequency etc. If you can use a Receive Group instead - do it.\n\n====Zones====\n\nZones are arbitrary groups of channels. Most amateurs would create a Zone per repeater, but it\'s really up to the user how these configured. Once you\'ve selected a Zone on the radio, you can usually switch through the channels in that zone using the selector knob on the top of the radio','utf-8'),(1543,'=== Introduction ===\n\nA Codeplug is the programming file that is uploaded to a radio to configure various channels, contacts, receive lists, scan lists and zones.\n\n===Format===\n\nWhilst the actual Code Plug format varies between manufacturers and models, they usually have the same basic structure. \n\n=====Contacts=====\n\nContacts are \'\'who\'\' you want to call. They could be a private call which will call another radio directly, or a talk group which will broadcast audio to anyone else monitoring that talk group.\n\nGenerally a Contact has only two important settings, the ID, i.e the number assigned to the Radio/User or the Talk Group, and they Type - whether its a Private or Group Call\n\nOne contact can usually be assigned to any channels and scan lists.\n\n=====Receive Group=====\n\nA receive group is a group of contacts that you wish to receive audio from, so one \"channel\" can listen to several talk groups simultaneously.\n\n=====Channels=====\n\nChannels are where you configure the frequencies, colour codes, time slots etc  for the individual repeater/gateway or simplex contact.\n\nYou then assign a contact to the channel, so when you key up the radio will transmit to that contact, and likewise the radio will output any traffic received from that contact\n\nYou can also assign a receive group, so your radio will output any traffic received from a group of contacts when received on the same frequency / colour code / Time Slot combination as the channel. \n\nYou can also assign a scan list, this is a list of channels that your radio will scan through, changing frequency when required. These can usually be a mix of Analog and DMR channels.\n\n=====Scan Lists=====\n\nScan lists are made up of groups of channels. The channels do not need to have anything in common, they can be a mix of frequencies, modes, colour codes etc.\n\nScan lists are then assigned to a channel so a user can scan through multiple contacts if desired. \n\nNote: Scan Lists are slower than Receive Groups as the radio is changing Frequency etc. If you can use a Receive Group instead - do it.\n\n=====Zones=====\n\nZones are arbitrary groups of channels. Most amateurs would create a Zone per repeater, but it\'s really up to the user how these configured. Once you\'ve selected a Zone on the radio, you can usually switch through the channels in that zone using the selector knob on the top of the radio','utf-8'),(1544,'=== Introduction ===\n\nA Codeplug is the programming file that is uploaded to a radio to configure various channels, contacts, receive lists, scan lists and zones.\n\n===Format===\n\nWhilst the actual Code Plug format varies between manufacturers and models, they usually have the same basic structure. \n\n=====Contacts=====\n\nContacts are \'\'who\'\' you want to call. They could be a private call which will call another radio directly, or a talk group which will broadcast audio to anyone else monitoring that talk group.\n\nGenerally a Contact has only two important settings, the ID, i.e the number assigned to the Radio/User or the Talk Group, and they Type - whether its a Private or Group Call\n\nOne contact can usually be assigned to any channels and scan lists.\n\n=====Receive Group=====\n\nA receive group is a group of contacts that you wish to receive audio from, so one \"channel\" can listen to several talk groups simultaneously.\n\n=====Channels=====\n\nChannels are where you configure the frequencies, colour codes, time slots etc  for the individual repeater/gateway or simplex contact.\n\nYou then assign a contact to the channel, so when you key up the radio will transmit to that contact, and likewise the radio will output any traffic received from that contact\n\nYou can also assign a receive group, so your radio will output any traffic received from a group of contacts when received on the same frequency / colour code / Time Slot combination as the channel. \n\nYou can also assign a scan list, this is a list of channels that your radio will scan through, changing frequency when required. These can usually be a mix of Analog and DMR channels.\n\n=====Scan Lists=====\n\nScan lists are made up of groups of channels. The channels do not need to have anything in common, they can be a mix of frequencies, modes, colour codes etc.\n\nScan lists are then assigned to a channel so a user can scan through multiple contacts if desired. \n\nNote: Scan Lists are slower than Receive Groups as the radio is changing Frequency etc. If you can use a Receive Group instead - do it.\n\n=====Zones=====\n\nZones are arbitrary groups of channels. Most amateurs would create a Zone per repeater, but it\'s really up to the user how these configured. Once you\'ve selected a Zone on the radio, you can usually switch through the channels in that zone using the selector knob on the top of the radio\n\n===Suggested Layout===\n\n{| class=\"wikitable\"\n! No\n! Name\n! Mode\n! Rx Frequency\n! Tx Frequency\n! Offset\n! CC / CTCSS\n! TS\n! TG\n! Scan List\n|-\n| 1\n| EMF Camp\n| D\n| 438.4000\n| 438.4000\n| 0\n| 4\n| 2\n| 27273\n| EMF Camp\n|-\n| 2\n| MB7IEF [A]\n| A\n| 430.8000\n| 430.8000\n| 0\n| 118.8\n| \n| \n| -\n|-\n| 3\n| MB6AEF [D]\n| D\n| 438.4000\n| 438.4000\n| 0\n| 4\n| -\n| -\n| -\n|-\n| 4\n| DH1 438.5875\n| D\n| 438.5875\n| 438.5875\n| 0\n| 1\n| 2*\n| 9\n| -\n|-\n| 5\n| DH2 438.6000\n| D\n| 438.6000\n| 438.6000\n| 0\n| 1\n| 2*\n| 9\n| -\n|-\n| 6\n| DH3 438.6125 (C)\n| D\n| 438.6125\n| 438.6125\n| 0\n| 1\n| 2*\n| 9\n| -\n|-\n| 7\n| DH4 438.6250\n| D\n| 438.6250\n| 438.6250\n| 0\n| 1\n| 2*\n| 9\n| -\n|-\n| 8\n| DH5 438.6375\n| D\n| 438.6375\n| 438.6375\n| 0\n| 1\n| 2*\n| 9\n| -\n|-\n| 9\n| DH6 438.650