'\'1234#\'\'\' (This is not the actual pin).\n# If the pin is correct you will hear a beep (or possibly silence...). If its incorrect the call will end.\n# After the beep, enter \'\'\'0*1#\'\'\'\n# If the unit has successfully turned off, you will hear a beep (or possibly silence...). Hangup.\n# If you hear two beeps, re-enter the shutdown command or hangup and try again.\n\n===Enable the Gateways===\n\nOnly the NoV holder should re-enable the gateways once authorised to do so.\n\n====SMS====\n\n# Send an SMS with the following message: \'\'\'1234#1*1#\'\'\' (where 1234 is the PIN-code)\n\n====Call====\n\n# Dial the supplied number.\n# When it answers, enter the supplied pin followed by hash. E.G 1234# (This is not the actual pin).\n# If the pin is correct you will hear a beep (or possibly silence...). If its incorrect the call will end.\n# After the beep, enter \'\'\'1*1#\'\'\'\n# If the unit has successfully turned on, you will hear a beep (or possibly silence...). Hangup.\n# If you hear two beeps, re-enter the shutdown command or hangup and try again.\n\n===Get the current status of the relay===\n\n#  Send an SMS with the following message: \'\'\'ABCD#8#\'\'\' (where ABCD is your PIN-code) \n# The reply will contain the following information:\n\n{| class=\"wikitable\"\n! style=\"text-align: center; font-weight:bold; font-size:14px; background-color:#9b9b9b;\" | Example\n! style=\"text-align: center; font-weight:bold; font-size:14px; background-color:#9b9b9b;\" | Explanation\n|-\n| style=\"text-align: center; font-size:14px;\" | *Ontech9009\n| style=\"font-size:14px;\" | A star (*) means that the alarm function is turned on.\n|-\n| colspan=\"2\" style=\"font-weight:bold; font-size:14px; background-color:#c0c0c0;\" | Units:\n|-\n| style=\"text-align: center; font-size:14px;\" | 1*\n| style=\"font-size:14px;\" | Indicates the units communicating with the master unit. Unit\nnumber 1 is always the master unit. A star (*) after the number\nindicates that the relay is turned on.\n|-\n| colspan=\"2\" style=\"font-weight:bold; font-size:14px; background-color:#c0c0c0;\" | Other:\n|-\n| style=\"text-align: center; font-size:14px;\" | Temp:24\n| style=\"font-size:14px;\" | Gives the temperature at the master unit in degrees Celsius.\n|}\n\n===Manual===\n\nThe full manual is available [http://cdn.marrold.co.uk/files/Manuals/Ontech_GSM_Mini_9009_Manual.pdf here]','utf-8'),(1596,'#REDIRECT [[Gateway Shutdown]]','utf-8'),(1597,'It\'s possible to shut the two on-site gateways down either manually or using GSM in case of malfunction, emergency, or request from Ofcom. Shutdown operators should be familiar with this process so they can shut the gateways down quickly if required.  \n\n\'\'\'!!! Use SMS comands where possible as they appear to be more reliable !!!\'\'\'\n\n===Disable the Gateways===\n\n====Manually====\n\nPick one of the following:\n\n* Switch off green switch on PSU\n* Unplug cable\n* Request EMF Orga shutdown power to the tent\n\n====SMS====\n\n# Send an SMS with the following message: \'\'\'1234#0*1#\'\'\' (where 1234 is the PIN-code)\n\n====Call====\n\n# Dial the supplied number.\n# When it answers, enter the supplied pin followed by hash. E.G \'\'\'1234#\'\'\' (This is not the actual pin).\n# If the pin is correct you will hear a beep (or possibly silence...). If its incorrect the call will end.\n# After the beep, enter \'\'\'0*1#\'\'\'\n# If the unit has successfully turned off, you will hear a beep (or possibly silence...). Hangup.\n# If you hear two beeps, re-enter the shutdown command or hangup and try again.\n\n===Enable the Gateways===\n\nOnly the NoV holder should re-enable the gateways once authorised to do so.\n\n====Manually====\n\nPick one of the following:\n\n* Switch on green switch on PSU\n* Plug in cable\n* Request EMF Orga switch on power to the tent\n\n====SMS====\n\n# Send an SMS with the following message: \'\'\'1234#1*1#\'\'\' (where 1234 is the PIN-code)\n\n====Call====\n\n# Dial the supplied number.\n# When it answers, enter the supplied pin followed by hash. E.G 1234# (This is not the actual pin).\n# If the pin is correct you will hear a beep (or possibly silence...). If its incorrect the call will end.\n# After the beep, enter \'\'\'1*1#\'\'\'\n# If the unit has successfully turned on, you will hear a beep (or possibly silence...). Hangup.\n# If you hear two beeps, re-enter the shutdown command or hangup and try again.\n\n===Get the current status of the relay===\n\n#  Send an SMS with the following message: \'\'\'ABCD#8#\'\'\' (where ABCD is your PIN-code) \n# The reply will contain the following information:\n\n{| class=\"wikitable\"\n! style=\"text-align: center; font-weight:bold; font-size:14px; background-color:#9b9b9b;\" | Example\n! style=\"text-align: center; font-weight:bold; font-size:14px; background-color:#9b9b9b;\" | Explanation\n|-\n| style=\"text-align: center; font-size:14px;\" | *Ontech9009\n| style=\"font-size:14px;\" | A star (*) means that the alarm function is turned on.\n|-\n| colspan=\"2\" style=\"font-weight:bold; font-size:14px; background-color:#c0c0c0;\" | Units:\n|-\n| style=\"text-align: center; font-size:14px;\" | 1*\n| style=\"font-size:14px;\" | Indicates the units communicating with the master unit. Unit\nnumber 1 is always the master unit. A star (*) after the number\nindicates that the relay is turned on.\n|-\n| colspan=\"2\" style=\"font-weight:bold; font-size:14px; background-color:#c0c0c0;\" | Other:\n|-\n| style=\"text-align: center; font-size:14px;\" | Temp:24\n| style=\"font-size:14px;\" | Gives the temperature at the master unit in degrees Celsius.\n|}\n\n===Manual===\n\nThe full manual is available [http://cdn.marrold.co.uk/files/Manuals/Ontech_GSM_Mini_9009_Manual.pdf here]','utf-8'),(1598,'{{Village\n|Description=Ham radio at its finest.\n|Contact=M0TZO\n|Activities=Demonstrations of Amateur Radio communication and possibly some contesting.\n|Location=51.21250,-0.60941\n|Name=mateur (Ham) Radio enthusiasts\n|Picture=Radiotowerhi.png\n}}\n==Amateur Radio==\nQuoting from Wikipedia [https://en.wikipedia.org/wiki/Amateur_radio Amateur Radio page] \'\'\"Amateur radio (also called \"ham\" radio) describes the use of radio frequency spectra for purposes of non-commercial exchange of messages, wireless experimentation, self-training, private recreation and emergency communication\".\'\'\n\nDuring EMF 2018 will shall be showcasing Amateur Radio on Bands from 3.5 MHz (80m) to 430MHz (70cm) and maybe higher. We\'ll also have a local frequency on either 144MHz (2m) &/or 430MHz (70cm) FM.\n\nFor reference, the EMF site in Eastnor is at Gridsquare: IO82ta. WAB Square: SO73\n\nUnique Hackerspace passport stamp available on site. Please ask for Paul M0TZO for the stamp in your passport.\n\n===Special Event Callsigns===\nAmateur Radio Village will be operating a special event station: \'\'\'GB2EMF\'\'\'<br />\nNoV Holder is MM0MRU\n\n===Local Comms===\n145.425 NFM / 433.425 WFM \'\'(If in use by other Amateurs then please try 145.450 / 433.450)\'\'\n\n==Amateur Radio chat on IRC/Telegram/Facebook==\nWe\'re using [http://en.wikipedia.org/wiki/IRC IRC] and [https://telegram.org/ Telegram] to organise the Amateur Radio Village, & you can find us on [https://kiwiirc.com/client/irc.freenode.net/emfhams <tt>#emfhams</tt>] on Freenode or our [https://telegram.me/joinchat/A3glvAZ5xf_T9RkCfuDeOA Telegram Group]. The IRC channel and Telegram group are linked, so you can use either.\n\n* IRC Network - <tt>chat.freenode.net</tt> on port 6667 (non-SSL) or 6697 (SSL, recommended)<br />\n* Channel - #emfhams<br />\n* Username - Callsign or other username<br />\n* Web Based Link to #emfhams - [http://webchat.freenode.net?channels=emfhams Webbased #emfhams channel]\n* Connect through Tor (Instructions can be found [http://freenode.net/irc_servers.shtml#tor here])\n* [https://telegram.me/emfhams Join our Telegram Group] (iPhone, Android Apps & Web Based)\n\nThere is also a Facebook group with pictures, videos and other bits:\n\n* [https://www.facebook.com/groups/316141732057436/ Facebook: EMF Hams]\n\n===Chat Members===\n{| class=\"wikitable sortable\"\n! style=\"text-align:left;\"| Callsign*\n! IRC Name\n! First Name\n! Role\n! Ticket\n! Notes\n|-\n| data-sort-value=\"M6LPI\"| M6LPI\n| M6LPI\n| Neil\n| &nbsp;\n| No\n| &nbsp;\n|-\n| data-sort-value=\"M0RVM\"| MRVM\n| tgreer\n| Thomas\n| &nbsp;\n| &nbsp;\n| &nbsp;\n|-\n| data-sort-value=\"M0WPG\"| M0WPG\n| paul-M0WPG\n| data-sort-value=\"Paul\"| Paul (another)\n| &nbsp;\n| No\n| Bringing Gazebo & SCAM12 mast\n|-\n| 2M0STB\n| irl\n| Iain\n| &nbsp;\n| No\n| &nbsp;\n|-\n| 5Q5R\n| mihtjel\n| Rune\n| &nbsp;\n| &nbsp;\n| &nbsp;\n|-\n| [https://www.qrz.com/lookup/M0NGY MNGY]\n| Filbert\n| Jon\n| &nbsp;\n| No\n| &nbsp;\n|-\n| M0RYS\n| kraptv\n| Ryan\n| &nbsp;\n| &nbsp;\n| &nbsp;\n|-\n| MM3ZRZ\n| hibby/Rde\n| Dave\n| Buckfast Warrior\n| data-sort-value=\"No\"| Nah\n| Manages Scottish Consulate, will have 5.4m mast in consulate\n|-\n| data-sort-value=\"M0TZO\"| [http://www.m0tzo.co.uk MTZO]\n| data-sort-value=\"M0TZO\"| MTZO\n| Paul\n| Ham Village Lead\n| Yes\n| Bringing some Radios and Cards Against Humanity (big set)\n|-\n| data-sort-value=\"M0SPN\"| M0SPN\n| M0SPN\n| Steve\n| &nbsp;\n| No\n| &nbsp;\n|-\n| data-sort-value=\"DB1SQU\"| DB1SQU\n| SQUelcher\n| Kai\n| &nbsp;\n| &nbsp;\n| &nbsp;\n|-\n| data-sort-value=\"M0NIT\"| M0NIT\n| M0NIT\n| Jan\n| &nbsp;\n| &nbsp;\n| &nbsp;\n|-\n| data-sort-value=\"M0PLL\"| M0PLL\n| plett\n| Paul (yet another one!)\n| &nbsp;\n| No\n| &nbsp;\n|-\n| data-sort-value=\"M0DLX\"| M0DLX\n| Dominic\n| Dominic\n| &nbsp;\n| No\n| Bringing IC-706, 2m/70cms beams, may enter contests\n|-\n| data-sort-value=\"HB9EGM\"| HB9EGM\n| hb9egm\n| Matthias\n| &nbsp;\n| &nbsp;\n| Doing DAB things\n|-\n| data-sort-value=\"M0NIT\"| M0NIT\n| jasiek\n| Jan\n| &nbsp;\n| &nbsp;\n| &nbsp;\n|-\n| data-sort-value=\"M0XPX\"| M0XPX\n| MatStace\n| Mat\n| &nbsp;\n| Yes\n|  \n|-\n| data-sort-value=\"G6VZM\"| G6VZM\n| g6vzm\n| JJ\n| Token old bloke with G- call to balance the inclusivity statistics.\n| No\n| Could bring FT-1000MP if shack is dry and secure, definitely FT-897D, 10m lightweight guyed mast, 2+70 yagis if required, <s>organising (but not actual transporting) 50m RG213 from LHS and</s> antenna cable believed to be 15-20m of RG-213.\n|-\n| data-sort-value=\"M6KVA\"| M6KVA\n| pe5er\n| Peter\n| Village First Aider\n| No\n| Bringing Kenwood TM-241E, Realtek SDRs, selection of DIY 2m antennas\n|-\n| data-sort-value=\"MM0MRU\"| MM0MRU\n| WSPR\n| Calum\n| Village Idiot\n| Yes\n| NoV Holder for GB2EMF\n|-\n| data-sort-value=\"M1PFS\"| M1PFS\n| M1PFS\n| Pete\n| &nbsp;\n| No\n| SDR stuff and Raspberry Pi\n|-\n| data-sort-value=\"M1DHL\"| M1DHL\n| murb\n| bill\n| &nbsp;\n| No\n| &nbsp;\n|-\n| data-sort-value=\"G0VQH\"| G0VQH\n| jennyb\n| Jenny\n| &nbsp;\n| No\n| Campervan + Large Tarheel. KX3+Pole+wire+gaffer tape for something creative;\n|-\n| data-sort-value=\"IV3BSI\"| IV3BSI\n| g5pw\n| Alja\n| &nbsp;\n| No\n| &nbsp;\n|-\n| data-sort-value=\"PD5KNR\"| PD5KNR\n| Knorrie\n| Hans\n| Learning stuff\n| No\n| &nbsp;\n|-\n| data-sort-value=\"ON4PHP\"| ON4PHP\n| trouble\n| Philip\n| &nbsp;\n| No\n| &nbsp;\n|-\n| data-sort-value=\"MM0TKE\"| MM0TKE\n| tkerby\n| Tim\n| &nbsp;\n| No\n| Bringing an APRS iGate and a Yaesu VX-8\n|-\n| data-sort-value=\"2E0SIP\"| 2ESIP\n| marrold\n| Matthew\n| &nbsp;\n| No\n| FM + DMR Gateway, possibly a cheapo 20W 2&70 Mobile Radio? (12/07/2018)\n|-\n\n|}\n<nowiki />* If you have a Callsign\n\n==Local Repeaters==\n\'\'List needs updating for new location\'\'\n{| class=\"wikitable sortable\"\n! style=\"text-align:left;\"| Repeater!!Output!!Recieve!!CTCSS/DMR!!Distance!!Notes\n|-\n| &nbsp;||&nbsp;||&nbsp;||&nbsp;||&nbsp;||&nbsp;\n|-\n| &nbsp;||&nbsp;||&nbsp;||&nbsp;||&nbsp;||&nbsp;\n|}\n\n==ISS Passes==\nList needs updating for New location and times. \n\nThere are quite a few ISS passes of which at least six are at high angle during hacker-friendly times:\n\n{| class=\"wikitable sortable\"\n! style=\"text-align:left;\"| Date!!Start!!Alt!!Az!!Highest!!Alt!!Az!!End!!Alt!!Az!!Pass type\n|-\n| &nbsp;\n| &nbsp;\n| &nbsp;\n| &nbsp;\n| &nbsp;\n| &nbsp;\n| &nbsp;\n| &nbsp;\n| &nbsp;\n| &nbsp;\n| &nbsp; \n|-\n| &nbsp;\n| &nbsp;\n| &nbsp;\n| &nbsp;\n| &nbsp;\n| &nbsp;\n| &nbsp;\n| &nbsp;\n| &nbsp;\n| &nbsp;\n| &nbsp;\n\n|}\n\n==Contests==\nThere are a [http://www.rsgbcc.org/cgi-bin/readcal.pl couple of contests] on during EMF which we might want to put together a station for:\n\nAlso here nearer the time will be contest over the EMF Camp weekend [http://www.hornucopia.com/contestcal/weeklycont.php Hornucopia.com 8 Day Contest Calendar]\n\n==Tasks/Organisation==\nSome tasks may already be complete - if so please add owner/completion date.  Otherwise feel free to take ownership.\n{| class=\"wikitable sortable\"\n! style=\"text-align:left;\"| Task*\n! Owner\n! Date Complete\n! Notes\n|-\n| Contact RSGB News\n| &nbsp;\n| &nbsp;\n| Sent item for special event stations\n|-\n| Contact RADCOM\n| &nbsp;\n| &nbsp;\n| Press release?\n|-\n| Contact GB2RS||&nbsp;||&nbsp;||Sent item for special event stations\n|-\n| emfcamp\n| &nbsp;\n| &nbsp;\n| Press release (Facebook/Twitter)?\n|-\n| Contact RSGB\n| &nbsp;\n| &nbsp;\n| Requested promo paterial\n|-\n| Contact Yaesu\n| &nbsp;\n| &nbsp;\n| Requested promo items & equipment loans\n|-\n| Contact Icom\n| &nbsp;\n| &nbsp;\n| Requested promo items & equipment loans\n|-\n| Contact Kenwood\n| &nbsp;\n| &nbsp;\n| Requested promo items & equipment loans\n|-\n| Contact Moonraker\n| &nbsp;\n| &nbsp;\n| Requested antenna loans (for satellite)\n|-\n| Furniture\n| &nbsp;\n| &nbsp;\n| Organise loan/hire of tables & chairs\n|-\n| Equipment\n| &nbsp;\n| &nbsp;\n| Contact attendees and compile definitive radio/antenna/mast list\n|-\n| Event Write Up\n| &nbsp;\n| &nbsp;\n| Something to post on Social Media after event\n|-\n| Photos\n| &nbsp;\n| &nbsp;\n| Maybe have a Shared DropBox or space somewhere\n|-\n|}\n\n==Station Planning==\nInitial plan made from comments/equipment above.  Please keep updated with offers/changes.\n\nBear in mind that this is an initial framework based on the offers of equipment received and the constraints of the site as best we can determine from Google/OS etc. It\'s quite likely to change on the day so please don\'t be surprised if you\'ve offered equipment to do one thing but we suggest it\'s better for something else.  If you have particular plans please raise it in the IRC channel.\n\n==== V/UHF ====\n\n===== Voice =====\n\nDo we want a dedicated base station doing V/UHF Voice?\n\n{| class=\"wikitable\"\n! Hardware\n! Description\n! Purpose\n! Owner\n|-\n| Radio\n|Kenwood D710GE\n|2/70 rig with APRS\n|Jon (M0NGY)\n|- \n| Antenna\n| \n| \n| \n|-\n| Mast/Antenna Support\n| \n| \n| \n|}\n\n===== Digital Voice =====\n\n{| class=\"wikitable\"\n! Hardware\n! Description\n! Purpose\n! Owner\n|-\n| Radio\n| Connect Systems CS-580\n| UHF DMR Rig I will leave in the tent for demonstrations etc\n| 2E0SIP\n|-\n| Radio\n| Motorola DM4000\n| UHF DMR Rig which can be left setup in the tent as well...\n| M0NGY\n|}\n\n===== Data/Packet =====\n\n[[User:irl|irl]] from ScotCon was talking about bringing a 44net packet data gateway. \n\n{| class=\"wikitable\"\n! Hardware\n! Description\n! Purpose\n! Owner\n|-\n| Radio\n|\n|\n|\n|- \n| TNC\n|\n|\n|\n|- \n| Interface Cable\n| \n|\n|\n|-\n| PC\n|\n|\n|\n|- \n| Antenna\n| \n| \n| \n|-\n| Mast/Antenna Support\n| \n| \n| \n|}\n\n===== APRS =====\n\nWe are going to have an APRS Digipeater and iGate running on site. If you have anything which can send or receive APRS packets, please bring it, it will be a lonely little digipeater if it has no traffic to pass.\n\n{| class=\"wikitable\"\n! Hardware\n! Description\n! Purpose\n! Owner\n|-\n| Radio\n| Kenwood TM-251E\n| Fanless 5/10/50W 2m rig with its own laptop style 12v PSU\n| Paul M0PLL\n|-\n| TNC\n| Direwolf\n|\n|\n|- \n| Interface Cable\n| G4ZLP box\n| radio in, usb out\n| Paul M0PLL\n|- \n| PC\n| a crap old laptop\n| I\'d normally use a Pi, but this lets me run xastir or similar for demonstrations\n| Paul M0PLL\n|- \n| Antenna\n| Diamond X-30 clone\n| A white stick which does 3dBi at 2m\n| Paul M0PLL\n|-\n| Mast/Antenna Support\n| the emfhams gazebo and cable ties!\n| That should be enough height to cover the site, and I haven\'t got anything taller\n| \n|}\n\n===== SatCom =====\n\nAre we going to have Satellite communications on site?\n\n{| class=\"wikitable\"\n! Hardware\n! Description\n! Purpose\n! Owner\n|-\n| Radio\n|\n|\n|\n|- \n| Antenna\n| \n| \n| \n|-\n| Mast/Antenna Support\n| \n| \n| \n|}\n\n==== HF ====\n\nPlease list below any HF Hardware you are bringing and what you\'d like to try and use it for. \nI ([[User:Hibby|Hibby]]) have listed out some essentials and left the ones I can\'t provide blank so we know it\'s not currently coming.\nPlease fill in the blanks!\n\n===== Voice =====\n\nDoes this need to be a separate station from the HF Data station? Shall we schedule timeshare between the two?\n\n{| class=\"wikitable\"\n! Hardware\n! Description\n! Purpose\n! Owner\n|-\n| Radio\n| IC-706mkI\n| HF+2m voice rig\n| Dominic (M0DLX)\n|-\n| Radio\n| FT857\n| HF Voice Rig\n| Jon (M0NGY)\n|- \n| ATU\n| LDG Z-11Pro II\n| Antenna matcher\n| Dominic (M0DLX)\n|-\n| Antenna\n| BuddiPole w/Mast\nBuddiStick\n| Allows RF to be propogated\n| Jon (M0NGY)\n|-\n| Mast/Antenna Support\n| 10m? Aluminium Mast\n| Putting stuff on\n| Jon (M0NGY) / Dominic (M0DLX)\n|}\n\n===== Data/Packet =====\n\nTarget Modes: FT8, RTTY, PSK63... Hellschreiber?\n\nTarget Bands: 20m, 30m, 40m\n\n{| class=\"wikitable\"\n! Hardware\n! Description\n! Purpose\n! Owner\n|-\n| Radio\n| Yaesu 450D\n| can also bring PSU\n| [[User:MatStace|Mat M0XPX]]\n|-\n| Modem/Interface\n| Digimaster Pro 3\n| to link computer and radio\n| [[User:MatStace|Mat M0XPX]]\n|-\n| \'Shack PC\'\n| Dell Something-or-other\n| Hibby can bring a shack PC/screen/keys/mouse with FLDigi, WSJT-X and other requests. It will be running Debian hamradio blend as I help make it\n| [[User:Hibby|Hibby]]\n|- \n| ATU\n| MFJ 949E\n| ATU for 2x antennas\n| [[User:Hibby|Hibby]]\n|-\n| Antenna\n| Sotabeams Triband Antenna\n| Antenna for 20, 30, 40m\n| [[User:Hibby|Hibby]]\n|-\n| Mast/Support\n| Sotabeams 7m Pole\n| Support for triband\n| [[User:Hibby|Hibby]]\n|}\n\n===DMR and Analogue Gateway===\n{| class=\"wikitable sortable\"\n! style=\"text-align:left;\"| Function*\n! Item\n! Owner\n! Notes\n|-\n| Transceiver\n| Tait 8105 UHF\n| 2E0SIP\n| 2x\n|-\n| PSU\n| Sharam 23A Switching PSU\n| 2E0SIP\n| \n|-\n| Antenna\n| Diamond X30\n| 2E0SIP\n| \n|-\n| Mast\n| Telescopic Mast Doo-Dad\n| 2E0SIP\n| \n|-\n| Feeder\n| RG8X patch leads + UltraFlex7 feeder to antenna\n| 2E0SIP\n| \n|}\n\n===Local Comms===\nFor comms around the site, maybe a crossband repeater if handhelds can\'t reach from one side of the site to the other.\n\nWill this be required this year? (MM0MRU 12/07/2018)\n{| class=\"wikitable sortable\"\n! style=\"text-align:left;\"| Function*\n! Item\n! Owner\n! Notes\n|-\n| Transceiver\n| \n| \n| \n|-\n| PSU\n| \n| \n| \n|-\n| Antenna\n| \n| \n| \n|-\n| Mast\n| \n| \n|\n|-\n| Feeder\n| \n| \n| \n|}\n\n===Misc/Shelter===\n{| class=\"wikitable sortable\"\n! style=\"text-align:left;\"| Item*\n! Owner\n! Notes\n|-\n| Gazebo\n| EMF Camp\n| Rented from EMF\n|-\n| Power Distribution\n| \n| \n|-\n| Rotator\n| ?\n| ?\n|-\n| Table and stools\n| EMF Camp\n| Rented from EMF\n|-\n| ?x chairs\n| EMF Camp\n| Rented from EMF\n|-\n| Ligthing\n| EMF Camp\n| Believed to be part of the tent?\n|}\n\n===Needed===\n{| class=\"wikitable sortable\"\n! style=\"text-align:left;\"| Item*\n! Owner\n! Notes\n|-\n| \n| \n|-\n| Mains cables\n| everyone!\n| You \'\'\'always\'\'\' need more 4-way bars than you have\n|}\n\n==Useful Links==\n[https://sites.google.com/site/gw6itj/bandplan GW6ITJ UK Band Plans]\n[http://www.arrl.org/graphical-frequency-allocations USA Band Plans]\n\n[[Category:Schedule]] <!-- added by [[User:Ms7821]] so we can potentially put the contests in the schedule -->','utf-8'),(1599,'{{Village\n|Description=Ham radio at its finest.\n|Contact=M0TZO\n|Activities=Demonstrations of Amateur Radio communication and possibly some contesting.\n|Location=51.21250,-0.60941\n|Name=mateur (Ham) Radio enthusiasts\n|Picture=Radiotowerhi.png\n}}\n==Amateur Radio==\nQuoting from Wikipedia [https://en.wikipedia.org/wiki/Amateur_radio Amateur Radio page] \'\'\"Amateur radio (also called \"ham\" radio) describes the use of radio frequency spectra for purposes of non-commercial exchange of messages, wireless experimentation, self-training, private recreation and emergency communication\".\'\'\n\nDuring EMF 2018 will shall be showcasing Amateur Radio on Bands from 3.5 MHz (80m) to 430MHz (70cm) and maybe higher. We\'ll also have a local frequency on either 144MHz (2m) &/or 430MHz (70cm) FM.\n\nFor reference, the EMF site in Eastnor is at Gridsquare: IO82ta. WAB Square: SO73\n\nUnique Hackerspace passport stamp available on site. Please ask for Paul M0TZO for the stamp in your passport.\n\n===Special Event Callsigns===\nAmateur Radio Village will be operating a special event station: \'\'\'GB2EMF\'\'\'<br />\nNoV Holder is MM0MRU\n\n===Local Comms===\n145.425 NFM / 433.425 FM \'\'(If in use by other Amateurs then please try 145.450 / 433.450)\'\'\n\n==Amateur Radio chat on IRC/Telegram/Facebook==\nWe\'re using [http://en.wikipedia.org/wiki/IRC IRC] and [https://telegram.org/ Telegram] to organise the Amateur Radio Village, & you can find us on [https://kiwiirc.com/client/irc.freenode.net/emfhams <tt>#emfhams</tt>] on Freenode or our [https://telegram.me/joinchat/A3glvAZ5xf_T9RkCfuDeOA Telegram Group]. The IRC channel and Telegram group are linked, so you can use either.\n\n* IRC Network - <tt>chat.freenode.net</tt> on port 6667 (non-SSL) or 6697 (SSL, recommended)<br />\n* Channel - #emfhams<br />\n* Username - Callsign or other username<br />\n* Web Based Link to #emfhams - [http://webchat.freenode.net?channels=emfhams Webbased #emfhams channel]\n* Connect through Tor (Instructions can be found [http://freenode.net/irc_servers.shtml#tor here])\n* [https://telegram.me/emfhams Join our Telegram Group] (iPhone, Android Apps & Web Based)\n\nThere is also a Facebook group with pictures, videos and other bits:\n\n* [https://www.facebook.com/groups/316141732057436/ Facebook: EMF Hams]\n\n===Chat Members===\n{| class=\"wikitable sortable\"\n! style=\"text-align:left;\"| Callsign*\n! IRC Name\n! First Name\n! Role\n! Ticket\n! Notes\n|-\n| data-sort-value=\"M6LPI\"| M6LPI\n| M6LPI\n| Neil\n| &nbsp;\n| No\n| &nbsp;\n|-\n| data-sort-value=\"M0RVM\"| MRVM\n| tgreer\n| Thomas\n| &nbsp;\n| &nbsp;\n| &nbsp;\n|-\n| data-sort-value=\"M0WPG\"| M0WPG\n| paul-M0WPG\n| data-sort-value=\"Paul\"| Paul (another)\n| &nbsp;\n| No\n| Bringing Gazebo & SCAM12 mast\n|-\n| 2M0STB\n| irl\n| Iain\n| &nbsp;\n| No\n| &nbsp;\n|-\n| 5Q5R\n| mihtjel\n| Rune\n| &nbsp;\n| &nbsp;\n| &nbsp;\n|-\n| [https://www.qrz.com/lookup/M0NGY MNGY]\n| Filbert\n| Jon\n| &nbsp;\n| No\n| &nbsp;\n|-\n| M0RYS\n| kraptv\n| Ryan\n| &nbsp;\n| &nbsp;\n| &nbsp;\n|-\n| MM3ZRZ\n| hibby/Rde\n| Dave\n| Buckfast Warrior\n| data-sort-value=\"No\"| Nah\n| Manages Scottish Consulate, will have 5.4m mast in consulate\n|-\n| data-sort-value=\"M0TZO\"| [http://www.m0tzo.co.uk MTZO]\n| data-sort-value=\"M0TZO\"| MTZO\n| Paul\n| Ham Village Lead\n| Yes\n| Bringing some Radios and Cards Against Humanity (big set)\n|-\n| data-sort-value=\"M0SPN\"| M0SPN\n| M0SPN\n| Steve\n| &nbsp;\n| No\n| &nbsp;\n|-\n| data-sort-value=\"DB1SQU\"| DB1SQU\n| SQUelcher\n| Kai\n| &nbsp;\n| &nbsp;\n| &nbsp;\n|-\n| data-sort-value=\"M0NIT\"| M0NIT\n| M0NIT\n| Jan\n| &nbsp;\n| &nbsp;\n| &nbsp;\n|-\n| data-sort-value=\"M0PLL\"| M0PLL\n| plett\n| Paul (yet another one!)\n| &nbsp;\n| No\n| &nbsp;\n|-\n| data-sort-value=\"M0DLX\"| M0DLX\n| Dominic\n| Dominic\n| &nbsp;\n| No\n| Bringing IC-706, 2m/70cms beams, may enter contests\n|-\n| data-sort-